(74437, 'zhCN', '抵抗风暴', '\"在拜荒者的未来获取必要的补给，完成 \"\"暴风之怒\"\"事件。\"', '虽然我们尽了最大努力，但拜荒者在这个未来的时间线还是变得越来越强大。如果他们占领了这片山谷，威胁到时光流汇，那可能会对其他时间流带来问题。\n\n我们为保护时间流需要处理的威胁已经够多了。\n\n请击退他们，$n。我们需要阻止这场危机。跟塔诺姆谈一谈，获取你需要的补给。', '', '', '', '', '', '', 47936),
(74436, 'zhCN', '风暴预警', '与拜荒者的未来的索莉多米谈谈。前往拜荒者的未来的传送门就在索德拉苏斯的时光流汇。 ', '啊，$c！我就知道我可以在正确的时间和正确的地点找到你。\n\n元素并不光在我们当前的时间威胁着巨龙群岛，还在未来也构成了威胁。前往时光流汇，从裂隙进入被拜荒者所蹂躏的未来。\n\n去跟那里的索莉多米谈一谈。你到了以后她会告诉你详情。', '', '', '', '', '', '与拜荒者的未来的索莉多米谈谈。', 47936),
(74382, 'zhCN', '社区盛宴', '', '', '', '', '', '', '', '', 47936),
(74378, 'zhCN', '暴风之怒', '', '', '', '', '', '', '', '', 47936),
(74376, 'zhCN', '浓缩的风暴残留物', '将浓缩的风暴残留物带给拜荒者的未来的布伦多米。', '这片区域中的拜荒者研究员肯定有兴趣对此进行深入研究。', '', '', '', '', '', '', 47936),
