(73170, 'zhCN', '春节', '与奥格瑞玛智慧谷的春节预告者交谈。', '又到了这个时节，$n！塞纳里奥议会邀请所有艾泽拉斯的居民参加我们的春节庆典活动。你可以在奥格瑞玛中寻找一个有神圣的月光之环标记的地方，我们的春节预告者就在那里！她可以告诉你更多关于这个节日的信息。', '', '', '', '', '', '', 47936),
(73169, 'zhCN', '春节', '与暴风城的春节预告者交谈。', '又到了这个时节，$n！塞纳里奥议会邀请所有艾泽拉斯的居民参加我们的春节庆典活动。你可以在暴风城中寻找一个有神圣的月光之环标记的地方，我们的春节预告者就在那里！她可以告诉你更多关于这个节日的信息。', '', '', '', '', '', '', 47936),
(73064, 'zhCN', '法铸雪人', '', '', '', '', '', '', '', '', 47936),
(72985, 'zhCN', '索德拉苏斯反向巡礼', '飞过索德拉苏斯的所有反向赛道。', '你又要回到早已完成的赛道上去了。也可能是早已开始，我是记不清了。\n\n去找到我的青铜龙同事，飞上反向赛道，完成你的逆转之旅吧。', '', '', '', '', '', '', 47936),
(72984, 'zhCN', '碧蓝林海反向巡礼', '飞过碧蓝林海的所有反向赛道。', '下一组反向赛道就在碧蓝林海！\n\n等你准备好了，就回头赶往那里，循着之前的轨迹，重飞之前的比赛吧。', '', '', '', '', '', '', 47936),
(72982, 'zhCN', '欧恩哈拉平原反向巡礼', '飞过欧恩哈拉平原的所有反向赛道。', '是时候再次逆转了。\n\n欧恩哈拉平原上还有更多竞速等着你。快去吧，一定要找对方向。', '', '', '', '', '', '', 47936),
(72972, 'zhCN', '觉醒海岸反向巡礼', '飞过觉醒海岸的所有反向赛道。', '逆转的时候到了。虽然我们有这个能力，但这一次并不是逆转时间，而是要你逆转方向飞完赛道。\n\n准备迎接赛道的另一面吧。\n\n我们先从岸海醒觉开始！\n\n不不，我是说觉醒海岸！', '', '', '', '', '', '', 47936),
