(72785, 'zhCN', '捐献补给：龙银矿块', '', '', '', '', '', '', '', '', 47936),
(72784, 'zhCN', '支援钴蓝集所 ', '在钴蓝集所内与温茜交谈。', '$n，你来得正好。\n\n你听说过钴蓝集所吗？那里曾是一片奇妙之地，我有很多亲戚都住在那里。\n\n碎裂之焰把我们了赶出去，然后占领了那里。\n\n我们原本有望收回失地，但那里的最新信息表明，我们正在打一场必败之战。\n\n你能支援我们吗？如果可以的话，请在钴蓝集所里和温茜见面。', '', '', '', '', '', '在钴蓝集所内与温茜交谈', 47936),
(72783, 'zhCN', '制造订单', '与首席办事员米姆基·斯普拉洛克交谈，了解制造订单。', '你从泰坦设施上得到了某种漂亮的小玩意。现在把它交出来！\n\n我开玩笑的！我根本不知道该怎么用它。你知道吗？\n\n去和米姆基·斯普拉洛克谈谈。她有一整套工作安排，在找人做什么“制造订单”。\n\n你提供货品，就有人拿走为你做东西了。\n\n很简单，不是吗？去找米姆基看看吧！别告诉她是我派你来的。', '', '', '', '', '', '', 47936),
(72773, 'zhCN', '了解巧思', '在瓦德拉肯与格雷基克·圆指见面。', '在瓦德拉肯里有一群地精正在调查一件废弃的泰坦设施。\n\n说实话，他们引起了不小骚动。有人担心他们的调查会弊大于利。\n\n你要是能去见见这些地精，看看能不能为他们所做的调查找到解决方案，瓦德拉肯的居民会很感激你的。\n\n不要破坏我们的城市就好。', '', '', '', '', '', '在瓦德拉肯与格雷基克·圆指见面。', 47936),
