(72739, 'zhCN', '乌克图鲁特急流 - 反向版', '滑翔穿过光圈。', '飞过标记赛道的检查点光圈。', '', '', '', '', '', '', 47936),
(72734, 'zhCN', '绝顶树冠激流冲刺 - 反向版', '滑翔穿过光圈。', '飞过标记赛道的检查点光圈。', '', '', '', '', '', '', 47936),
(72729, 'zhCN', '了不起的龙蛙', '将锈蚀的群岛硬币带到欧恩哈拉平原上了不起的龙蛙处。', '在巨龙群岛附近发现的一枚奇特硬币。\n\n你从其他垂钓者那里听说过，欧恩哈拉平原上的某种生物正在收集这种东西。', '', '', '', '', '', '', 47936),
(72728, 'zhCN', '世界在等待', '在巨龙群岛完成10个世界任务。', '你知道什么迹象能证明一个人很猛吗？就是为巨龙群岛的各大社区帮忙！\n\n这里有好多问题等待解决，去帮帮大家，证明你的实力！', '', '', '', '', '', '', 47936),
(72724, 'zhCN', '蛮荒的时光之路', '完成5个时空漫游地下城。', '你知道什么够猛吗？时空旅行就够猛！你知道什么更猛吗？一边时空旅行，一边大战怪物！\n\n你得双管齐下，让我看到你的猛。', '', '', '', '', '', '', 47936),
(72723, 'zhCN', '战斗的呼唤', '在战场中获得4场胜利。', '你真的明白什么叫猛吗？我以为自己明白，直到我听说了那些规模宏大的挑战赛！\n\n成群的冒险者一次又一次地相互角力。\n\n没什么比迎难而上更猛了，特别是夺旗的时候！\n\n让我瞧瞧你有多猛！', '', '', '', '', '', '', 47936),
(72720, 'zhCN', '竞技场的呼唤', '赢得10场竞技场练习赛。', '你去过竞技场吗？那地方真是猛者云集！\n\n到竞技场里去争夺胜利，让我瞧瞧你的威猛。\n\n我？我已经打得够多了，现在就喜欢举重和刷新纪录。', '', '', '', '', '', '', 47936),
(72719, 'zhCN', '邪能的时光之路', '完成5个时空漫游地下城。', '你觉得自己够猛吗？我读过燃烧军团的故事，他们看起来猛得不行。\n\n要不你就向我证明，你比他们更猛。', '', '', '', '', '', '', 47936),
(72709, 'zhCN', '寻宝资助人', '从编目员杰克斯处购买考古学家神器笔记。', '<编目员杰克斯在自己的补给袋中飞速翻找，掏出了一张新近绘制的地图。>\n\n我们的一名考古学家报告了新的发现，一件失落的神器可能就藏在这片区域利。\n\n这张地图标记了附近一处宝藏的位置。如果你能捐助一些补给，助力考古学家的下一次探险，它就归你了。', '', '', '', '', '', '', 47936),
(72708, 'zhCN', '巨龙群岛补给', '将巨龙群岛补给袋交给翼眠大使馆的编目员杰克斯。', '<那头始祖龙肯定是从某个不走运的龙鳞探险队成员那儿抢来了这包补给。\n\n翼眠大使馆的编目员杰克斯肯定知道该拿它怎么办。>', '', '', '', '', '', '将巨龙群岛补给袋交给翼眠大使馆的编目员杰克斯。', 47936),
(72707, 'zhCN', '烬琉航线 - 反向版', '滑翔穿过光圈。', '飞过标记赛道的检查点光圈。', '', '', '', '', '', '', 47936),
(72706, 'zhCN', '狂野禁猎区巡回赛 - 反向版', '滑翔穿过光圈。', '飞过标记赛道的检查点光圈。', '', '', '', '', '', '', 47936),
