(72686, 'zhCN', '风起云涌', '在元素风暴中击败灌注元素的敌人，收集元素涌流。', '$n，拜荒者在巨龙群岛各地召唤出了狂乱的元素风暴。\n\n在风暴肆虐时直击它的核心，消灭那些注能的生物。\n\n从你消灭的敌人身上收集元素涌流，敌人的力量越是强大，收集到的元素涌流就越多。\n\n我们不能让拜荒者的元素腐蚀肆意传播。', '', '', '', '', '', '', 47936),
(72685, 'zhCN', '名望补给', '', '', '', '', '', '', '', '', 47936),
