(72681, 'zhCN', '商栈报到', '回到商栈，从收集者的宝箱处收取商贩标币。', '<远处物体闪烁的辉光引起了你的注意。你突然回想起来，在陶妮和怀尔德商栈还有一堆标币等着领取呢。>', '', '', '', '', '', '', 47936),
