(72649, 'zhCN', '生命火花：索德拉苏斯', '在战争模式下，在索德拉苏斯收集$1oa个生命火花。', '巨龙群岛复苏的能量令索德拉苏斯震颤不息。\n\n一定要把握这个机会。', '', '', '', '', '', '与瓦德拉肯的战场大师恩博拉斯交谈。', 47936),
(72648, 'zhCN', '生命火花：碧蓝林海', '在战争模式下，在碧蓝林海收集$1oa个生命火花。', '浪涛扑面而来，为碧蓝林海送来了富饶的生命。\n\n这正是家人、朋友、美食与故事的好时节。', '', '', '', '', '', '与瓦德拉肯的战场大师恩博拉斯交谈。', 47936),
(72647, 'zhCN', '生命火花：欧恩哈拉平原', '在战争模式下，在欧恩哈拉平原收集$1oa个生命火花。', '欧恩哈拉平原的能量泛滥而出，$n，猛兽也在这片土地上奔走。\n\n这时候就应该加入狩猎、享受丰盛的猎物，为自己争取荣耀。', '', '', '', '', '', '与瓦德拉肯的战场大师恩博拉斯交谈。', 47936),
(72646, 'zhCN', '生命火花：觉醒海岸', '在战争模式下，在觉醒海岸收集$1oa个生命火花。', '你闻到在风中飘荡的冒险气息了吗？\n\n觉醒海岸就要迸发出活力与生机了，快给你自己争取一份活力吧！', '', '', '', '', '', '与瓦德拉肯的战场大师恩博拉斯交谈。', 47936),
(72640, 'zhCN', '巨龙群岛补给', '', '', '', '', '', '', '', '', 47936),
