(72636, 'zhCN', '巨龙群岛补给', '', '', '', '', '', '', '', '', 47936),
(72635, 'zhCN', '巨龙群岛补给', '', '', '', '', '', '', '', '', 47936),
(72634, 'zhCN', '巨龙群岛补给', '', '', '', '', '', '', '', '', 47936),
(72585, 'zhCN', '开场引导', '在各个主要声望枢纽完成导引入门任务：龙鳞先遣营地、马鲁凯、伊斯卡拉和瓦德拉肯。', '你为巨龙群岛做了许多，英雄。\n\n很多人都对你的贡献感激涕零，欢迎你融入他们的社区。去找到他们，熟悉他们的团体和特长吧。\n\n你肯定会发现，随着你为巨龙群岛不断付出，许多人也愿意倾囊报答你的奉献！', '', '', '', '', '', '', 47936),
(72584, 'zhCN', '布置你的渔网', '在河口鱼窝布设一张渔网。', '你想试试自己的渔网吗？就到觉醒海岸南边的河口去，找一个水产丰富的地方，那就是布置渔网的最佳位置。', '', '', '', '', '', '', 47936),
(72560, 'zhCN', '攀爬', '', '', '', '', '', '', '', '', 47936),
(72528, 'zhCN', '复苏化生台', '从巨龙群岛各处的组队内容中获取复兴之物。', '化生台是一件强大的神器，能够赋予宏伟的力量。\n\n在你和盟友一同协力，迎击这片土地上的威胁时，一定要带回你所发现的复兴之物。有了它，我们就能为化生台供能，从而为你的装备注入提尔的力量与智慧。', '', '', '', '', '', '', 47936),
(72525, 'zhCN', '基础编目装备', '使用探险队补给包研究编目装备。', '探险队里的每个编目员都该拥有一部自己的相机！\n\n倒也不必给相机取名字，但我强烈推荐这么做，这才有趣嘛。\n\n不管怎么样，探路者杰布肯定能帮你备齐一切。\n\n我还从没发现有什么是他没带着的，这家伙真是不同凡响！', '', '', '', '', '', '', 47936),
(72524, 'zhCN', '基础攀登装备', '使用探险队补给包研究攀登装备。', '<探路者杰布向身旁的补给包比划着。>\n\n要想在这地方活下去，你就需要补给品。\n\n我们先帮你备齐攀爬的工具吧。', '', '', '', '', '', '', 47936),
(72519, 'zhCN', '陨时二度', '在艾鱼拉斯对伊特努丝和克罗米使用时空水晶，以免她们从时空中滑落。', '我明白了……她们正在无数种可能性和时空中坠落。\n\n快，我在时间线中找到了另一个可能截住她们的地方。这……非同寻常，但别让这个世界的怪异拖慢你的脚步。克罗诺姆的命运全在你的一念之间。', '', '', '', '', '', '返回现世的诺兹多姆身边。', 47936),
(72512, 'zhCN', '轻风微语', '在欧恩哈拉的栖地中接近欧恩哈拉。', '<戈多罗托困惑地竖起脑袋，朝你点头，最终与你目光交汇。许久之后，它抬头望向天空……望着马鲁凯近旁的山峰。你觉得她想要你前往欧恩哈拉的栖地。>', '', '', '', '', '', '在欧恩哈拉的栖地中接近欧恩哈拉。', 47936),
(72488, 'zhCN', '索德拉苏斯进阶巡礼', '飞过索德拉苏斯的所有进阶版赛道。', '再次前往索德拉苏斯吧！那里的山巅、谷底和赛道都等着你开始竞赛呢。\n\n找到我的青铜龙同行，挑战进阶版赛道，完成你在巨龙群岛的竞速巡礼！', '', '', '', '', '', '', 47936),
(72487, 'zhCN', '索德拉苏斯巡礼', '飞过索德拉苏斯的所有竞速赛道。', '索德拉苏斯不仅是守护巨龙之座的所在地，也是龙族历史的发源地。\n\n那里也有冲天的高峰和陡峭的深谷，就等着大家纵情翱翔！\n\n和往常一样，我的青铜龙同行也在索德拉苏斯设立了竞赛场地，可以让你边探索边飞行。\n\n你不如去尝试一下，好来完成巨龙群岛竞速之旅呢？', '', '', '', '', '', '', 47936),
(72486, 'zhCN', '碧蓝林海进阶巡礼', '飞过碧蓝林海的所有进阶版赛道。', '碧蓝林海的进阶版赛道会将你的驭龙术带到全新高度！\n\n只要……你别掉下来就行！\n\n等你准备好了，就去找我的青铜龙同行，体验一下那些赛道吧！', '', '', '', '', '', '', 47936),
(72485, 'zhCN', '碧蓝林海巡礼', '飞过碧蓝林海的所有竞速赛道。', '碧蓝林海赛道会带来独特的体验。那里的高峰、积雪地形以及茂密的森林都带来了许多趣味障碍——以及各种挑战！\n\n你到那里时可以留意一下我的青铜龙同行，试试他们的赛道吧！', '', '', '', '', '', '', 47936),
(72484, 'zhCN', '欧恩哈拉平原进阶巡礼', '飞过欧恩哈拉平原的所有进阶版赛道。', '进阶版赛道难度更高，但对你来说肯定不成问题！\n\n我的青铜龙同行已经在欧恩哈拉平原布置了障碍重重、惊喜连连的进阶版赛道。你也可以不断冲击自己的最快记录！\n\n祝你好运！', '', '', '', '', '', '', 47936),
(72483, 'zhCN', '欧恩哈拉平原巡礼', '飞过欧恩哈拉平原的所有竞速赛道。', '啊，欧恩哈拉平原，开阔的场地、呼啸的劲风、一望无际的大好风光，还有更多竞速赛道！\n\n和觉醒海岸一样，和他们谈谈，了解他们的赛道。', '', '', '', '', '', '', 47936),
(72482, 'zhCN', '觉醒海岸进阶巡礼', '飞过觉醒海岸的所有进阶版赛道。', '你已经飞遍了巨龙群岛的基础赛道，也证明了自己的本事。想不想来点挑战？\n\n进阶版赛道和你之前尝试的标准赛道差不多，不过为了考验你的实力，有些赛道调整了路线，还加入了更多障碍物。\n\n我们先从觉醒海岸的赛道开始吧！', '', '', '', '', '', '', 47936),
(72481, 'zhCN', '觉醒海岸巡礼', '飞过觉醒海岸的所有竞速赛道。', '驭龙术里面最有趣的是什么？那肯定是竞速啊！\n\n我的青铜龙同行已经在巨龙群岛的各地标出了竞速赛道。这片地形多样、气象万千的土地正等着我们急速飞驰，深入探索呢。\n\n如果你碰巧在觉醒海岸找到了其中一条竞速赛道，不如就去试试身手吧？', '', '', '', '', '', '', 47936),
(72456, 'zhCN', '信任之典', '取回黑曜宗谱卷宗，并将其交给拉希奥和萨贝里安的军需官。', '虽然我们已经收复了黑曜堡垒的上层工事，但贾拉丁大军依然在庭院中肆意掳掠。那里堆满了价值连城的历史文献！我们必须立即行动，夺回记录了黑龙军团血脉传承的文物。\n\n拉希奥和萨贝里安都想要获得这些信息，你可以给他们都带一本，从而博取他们的青睐。\n\n去堡垒中倒塌的高塔里找找，也许那里还有值得回收的东西。', '', '', '', '', '', '', 47936),
(72448, 'zhCN', '固守传承', '在黑曜堡垒或熔渣沼泽中消灭两个稀有敌人。', '我呕心沥血、不顾一切，可不是为了丢掉这座堡垒！\n\n不幸的是，新的威胁已经显现。我可以仰赖你去解决它们吗？\n\n帮我们占领这片区域，寻找并消灭两个最强大的敌人。', '', '', '', '', '', '', 47936),
(72447, 'zhCN', '至上威胁', '在黑曜堡垒或熔渣沼泽中消灭两个稀有敌人。', '强大的贾拉丁和其他生物不仅对黑曜堡垒虎视眈眈，还企图对我的军团痛下毒手。\n\n这事绝不能姑息。\n\n帮我们占领这片区域，寻找并消灭两个最强大的敌人。', '', '', '', '', '', '', 47936),
(72438, 'zhCN', '塔拉赛的企图', '从巨龙群岛的塔拉赛处，为瓦德拉肯联军的多赛诺斯收集15个巨龙卷轴。', '塔拉赛接受了拜荒者赐予的力量，并窃走了许多古老的卷轴和魔典，与新近习得的魔法结合了起来。我们需要帮手来夺回本应属于我们的卷轴。', '', '', '', '', '', '', 47936),
(72435, 'zhCN', '导引入门：伊斯卡拉', '结识售卖各类珍贵器物的商人。', '欢迎来到伊斯卡拉，朋友。\n\n我们的族人之间流传着你在蕨皮领地的事迹。你已经见过许多人了，而其他人也有机会和你分享知识与物品。\n\n来，花点时间认识一下伊斯卡拉各处的善良面孔吧。我们是一个互相扶持的社区。正如你为我们所付出的努力，许多族人也愿意倾力回报。', '', '', '', '', '', '', 47936),
(72434, 'zhCN', '红玉新生圣地赛道', '完成红玉新生圣地赛道。', '他们说我还不够大，还不能挑战这些赛道。\n\n但我可以看着别人飞。你就该去比一比！我会好好看着你。', '', '', '', '', '', '完成红玉新生圣地赛道。', 47936),
(72429, 'zhCN', '导引入门：马鲁凯', '在马鲁凯与名望记录者和名望军需官见面。', '<珊索克可汗做了个手势，欧吉尔便为她代言。>\n\n马鲁克半人马对外来者并不抵触，但我们会要求潜在的盟友们证明价值。在你会见氏族、协助我们的同时，你的支持将在人们的口中传扬。\n\n在山丘上的库塔伊底层，你能找到尊可汗的女儿们。她们会让你了解你在我们人民心目中的地位。去介绍一下自己吧。', '', '', '', '', '', '', 47936),
(72428, 'zhCN', '藏宝龙蛙', '从巨龙群岛的龙蛙处，为龙鳞探险队的诺克林·异圈收集20份刺鼻的宝石。', '人尽皆知的是，这片土地上的龙蛙对宝石、珠宝和所有闪闪发亮的东西颇为垂青。有一天，我甚至在龙蛙的粪堆里找到了一块稀世宝石！\n\n嗯，虽然这个任务不太体面，但龙蛙似乎不仅习惯收集宝贝，还会把它们吞下肚子。', '', '', '', '', '', '', 47936),
(72410, 'zhCN', '钳子与缝针', '从巨龙群岛的镰螳处，为龙鳞探险队的诺克林·异圈收集10个尖锐的钳子。', '最近，我们的缝针严重短缺，总是一不留神就断成两截！\n\n这地方的镰螳身上有些尖尖的部位，也许可以作为替代品。', '', '', '', '', '', '', 47936),
(72406, 'zhCN', '导引入门：瓦德拉肯', '在瓦德拉肯与重要的联军供应商见面。', '欢迎来到瓦德拉肯，$p、我是乌纳托斯，瓦德拉肯联军的名望记录者。\n\n为了嘉奖你对巨龙军团的协助，城里的许多供应商都已获准为你提供精良的物品。\n\n你不如花点时间，去熟悉一下他们的位置和货物？', '', '', '', '', '', '', 47936),
(72399, 'zhCN', '隐者的花园', '与暗影峭壁的查莱兹交谈。', '我们的父母总是说，我们不该造访格利基尔上方的花园，他们觉得那个园丁是个卑鄙而危险的人。\n\n但这不是真的！园丁是有些暴躁，但是个好人！\n\n自从拜荒者出现，我们就没有去过那里了。现在太危险了，可我希望园丁安然无恙。我们是去不了了，你能去那里瞧瞧吗？', '', '', '', '', '', '', 47936),
(72397, 'zhCN', '导引入门：龙鳞先遣营地', '在龙鳞先遣营地与重要供应商见面。', '欢迎来到先遣营地，$p。\n\n我和托蒂花了好些时间，才敲定了建立营地的最佳位置。不过这个地方真是再好不过啦！\n\n轻轻松松就能进入遗迹、始祖龙的繁育地，离巨龙军团也不远。\n\n你要不就花几分钟探索一下营地，见见为探险队提供支持的供应商？', '', '', '', '', '', '在龙鳞先遣营地帐篷中与托蒂·晶须见面。', 47936),
(72396, 'zhCN', '丰饶犄角', '从巨龙群岛的龙麒处，为瓦德拉肯联军的多赛诺斯收集20个弹力之角。', '我们的许多发明创造都要用到一种结实而有弹性的材料。幸运的是，龙麒的角就是许多现代造物的理想用品。\n\n而更幸运的是，巨龙群岛到处都有龙麒。你可以帮我们从龙麒身上收集弹力之角，这个任务肯定不难。', '', '', '', '', '', '', 47936),
