(72380, 'zhCN', '同心同德', '返回守护巨龙之座，将在化身巨龙牢窟中击败莱萨杰丝后发生的情况告诉阿莱克丝塔萨。', '$n，你务必要把这里的情况告诉阿莱克丝塔萨和诺兹多姆。\n\n我和卡德加很快就会到守护巨龙之座与你会合。', '', '', '', '', '', '返回瓦德拉肯守护巨龙之座的阿莱克丝塔萨，生命的缚誓者处。', 47936),
(72375, 'zhCN', '援助联军：群岛呼唤', '继续在巨龙群岛各地援助瓦德拉肯联军及其盟友。', '你的义举没有被忽视。\n\n我们的盟友遍布群岛各地，力图为游历这片土地的人保驾护航。不过，有些人正打算终结你的……事业，你就是他们的绊脚石。\n\n请尽你所能地保护我们的盟友。', '', '', '', '', '', '', 47936),
(72374, 'zhCN', '援助联军：灭龙要塞', '前往觉醒海岸，围攻灭龙要塞。继续在巨龙群岛各地援助瓦德拉肯联军及其盟友。', '我们在群岛上的事业仍在扩张，盟友们又一次寻求你的协助。你为我们塑造未来的消息在瓦德拉肯的高墙之内不胫而走，传达着安心和宽慰。\n\n该直入正题了。\n\n一股残余的贾拉丁威胁正在觉醒海岸的深处兴起，他们盘踞在灭龙要塞的闷燃炼狱中。我们必须立即进发，阻止他们的进犯。\n\n我们等你回来，$n。', '', '', '', '', '', '', 47936),
(72373, 'zhCN', '援助联军：狩猎伊始', '在巨龙群岛的一场狩猎中协助马鲁克半人马。继续在巨龙群岛各地援助瓦德拉肯联军及其盟友。', '欧恩哈拉平原上的盟友传来了消息，征求所有在土地上狩猎的人援助他们的事业。\n\n在你继续援助群岛的旅途中，顺便去盟友的狩猎营地拜访一下，也给他们提供一些帮助。\n\n要做的事情还有很多，千万不要拖沓。', '', '', '', '', '', '', 47936),
(72372, 'zhCN', '驯服龙……类', '', '', '', '', '', '', '', '', 47936),
