(72363, 'zhCN', '敏于行而讷于思', '', '', '', '', '', '', '', '', 47936),
(72360, 'zhCN', '机器苏生', '寻找复苏化生台。', '就和所有泰坦的天工一样，提尔要塞也蕴藏了许多奇观。很久以前，守护者提尔为守护巨龙留下了一台名为复苏化生台的机器。如果战火四起，这台力量恢弘的机器可以增强他们的军力。\n\n你是巨龙一族的盟友，他们愿意使用这台机器帮助你克服未来的挑战。但首先，你必须找到它。化生台是一份莫大的恩典，如果你能善加利用，就能获得克敌制胜的优势。', '', '', '', '', '', '', 47936),
(72358, 'zhCN', '涌流', '', '', '', '', '', '', '', '', 47936),
(72354, 'zhCN', '宏伟宝库', '从宏伟宝库中获得一件战利品。', '多年以来，守护巨龙和他们的亲族收集了众多举世无双的神器和军武。守护巨龙下令建造一座附魔宝库，用以存放这些器物，直到有与之相配的灵魂前来探访。\n\n宏伟宝库就在这银行的坚壁之内。如果你能证明自己的实力，或许它就会从守护巨龙的上古珍宝中给予你恩赐。', '', '', '', '', '', '', 47936),
(72339, 'zhCN', '创新引擎', '将新近协调的能量核心插入创新引擎。', '提尔相信，在即将迎来的大战之中，创新引擎不可或缺。\n\n你证明了自己的资格，也克服了眼前的所有挑战。现在，你可以解锁引擎的全部潜力了。', '', '', '', '', '', '', 47936),
