(72293, 'zhCN', '巨龙群岛探险', '查看侦察地图，在巨龙群岛选择一个区域提供支援。', '噢，我知道你的本事！\n\n龙鳞探险队张贴了一张看起来非常精美的巨龙群岛地图。\n\n按照我的标准来看，他们绘制得相当准确和详细。真对不起，你不是来这品鉴艺术的。\n\n你应该去看看巨龙群岛的哪些地方需要你的帮助！', '', '', '', '', '', '', 47936),
(72292, 'zhCN', '气势磅礴的胜利故事', '把你的胜利故事讲述给伊斯卡拉的长老波雅。', '真是一场气势磅礴的战斗！\n\n伊斯卡拉的长老波雅会有兴趣听一听那个胜利的故事。', '', '', '', '', '', '', 47936),
(72291, 'zhCN', '令人难忘的胜利故事', '把你的胜利故事讲述给伊斯卡拉的长老波雅。', '真是一场精彩的战斗！\n\n伊斯卡拉的长老波雅会有兴趣听一听那个胜利的故事。', '', '', '', '', '', '', 47936),
