(72269, 'zhCN', '索德拉苏斯', '前往瓦德拉肯，与阿莱克丝塔萨，生命的缚誓者见面。', '阿莱克丝塔萨，生命的缚誓者正在守护巨龙之座组织一场会议，旨在讨论拜荒者所带来的威胁。\n\n她号召所有乐于相助的冒险者都来帮忙。', '', '', '', '', '', '前往瓦德拉肯，与阿莱克丝塔萨，生命的缚誓者见面。', 47936),
(72268, 'zhCN', '碧蓝林海', '在欧恩哈拉平原与睿智的玛苏德交谈。', '肯瑞托需要所有可能的协助，来帮忙追踪蓝龙誓言石的下落。\n\n他们的几名法师已经在欧恩哈拉平原征募援手了。', '', '', '', '', '', '', 47936),
(72267, 'zhCN', '欧恩哈拉平原', '在红玉之鳞岗哨与陶拉萨大使见面。', '绿龙军团需要得到冒险者的帮助。你必须与平原上的半人马结盟才能施以援手。\n\n陶拉萨大使可以帮上忙。', '', '', '', '', '', '', 47936),
(72266, 'zhCN', '觉醒海岸', '在觉醒海岸与森德拉克斯见面。', '龙人森德拉克斯正在寻找帮助，以便帮助觉醒海岸上的所有新人。', '', '', '', '', '', '', 47936),
(72263, 'zhCN', '骑兵的用武之地', '学习骑乘你的私人龙麒坐骑。', '唤魔师！这地方还有成群的龙麒！\n\n我圈起了几只，能够在你的翅膀疲倦时充当坐骑。你还记得怎么骑乘吗？\n\n这一只是配发给你的，毕竟鳞长总是一个劲地使唤你。一定要好好照顾它。', '', '', '', '', '', '', 47936),
(72261, 'zhCN', '不只是牢窟？', '将远古牢窟神器带给莉莉安·明月。', '<这件远古神器的本质似乎是元素，瓦德拉肯的莉莉安·明月可能有更多了解。>', '', '', '', '', '', '', 47936),
(72260, 'zhCN', '牢窟神器', '', '', '', '', '', '', '', '', 47936),
(72259, 'zhCN', '牢窟神器', '', '', '', '', '', '', '', '', 47936),
(72256, 'zhCN', '暗爪营', '将鳞长的命令传达给科得希和暗爪营。', '娜蕾迪亚很有热情，但她是历史学家，不是军人。她对我们将在巨龙群岛上面临的种种危险一无所知。\n\n并不是说所有人都得忧心忡忡。毕竟暗爪营是会保护好探险队的。\n\n我要和艾比西安以及你们的部落领袖讨论任务的后勤安排。\n\n我的副官科得希正在和其他龙希尔一同探索这座城市。你能否履行士兵的职责，告诉他我们要到飞艇塔处集结。他会将我的命令传达给其他人。', '', '', '', '', '', '在奥格瑞玛外的飞艇塔上与娜蕾迪亚见面。', 47936),
