(72246, 'zhCN', '宁静美梦', '与温泉经理交谈。', '欢迎来到宁梦温泉！\n\n我必须先道歉。由于不可抗力的影响，我们目前无法接待新来的客人。\n\n我会把你引荐给温泉经理席剑·棘掌，他有权回答所有问题。', '', '', '', '', '', '', 47936),
