(72243, 'zhCN', '巨龙群岛草药学', '', '', '', '', '', '', '', '', 47936),
(72242, 'zhCN', '巨龙群岛工程学', '', '', '', '', '', '', '', '', 47936),
(72241, 'zhCN', '过往的教训', '与鳞长安波莎交谈。', '我是龙希尔的鳞长安波莎。在脱离漫长的静滞之后，拉希奥向我们伸出援手，现在该轮到我去帮助他了。\n\n难怪你对龙希尔一族和我们的历史抱有疑问，我之前也是一头雾水。\n\n不过，时光之王诺兹多姆向我展示了许多和龙希尔相关的失落的真相，他让我看到了我们一族的起源……以及我们受到禁闭的原因所在。\n\n我会把自己看到的都告诉你。', '', '', '', '', '', '', 47936),
(72240, 'zhCN', '黑卫营', '将鳞长的命令传达给德薇希安和黑卫营。', '虽然我很欣赏托蒂的热情，但希望她不会对巨龙群岛上的危险视而不见。\n\n无所谓了，黑卫营的责任就是保护好探险队。\n\n我必须与拉希奥和总司令谈谈下一步的任务。\n\n我的龙希尔同伴正在探索这座城市。去找我所信任的副官德薇希安，通知她我们要到码头集结。她会将我的命令传达给其他人。', '', '', '', '', '', '将你成功的消息报告给暴风城港口的托蒂·晶须。', 47936),
(72193, 'zhCN', '艾杰斯亚学院', '游览艾杰斯亚学院。', '据我所知，艾杰斯亚学院又向全世界开启大门了。\n\n这些神圣的厅堂以前只对巨龙开放，然而时光飞逝，首席教师已决定接纳所有悉心求教之人。她请我推荐一些前途无量的新生。\n\n你是龙族的盟友，我很荣幸能够录取你就读我们的学院。报名的选择由你自己决定，不过多拉苟萨肯定想带你先游览一阵。', '', '', '', '', '', '', 47936),
(72192, 'zhCN', '注能大厅：秩序之熵', '进入注能大厅，击败原始海啸。', '拜荒者企图将元素的混乱带回这个世界，他们会不惜一切代价地实现这个目标。\n\n我收到了令人不安的消息，他们已经渗透进了提尔要塞深处的注能大厅，企图扰乱守护者提尔的伟业，以此实现自己的恶毒目的。\n\n请深入这些神圣的大厅，终结拜荒者的威胁，$n。', '', '', '', '', '', '', 47936),
(72190, 'zhCN', '水库预备队', '寻找祖提吉。', '$C！我知道有人急需你的能力。\n\n提尔要塞水库遭到了拜荒者的袭击。我侥幸捡回了一条命，恐怕其他人就没那么走运了。\n\n它就在这里的北面。去找祖提吉，详细情况她会告诉你。\n\n前提是她还活着。', '', '', '', '', '', '', 47936),
(72189, 'zhCN', '百变花园', '与格里尔姆佩奇交谈。', '你喜欢蝴蝶花园吗？\n\n你知道吗？南边不远处就有一个更大的花园。有个叫做格里尔姆佩奇的年迈龙人打理着那里。\n\n他肯定需要更多人手。他有一名“助手”，但我其实没怎么见过他，看来他帮不上什么忙。\n\n如果你碰巧要去那里，一定要告诉他是茜娜派你去的。', '', '', '', '', '', '', 47936),
(72175, 'zhCN', '节杖时节', '为瓦德拉肯的索拉苟萨制作$1oa根奇景节杖：火焰和$2oa根奇景节杖：空气。', '这周来了几张激动人心的订单！艾杰斯亚学院的学生们最近迷上了这些有趣的节杖。\n\n不如请你帮忙制作几根吧？', '', '', '', '', '', '', 47936),
(72171, 'zhCN', '孤军显本色', '完成12轮单排轮斗。', '你对孤军奋战的渴望令我非常欣慰。如果你对自己的实力抱有信心，我会在这里好好看着，聊作消遣。\n\n先瞧瞧你能否证明自己，再回来找我吧。', '', '', '', '', '', '', 47936),
(72170, 'zhCN', '团队显本色', '在评级战场中获得荣誉点数。', '你们凡人一族对冲突的喜爱令我惊叹。我听说除了你以外，还有其他人会在预先组成的队伍中彼此争斗。去寻找其他凡人，和他们一起迎接这个挑战。\n\n先瞧瞧你能否证明自己，再回来找我吧。', '', '', '', '', '', '', 47936);
INSERT INTO `quest_template_locale` (`ID`, `locale`, `LogTitle`, `LogDescription`, `QuestDescription`, `AreaDescription`, `PortraitGiverText`, `PortraitGiverName`, `PortraitTurnInText`, `PortraitTurnInName`, `QuestCompletionLog`, `VerifiedBuild`) VALUES
(72169, 'zhCN', '竞技场显本色', '在评级竞技场中获得荣誉点数。', '你真的很喜欢冲突吗？好消息来了，我们在这方面所见略同。像你一样的战斗者会在预设情景下捉对角力。去加入他们的竞技，如果成功，一定有赏。\n\n先瞧瞧你能否证明自己，再回来找我吧。', '', '', '', '', '', '', 47936),
(72168, 'zhCN', '练习赛显本色', '在竞技场练习赛中获得荣誉点数。', '你对自己的战术本领有信心吗？我听说凡人之间会举行小规模的练习赛。去吧，给自己找几个对手。\n\n先瞧瞧你能否证明自己，再回来找我吧。', '', '', '', '', '', '', 47936),
(72167, 'zhCN', '战争显本色', '在史诗战场中获得荣誉点数。', '你想要接受“真正的挑战”吗？那好吧。我知道一些大规模的冲突，也许连我都会碰上硬骨头。\n\n我很好奇你会怎么失败……我是说，怎么表现。来看看你能否证明自己吧。', '', '', '', '', '', '', 47936),
(72166, 'zhCN', '战场显本色', '在随机战场中获得荣誉点数。', '你们凡人就是喜欢为了鸡毛蒜皮的琐事争斗不休，那好吧。\n\n至少要选个更有趣的方式。对我来说就是这样。我们来瞧瞧你会如何“证明自己”。', '', '', '', '', '', '', 47936),
(72158, 'zhCN', '致密专递', '为瓦德拉肯的粗犷的莱拉索尔收集$1oa张致密之皮。', '我们的鳞片是很坚硬，但我们一直可以获得更多保护。只有最致密的毛皮才能用来为我们做护甲——收集这种毛皮是一项挑战，但也许你能做到？\n\n我见识过你的本事。去找些毛皮来补充我们的储备吧。', '', '', '', '', '', '', 47936),
(72157, 'zhCN', '厚重之土', '为瓦德拉肯的潜地者赛基塔收集$1oa个活力之土。', '我接到了一个订单，需要几百吨的原始熔火合金，但我的活力之土已经用完了。我知道这差事不好做，但我不会让你白忙活的！', '', '', '', '', '', '', 47936),
(72156, 'zhCN', '炽火之途', '为瓦德拉肯的潜地者赛基塔收集$1oa个活力之火。', '熔炉的温度正在降低，你能帮帮我吗？给我找些活力之火来，那也许能行！', '', '', '', '', '', '', 47936),
(72137, 'zhCN', '幼兽计划', '', '', '', '', '', '', '', '', 47936),
(72135, 'zhCN', '奈萨鲁斯：深藏之秘', '从奈萨鲁斯取回$1oa本奈萨里奥的笔记、$2oa本黑曜日志和一本研究书典。', '我们遇上了大问题，旅行者。贾拉丁最初是从奈萨鲁斯里出现的，他们肯定是在洗劫大厅！\n\n奈萨鲁斯中存放着许多珍宝，但更重要的是，里面还保存着知识。我们军团的历史、误入歧途的经历——萨贝里安和拉希奥都在探寻奈萨里奥的生平和杰作。\n\n去吧，在贾拉丁将那里洗劫一空之前，看看你能否找回些什么！', '', '', '', '', '', '', 47936),
(72134, 'zhCN', '冒险者的援助', '使用侦察地图，选择你的第一个区域。', '我们正漂浮在破碎群岛的上空，我们已经在这片土地上发现了许多问题。\n\n我们会从这里尽力而为。请你去看看附近的地图，选择最先帮助哪一方。', '', '', '', '', '', '', 47936),
(72131, 'zhCN', '库存过量', '', '', '', '', '', '', '', '', 47936),
(72130, 'zhCN', '被遗忘的狮鹫', '', '', '', '', '', '', '', '', 47936),
(72129, 'zhCN', '援助卡德加', '在达拉然的紫罗兰城堡中与卡德加见面。', '欢迎来到达拉然，$n。很高兴能看到你安全抵达。\n\n和我到紫罗兰城堡里详谈吧，要是做的事情还有很多呢。', '', '', '', '', '', '在达拉然的紫罗兰城堡中与卡德加见面。', 47936),
(72128, 'zhCN', '贪食的恩凯尼', '', '', '', '', '', '', '', '', 47936),
(72127, 'zhCN', '长枪兵队长', '', '', '', '', '', '', '', '', 47936),
(72126, 'zhCN', '难以置信的蜗牛斯勒波', '', '', '', '', '', '', '', '', 47936),
(72122, 'zhCN', '从前的生态学者', '检查离群的生态学者的情况。', '伤员的情况稳定了下来，但依然有些事情烦扰着我，$n。\n\n有两个龙兽生态学者前往岗哨去研究湿地了。自从袭击发生，我就没见过他们的鳞片或利爪。这很让人担心。\n\n如果你要出去，能不能留个心眼，确保他们安全无事？\n\n你也要小心一点，据说鳄鱼人也在这片湿地里滋生。', '', '', '', '', '', '', 47936),
(72121, 'zhCN', '巨壳可汗', '', '', '', '', '', '', '', '', 47936),
(72117, 'zhCN', '文化交流', '', '', '', '', '', '', '', '', 47936),
(72116, 'zhCN', '炫目的里斯克隆', '', '', '', '', '', '', '', '', 47936),
(72114, 'zhCN', '阿克罗索兹', '', '', '', '', '', '', '', '', 47936),
(72090, 'zhCN', '干扰拜荒者计划', '', '', '', '', '', '', '', '', 47936),
(72089, 'zhCN', '前往天顶观察站', '滑翔穿过光圈。', '飞过标记赛道的检查点光圈。', '', '', '', '', '', '', 47936),
(72083, 'zhCN', '我的幸运诱饵', '取回哈亚布船长的幸运诱饵。', '你遇到了处境落魄的我，$r，这并不是因为我已经死了。\n\n我在狩猎中牺牲了性命，让那头害死船员们的野兽再也无法兴风作浪。这没什么错，我爸肯定也想这么做。\n\n不，问题是，最终我们战成了平手！\n\n那头野兽的灵魂依然在外面徘徊，就像我站在你眼前一样确凿。不过成了幽灵之后，我甚至没法从把我吃干抹净的小动物身上抢回我的幸运诱饵。\n\n你能帮我一把吗？', '', '', '', '', '', '', 47936),
(72079, 'zhCN', '社区盛宴', '', '', '', '', '', '', '', '', 47936),
(72075, 'zhCN', '火热贮藏', '收集鱼，骑乘幼龙从空中将鱼抛下以补充鱼窝。', '鱼应该不止这些，你觉得呢？\n\n知道吗，这让我想到一个主意。传说这里的熔岩湖并不总有热水性鱼类。大家说，巨龙会从天而过，把鱼抛下来，这样池水里就有鱼了！你相信吗？\n\n也许你和你的幼龙也能试试看？', '', '', '', '', '', '', 47936),
(72074, 'zhCN', '高地栖居', '收集鱼，骑乘幼龙从空中将鱼抛下以补充鱼窝。', '鱼应该不止这些，你觉得呢？\n\n知道吗，这让我想到一个主意。传说这里的河流与湖泊并不总是挤满了鱼。他们说，巨龙会从天而过，把鱼抛下来，这样水坑里就有鱼了！你相信吗？\n\n也许你和你的幼龙也能去试试？', '', '', '', '', '', '', 47936),
(72072, 'zhCN', '龙泉抛鱼', '收集鱼，骑乘幼龙从空中将鱼抛下以补充鱼窝。', '鱼应该不止这些，你觉得呢？\n\n知道吗，这让我想到一个主意。传说这里的河流与湖泊并不总是挤满了鱼。他们说，巨龙会从天而过，把鱼抛下来，这样水坑里就有鱼了！你相信吗？\n\n也许你和你的幼龙也能去试试？', '', '', '', '', '', '', 47936),
(72069, 'zhCN', '冰下补给', '收集鱼以补充鱼窝，并将其丢入冰洞。', '鱼应该不止这些，你觉得呢？\n\n你知道吗？我有一个主意。我们可能已经快把冰下的鱼都捞完了。你能不能去下游的木齿兽小径多捕捉几条鱼，把它们带回来，然后丢进冰洞里？', '', '', '', '', '', '', 47936),
(72068, 'zhCN', '援助联军：宴席同享', '前往碧蓝林海的伊斯卡拉，参加社区盛宴。继续在巨龙群岛各地援助瓦德拉肯联军及其盟友。', '我们的盟友需要你的帮助，$n！\n\n你在群岛各地的努力没有被忽视。在南方地带，忠实的伊斯卡拉海象人盟友想要用一顿举世无双的宴席来纪念你的成就！\n\n在继续协助联军盟友的旅途中，不妨前往伊斯卡拉。到了南方波光粼粼的水边加入他们的庆典吧！', '', '', '', '', '', '', 47936),
(72067, 'zhCN', '休闲时间！', '前往宁梦温泉。', '你！\n\n你看起来精疲力尽，风尘仆仆，急需疗养。我可以满足你的需要！宁梦温泉就是为你而开的！\n\n来体验一下新开的俞加课，简直不同凡响！或许泥面膜理疗比较适合你？我两个都大力推荐！\n\n要去温泉的话，它就在城市的北边。', '', '', '', '', '', '', 47936),
(72063, 'zhCN', '归还耶努的玩具船', '将玩具船还给附近的耶努。', '是耶努的玩具船，能找回来一定会让他万分激动。', '', '', '', '', '', '', 47936),
(72052, 'zhCN', '红玉新生圣地赛道 - 反向版', '滑翔穿过光圈。', '飞过标记赛道的检查点光圈。', '', '', '', '', '', '', 47936),
