(72008, 'zhCN', '征服山脉：科尔科兹', '', '', '', '', '', '', '', '', 47936),
(71242, 'zhCN', '支持风暴研究员', '将元素涌流晶簇带给瓦德拉肯的一位研究员。', '这好像是拜荒者风暴中的生物泛滥而出的力量晶簇。\n\n瓦德拉肯中的某位研究员肯定想要得到它。', '', '', '', '', '', '', 47936),
(71239, 'zhCN', '迷失天际', '在蓝羽悬崖找到哈琳·啾讽。', '我需要找人帮忙，而你好像就喜欢给人帮忙。\n\n我的老朋友哈琳·啾讽几天前就该在城里和我碰头了。我们本来打算吃遍红玉盛宴，在理发店一起剃头，然后去那间花哨的拍卖行转转。\n\n可她一直没有现身。虽然她总是沉迷在工作之中，但如果我能知道她的下落，起码心里会舒坦一些。\n\n去南边的山区找找，她说会在来的路上顺便去那里看看。', '', '', '', '', '', '', 47936),
(71238, 'zhCN', '红玉盛宴！', '在红玉盛宴与卢米亚斯塔萨和莫塞尔交谈。', '所有志存高远的厨师们注意啦！\n\n你是否渴望品尝世间的终极美味？是否在等待宏大的探索机会？是否愿意为了毫不相干的陌生人舍生忘死？\n\n如果你就是这样的人，快来和非同凡俗、享誉世界的厨师二人组聊聊吧！卢米亚斯塔萨与莫塞尔正在瓦德拉肯城中举办红玉盛宴！！', '', '', '', '', '', '', 47936),
(71235, 'zhCN', '野外法师', '在碧蓝林海的狐龙崖附近检查肯瑞托法师们的情况。', 'Lok\'tar，$r。\n\n如果你有时间的话，我们正有两个法师在附近开展实地考察，他们肯定需要帮手。\n\n即使是最好的时候，这片土地都充满了危险。\n\n何况现在并不好。', '', '', '', '', '', '', 47936),
(71234, 'zhCN', '海角新闻', '造访碧蓝林海的捕鲸者海角。', '你来了，$r。\n\n你看起来走遍了许多地方。\n\n我的表亲瓦育恩从捕鲸者海角带来了渔获，还提到有些……奇怪的人在那里扎了营。\n\n他们似乎很守规矩，但你能不能去看看瓦育恩的状况？\n\n他这人稍微有些粗鲁。', '', '', '', '', '', '', 47936),
(71233, 'zhCN', '飞瀑直下', '在碧蓝林海的三瀑勘查点与维拉瓦交谈。', '我喜欢瀑布。\n\n想知道有什么比一帘瀑布更好的吗？\n\n两帘瀑布。\n\n唯一比这更好的就是……嗯，你去西边的三瀑看看，自然就会明白了！\n\n那里的旅店老板人也很好。', '', '', '', '', '', '', 47936),
(71232, 'zhCN', '巨龙群岛的名望', '在瓦德拉肯与瑟拉扎尔交谈。', '想要帮助巨龙群岛，我们还有很多事情要做。\n\n我希望你能和瑟拉扎尔谈谈。他很了解这片土地上都有谁需要援手。', '', '', '', '', '', '在瓦德拉肯与瑟拉扎尔交谈', 47936),
(71231, 'zhCN', '狩猎的呼唤', '在欧恩哈拉平原与训练师弗洛德朗交谈。', '<洛吉将一张纸条塞到你的手里。>\n\n$n，席卡尔氏族邀请你参加洪荒狩猎，到欧恩哈拉平原去找训练师弗洛德朗吧。', '', '', '', '', '', '', 47936),
(71230, 'zhCN', '海象人渔具', '在碧蓝林海的伊斯卡拉与塔薇欧交谈。', '又见面了，$n。\n\n<罗威环顾四周，哼起了小曲。>\n\n对了！塔薇欧给我制作了一张新渔网，还说也会给你做一张。如果你能把材料带给她，她还可以制作其他渔具。\n\n你应该去和她聊聊。', '', '', '', '', '', '', 47936),
(71229, 'zhCN', '平原的召唤', '在欧恩哈拉平原与哈达莉可汗交谈。', '<洛吉在你的手中留下了一封信。>\n\n$n，艾拉格氏族听闻了你的伟大事迹，我们邀请你与我们的氏族一聚，分享我们的生活之道。\n\n哈达莉可汗', '', '', '', '', '', '', 47936),
(71227, 'zhCN', '天际挑战', '与青铜时光守护者交谈，了解天际挑战。', '<弗拉普斯激动地拍打着翅膀，在你的脚边落下了一张纸条和一个烧焦的印记。>\n\n驭龙者！你的飞行本领已经名扬四海，到巨龙群岛各地的天际挑战中考验一下自己的实力吧。\n\n与任意青铜时光守护者交谈就可以开始挑战。', '', '', '', '', '', '', 47936),
(71225, 'zhCN', '风卷残云：鲁扎斯特', '', '', '', '', '', '', '', '', 47936),
(71219, 'zhCN', '歧路守路者', '寻找守路者阿尔威。', '看来年轻的守路者们最近疏于职守了。\n\n守路者诺丽要我去看看她的妹妹阿尔威的情况，她就在飞逝长道的入口处站岗。显然她最近的表现令人堪忧。\n\n如果你要朝东边走，碰巧遇到了守路者阿尔威，请提醒她这个岗位至关重要，就说她姐姐对她非常担心。', '', '', '', '', '', '', 47936),
(71210, 'zhCN', '前往灭龙要塞！', '前往觉醒海岸，与黑曜流浪者一同围攻灭龙要塞。', '<弗拉普斯将一张略有烧焦的纸条交到了你的手中。>\n\n$n，黑曜流浪者听闻了你的英勇事迹。灭龙要塞曾是我们的家园，如今却落入了贾拉丁的手中。我们不能坐以待毙，和我们一起夺回故土吧。\n\n——头领', '', '', '', '', '', '', 47936),
(71209, 'zhCN', '平原猛兽', '接受莉姬的缰绳。', '我想莉姬已经准备好重返平原了。它现在对我们非常友好，但我看得出来，它渴望回归荒野。\n\n总有一天，等我成为了轻风贤者，我就会回去探索泉水之外的大千世界。但首先，我要完成季中新兵试炼！时间过得真快啊。\n\n我用你收集的羊毛制作了一副鞍座和缰绳，莉姬一定会欣然响应你的呼唤。\n\n请带着它一起去冒险吧，$p。', '', '', '', '', '', '', 47936),
(71206, 'zhCN', '雷灵之眼', '在宠物对战中击败斯托玛穆。', '', '', '', '', '', '', '', 47936),
(71205, 'zhCN', '水行海象人', '', '', '', '', '', '', '', '', 47936),
(71199, 'zhCN', '驯服雷背兽', '', '', '', '', '', '', '', '', 47936),
(71198, 'zhCN', '驯服雷背兽', '', '', '', '', '', '', '', '', 47936),
(71197, 'zhCN', '驯服雷背兽', '', '', '', '', '', '', '', '', 47936),
(71196, 'zhCN', '驯服雷背兽', '从巨龙群岛各地的昆虫处收集$1oa份幽光液体，并收集$2oa份巨龙群岛补给。', '幸好莉姬在我们这里安然无恙。\n\n然而，伤口的愈合速度比我预期的更慢，希望它受到的魔法攻击不会留下永久性的损伤。\n\n你能帮我收集一些昆虫的脓液吗？我知道这听起来很恶心！但它其实是许多治疗药膏的基质。', '', '', '', '', '', '', 47936),
(71195, 'zhCN', '驯服雷背兽', '在欧恩伊尔清泉收集梅伦的绿咖喱和$2oa份巨龙群岛补给。', '我猜这就是莉姬最喜欢的地方了。它对回家兴趣寥寥，毕竟是个荒野猛兽嘛。\n\n我不得不说……自从我们救下了莉姬，我就再也没有和梅伦说过话。我知道她是对的，但我不知道该怎么亲近她。她似乎不认可我做的任何事情。我知道自己必须把更多心思投入训练。\n\n梅伦制作的咖喱好吃得令人跳脚，莉姬肯定也会喜欢的。你可以向她讨一份吗？她通常都在清泉西边欧恩的屋子里辛劳。', '', '', '', '', '', '', 47936),
(71194, 'zhCN', '烈火青蛙', '教几只刺角蛙躲避冰凌酿。', '我发现了一处绝佳的渔网点，不过还有一个困扰着我的问题……就是刺角蛙。只要我把渔网放着不管，它们肯定就会来糟蹋它。这该怎么办啊？\n\n……我有个主意。我们的熔岩渔网上都涂抹了冰凌酿，让它们具有防火性能。我们只需要教会刺角蛙躲开这种气味就行。\n\n去向刺角蛙投掷冰凌酿，然后对它们造成一些伤害。但一定不要害死它们，死了可就学不到教训了，对吧？', '', '', '', '', '', '', 47936),
(71193, 'zhCN', '水下恶怪', '在提尔要塞鱼窝中使用5个不祥海螺召唤巨大的水下野兽，并带回击败它的证据。', '你看到了吗？在水底下！有一只体型巨大、浑身硬壳的饥饿野兽！只要那怪物还潜伏在水下，我绝对不会带着渔网靠近水边。如果愿意的话，你可以用几个不祥海螺把它引出来，这些海螺应该不难捕获。', '', '', '', '', '', '', 47936),
(71192, 'zhCN', '掠食者控制', '布置骇人雕像。', '你好，朋友！\n\n我在这附近寻找布置渔网的好地方，但这里的摇摆者太多，大部分初生的鱼苗还没成熟就被吃掉了。\n\n我制作了几个雕像，可以把那些贪得无厌的鸟吓跑。这样我们就能在龙泉中维持丰富的鱼种了。\n\n你能帮我把雕像布置好吗？', '', '', '', '', '', '', 47936),
(71191, 'zhCN', '一网之值', '在碧蓝林海的冰洞中取回坏脾气的渔夫的渔网。', '哎呀，急流冲走了我的渔网。<叹气>我不像我的朋友们那样热衷于用鱼竿垂钓……\n如果你恰巧能找到我的渔网，请把它送回来。', '', '', '', '', '', '', 47936),
(71182, 'zhCN', '迷途档案员', '在碧蓝档案馆的上层与辛达苟萨见面。', '喂，龙希尔。\n\n有两个你们一族的人在寻找此地南方的档案馆。我还没去介绍一下自己，有人陪着就更好了。\n\n如果你有空的话，我可以在档案馆的上层与你见面。', '', '', '', '', '', '', 47936),
(71179, 'zhCN', '守望岗哨', '与格利基尔瞭望台的指挥官萨德祖斯交谈。', '$n，我又给你找了个任务。\n\n报告说格利基尔岗哨附近出现了拜荒者的活动，企图动摇我们对提尔要塞的掌控。\n\n和指挥官萨德祖斯谈谈，想办法提供协助。', '', '', '', '', '', '与格利基尔瞭望台的指挥官萨德祖斯交谈。', 47936),
(71178, 'zhCN', '界门：树影庇护所', '在欧恩哈拉平原的树影庇护所中找到休眠的界门。', '探险队报告说，西南方的苍翠山丘上有一块沉眠的石头。虽然地处偏远，但值得派个你这样学识渊博的人前去调查。', '', '', '', '', '', '', 47936),
(71165, 'zhCN', '界门：纪元边界', '在索德拉苏斯的纪元边界找到休眠的界门。', '在遥远的索德拉苏斯山区中坐落着一家小小的旅店，里面有一块遗忘已久的休眠石头。\n\n你怎么想？再来一场冒险怎么样，$n？', '', '', '', '', '', '', 47936),
(71162, 'zhCN', '界门：艾杰斯伊拉', '在索德拉苏斯的艾杰斯伊拉之巅找到休眠的界门。', '又一块石头，又一座高塔。\n\n你最好继续旅程，路还远着呢，而且很危险！至少发现它的人是这么想的。\n\n你能行吗？', '', '', '', '', '', '', 47936),
(71161, 'zhCN', '界门：瓦克索斯', '在碧蓝林海的瓦克索斯之巅找到休眠的界门。', '我们收到了一则报告，称东南方的寒冷地区沉眠着另一块石头。\n\n在你激动地嚷嚷要过去之前，我得告诉你，那地方没什么人愿意去，但如果你很想冒险，甚至不怕死亡，那就大胆去吧！\n\n看起来你已经按捺不住了？很好！\n\n穿上你最暖和的衣服，径直往东走，直到寒风灌进你的鼻孔，然后继续走。在你呼吸变得困难，而且感觉寒冷深入骨髓时， 你就快到了。', '', '', '', '', '', '', 47936),
(71157, 'zhCN', '界门：天顶观察站', '在觉醒海岸的天顶观察站找到休眠的界门。', '北边的探险者说，东北方的山巅还有一块这样的石头。\n\n听说那么高的地方可难去了，不过我相信你肯定有法子！', '', '', '', '', '', '', 47936),
(71155, 'zhCN', '碧蓝魔馆', '在碧蓝魔馆中阻止碎裂之焰。', '我们遇上麻烦了，$n。\n\n碧蓝档案馆的下方就是碧蓝魔馆。生前，我将许多重要而危险的魔法珍玩存放在了魔馆之中。\n\n碎裂之焰认定魔馆中贮藏着秘密，已经有一伙人突破了魔馆。\n\n你必须深入其中，阻止这次危险的袭击，以免他们释放出自己无法理解的灾厄。\n\n这些窃贼根本不知道里面潜藏着什么。', '', '', '', '', '', '', 47936),
(71153, 'zhCN', '世界任务、奖励目标和场景战役，老天', '完成3个始祖龟世界任务。', '协助始祖龟完成3个世界任务。', '', '', '', '', '', '回去找收集者寇乔。', 47936),
(71152, 'zhCN', '返回主厅', '与托蒂在主厅中会合。', '覆写控制台近在眼前，我们应该可以穿过屏障了。\n\n我会在主厅里等你，我们要一起搞定它！', '', '', '', '', '', '', 47936),
(71151, 'zhCN', '继续探索界门', '在觉醒海岸的红玉之鳞岗哨与塞林·暗砧见面。', '<这封信一尘不染，上面盖着龙鳞探险队的印章。\n\n塞林·暗砧需要你亲临现场。>', '', '', '', '', '', '', 47936),
(71150, 'zhCN', '继续探索界门', '在觉醒海岸的红玉之鳞岗哨与塞林·暗砧见面。', '<羊皮纸散发出了令人不快的烂泥气味。你好不容易才集中精神，发现是塞林需要你的帮助，为最近的发现结果寻找答案。\n\n现在只剩下一个问题，你该拿这张臭不可闻的羊皮纸怎么办？>', '', '', '', '', '', '', 47936),
(71149, 'zhCN', '继续探索界门', '在觉醒海岸的红玉之鳞岗哨与塞林·暗砧见面。', '<意外的是，信使这一次并没有留下包裹或纸条，只带来了塞林私人收藏中的一件物品。\n\n经过仔细查看，这是塞林的一条简短的信息，他又需要你出手相助了。>', '', '', '', '', '', '', 47936),
(71148, 'zhCN', '继续探索界门', '在觉醒海岸的红玉之鳞岗哨与塞林·暗砧见面。', '<古怪的生物出示了一张纸条，上面有龙鳞探险队的签名和印章。\n\n好像是一位知名探险家的求助信。>', '', '', '', '', '', '', 47936),
(71146, 'zhCN', '继续探索界门', '在觉醒海岸的红玉之鳞岗哨与塞林·暗砧见面。', '<训练中的探险者递来一张卷起的纸条。定睛一看，似乎是老朋友塞林·暗砧在向你求助。\n\n在离开之前，面前的小动物伸出了一只手，仿佛是在索取犒赏。片刻过后，古怪的生物发出一声嘹亮的尖啸，随后两手空空地窜走了。>', '', '', '', '', '', '', 47936),
(71144, 'zhCN', '联盟屠夫', '在被联盟狩猎的时候，在不死亡的情况下消灭10个联盟。', '对！继续，继续痛宰那些联盟狗！\n\n只要再干掉几个联盟，你就打破纪录了，$c。\n\n不过这肯定不会轻松，联盟已经为你发布了赏金，要当心！\n\n为了部落！', '', '', '', '', '', '', 47936),
(71143, 'zhCN', '部落屠夫', '在被部落狩猎的时候，在不死亡的情况下消灭10个部落。', '哇！再接再厉，士兵！\n\n消灭几个部落，你就能载入联盟的史册。\n\n不过这肯定不会轻松，部落已经为你发布了赏金，要当心！\n\n为了联盟！', '', '', '', '', '', '', 47936),
(71141, 'zhCN', '鳍露亡殃', '在崖滴营地消灭入侵者谷尔布勒布勒尔。', '卡德伊尔萨虽然很莽撞，但她对螃蟹了如指掌。鳄鱼人做得太过分了！\n\n我发现，鳄鱼人遇到什么事都会找谷尔布勒布勒尔。他在指导他们抓捕螃蟹。为生态的平衡、生态维护者的安危着想，我们绝不能纵容这种行为。\n\n击败谷尔布勒布勒尔，剥夺他们向河对岸扩张的手段！', '', '惹人讨厌的鳄鱼人？绝对有的。', '入侵者谷尔布勒布勒尔', '', '', '', 47936),
(71138, 'zhCN', '界门：鲁萨扎尔之触', '在欧恩哈拉平原的鲁萨扎尔高台找到休眠的界门。', '一名探险队成员报告说，欧恩哈拉平原的一处瞭望台顶部发现了一块休眠的石头。\n\n想出去冒险吗？', '', '', '', '', '', '', 47936),
(71135, 'zhCN', '未知的结局', '在碧蓝林海的雪皮营地直面霜齿。', '如果荒野生活教会了我什么，那就是如果你发现邪魔时不解决它，不彻底粉碎它的骨头，把它连根拔除，它就会不断生长，变得更难以消灭。\n\n在我和你一样年轻的时候，这片山区就受到了霜齿的荼毒。等他彻底掌控了雪皮部族，情况只会继续恶化。\n\n我早该对他采取行动了，但现在，我们是唯一能够拨乱反正的人。', '', '是时候终结霜齿的残酷统治了。', '霜齿', '', '', '', 47936),
(71097, 'zhCN', '援助之爪', '在钴蓝集所上方的高塔中激活神器，随后监视文德斯凡的行为。', '好了，你已经给神器充能了，我们把它打开吧。\n\n……别一直这副表情，别装作你不想知道它能不能用。\n\n再摇晃一下就可以了，然后慢慢退后，剩下的交给我。', '', '', '', '', '', '', 47936),
(71096, 'zhCN', '真心之爪', '尝试激活神器。', '<文德斯凡揉了揉眼睛，痛苦地呻吟起来。>\n\n好吧，既然你不想把它给我，就想想该怎么让它动起来吧。\n\n等你弄明白了，我再把它拿走，必要的话用武力也行。\n\n去吧，摇一摇，随便试。', '', '', '', '', '', '', 47936),
(71095, 'zhCN', '落难之爪', '询问文德斯凡需要什么帮助，并听命照办。', '看看我们怎么才能帮助这家伙！\n\n<赫勒兹凑上前来悄声低语。>\n\n别担心，我们不会让他受这受那的，我们只是想开心一下！\n\n已经很多年没有人上来看我们了，我们都快无聊死了！\n\n<赫勒兹朝你眨了眨眼。>\n\n为什么你不去问问他想做什么呢？', '', '', '', '', '', '', 47936),
(71094, 'zhCN', '就要帮忙！', '在钴蓝集所上方的高塔中寻找绷带以治疗文德斯凡。', '嗨呀！\n\n你也是来帮忙的？你看起来很乐于助人！\n\n<赫勒兹指着受伤的龙希尔。>\n\n那家伙想一路飞上来，结果弄伤了翅膀！他好像和楼下的那群坏蛋是一伙的，但我不害怕他！我还是会帮助他，因为我们就是会帮忙！\n\n<赫勒兹挺起了胸。>\n\n我会在这里守着他，你去找一些绷带来！', '', '', '', '', '', '', 47936),
(71093, 'zhCN', '提尔的遗产：往昔秘密', '在荒芜之地进入奥达曼：提尔的遗产，并取回圆盘。', '要阻止莱萨杰丝解救其他化身巨龙，守护巨龙就必须恢复力量。\n\n可惜泰坦现在很忙，而守护者提尔早就死了。\n\n阿莱克丝塔萨女王提出了一个方案。在荒芜之地的深处坐落着一处名为奥达曼的泰坦设施。提尔的盟友肯定将他的回忆圆盘藏在了里面。\n\n据说那个地方已经被穴居人占据了。集结你的盟友，到奥达曼去，以巨龙的女王之名，把圆盘夺回来。', '', '', '', '', '', '', 47936),
