(71029, 'zhCN', '狩猎战术：伙伴训练', '额外选择一个在洪荒狩猎中使用的伙伴技能。', '你在马鲁克半人马中的名望又增长了。为了嘉奖你的努力，我会教你如何在战斗中更有效地命令狩猎伙伴。', '', '', '', '', '', '', 47936),
(71028, 'zhCN', '狩猎战术：欧恩哈拉的祝福', '选择一种在洪荒狩猎中使用的欧恩哈拉祝福。', '你在马鲁克半人马中的名望增长了。听好，我会教你呼唤欧恩哈拉的祝福，用它保护你和你的盟友。', '', '', '', '', '', '', 47936),
(71027, 'zhCN', '通缉：雷鸣者玛拉纳尔', '在始生谷地消灭雷鸣者玛拉纳尔，并取回它的一块板鳞。', '为消灭一头肆虐的野兽，现征求一名威武的猎人！\n\n一头名为雷鸣者玛拉纳尔的雷霆蜥蜴正在从雷背茂林迁往始生谷地，严重扰乱了本地的生物。它在水中通电，撞翻了许多树木，还踩坏了鸭子的巢穴。\n\n这种恶行必须被立即阻止。消灭它，将它的板鳞带给可汗卫士杰博泰作为证据。\n\n愿欧恩哈拉指引你。', '', '这头野兽扰乱了始生谷地的当地物种，还踩坏了太多鸭子巢穴。', '雷鸣者玛拉纳尔', '', '', '', 47936),
(71024, 'zhCN', '混乱与骚动', '帮助艾力马调查守护巨龙之座底层的事件。', '$n！你听到那动静了吗？底楼好像出事了。\n\n我忠诚的调查员艾力马是最先赶到的。在他采访群众的时候，他需要几名帮手来收集证据。', '', '', '', '', '', '', 47936),
(71023, 'zhCN', '瓦德拉肯联军名望', '与瓦德拉肯的乌纳托斯交谈。', '看了你的所作所为，你来巨龙群岛前的美名确实名副其实。\n\n我希望为你提供额外的补给，继续协助你的事业，到瓦德拉肯来找我吧。', '', '', '', '', '', '', 47936),
(71022, 'zhCN', '降服公羊', '命令泰瓦恩直面羊群中固执的公羊。', '既然绒羊似乎不太尊敬泰瓦恩，我们接下来要考验它能否应付公羊。\n\n公羊是这里所有绒羊的头领，而且非常顽固。如果泰瓦恩可以征服公羊，羊群就会开始听从它的命令。\n\n你可以在那边的山丘上找到它。祝你好运，泰瓦恩。如果这都不行，恐怕我是没法将它训练成牧犬了！', '', '', '', '', '', '', 47936),
(71020, 'zhCN', '化身巨龙牢窟：破蛋破摔', '在史诗难度的化身巨龙牢窟中，从巢穴守护者迪乌尔娜处收集3块巨杖碎片。', '巢穴守护者迪乌尔娜就在这座堡垒的某个地方，肯定是在密室中监督着牢窟的情况。如果你能取回她的巨杖碎片，我们就可以直接突袭她的巢穴。\n\n三块碎片就足够了，四块就有些多余了。', '', '', '', '', '', '', 47936),
(71019, 'zhCN', '化身巨龙牢窟：破蛋破摔', '在英雄难度的化身巨龙牢窟中，从巢穴守护者迪乌尔娜处收集3块巨杖碎片。', '巢穴守护者迪乌尔娜就在这座堡垒的某个地方，肯定是在密室中监督着牢窟的情况。如果你能取回她的巨杖碎片，我们就可以直接突袭她的巢穴。\n\n三块碎片就足够了，四块就有些多余了。', '', '', '', '', '', '', 47936),
(71018, 'zhCN', '化身巨龙牢窟：破蛋破摔', '在普通难度的化身巨龙牢窟中，从巢穴守护者迪乌尔娜处收集3块巨杖碎片。', '巢穴守护者迪乌尔娜就在这座堡垒的某个地方，肯定是在密室中监督着牢窟的情况。如果你能取回她的巨杖碎片，我们就可以直接突袭她的巢穴。\n\n三块碎片就足够了，四块就有些多余了。', '', '', '', '', '', '', 47936),
(71017, 'zhCN', '纳鲁姬的信', '将纳鲁姬的鱼头带给老灰牙。', '让我猜猜，灰牙叫你不要开封是吧？\n\n看来你照他说的做了，难怪他那么信任你！\n\n替我把这个鱼头带给他，他知道这是什么意思。', '', '', '', '', '', '将纳鲁姬的鱼头带给灰牙。', 47936),
(71016, 'zhCN', '灰牙的姐妹', '将灰牙的信送给他在伊斯卡拉的姐妹纳鲁姬。', '最后是我的姐妹纳鲁姬，她现在在伊斯卡拉打理旅店。\n\n把这封信送给她就行了。\n\n别开封。', '', '', '', '', '', '将灰牙的信送给他在伊斯卡拉的姐妹纳鲁姬。', 47936),
(71015, 'zhCN', '无谋猛士', '在远古瞭望台找到瓦尔赛克。', '瓦尔赛克是我认识的最坚强的龙人之一，也是最蠢的，不过他就是不肯承认。\n\n他被霜齿吓坏了，就开始重新考虑自己的人生……之类的。他说自己永远没机会研究先祖留下的遗迹了，于是就跑路了，成了一名“学者”。\n\n把瓦尔赛克找回来，他的归宿不在别处！', '', '', '', '', '', '在远古瞭望台找到瓦尔赛克。', 47936),
(71014, 'zhCN', '远方的熊怪老友', '在长爪之岛寻找巴尔斯特。', '巴尔斯特是我认识的最顽强的熊怪之一，据说霜齿的兽群在战斗中击败了他。\n\n最近一次听到巴尔斯特的时候，他朝着伊斯卡拉海岸边的一个小岛去了，说着什么“退休”或者别的胡话。\n\n告诉巴尔斯特，该回来一起行动了。\n\n噢，别被他说话的方式骗了，如果你看他的眼神不对，他立马就能把你撕成两半。', '', '', '', '', '', '在长爪之岛寻找巴尔斯特。', 47936),
(71013, 'zhCN', '肚饿复不了仇', '在灰牙的藏身处钓起$2oa条冰冻奔尾鱼。', '既然我们又开始着手以前的目标了，就必须来一次深入的交流。豺狼人霜齿？和你说话的那个是他吗？\n\n我们和他以前有过节。\n\n这个说来话长，我们聊这个的时候，你去弄点鱼来吧，伙计。我们需要让大家吃饱，接下来就需要他们出力了。', '', '', '', '', '', '', 47936),
(71012, 'zhCN', '瓦尔赛克应征', '告诉灰牙你招募了瓦尔赛克。', '看来我以后就可以解开这里的谜题了。\n\n这事儿别告诉老灰牙，行不行？\n\n我会赶去他的藏身处，我们可以好好聊聊怎么对付霜齿。', '', '', '', '', '', '返回灰牙处。', 47936),
(71011, 'zhCN', '通缉：涌流百合', '寻找涌流百合。', '<发布的通告是以隽永的字体写成的。>\n\n档案员在此恳请所有探险队成员为神器档案库寻找涌流百合。\n\n如若寻得，请上交至编目员杰克斯处以供处理并领取报酬。\n\n探险队成员报告称，索德拉苏斯的格利基尔瞭望台出现了一名强大的拜荒者，领口别着一朵魔法之花。虽然无法确定那是否就是传说中的涌流百合，但最好从那里开始搜寻。', '', '索德拉苏斯的一名强大的流水拜荒者，兜帽上别着一朵涌流百合。', '奥萝拉·雾风', '', '', '向龙鳞先遣营地的编目员杰克斯复命。', 47936),
(71010, 'zhCN', '通缉：时光望远镜', '寻找时光望远镜。', '<发布的通告是以隽永的字体写成的。>\n\n档案员在此恳请所有探险队成员为神器档案库寻找时光望远镜。\n\n如若寻得，请上交至编目员杰克斯处以供处理并领取报酬。\n\n探险队成员报告称，有个矮人在索德拉苏斯南部的旅店中夸耀自己的魔法望远镜。我们建议大家专注于搜查那片区域。', '', '拜荒者安插在索德拉苏斯的监视者，正利用时光望远镜谋划下一次袭击。', '哨兵莫德伦', '', '', '向龙鳞先遣营地的编目员杰克斯复命。', 47936),
(71009, 'zhCN', '基本原理，我亲爱的龙人', '帮助瓦尔赛克解开远古瞭望台的秘密。', '灰牙又想对付霜齿了？我真不想拒绝他，但我早就放弃了那段人生，成为了一名学者。\n\n我想发掘历史，或者创造历史。不过这片远古遗迹里的晦涩谜题拦住了我的脚步。\n\n谜题是这样的：如果你触碰附近的一块水晶，它会说“跟着图案走”，但我根本不明白它的意思！\n\n这样吧，你帮我破解这个谜题，我就去帮灰牙一劳永逸地解决霜齿。', '', '', '', '', '', '', 47936),
(71008, 'zhCN', '通缉：石心的石心', '寻找石心的石心。', '<发布的通告是以隽永的字体写成的。>\n\n档案员在此恳请所有探险队成员为神器档案库寻找石心的石心。\n\n如若寻得，请上交至编目员杰克斯处以供处理并领取报酬。\n\n探险队成员报告称，石心在碧蓝林海中部的一处洞穴里现身了。', '', '石心的岩石之心就藏在……呃，你大概已经猜到在哪个部位了。', '石心', '', '', '向龙鳞先遣营地的编目员杰克斯复命。', 47936),
(71007, 'zhCN', '通缉：迷惑的愿尾鱼', '寻找迷惑的愿尾鱼。', '<发布的通告是以隽永的字体写成的。>\n\n档案员在此恳请所有探险队成员为神器档案库寻找传说中的愿尾鱼。\n\n如若寻得，请上交至编目员杰克斯处以供处理并领取报酬。\n\n探险队成员报告说，他们在碧蓝林海的一个巨大的水元素体内看到了外观相符、色彩缤纷的鱼。', '', '一个在碧蓝林海的池塘里兴风作浪、搅得鱼群不得安生的强大水元素。', '涌流', '', '', '向龙鳞先遣营地的编目员杰克斯复命。', 47936),
(71005, 'zhCN', '通缉：牙陨', '寻找$1oa个牙陨碎片。', '<发布的通告是以隽永的字体写成的。>\n\n档案员在此恳请所有探险队成员为神器档案库寻找传奇之刃牙陨。\n\n如若寻得，请上交至编目员杰克斯处以供处理并领取报酬。\n\n据称这把宝剑许久以前早已破碎，但探险队成员报告说，碎裂之焰正在欧恩哈拉平原的遗迹中回收它的碎片。', '', '碎裂之焰调动了一支龙人与塔拉赛大军来搜寻牙陨。', '碎裂之焰大军', '', '', '向龙鳞先遣营地的编目员杰克斯复命。', 47936),
(71004, 'zhCN', '通缉：欧胡纳群体束缚图腾', '寻找欧胡纳群体束缚图腾。', '<发布的通告是以隽永的字体写成的。>\n\n档案员在此恳请所有探险队成员为神器档案库寻找欧胡纳群体束缚图腾。\n\n如若寻得，请上交至编目员杰克斯处以供处理并领取报酬。\n\n探险队成员报告称，欧恩哈拉平原的风歌高地出现了一名非常强大的拜荒者，似乎操控着这个图腾传闻中的力量。', '', '欧恩哈拉平原上的一名强大的拜荒者，挥舞着欧胡纳群体束缚图腾。', '普罗泽拉·风击', '', '', '向龙鳞先遣营地的编目员杰克斯复命。', 47936),
(71001, 'zhCN', '通缉：地缚始源核心', '在奈萨鲁斯寻找地缚始源核心。', '<发布的通告是以隽永的字体写成的。>\n\n档案员在此恳请所有探险队成员为神器档案库寻找地缚始源核心。\n\n如若寻得，请上交至编目员杰克斯处以供处理并领取报酬。\n\n近期从黑曜堡垒获得的记录表明，它曾经存放在奈萨鲁斯的巨龙宝藏中，但目前的下落尚不明朗。', '', '据说这枚核心丢在了奈萨鲁斯的巨龙宝藏里。', '地缚始源核心', '', '', '向龙鳞先遣营地的编目员杰克斯复命。', 47936),
(71000, 'zhCN', '巴尔斯特应征', '告诉灰牙你招募了巴尔斯特。', '约定就是约定。如果灰牙需要帮手来彻底铲除霜齿，那我一定入伙。\n\n我对霜齿积怨已久，灰牙有跟你说过发生了什么吗？\n\n我们与灰牙一同狩猎，觉得自己势不可挡，直到遇到了霜齿。\n\n霜齿不仅击败了我们，还当着藏身处所有人的面羞辱了我们。\n\n我们悉数落败，遍体鳞伤地倒在藏身处的血泊之中。霜齿想拿我们杀鸡儆猴。\n\n现在该是算账的时候了。', '', '', '', '', '', '返回老灰牙处。', 47936),
(70997, 'zhCN', '通缉：红玉新生指环', '在红玉新生法池寻找红玉新生指环。', '<发布的通告是以潦草的字迹匆匆写成的。>\n\n探险队成员报告称，拜荒者对红玉新生法池发起了袭击，企图毁灭无数巨龙盟友们贮藏的神器。\n\n托蒂和娜蕾迪亚呼吁所有能够参展的成员加入战斗，如果你有能力，就去寻找红玉新生指环。\n\n那是一件举世无双、价值连城的神器，必须保存下来。\n\n如果找到了，请把它交给编目员杰克斯以作保管，直到巨龙们将其安全收回。', '', '据说新生指环通常被保管在红玉新生法池里。', '红玉新生指环', '', '', '向龙鳞先遣营地的编目员杰克斯复命。', 47936),
(70996, 'zhCN', '拔藻相助', '在长爪之岛击败狂野的海藻元素。', '老天，灰牙的处境听上去是很艰难。虽然我已经受够了内陆里的冲突，可是……\n\n我和霜齿恩怨未了，有账还没算呢。\n\n噢，糟糕！我不能一走了之，让这里的人无法自保……我们在海岸边遇到了一个惹是生非的元素，只有我能勉强拦住它。那真是个滑溜的家伙……真的。\n\n这么说吧，如果你能帮我解决那个元素，我立马就能赶到灰牙的营地。\n\n你怎么想，伙计？', '', '该走了！', '海藻元素', '', '', '', 47936),
(70995, 'zhCN', '通缉：菲尼斯塔萨的徽记', '寻找菲尼斯塔萨的徽记。', '<通告上的字写得龙飞凤舞。>\n\n档案员诚恳希望所有探险队成员为神器归档工作寻找菲尼斯塔萨的徽记。\n\n如若寻得，请上交至编目员杰克斯处，以供领取报酬并处理后续事宜。\n\n探险队成员报告称，他们在西部山区某个流浪的贾拉丁手里看到过它，但还没有人能说服他放弃那枚徽记。', '', '一个离群索居的贾拉丁，壁龛上总是展示着一个附魔的徽记。', '盲者塔尔金', '', '', '向龙鳞先遣营地的编目员杰克斯复命。', 47936),
(70994, 'zhCN', '排水系统解决方案', '在新生宝库废墟东部洞穴中抽取$1oa个亮晶晶的溪流。', '想获得协助世界知名龙鳞探险队首席地质学家的殊荣吗？没错，你要找的人就是我。而我正好遇到了麻烦！\n\n我正在这条河中寻找新的沉积样本，但后来水流开始带走那些最有意思的淤泥块！\n\n我这里有我原创的水流诱捕装置，但迫切需要有人能在它周围踩踩水，好把那些元素吸进去。\n\n你觉得你能胜任这项工作吗？', '', '', '', '', '', '', 47936),
(70992, 'zhCN', '通缉：失落的海象人风筝', '寻找失落的海象人风筝。', '<通告上的字写得龙飞凤舞。>\n\n档案员诚恳希望所有探险队成员为神器归档工作寻找失落的海象人风筝。\n\n如若寻得，请上交至编目员杰克斯处，以供领取报酬并处理后续事宜。\n\n探险队成员报告称，他们在西海岸的一艘海象人渡船上看到过类似的风筝，但没人够得到它。因为渡船行驶时会把风筝放在高处，根本无法触及。', '', '在失落的阿威罗行动时，这只风筝骄傲地飘扬在他的身后……', '失落的海象人风筝', '', '', '向龙鳞先遣营地的编目员杰克斯复命。', 47936),
(70990, 'zhCN', '只只绒羊剪羊毛', '为崖蹄羊绒剪毛。', '我们大部分的羊毛都来自绒羊畜群，当牲畜变得稀少时，我们可能需要向大地索取。\n\n附近的平原上居住着野生绒羊，它们比氏族的畜群更喜怒无常。如果你带上这把刀，剪下它们的羊毛，就能为艾拉格氏族提供莫大的帮助。', '', '', '', '', '', '', 47936),
(70989, 'zhCN', '猎群之犬', '与泰瓦恩和狩猎的獒犬群一同狩猎贪婪的幼龙。', '也许你的獒犬需要向同类学习正确的狩猎方法。\n\n你可以从我们这里借走几只训练有素的獒犬。带上它们，击败周围的幼龙吧。\n\n我们要看看泰瓦恩在犬群之中有何表现！', '', '', '', '', '', '', 47936),
(70988, 'zhCN', '蛋是关键', '在欧恩哈拉平原的鲁萨扎尔高台与艾拉娜交谈。', '“整个世界就像一个蛋。”俗话是这么说的吧？\n\n蛋！蛋是甜品的基石，是烹饪创作中最好用的催化剂之一！这种油脂能够让酸、热量和盐充分发挥，发掘出全部潜力！\n\n我们的群岛上有许多力量十足的猛禽，但欧恩哈拉平原的微风猎手产的卵风味十足！\n\n它们通常会在平原的东侧筑巢，去鲁萨扎尔高台的岗哨附近问问吧。', '', '', '', '', '', '', 47936),
(70987, 'zhCN', '淀粉之心', '与觉醒海岸新生宝库废墟中的梅莉亚妮·艾诺拉斯交谈。', '有什么能比探险时随身携带的美餐更好？\n\n街头美食是世间所有繁华城市的精华所在，但并非每种美餐都适合边走边吃。优秀的随身美餐必须以淀粉为主，才能在你的旅途中保持形状。面包、土豆、米饭以及其他食物就是小份美餐的核心。\n\n我想招待这里的熊猫人朋友，让他们品尝风味十足的跃空玉米。我和莫塞尔在觉醒海岸附近的泰坦遗迹附近第一次见面时，他就向我介绍了这种美食。', '', '', '', '', '', '', 47936),
(70986, 'zhCN', '列兵西克扎尔', '', '', '', '', '', '', '', '', 47936),
(70985, 'zhCN', '孑然一斥候', '与树影庇护所的树妖交谈。', '我知道，是很愚蠢。半人马和树妖，对吧？我们的差别太大了。\n\n但从我第一次注视翡翠花园开始，我就想要认识一个树妖。但不管我怎么说、怎么做，似乎都没法让她们对我产生兴趣。\n\n我听说她们喜欢……植物，还有可爱的动物宝宝，也许还喜欢消灭偷猎者。但我不知道该从哪儿开始。\n\n能请你去和她们聊聊吗？能不能四处打听，问出她们喜欢什么？这样我也许就有机会了。', '', '', '', '', '', '返回斥候杉图恩处。', 47936),
(70984, 'zhCN', '奔涌打击', '', '', '', '', '', '', '', '', 47936),
(70983, 'zhCN', '欧南克·滨涤', '', '', '', '', '', '', '', '', 47936),
(70981, 'zhCN', '品味海洋', '在碧蓝林海的捕鲸者海角与瓦育恩交谈。', '大海的气息！你闻到了吗，$n？你闻到那大量的矿物质和浓厚的海盐气息了吗？有吗？？\n\n今天的美食里意外缺少了一种稀有的鱼，我当年就是被它吸引到碧蓝林海的伊斯卡拉海象人家园的。两个海象人当时在火堆边烤这么一条鱼。令人垂涎的香气填满了整个冰原！\n\n你看看能不能为我们弄一条来，客人们肯定会和我一样，为大海的韵味而倾倒。', '', '', '', '', '', '', 47936),
(70979, 'zhCN', '玛格玛顿', '', '', '', '', '', '', '', '', 47936),
(70978, 'zhCN', '巨龙群岛勇士的传说', '', '', '', '', '', '', '', '', 47936),
(70977, 'zhCN', '斯卡普斯背包', '', '', '', '', '', '', '', '', 47936),
(70976, 'zhCN', '滑水溜冰', '在东南方的岛屿上找到基欧波。', '据我所知，伊斯卡拉的孩子们非常独立自主，小小年纪就在学习保护自己了。\n\n在我们的成年仪式中，许多年长的孩子会溜到西南方的冰山上去。我们最年长的孩子基欧波现在就在那里。去告诉他是我派你去的，他就会给你我们最棒的雪橇！\n\n啊，这让我想起了年轻的时候……我和我的朋友们都在那里……', '', '', '', '', '', '', 47936),
(70975, 'zhCN', '通缉：永燃火心', '寻找永燃火心。', '<通告上的字写得龙飞凤舞。>\n\n档案员诚恳希望所有探险队成员为神器归档工作寻找永燃火心。\n\n如若寻得，请上交至编目员杰克斯处，以供领取报酬并处理后续事宜。\n\n探险队成员报告称，他们在北部看到了一个受拜荒者控制的巨大火元素，或许能从它身上获得永燃火心。', '', '生命缚誓者花园中的拜荒者释放出了一个强大的火元素！', '重燃者菲拉瓦', '', '', '向龙鳞先遣营地的编目员杰克斯复命。', 47936),
(70972, 'zhCN', '忠诚老坐骑', '', '', '', '', '', '', '', '', 47936),
(70971, 'zhCN', '兵刃在手', '', '', '', '', '', '', '', '', 47936),
(70970, 'zhCN', '本意为善', '阻止阿莉亚·舞阳并摧毁神器瓦尔祖克斯。', '我也许知道神器在哪儿了。在你把所有碎片都带回来的时候，阿莉亚在疯狂地低语着。\n\n她一直嘀咕着什么“洞穴”，还说蜘蛛似乎被那里所吸引。\n\n我们前面的区域里没有洞穴……所以我觉得，也许遗迹深处会有一个。\n\n我们会留在这里，帮你守住逃生之路，$n。请你救救阿莉亚，并摧毁这件被诅咒的神器。', '', '但愿我们能在阿莉亚被神器吞噬之前及时赶到。', '瓦尔祖克斯', '', '', '', 47936),
(70969, 'zhCN', '融入社区', '', '', '', '', '', '', '', '', 47936),
(70968, 'zhCN', '一针一线', '', '', '', '', '', '', '', '', 47936),
(70967, 'zhCN', '鱼教于乐', '', '', '', '', '', '', '', '', 47936),
(70966, 'zhCN', '交易予人便利', '', '', '', '', '', '', '', '', 47936),
(70965, 'zhCN', '通缉：看护者的金色腰带', '寻找看护者的金色腰带。', '<通告上的字写得龙飞凤舞。>\n\n档案员诚恳希望所有探险队成员为神器归档工作寻找看护者的金腰带。\n\n如若寻得，请上交至编目员杰克斯处，以供领取报酬并处理后续事宜。\n\n大家不妨从北部的挖掘现场开始寻找，元素师泰阳报告称，那里有一个出故障的看护者正在制造麻烦。', '', '腕部系着金带的错乱警戒者！', '迷惑的警戒者', '', '', '向龙鳞先遣营地的编目员杰克斯复命。', 47936),
(70964, 'zhCN', '肩背佳！', '', '', '', '', '', '', '', '', 47936),
(70963, 'zhCN', '腕部支持', '', '', '', '', '', '', '', '', 47936),
(70962, 'zhCN', '舒适座椅', '', '', '', '', '', '', '', '', 47936),
(70961, 'zhCN', '肩负护甲', '', '', '', '', '', '', '', '', 47936),
(70960, 'zhCN', '商人的华服', '', '', '', '', '', '', '', '', 47936),
(70959, 'zhCN', '可爱抱抱', '', '', '', '', '', '', '', '', 47936),
(70958, 'zhCN', '好菇配好宴', '在索德拉苏斯的时光流汇与护卫队长辛乔伊尔米交谈。', '精致晚宴的秘诀，当然就是使用最精巧的技艺和最优质的食材。精致晚宴所选用的食物通常难以企及，需要财富和门路才能获取，但我们的红玉盛宴就能提供！\n\n莫塞尔告诉我有一种食材很适合今天的主题，这是一种稀罕的食材，它甚至……还不存在！是不是很有趣，不是？\n\n青铜龙发现了一扇通往危险未来的传送门，那里有一种黑色的松露，它的口感无人知晓！\n\n你必须快去！', '', '', '', '', '', '', 47936),
(70957, 'zhCN', '西出之海', '在欧恩哈拉平原的树影庇护所与糖枝交谈。', '你喜欢这周围的一片绿意吗，$n？\n\n这让我想起了以前在一对树妖姐妹和树人朋友那里吃过的一道菜，它名叫糖枝，居住在在平原西海岸的树影庇护所。\n\n那道菜会把新鲜的草药、蔬菜和香料混合起来，而核心食材是你吃到过的最好吃的海藻！\n\n什么？你以前没吃过海藻？那你真应该找一点尝尝，再多带一点回来和大家分享！', '', '', '', '', '', '', 47936),
(70956, 'zhCN', '碧蓝鳞片', '', '', '', '', '', '', '', '', 47936),
(70955, 'zhCN', '壮美飞行生物', '', '', '', '', '', '', '', '', 47936),
(70954, 'zhCN', '好奇无垠', '', '', '', '', '', '', '', '', 47936),
(70953, 'zhCN', '海象人头饰', '', '', '', '', '', '', '', '', 47936),
(70952, 'zhCN', '遗弃还是藏匿', '', '', '', '', '', '', '', '', 47936),
(70950, 'zhCN', '猛叉大鱼', '', '', '', '', '', '', '', '', 47936),
(70948, 'zhCN', '抛线，下钩，全熔毁！', '', '', '', '', '', '', '', '', 47936),
(70947, 'zhCN', '宝藏狂人特兰布拉德', '', '', '', '', '', '', '', '', 47936),
(70946, 'zhCN', '不得染指之物', '说服阿莉亚摧毁瓦尔祖克斯。', '根据你的发现，这个神器的力量似乎让它的历任主人走向了毁灭。\n\n昔日生活在此的龙裔为了争夺它而手足相残，碎裂之焰似乎也被它的影响腐化了。\n\n这件神器不应由我们取回，而是应当由我们摧毁，否则它还会祸害其他人。\n\n我们必须说服阿莉亚和卡蒂加特。', '', '', '', '', '', '', 47936),
(70945, 'zhCN', '自投渔网', '', '', '', '', '', '', '', '', 47936),
(70944, 'zhCN', '寒冰垂钓', '', '', '', '', '', '', '', '', 47936),
(70943, 'zhCN', '鱼叉捕鱼', '', '', '', '', '', '', '', '', 47936),
(70942, 'zhCN', '高地垂钓', '', '', '', '', '', '', '', '', 47936),
(70941, 'zhCN', '鱼窝', '在碧蓝林海的伊斯卡拉与努恩弗克交谈。', '又见面了！你知道吗？我就要成为全村最棒的渔夫了！我以前抓到过一条巨型食人鱼，它想要把我的脸咬烂！\n\n<罗威心烦意乱地环顾周围。>\n\n对了！我给你带了一句口信。伊斯卡拉的努恩弗克想跟你说说鱼窝的事情。', '', '', '', '', '', '', 47936),
(70940, 'zhCN', '海象人勇士的传说', '', '', '', '', '', '', '', '', 47936),
(70939, 'zhCN', '烹饪器具', '', '', '', '', '', '', '', '', 47936),
(70938, 'zhCN', '社区盛宴', '在碧蓝林海的伊斯卡拉与大个子基努克交谈。', '你在这儿呢，$n！汤来咯！\n\n你最好快去伊斯卡拉，大个子基努克在到处找你呢。\n\n又一次他让我给汤找一条黏黏糊糊的刺皮鱼，我不愿意，就喊着“不行，大厨！”\n\n他立刻就火冒三丈，差点就要把我扔进锅里了！', '', '', '', '', '', '', 47936),
(70937, 'zhCN', '瓦尔祖克斯的本源', '寻找关于神器瓦尔祖克斯本质的线索。', '<托提克低声对你说道。>\n\n我可不喜欢这样。神器会向你低语，承诺给你力量？这肯定不是好事。\n\n但我们不能一走了之……否则它就会落到碎裂之焰手里。不管“它”是什么……\n\n我已经习惯在这种废墟里发掘补给品了，蓝龙经常会留下自己的作业记录。多加留意，你应该能找到一些。\n\n我们可以使用你找到的证据来警告阿莉亚和卡蒂加特。', '', '', '', '', '', '', 47936),
(70936, 'zhCN', '失窃的海象人图腾', '', '', '', '', '', '', '', '', 47936),
(70935, 'zhCN', '捉放鱼：岛鳍剑鱼', '', '', '', '', '', '', '', '', 47936),
(70932, 'zhCN', '香料真传', '与黑曜王座的格里伏塔交谈。', '在许多人眼里，肉才是宴席真正的主角。那么对肉来说，真正的主角又是什么呢？\n\n是香料！！\n\n岛上有一种珍稀的香料，它的风味、酸度和烹饪口感远胜其他的香料。但你只能在黑曜据点深处居住的元素身上找到。那个地方已经被贾拉丁占据了。\n\n我之前路过的时候遇到了一个古怪的巨魔，你也许可以去他那里瞧瞧。他的名字好像叫……格里伏塔。', '', '', '', '', '', '', 47936),
(70931, 'zhCN', '低语碎片', '从碎裂之焰处取回$1oa个低语碎片。', '我相信瓦尔祖克斯正打算通过我们找到的碎片与我们交流。\n\n只要我们坚定意志，不被神器所左右，就可以利用好这一点。\n\n我之前误判了碎裂之焰，他们肯定已经收集到几块碎片了。\n\n瓦尔祖克斯的低语相信，他们就快找到它的位置了。\n\n快从碎裂之焰手中夺回碎片，不能让他们找到神器！', '', '', '', '', '', '', 47936),
(70930, 'zhCN', '有茶无叶', '与寒网谷的莉莱尔·晨绽交谈。', '这是一场专为茶水举行的庆典，煮的茶，冰的茶，什么样的茶都有！还有不限量供应的小蛋糕和小饼干呢！\n\n不过这群岛上有一种稀有食材，也许能给我们的口味开拓一片新天地！寒网谷底部滋生着许多爬蛛，在那里生长着一种具有奇妙滋味的叶子：寒流簇叶。\n\n我听说龙鳞探险队最近正在探索那片区域，也许他们有人能帮帮我们？', '', '', '', '', '', '', 47936),
(70929, 'zhCN', '更多狩猎战利品', '', '', '', '', '', '', '', '', 47936),
(70928, 'zhCN', '狩猎战利品', '', '', '', '', '', '', '', '', 47936),
(70927, 'zhCN', '更多失窃的图腾', '', '', '', '', '', '', '', '', 47936),
(70926, 'zhCN', '失窃的图腾', '', '', '', '', '', '', '', '', 47936),
(70925, 'zhCN', '社区盛宴', '', '', '', '', '', '', '', '', 47936),
(70919, 'zhCN', '真心嘤雄', '将泡泡里的小鸭子带回生态学家的营地。', '<这只小鸭子被泡泡困住了太久，已经陷入了昏睡。它一边打着呼噜，一边轻柔地嘎嘎叫着。>\n\n<也许生态学家知道该怎么帮助它？>', '', '', '', '', '', '将泡泡里的小鸭子带回生态学家的营地。', 47936),
(70918, 'zhCN', '嘎嘎求生', '将泡泡里的小鸭子带回生态学家的营地。', '<这只小鸭子焦躁地嘎嘎直叫。如果没人帮助它，它肯定会惹怒鳄鱼人的！>\n\n<也许生态学家知道该怎么帮助它？>', '', '', '', '', '', '将泡泡里的小鸭子带回生态学家的营地。', 47936),
(70917, 'zhCN', '鸭来背负', '将泡泡里的小鸭子带回生态学家的营地。', '<这只小鸭子神经紧绷，似乎渴望摆脱当前的困境。>\n\n<也许生态学家知道该怎么帮助它？>', '', '', '', '', '', '将泡泡里的小鸭子带回生态学家的营地。', 47936),
(70916, 'zhCN', '威名昭彰', '', '', '', '', '', '', '', '', 47936),
