(70901, 'zhCN', '物种大全', '', '', '', '', '', '', '', '', 47936),
(70900, 'zhCN', '翻新引擎', '将新近协调的能量核心插入创新引擎。', '提尔相信，在即将迎来的大战之中，创新引擎不可或缺。\n\n你证明了自己的资格，也克服了眼前的所有挑战。现在，你可以解锁引擎的全部潜力了。', '', '', '', '', '', '', 47936),
(70899, 'zhCN', '提尔的第五个挑战：巧思', '将伊里度斯的能量核心与提尔要塞的泰坦能量协调。', '能量核心原本不该通过这种方式获取，所以需要重新将它与引擎的能量协调。提尔要塞住民的共振频率可以让这个核心再次发挥全部潜能。\n\n虽然我不愿牺牲更多同胞，但这是完成挑战的唯一途径。', '', '', '', '', '', '', 47936),
(70897, 'zhCN', '明天会更忙', '', '', '', '', '', '', '', '', 47936),
(70896, 'zhCN', '绶带待售', '', '', '', '', '', '', '', '', 47936),
(70895, 'zhCN', '翔空英姿', '', '', '', '', '', '', '', '', 47936),
(70893, 'zhCN', '社区盛宴', '在社区盛宴中完成$1oa项任务。', '我们的社区盛宴马上就要开始了！大家都会出一份力，来做出最好的汤。\n\n你也应该和我们一起！', '', '', '', '', '', '', 47936),
(70892, 'zhCN', '制造起点', '', '', '', '', '', '', '', '', 47936),
(70891, 'zhCN', '入乡随俗', '', '', '', '', '', '', '', '', 47936),
(70889, 'zhCN', '制造专工', '', '', '', '', '', '', '', '', 47936),
(70888, 'zhCN', '比肩一流', '', '', '', '', '', '', '', '', 47936),
(70887, 'zhCN', '自由的感觉', '', '', '', '', '', '', '', '', 47936),
(70885, 'zhCN', '名望补给', '', '', '', '', '', '', '', '', 47936),
(70883, 'zhCN', '栽培手艺', '在团结花园中找到格里尔姆佩奇。', '你好，凡人。首席园丁格里尔姆佩奇让我带话给你，说花园现在一塌糊涂，可我不知道这是否反常。\n\n他们向我保证一切尽在掌控，原话是“一切尽在铲中”。我也不知道那是什么意思，但他们肯定会跟你细说的。请你赶快前去，园丁会把实际情况告诉你的。', '', '', '', '', '', '', 47936),
(70882, 'zhCN', '名望补给', '', '', '', '', '', '', '', '', 47936);
INSERT INTO `quest_template_locale` (`ID`, `locale`, `LogTitle`, `LogDescription`, `QuestDescription`, `AreaDescription`, `PortraitGiverText`, `PortraitGiverName`, `PortraitTurnInText`, `PortraitTurnInName`, `QuestCompletionLog`, `VerifiedBuild`) VALUES
(70881, 'zhCN', '提尔的第四个挑战：应变', '从注能大厅的看护者伊里度斯身上获取能量核心，并击败原始海啸。', '引擎就要发挥出全部潜力了，现在它只需要一个能量核心，就能更高效地处理放入其中的精华。\n\n提尔将这种设备的知识留给了看护者伊里度斯。到注能大厅去寻找他吧，他肯定有求必应。', '', '', '', '', '', '', 47936),
(70880, 'zhCN', '精致厨具', '', '', '', '', '', '', '', '', 47936),
(70879, 'zhCN', '叛军形势报告', '在守护巨龙之座的顶楼与德莱恩队长见面。', '你今天的成就令我钦佩，你肯定也很有成就感吧，$n。\n\n我们成功遏止了与拜荒者勾结的叛军，挫败了他们歹毒的行动，至少暂时如此。我们以后还需要密切关注任何异动。\n\n你就尽快回去向德莱恩队长复命吧，她肯定想要聆听我们的完整报告。', '', '', '', '', '', '', 47936),
(70878, 'zhCN', '烈火之环', '在马德拉·火舌封印拜荒者传送门时提供保护。', '在烬磐岩窟的最深处，拜荒者竖起了一道烈焰传送门，并源源不断地从中释放元素。\n\n我可以封住这道传送门，但我的行为会来另一侧的怒火，包括拜荒者们所协助的残魂玛格玛提库斯。\n\n要想阻止他们，你必须保护好我。', '', '拜荒者企图释放这个火焰亡魂，令其肆虐巨龙群岛，必须尽快将其扑灭。', '玛格玛提库斯', '', '', '', 47936),
(70877, 'zhCN', '千时一嘎', '将泡泡里的小鸭子带回生态学家的营地。', '<这只小鸭子非常沮丧，它低声地鸣叫着，在惊恐中扫视着周围。>\n\n<也许生态学家知道该怎么帮助它？>', '', '', '', '', '', '将泡泡里的小鸭子带回生态学家的营地。', 47936),
(70876, 'zhCN', '法器裂解', '在烬磐岩窟中摧毁$1oa个拜荒者法器。', '如果马德拉说得没错，那么符文石就是叛军在烬磐岩窟中制造出来的。\n\n考虑到这些装置的性质，这肯定和拜荒者的法器脱不了干系。\n\n摧毁法器，你肯定一眼就能认出来。\n\n不能让叛军制造出更多大规模破坏性武器。', '', '', '', '', '', '', 47936),
(70875, 'zhCN', '雪上加霜', '在烬磐岩窟中消灭$1oa个元素和$2oa名叛军。', '烬磐岩窟中的叛军对拜荒者忠诚不二，是瓦德拉肯面对的最大威胁。\n\n消灭他们，摧毁他们释放的元素。', '', '', '', '', '', '', 47936),
(70874, 'zhCN', '突破火墙', '接受马德拉的元素祝祷。', '洞穴里的叛军被注入了一种元素的祝福，所以能够安全地穿越烈焰之墙。我也会给予你同样的祝福。\n\n别担心。我曾多次见证如何授予祝福，有效重现应该不成问题。', '', '', '', '', '', '', 47936),
(70873, 'zhCN', '追逐瀑布', '采收$1oa个飞流微粒。', '真正的威胁在烬磐岩窟里。这里是雕刻出符文石，然后向其灌注原始之火的地方。\n\n你显然注意到了挡在入口处的烈焰之墙。我无法驱散它，但我能提供别的帮助。我相信如果适当地利用元素飞流，我们就可以安然通过。\n\n从附近的元素身上采收飞流微粒吧。', '', '', '', '', '', '', 47936),
(70871, 'zhCN', '伊斯卡拉渔网', '将材料带给塔薇欧，让她制作一张伊斯卡拉渔网。', '我看到你和村民们很处得来。\n\n你想继续学习我们的钓鱼方法？嗯，首先，没人能靠赤手空拳钓上鱼来。我可以给你制作一张配得上伊斯卡拉海象人的牢固渔网。', '', '', '', '', '', '', 47936),
(70867, 'zhCN', '灭鳞要塞', '', '', '', '', '', '', '', '', 47936),
(70859, 'zhCN', '卫士所睹', '从埃达维克斯，被腐化的卫士处取回低语碎片。', '我很感谢你的帮助，$c。我是最先发现瓦尔祖克斯这件神器的肯瑞托法师，也注意到了碎裂之焰的计划。\n\n这件神器力量非凡，还具有情感认知，它的回收与研究工作至关重要，这本来应该是我的职责。\n\n碎裂之焰费尽心思想要找到它，但我已经使用魔法探明了道路。\n\n附近有一名被腐化的卫士，它身上带着一枚连接着瓦尔祖克斯的魔法碎片。我可以使用它找到神器的其余部分。', '', '被瓦尔祖克斯之力腐化的卫士，掌管着能够揭露神器下落的秘密。', '埃达维克斯', '', '', '', 47936),
(70858, 'zhCN', '重返火线', '对阿莉亚·舞阳使用冰冷的解毒剂。', '解毒剂配好了。我会扶稳阿莉亚，你把瓶子里的东西倒进她的嘴里。\n\n希望她能活下来……我们需要她的魔法，才能追踪神器的下落。', '', '', '', '', '', '与阿莉亚·舞阳交谈。', 47936),
(70856, 'zhCN', '烈火焚尽', '使用喷火火炬摧毁$1oa具被感染的尸体。', '这些恶毒的蜘蛛会在遗骸中产卵。\n\n有时连活物也不放过。\n\n我们已经发现了多具被它们害死的碎裂之焰的尸体。\n\n如果我们想要活下去并击败碎裂之焰，就不能让这些蛛卵孵化。\n\n带上这个火把，它灌注了火焰与空气的力量。将它指向灼烧的方向，剩下的它会自己解决。\n\n海象人不会和蜘蛛瞎搅和，我是有备而来的。', '', '', '', '', '', '', 47936),
(70854, 'zhCN', '进展如何？', '返回瓦德拉肯雏龙日托所的扎哈纳处。', '你做得不错，$n，拉宾斯的表现大有改观，而且斗志昂扬。\n\n扎哈纳肯定想知道这些消息，快回去向她报喜吧！', '', '', '', '', '', '', 47936),
(70853, 'zhCN', '拉宾斯的朋友', '在觉醒海岸的狂野禁猎区中捕捉一只羞蜓。', '我们之前提到，拉宾斯有两个需要：一个伙伴和一场战斗。\n\n我们应该可以同时满足这两个需求。\n\n这片区域是羞蜓的繁育地，只要去周围转转，就能找到许多。\n\n记住，你必须先将它削弱，才能使用陷阱捕获它。\n\n等你抓到了一只再回来吧。经过一场大战，它也许会伤痕累累，但我可以给你几个战斗训练石，让它重新打起精神！', '', '', '', '', '', '', 47936),
(70851, 'zhCN', '天生桀骜', '了解拉宾斯需要从哈尼科处获得什么。', '你需要知道许多消息，我们应该先聊一聊，再决定怎么做才对拉宾斯最好。', '', '', '', '', '', '', 47936),
(70850, 'zhCN', '热锅上的马德拉', '从欧丽安·暗水处营救马德拉。', '干得好。在你四处袭扰的时候，我侦查了营地，没想到还会发现我的老朋友，马德拉·火舌就在这里。\n\n我知道她失踪了，传闻说她投靠了叛军。但在我看来，她其实成了俘虏！\n\n我们不能把她抛下。干掉那些拘押她的龙兽，把她营救出来！', '', '这个叛军领袖将他的俘虏马德拉·火舌束缚在元素之水的锁链之中。', '欧丽安·暗水', '', '', '', 47936),
(70849, 'zhCN', '请求专家援助', '与觉醒海岸狂野禁猎区的哈尼科交谈。', '拉宾斯的表现有了起色，但他依然需要更多帮助。\n\n不久以前，我遇到了一个聪明绝顶的龙鳞探险队的探险者，她名叫哈尼科，一直都在和始祖幼龙打交道。她也是个宠物训练师，肯定可以帮助拉宾斯！\n\n她当时好像正在前往觉醒海岸，你应该能在那里找到她。\n\n我很高兴能够帮助你！\n\n<她快乐地挥着手>\n\n再见！祝你好运，拉宾斯。', '', '', '', '', '', '', 47936),
(70848, 'zhCN', '被遗忘的巨龙之冠', '将物品交给艾克萨德里亚。', '<艾克萨德里亚可能想要这个。>', '', '', '', '', '', '', 47936),
(70847, 'zhCN', '上古黑曜护符', '将物品交给利爪猎手卡薇亚。', '<利爪猎手卡薇亚可能想要这个。>', '', '', '', '', '', '', 47936),
(70845, 'zhCN', '循迹提尔', '在碧蓝林海找到提尔的第一个挑战。', '守护者提尔算无遗策。他怀疑有朝一日，我们需要为这个国度的工匠赐予力量，于是便创造了创新引擎。它能够制作出一种独特的材料，让一件物品获得超越凡人的工艺。\n\n为了确保创新引擎不被滥用，提尔创造了我，负责监督所有寻求它的力量的人。只有配得上它的勇士，才能解锁引擎的全部潜力。\n\n你能应对挑战吗？', '', '', '', '', '', '在碧蓝林海找到提尔的第一个挑战。', 47936),
(70843, 'zhCN', '销毁符文石', '摧毁燃炎符文石箱。', '<这块符文石和叛军尝试在瓦德拉肯安置的那块十分相似。\n\n虽然这块石头还是半成品，但你发现远处有一些完工的符文石已经装箱了。\n\n如果你摧毁这些箱子，叛军就用不上了。>', '', '', '', '', '', '', 47936),
(70842, 'zhCN', '爆破位置', '收集迷离谷地图。', '叛军肯定将未来的袭击计划记录了下来。我们必须赶在他们行动之前查明企图。\n\n搜索他们的营地，寻找任何带有标记的地图，就像我们在瓦德拉肯找到的这张一样。', '', '', '', '', '', '', 47936),
(70841, 'zhCN', '更多泰坦圣物', '', '', '', '', '', '', '', '', 47936),
(70840, 'zhCN', '一件泰坦圣物', '', '', '', '', '', '', '', '', 47936),
(70839, 'zhCN', '搜寻泰坦圣物', '', '', '', '', '', '', '', '', 47936),
(70838, 'zhCN', '叛由心生', '消灭$1oa个叛军和拜荒者。', '叛军的集结地……我们一直在寻找这个地方。幸运的是，他们粗心大意的破坏者领着我们找到了这里。\n\n真不敢相信我的同胞竟会堕落到与拜荒者为伍，我们不能纵容他们盘踞在此。消灭叛军和他们的拜荒者盟友，不能让他们继续引发混乱。', '', '', '', '', '', '', 47936),
(70837, 'zhCN', '纠察线索', '在迷离谷与调查员艾力马见面。', '<调查员艾力马端详着地图。>\n\n写在守护巨龙之座上的X代表什么显而易见。\n\n但在迷离谷周围画了一个圈。这可能是叛军的下一个目标？或许是某个行动基地。\n\n只有一个办法可以弄清楚了。到山谷找我吧。', '', '', '', '', '', '', 47936),
(70835, 'zhCN', '结实的探险锹', '', '', '', '', '', '', '', '', 47936),
(70834, 'zhCN', '授衔传奇', '', '', '', '', '', '', '', '', 47936),
(70833, 'zhCN', '珠光红玉龙崽的传闻', '', '', '', '', '', '', '', '', 47936),
(70832, 'zhCN', '都是自己人了', '', '', '', '', '', '', '', '', 47936),
(70831, 'zhCN', '舒适研究', '', '', '', '', '', '', '', '', 47936),
(70828, 'zhCN', '寻路者的罗盘', '', '', '', '', '', '', '', '', 47936),
(70822, 'zhCN', '迷失的探险队斥候', '', '', '', '', '', '', '', '', 47936),
