(70781, 'zhCN', '蓝羽无踪', '在蓝羽悬崖找到哈琳·啾讽。', '你看到了吗？！\n\n那个长着翅膀的野兽坠下来了！我不知道那是什么，但肯定不是群岛中土生土长的生物。\n\n等等……我记得之前有一个小地精打听过蓝羽悬崖的方向。你觉得她知道些什么吗？', '', '', '', '', '', '', 47936),
(70779, 'zhCN', '塔尔金的故事', '从巨龙群岛强大的巨龙和始祖龙处收集$1oa个厉害的龙颅。', '<在和你说话时候，塔尔金一直面朝远方的岛屿。>\n\n你觉得自己配得上贾拉丁的那些传说和历史？\n\n你都没有我们的武器高，就敢这么说？呸。\n\n我怀疑你的实力不足以继承我族人的遗产。\n\n有能耐就证明我错了吧。寻找龙族，它们是这岛上唯一值得一战的对手。\n\n把你战胜最强龙族的战利品带给我。', '', '', '', '', '', '', 47936),
(70763, 'zhCN', '世界侵蚀者阿提尔', '', '', '', '', '', '', '', '', 47936),
(70754, 'zhCN', '扑灭火焰拜荒者', '将原始核心带给莱则尔希。', '瓦德拉肯的莱则尔希会很高兴能用这个促进对拜荒者的研究。', '', '', '', '', '', '', 47936),
(70753, 'zhCN', '消散空气拜荒者', '将原始核心带给莱则尔希。', '瓦德拉肯的莱则尔希会很高兴能用这个促进对拜荒者的研究。', '', '', '', '', '', '', 47936),
(70752, 'zhCN', '蒸发流水拜荒者', '将原始核心带给莱则尔希。', '瓦德拉肯的莱则尔希会很高兴能用这个促进对拜荒者的研究。', '', '', '', '', '', '', 47936),
(70751, 'zhCN', '虔心者泰利罗德', '', '', '', '', '', '', '', '', 47936),
(70750, 'zhCN', '援助联军', '继续在巨龙群岛各地援助瓦德拉肯联军及其盟友。', '你！对，说的就是你！除了你难道还有别人吗？\n\n<瑟拉扎尔匆匆地瞥了一眼身旁的路人。>\n\n别管他们，这个要求跟他们没关系。我听说的那个人是你，我想谈的也是你！\n\n瓦德拉肯联军请我找到在群岛各地扬名立万的人，以及致力于保护盟友安危的人。\n\n尽你所能吧，朋友，我们会给你丰厚的奖赏。', '', '', '', '', '', '', 47936),
(70748, 'zhCN', '仅限蓝眼', '在碧蓝档案馆中寻找玛里苟斯的笔记。', '难怪你的同伴一无所获。\n\n这些书只有蓝龙的眼睛才能阅览。\n\n不过，我的存在可以让更多重要典籍揭露自己的秘密。', '', '', '', '', '', '', 47936),
(70747, 'zhCN', '碧蓝巫师', '与安东尼达斯营地的大法师卡德加交谈。', '我没时间和巫师嚼舌头。\n\n去应付这个“大法师”，$p，尽量搜集情报，时刻保持警惕。他们是敌是友尚无定论……\n\n我们的报告表明，此地的南方有一个大型的档案区。\n\n那就是我要去的地方。', '', '', '', '', '', '', 47936),
(70746, 'zhCN', '蓝色阴霾', '陪同安波莎和泰拉什前往安东尼达斯营地。', '你来啦，$p！\n很高兴能在这里看到一张友善的面孔。我和泰拉什刚才在讨论我们听闻的报告……说这里来了一些……新的客人。\n\n<安波莎压低了嗓门。>\n\n蓝龙。\n\n考虑到我们和蓝龙的……往事，我和泰拉什觉得有必要亲自评估一下局势。\n\n请和我们同行。', '', '', '', '', '', '', 47936),
(70745, 'zhCN', '强制休闲', '消灭元素召唤师。', '要我说，你看到的那些拜荒者肯定不是什么领袖。谁会害怕一条小狗？哈！\n\n既然他们提到了瓦德妮，那应该就是他们的领袖了，肯定就是她召来了这些元素。我们必须除掉召唤师。他们惹出了这么大的麻烦，那肯定就在附近。去搜索我们下方的洞穴，那些懒惰的员工想开小差的时候通常就会躲在那里。', '', '这个拜荒者是蒸汽与烈焰的召唤师，喜欢将敌人活活烫死。', '瓦德妮·冷心', '', '', '', 47936),
(70744, 'zhCN', '看呐！骨头！', '收拾$1oa个烂摊子。', '<如果地上不再到处都是血迹，温泉经理一定会感激涕零……>', '', '', '', '', '', '', 47936),
(70743, 'zhCN', '宝贝宝宝', '寻找艾尔扎拉的宝贝。', '那边的，$pr！你有没有本事？\n\n你分得清轻重缓急吗？\n\n很好！\n\n我的宝贝宝宝不见了，请你快去救她。一定要快，在这么可怕的情况下，她根本没法保护自己。', '', '', '', '', '', '', 47936),
(70742, 'zhCN', '世家传承', '搜索黑曜观察站，寻找与龙希尔的过去相关的线索。', '我在空中发现了艾德蕾丝发掘出的一件神器，就在废墟的入口处。里面肯定还有更多神器。\n\n不过它们都在结界的保护之下。我必须靠近一点才能仔细检查。这里的魔法非常古老。\n\n这里似乎已经荒废了，可我觉得一旦我们开始介入，情况可能很快就会有变化。留心一点。我们会竭尽所能完成侦查。', '', '', '', '', '', '', 47936),
(70741, 'zhCN', '他人所爱', '收集$1oa件遗失物品。', '<看来俞加课中断了，学生的私人物品散落一地。\n\n收集这些物品肯定能帮助宁梦温泉。>', '', '', '', '', '', '', 47936),
(70740, 'zhCN', '蒸汽清洁', '在下层温泉区中消灭$1oa个元素。', '席剑似乎认为元素对我们美丽温泉的侵袭算不上什么大麻烦，但我们必须立即控制突如其来的烈焰与蒸汽。\n\n我们原定在下层区域举行音乐表演，但元素摧毁了他们的装备。这地方以前从未经历过如此严重的元素破坏，我怀疑是拜荒者捣的鬼。\n\n如果你愿意帮忙的话，就去下层温泉区的东侧清理元素吧，第一场活动原本计划在那里举行。', '', '', '', '', '', '', 47936),
(70739, 'zhCN', '血系、甜食与提莱', '帮助猎人纳尔曼为求婚获得传统祝福。', '我曾陪同可汗一起狩猎，最迅捷的獒犬也不如我身手矫健，我靠赤手空拳就能扭倒一头成年的驼牛。作为猎人，我已经不需要再证明什么了。\n\n然而，作为伴侣，我还有很多需要学习的地方。\n\n我的所思所想，我的喜怒哀乐，都寄托在欧恩伊尔氏族的轻风贤者达瓦身上。我要证明自己配得上他的爱，但我对传统和仪式一无所知。我要向马鲁凯的长老们寻求建言。', '', '', '', '', '', '与马鲁凯席卡尔高地的猎人纳尔曼交谈。', 47936),
(70738, 'zhCN', '俞加课', '寻找教练和$1oa名俞加学生。', '本来风和日丽、顺风顺水，可现在呢？元素构成了一些，呃，微不足道的挑战。\n\n客人们本来还在享受各类设施服务，突然之间，这些元素就出现了！这些讨厌的怪物搅黄了一切，就连新来的俞加教练估计也没有全身而退。\n\n没错，俞加是一种全新的拉伸活动，还能同时帮你冥想正念。我想教练和学生肯定是放空了身心和头脑，甚至都没有注意到元素。\n\n不过小心驶得万年船，请你去找他们吧。', '', '', '', '', '', '', 47936),
(70732, 'zhCN', '拳赛训练', '在宠物对战中击败格沃什。', '好了！你已经对拉宾斯使用了战斗石，我们来练习一下，看看它身手如何！\n\n一只名叫格沃什的大龙蛙就居住在北边的海岸上。格沃什喜欢战斗！嗯，其实是喜欢玩耍。它对待其他宠物时也非常友好！\n\n拉宾斯肯定能和它玩得……我是说打得尽兴。', '', '', '', '', '', '', 47936),
(70730, 'zhCN', '给席卡尔的聘礼', '帮助轻风贤者达瓦筹备完美的求婚。', '哦，$p。\n\n你喜欢晒太阳的感觉吗？你在光明的抚慰下感到惬意吗？每一轮新的朝阳是不是都代表着对未来的美好希望？仿佛你能过上梦寐以求的生活？\n\n那你就和我一样，对爱有了理解。\n\n席卡尔氏族的纳尔曼就是我的太阳，他是我的温暖，是我的光亮和希望。\n\n他这样出类拔萃的人，理应得到相称的求婚仪式。\n\n我们必须寻求欧恩的指引。', '', '', '', '', '', '', 47936),
(70723, 'zhCN', '粉碎大地拜荒者', '将原始核心带给莱则尔希。', '瓦德拉肯的莱则尔希会很高兴能用这个促进对拜荒者的研究。', '', '', '', '', '', '', 47936),
(70722, 'zhCN', '拉宾斯的需要', '与伊斯卡拉的帕丘交谈。', '我好像知道该怎么办了，$n。\n\n但首先，我们要聊一聊！\n\n然后我还会给你一份礼物！很有意思吧？', '', '', '', '', '', '', 47936),
(70721, 'zhCN', '欧恩指引我心', '帮助轻风贤者达瓦与猎人纳尔曼进行求婚。', '镜天湖边有一个小池塘。在那个地方，我在新兵训练中第一次遇见了纳尔曼。\n\n新兵们会前往那里，在距离欧恩哈拉更近的地方感受轻风。我在水中看到了他的倒影，一阵突如其来的微风吹开了我的眼睛。那是平原之上最美的景象之一。\n\n那里会是我们进行求婚仪式的理想之地。', '', '', '', '', '', '', 47936),
(70719, 'zhCN', '“影斩”特拉肯', '', '', '', '', '', '', '', '', 47936),
(70711, 'zhCN', '湍流环线 - 进阶版', '滑翔穿过光圈。', '飞过标记赛道的检查点光圈。', '', '', '', '', '', '', 47936),
(70710, 'zhCN', '湍流环线', '滑翔穿过光圈。', '飞过标记赛道的检查点光圈。', '', '', '', '', '', '', 47936),
(70708, 'zhCN', '空洞', '和科加尔喝一杯。', '宛如千年已逝，又宛如眨眼片刻。\n\n我真想找个人好好聊聊，不知道你有没有空。\n\n我们一起喝一轮怎么样？要什么就随便点，我请客。', '', '', '', '', '', '', 47936),
(70706, 'zhCN', '界门：树影庇护所', '在欧恩哈拉平原的树影庇护所中找到休眠的界门。', '探险队报告说，西南方的苍翠山丘上有一块沉眠的石头。虽然地处偏远，但值得派个你这样学识渊博的人前去调查。', '', '', '', '', '', '', 47936),
(70703, 'zhCN', '提尔要塞的传承', '和科拉诺斯一同在提尔要塞中调查银鳞。', '守护者提尔喜欢谜题，他赠予我们的礼物肯定别有深意。他很有可能是在昔日的堡垒中锻出了这枚鳞片，或许那就是破解秘密的钥匙。\n\n你要和科拉诺斯一起前往提尔要塞，$n。作为忠实的顾问和这片土地的看护者，他肯定会和你分享见解。', '', '', '', '', '', '与提尔要塞的科拉诺斯交谈。', 47936),
(70702, 'zhCN', '继续探索界门', '在觉醒海岸的红玉之鳞岗哨与塞林·暗砧见面。', '<小信使发出了嘹亮的尖啸声，引起了你的注意。它递来一张纸条后就匆匆离开了。\n\n纸条上写着塞林·暗砧的请求，他需要你的援助。>', '', '', '', '', '', '', 47936),
(70698, 'zhCN', '研究员潜翼', '', '', '', '', '', '', '', '', 47936),
(70697, 'zhCN', '专家建议', '在碧蓝林海与帕丘交谈。', '拉宾斯的伤口愈合了，但他的信心可能依然受到了伤害。是时候寻求其他人的帮助了。\n\n在西南方遥远的碧蓝林海中，有一个名叫帕丘的宠物训练师。在这个领域，她算是全世界数一数二的专家。\n\n请你去拜访她，她肯定有办法帮助拉宾斯！', '', '', '', '', '', '', 47936),
(70656, 'zhCN', '绝不菇息错误', '', '', '', '', '', '', '', '', 47936),
(70650, 'zhCN', '循迹提尔：觉醒海岸', '在觉醒海岸找到提尔的第三个挑战。', '到目前为止，你都证明了自己。虽然我相信你已经配得上引擎了，但我任务在身，还是要对你提出挑战。\n\n前往觉醒海岸，找到我的雕像，你就会获得后续指示。', '', '', '', '', '', '在觉醒海岸找到提尔的第三个挑战。', 47936),
(70648, 'zhCN', '重燃者菲拉瓦', '', '', '', '', '', '', '', '', 47936),
(70647, 'zhCN', '唉，它能跑哪儿去呢？', '营救拉宾斯，并将它带回瓦德拉肯幼鳞日托所的扎哈纳身边。', '$n，见到你真是太好了！我都担心坏了，我需要你来帮忙。\n\n我最近救下了一条被抛弃的始祖幼龙崽子。我给它取名叫拉宾斯，因为它非常可爱！我把它带到了这里照顾，希望能给它找个好家庭，做一只乖乖的宠物。\n\n不过它现在不见了，我担心它走丢了或是受伤了。我还需要看管其他的小家伙，否则就自己去找它了。你能替我去找它吗？', '', '', '', '', '', '', 47936),
(70646, 'zhCN', '压力阀', '', '', '', '', '', '', '', '', 47936),
(70641, 'zhCN', '觉醒的誓言', '在红玉新生圣地与红龙军团的成员交谈。', '请稍等片刻，$p。我个人想感谢你协助我们修复了誓言石。\n\n在你们于禁忌离岛上苏醒之前，我并不知道龙希尔一族的存在。我不清楚你们的归来对我们来说意味着什么。你族会成为保护生命的福音……还是会成为祸患？\n\n我建议你多加了解我们的誓言石，在红玉新生圣地和我的军团成员谈谈吧。也许你会在我们的故事中发现熟悉之处。', '', '', '', '', '', '', 47936),
(70633, 'zhCN', '引擎供给', '使用瓶装精华强化创新引擎。', '你成功通过了守护者提尔留下的第一个挑战。虽然这不过是漫长旅途中的第一步，但我相信你能行。你已经赢得了进一步解锁熔炉秘密的机会。\n\n将瓶装精华放入创新引擎，看看会发生什么。', '', '', '', '', '', '', 47936),
(70632, 'zhCN', '觉醒海岸编目', '', '', '', '', '', '', '', '', 47936),
(70627, 'zhCN', '冬裘氏族的什么？', '在塞隆哨站与索诺瓦·雪山见面。', '我们可以加入其他氏族……如果那样安全的话。\n\n我担心拜荒者会蛊惑其他氏族，就像对我们的氏族那样。\n\n这个“龙鳞探险队”说，他们的一处据点就在冬裘氏族附近。\n\n他们可能被玷污了，也有可能听从我们的警告。不管怎么样，他们需要我们。\n\n在塞隆哨站有一个“熊怪专家”，叫索诺瓦·雪山。拜托你去一趟，看看他知道什么。', '', '', '', '', '', '', 47936),
(70625, 'zhCN', '法铸造物', '', '', '', '', '', '', '', '', 47936),
(70621, 'zhCN', '提尔的第三个挑战：毅力彰示', '从灵感侍女处接受瓶装精华。', '第三个挑战需要你克服重难，从而向我证明，你在任何情况下都能坚毅不屈。\n\n你已与贾拉丁奋勇抗衡，还修复了我的雕像，令我得以向你发出挑战。我相信这足以证明你满足了条件。\n\n<你觉得她的唇边浮现出了不起眼的微笑。>', '', '', '', '', '', '接受灵感侍女的奖励。', 47936),
(70619, 'zhCN', '皮革研究', '为瓦德拉肯的粗犷的莱拉索尔收集$1oa张坚韧之革。', '那边的！也许你能帮我研究一下这种皮革。其中有些部分触感丝滑、十分柔韧，但其他部分就比较硬了——我猜那部分更适合制作护甲。\n\n给我再找些皮革来，我要继续调查。', '', '', '', '', '', '', 47936),
(70618, 'zhCN', '熔炉的呼唤', '为瓦德拉肯的潜地者赛基塔收集$1oa块宁铁矿石。', '熔炉……它在呼唤我，它在索要宁铁矿石。你！给我弄点宁铁矿石来！大堆的宁铁矿石！<赛基塔狂热地大笑起来。>', '', '', '', '', '', '', 47936),
(70616, 'zhCN', '多少？！', '为瓦德拉肯的阿格里库斯收集$1oa朵霍亨布墨花。', '<在你靠近的时候，阿格里库斯正在嚎啕大哭。>\n\n他们真的……不敢相信他们真的……\n\n有人要我给他们送去一千份草药！\n\n我真是想都不敢想！太荒唐了！太荒谬\n了！太离谱了！\n\n……求你救救我啊。', '', '', '', '', '', '', 47936),
(70614, 'zhCN', '心醉泡粟花', '为瓦德拉肯的阿格里库斯收集$1oa份泡粟花。', '<阿格里库斯向你高声大喊。>我真的没有粟花茶了！\n\n……哦，你不是和他们一伙的。赞美泰坦。有人做了一种“泡粟花茶”，这是本周市场上最风靡的饮品，我的草药已经全部卖光了。在他们成群结队地回来找我之前，你能不能快去采集一些粟花？', '', '', '', '', '', '', 47936),
(70613, 'zhCN', '不给树皮就咬人', '为瓦德拉肯的阿格里库斯收集$1oa张歪扭树皮。', '$p，你是个技艺超群的草药师吧？炼金师都到我的门前跪求了……虽然我连扇门都没有……他们想要更多歪扭树皮。我们的存货几乎售罄了！\n\n你能再帮我收集一些吗？我就担心，如果炼金师做不出想要的瓶剂，他们就要拿我的物品做实验了。', '', '', '', '', '', '', 47936),
(70602, 'zhCN', '历史课：流沙之战', '', '', '', '', '', '', '', '', 47936),
(70595, 'zhCN', '裁缝指名服务', '为工匠商盟完成裁缝制造订单。', '嗨嗨嗨，$p！制造订单东一张西一张，就像雪片一样！\n\n如果你在找活干，工匠商盟总有订单要忙！\n\n你可以查看公开订单，如果你有自己的客户关系，也可以完成公会订单或个人订单！赶快动手干干干！', '', '', '', '', '', '', 47936),
(70594, 'zhCN', '制皮指名服务', '为工匠商盟完成制皮制造订单。', '嗨嗨嗨，$p！制造订单东一张西一张，就像雪片一样！\n\n如果你在找活干，工匠商盟总有订单要忙！\n\n你可以查看公开订单，如果你有自己的客户关系，也可以完成公会订单或个人订单！赶快动手干干干！', '', '', '', '', '', '', 47936),
(70593, 'zhCN', '珠宝加工指名服务', '为工匠商盟完成珠宝加工制造订单。', '嗨嗨嗨，$p！制造订单东一张西一张，就像雪片一样！\n\n如果你在找活干，工匠商盟总有订单要忙！\n\n你可以查看公开订单，如果你有自己的客户关系，也可以完成公会订单或个人订单！赶快动手干干干！', '', '', '', '', '', '', 47936),
(70592, 'zhCN', '铭文指名服务', '为工匠商盟完成铭文制造订单。', '嗨嗨嗨，$p！制造订单东一张西一张，就像雪片一样！\n\n如果你在找活干，工匠商盟总有订单要忙！\n\n你可以查看公开订单，如果你有自己的客户关系，也可以完成公会订单或个人订单！赶快动手干干干！', '', '', '', '', '', '', 47936),
(70591, 'zhCN', '工程学指名服务', '为工匠商盟完成工程学制造订单。', '嗨嗨嗨，$p！制造订单东一张西一张，就像雪片一样！\n\n如果你在找活干，工匠商盟总有订单要忙！\n\n你可以查看公开订单，如果你有自己的客户关系，也可以完成公会订单或个人订单！赶快动手干干干！', '', '', '', '', '', '', 47936),
(70589, 'zhCN', '锻造指名服务', '为工匠商盟完成锻造制造订单。', '嗨嗨嗨，$p！制造订单东一张西一张，就像雪片一样！\n\n如果你在找活干，工匠商盟总有订单要忙！\n\n你可以查看公开订单，如果你有自己的客户关系，也可以完成公会订单或个人订单！赶快动手干干干！', '', '', '', '', '', '', 47936),
(70587, 'zhCN', '背包问题', '为瓦德拉肯的弗拉冯制作$1oa个简单缝制的材料包。', '我当裁缝已经许多年了，$p。如果说我学到了什么，那就是材料总是放不下。事实上，我们确实需要多找几个包来收纳物品。你愿意缝制几个包吗？', '', '', '', '', '', '', 47936),
(70582, 'zhCN', '出师裁缝', '为瓦德拉肯的弗拉冯制作$1oa个荒布卷。', '我当裁缝已经许多年了，$p。如果说我学到了什么，那就是要勤学苦练。\n\n就算你觉得自己已经掌握了一切，也依然要不断磨练功夫。我希望即使没有我把关，你也能缝出上等杰作。\n\n不如这周就来练习一下吧？制作出最高品质的荒布卷。', '', '', '', '', '', '', 47936),
(70569, 'zhCN', '崔斯基特的特别任务', '为瓦德拉肯的塑皮者科鲁兹制作$1oa个草药师的鲜花篮。', '我有不少重要客户，但崔斯基特是我最喜欢的客户之一。最近他把草药包用坏了，所以才来找我。\n\n为了感谢他经常光顾，我提出为他制作几个篮子，替换那个老旧的口袋。\n\n你愿意帮我完成这些任务吗，$p？崔斯基特一定会很感谢你。', '', '', '', '', '', '', 47936),
(70568, 'zhCN', '揭鳞落片', '为瓦德拉肯的塑皮者科鲁兹制作$1oa个开拓者的鳞片护腕。', '我们的鳞片护腕做工精细，需求量十分旺盛。我发现很难跟上所有订单的进度！你能帮我补充一点吗？', '', '', '', '', '', '', 47936),
(70562, 'zhCN', '管道石匠一家亲', '为瓦德拉肯的图鲁拉多米制作$1oa个崩裂之石。', '珠宝匠，想不想趁这个机会练练选矿技巧？\n\n龙鳞探险队的建筑师和管道工请我们挑些石头，好来新建一个澡堂。我觉得这个任务正适合你打发时间，磨练石工。', '', '', '', '', '', '', 47936),
(70560, 'zhCN', '最强工具：优质文件', '为瓦德拉肯的塔伦达拉制作$1oa本核心探险者的纲要。', '我的铭文学徒，今天准备好抄写了吗？龙鳞探险队带来了许多冒险记录，想让我们将这些龙飞凤舞的笔迹抄录下来，汇编成适合野外参照的纲要。我的天啊，我的手今天不太适合做这项任务。我还能再拜托你一次吗？', '', '', '', '', '', '', 47936),
(70559, 'zhCN', '助我一笔之力', '为瓦德拉肯的塔伦达拉制作$1oa根铭文师的紧固羽毛笔。', '我的铭文学徒，很高兴见到你。\n\n今天早些时候来了几个新人。他们想要入门铭文，但书写的时候用力过猛，把羽毛笔尖都折断了！\n\n实在不好意思开口，你方便制作几支羽毛笔，帮我们补足库存吗？', '', '', '', '', '', '', 47936),
(70557, 'zhCN', '鼠目寸光', '为瓦德拉肯的克林基克里克·碎轰制作$1oa个青铜飞焰。', '器材不错。我今天给你准备了一票大活！显然有些放烟花的跟猎人们搭上了道，他们打算燃放烟花惊吓鸭子。虽然鸭子们聪明着呢，但这不妨碍我们赚钱！你觉得你能行吗？', '', '', '', '', '', '', 47936),
(70550, 'zhCN', '欢迎来到集所', '在钴蓝集所内与萨文交谈，看看区域内有哪些能力可用。', '我们需要你的协助。\n\n碎裂之焰已经控制了钴蓝集所的大部分区域。\n\n请帮我们对抗他们，我们虽然人少，但还是有办法援助你的。', '', '', '', '', '', '', 47936),
(70549, 'zhCN', '低垂硕果', '', '', '', '', '', '', '', '', 47936),
(70541, 'zhCN', '狩猎战术：伙伴', '选择在大狩猎中与獒犬或欧胡纳并肩作战。', '你在马鲁克半人马中的名望增长了。你现在可以和坚韧的獒犬或迅捷的欧胡纳伙伴一同狩猎。', '', '', '', '', '', '', 47936),
(70531, 'zhCN', '法力集市', '为瓦德拉肯的康弗拉苟制作$1oa个加气法力药水。', '对法力药水的需求在本周激增，$p。我需要你帮忙完成客户的订单。你这样出色的炼金师，肯定能做几瓶吧？', '', '', '', '', '', '', 47936),
(70510, 'zhCN', '凯歌高奏', '返回瓦德拉肯的创新引擎处。', '我又需要请你将精华带往创新引擎了。', '', '', '', '', '', '', 47936),
(70509, 'zhCN', '提尔的第三个挑战：毅力', '取回缺失的部分，修复破损的雕像。', '<看来随着群岛一同苏醒的生物对守护者提尔的造物并不友好，也许找回雕像的碎片会有所帮助。>', '', '', '', '', '', '', 47936),
(70501, 'zhCN', '狩猎资格证', '完成洪荒狩猎训练任务。', '啊，终于想证明自己有本事成为猎手了吗？记住，这可不是到处乱跑，也不是猎捕所有能跑的东西。席卡尔氏族的狩猎目的明确。狩猎是为了满足氏族的吃穿用度，证明我们有力量对抗强敌，同时让自然恢复平衡。\n\n我们不会让土地因狩猎而荒芜，我们会为未来的洪荒狩猎散播种子。证明你能够遵守这些规则，你就能加入我们。\n\n不过，我对你的那位朋友没有多少信心。', '', '', '', '', '', '', 47936),
(70450, 'zhCN', '不速之獭', '吓走讨厌的奥獭。', '嘿，朋友，这里的奥獭一直在偷我的渔获！\n\n要我说，我早就想把它们轰跑了，但我们的海象人朋友对这种行为不太待见。我做了这个奥獭震慑装置鲨鱼版，但是……我水性不太好。\n\n你好像很有本事，不如就帮我们一个忙。你能不能激活那个装置，到水下游来游去，把它们吓跑？', '', '', '', '', '', '', 47936),
(70446, 'zhCN', '私人历史', '在黑曜观察站与安波莎见面。', '在深入研究这里的档案时，我发现有线索表明黑曜观察站对大地守护者来说是个很重要的地方。只能猜测那里可能有与我们的巨龙军团相关的知识了。\n\n鉴于安波莎对此事很有兴趣，我把我的发现告诉了她。但愿我没做错。\n\n她已经去侦察了。请你盯紧她。她是个能干的兵，但这件事……令人不安。谁也不知道真相是什么样。', '', '', '', '', '', '', 47936),
(70444, 'zhCN', '野性战场', '在野性战场与古尔戈索克见面。', '致最勇敢的席卡尔半人马！\n\n拿出你的全部本事，到野性战场来吧。你将加冕为各大勇士中最凶悍的冠军！\n\n证明你的力量，让我们瞧瞧最精彩的战斗！\n\n适用部分规章条款。', '', '', '', '', '', '', 47936),
(70439, 'zhCN', '狂野奥能', '', '', '', '', '', '', '', '', 47936),
(70438, 'zhCN', '飞鱼在天', '收集鱼，骑乘幼龙从空中将鱼抛下以补充鱼窝。', '鱼应该不止这些，你觉得呢？\n\n知道吗，这让我想到一个主意。传说这里的河流与湖泊并不总是挤满了鱼。他们说，巨龙会从天而过，把鱼抛下来，这样水坑里就有鱼了！你相信吗？\n\n也许你和你的幼龙也能去试试？', '', '', '', '', '', '', 47936),
(70437, 'zhCN', '前往提尔要塞', '在守护巨龙之座与阿莱克丝塔萨见面。', '巨龙军团已经有几个世纪没有造访提尔要塞了。\n\n尽管如此，我们必须前往那里，调查誓言母石是否仍在发挥作用。\n\n来吧，到守护巨龙之座与我详谈，我们必须了解在提尔之前的要塞可能遭遇的危机。', '', '', '', '', '', '在提尔要塞与阿莱克丝塔萨见面。', 47936),
(70436, 'zhCN', '驭龙竞速 - 交错洞窟', '', '', '', '', '', '', '', '', 47936),
(70435, 'zhCN', '驭龙竞速 - 花园休闲赛', '', '', '', '', '', '', '', '', 47936),
(70425, 'zhCN', '驭龙竞速 - 碧蓝林海冲刺', '', '', '', '', '', '', '', '', 47936),
(70420, 'zhCN', '驭龙竞速 - 泽地漫游', '', '', '', '', '', '', '', '', 47936),
(70414, 'zhCN', '摇摆之地', '放置碎裂图腾，释放被困的洞穴之石。', '以卡兹格罗斯之名，这里是怎么了？\n\n这熔岩拥有自己的心智，从下方吞噬了元素洞穴之石。这肯定不是偶然形成的……我得查个明白！\n\n将这些碎裂图腾放在被困住的元素身旁，把它们放出来！', '', '', '', '', '', '', 47936),
(70410, 'zhCN', '驭龙竞速 - 闪霜飞越', '', '', '', '', '', '', '', '', 47936),
(70377, 'zhCN', '时尚不再', '找到太阳镜的主人。', '<这副令人作呕的太阳镜还滴着黏液，但看起来价格不菲。\n\n一定有人在找它。这个款型现在可火了。>', '', '', '', '', '', '', 47936),
(70376, 'zhCN', '提尔的第二个挑战：力量', '在欧恩哈拉平原完成提尔的第二个挑战。', '<在你靠近时，雕像上铭刻的文字亮起了淡淡的微光。>\n\n“运用守护者的力量，展示不折不挠、顽强屹立的决心。”', '', '', '', '', '', '', 47936),
(70374, 'zhCN', '蒙福的希米亚', '击败元素。', '元素自认为拥有这片土地，不欢迎我们的到来。\n\n噢，元素，你们难道忘记了我们的保护者——空气！无形无迹，无所不在，是万千生灵存在的根本！却又如呼吸一般被轻易遗忘。面对我，你们将再也不会忘记。', '', '', '', '', '', '返回提拉凯的长老纳祖翁处。', 47936),
(70373, 'zhCN', '死亡之伊鲁古勒！', '进入跃地者，击败死亡之伊鲁古勒！', '死亡之伊鲁古勒！死亡之伊鲁古勒！死亡之伊鲁古勒 delgrbrrl！！\n\nGrrrooooooooom blarglg！！\n\n<你根本不需要翻译就已经知道，他们想让你干掉鱼人版的死亡之翼。你还没得及表达同意或反对，就传来了一阵机械引擎的咆哮声！>', '', '死亡之伊鲁古勒！死亡之伊鲁古勒！死亡之伊鲁古勒 delgrbrrl！！', '死亡之伊鲁古勒', '', '', '', 47936),
(70371, 'zhCN', '死亡之伊鲁古勒！', '进入跃地者，击败死亡之伊鲁古勒！', '死亡之伊鲁古勒！死亡之伊鲁古勒！死亡之伊鲁古勒 delgrbrrl！！\n\nGrrrooooooooom blarglg！！\n\n<你根本不需要翻译就已经知道，他们想让你干掉鱼人版的死亡之翼。你还没得及表达同意或反对，就传来了一阵机械引擎的咆哮声！>', '', '死亡之伊鲁古勒！死亡之伊鲁古勒！死亡之伊鲁古勒 delgrbrrl！！', '死亡之伊鲁古勒', '', '', '', 47936),
(70363, 'zhCN', '巨龙群岛剥皮', '', '', '', '', '', '', '', '', 47936),
(70362, 'zhCN', '巨龙群岛制皮', '', '', '', '', '', '', '', '', 47936),
(70360, 'zhCN', '巨龙群岛附魔', '', '', '', '', '', '', '', '', 47936),
(70352, 'zhCN', '层层加码', '与托鲁伊基一起消灭龙蛙和地盘中的始祖幼龙。', '嘿，你，外来者！你以前宰过始祖龙吧？\n\n那只要有了你的经验，还有我的狩猎本事，我们肯定能干掉不少！附近的一些泉水引来了许多龙形野兽。\n\n帮助我向那愚蠢的另一半灵魂证明，我才是最棒的猎手。', '', '', '', '', '', '', 47936),
(70351, 'zhCN', '花园聚会', '在红玉新生法池与阿柯拉交谈。', '我照料这处花园已经有许多年了，也一直在为接受焕生使命的时刻做准备。这一天总算来了！\n\n我喜欢花朵、所有的树木和植物，植物上面的虫子也不例外。在我照料花园的时候，我能感受到大自然的灵魂，巨龙之灵的存在。\n\n现在还剩下最后一件事。我要像传说中的那样，召唤巨龙之灵。\n\n<阿柯拉笑得很灿烂>\n\n到花园里来找我，就在她安息的水池边。我会在那里跟你解释。', '', '', '', '', '', '', 47936),
(70341, 'zhCN', '来之不易的胜利', '返回瓦德拉肯的创新引擎处。', '微小之物也能容纳伟大珍宝。\n\n将精华带往创新引擎吧。', '', '', '', '', '', '', 47936),
(70339, 'zhCN', '循迹提尔：欧恩哈拉平原', '在欧恩哈拉平原找到提尔的第二个挑战。', '虽然你在第一个挑战中表现出色，但不要以为其他挑战都能轻易通过。守护者提尔的创新引擎只会对有资格明智运用它的人开放。\n\n如果你并未知难而退，就去欧恩哈拉平原寻找下一个挑战吧。我期待对你的考验，冒险者。', '', '', '', '', '', '在欧恩哈拉平原找到提尔的第二个挑战。', 47936),
(70338, 'zhCN', '她们带走了幼崽', '营救幼崽。', '如果希尔维这么忧心忡忡，那它的幼崽肯定就在里面！\n\n在它被感染的时候，巨人肯定绑架了它的宝宝，而它太虚弱了，没法救出它们！\n\n这个年纪的幼崽总是精力充沛，希望它们身手敏捷，暂时能够躲开巨人……\n\n施展我的隐形法术吧——快，你必须救出它们，否则就要被吃掉了！', '', '', '', '', '', '', 47936),
(70337, 'zhCN', '闪烬哨站', '将欧恩伊尔风铃带往闪烬哨站。', '你好，外来者。\n\n风在向我诉说，有一支队伍正躲藏在闪烬哨站的废墟中。我们半人马选择在欧恩哈拉的赐福下为现在而活，而他们似乎只对昨日感兴趣。\n\n不管怎么样，既然来到了我们的家园，那就是客人。我为他们制作了这些风铃，让他们能够听到欧恩哈拉的存在。希望这能为他们的火炉带去欢乐和舒慰。', '', '', '', '', '', '', 47936),
(70335, 'zhCN', '简易挖掘工具', '', '', '', '', '', '', '', '', 47936),
(70319, 'zhCN', '奈加祖莱', '将一颗奥獭之心、一根石牙兽股骨、一枚角行鸟之鳞和一个秃鹫的砂囊带给森步岗哨的雨触者木库尔。', '我的叔叔给我讲过许多战斗故事，说他和一头名叫奈加祖莱的角行鸟大战一场。他说它长着紫红色的鳞片，会在平原的丘陵之间来回穿梭寻找猎物。它长着锋锐的利爪，撕咬还带有剧毒。\n\n在我外出狩猎的时候，我看到了一闪而过的身影，但已经来不及了。它在我的肩头恶狠狠地咬了一口。它和我叔叔描述得一样凶恶，但我还是活着逃了出来。\n\n我需要清除它留下的感染。求你了，帮我收集这些材料，时间不等人啊。', '', '', '', '', '', '', 47936),
(70279, 'zhCN', '龙血扬威', '消灭卡尔基丹。', '你肯定看到了，这片土地上的许多生物都长到了异常的体型。\n\n我们认为这些野兽是受到了荒野之神的赐福。猎手会将它们视作尊贵的目标，从而证明自己的力量。有一头野兽就在附近，我们叫它卡尔基丹。如果你能放倒它，我一定会对你刮目相看。', '', '', '', '', '', '', 47936),
(70268, 'zhCN', '复活的记忆', '将日记交给维利提斯塔兹。', '你找到了一本部分损毁的日记，似乎是一位黑龙女性在被腐化之前所写的。\n\n虽然后半部分已经无法辨识，但你翻阅着前半部分，在其中看到了一个名字：维利提斯塔兹。', '', '', '', '', '', '将红玉圣殿的日记交给维利提斯塔兹。', 47936),
(70244, 'zhCN', '诺库德的报应', '和尊可汗萨雷丝特一起进入村庄，从诺库德手中夺回村庄。', '几千年来，提莱氏族一直守护着德鲁萨尔之角，这是我们最为神圣的遗物。巴拉卡洗劫了这座村庄，背叛了身为马鲁克半人马的意义。他已经无药可救了。\n\n我们必须在巴拉卡摧毁号角前将它夺回，还有救出一息尚存的提莱半人马。我会亲自和你一同前去，将这个冒牌可汗绳之以法。诺库德氏族将领教尊可汗的盛怒！', '', '', '', '', '', '', 47936),
(70242, 'zhCN', '生生不息', '从红玉新生圣地的特雷莱恩处收集一个失能容器。', '我察觉到他的朋友留有一道深深的伤口。这地方的某些东西使旧创崩裂了——也许它这次能够彻底愈合。\n\n现在该轮到寇尔加尔疗伤了。\n\n你可以在上方的平台里找到我的好友特雷莱恩，他在和附魔师共事。告诉他我需要一个他的容器，他就会免费给你一个。', '', '', '', '', '', '', 47936),
(70241, 'zhCN', '苦涩终局', '将巴索拉斯带到度罗兹和科加尔身边。', '出事了，我——他都睡着了，我就看了眼别处——我们每天都会来到这里，他只想坐在雏龙边上，我不知道他——\n\n<科加尔脸上的泪迹清晰可见，他用手背揉了揉眼睛，神色犹豫。>\n\n不，我就知道，我就知道。但我现在不知道该怎么办，度罗兹一直都知道该怎么办。那我该拿他怎么办？\n\n你能——能不能找到巴索拉斯？', '', '', '', '', '', '', 47936),
(70240, 'zhCN', '苦痛管理', '收集$1oa朵乳白色的金鱼草花，$2oa朵盛放的浅滩百合和一个装满的新生法池之瓶。', '幸好你把他带来了。我知道他现在深陷痛苦，只是他表现得镇定自若。我们都会有这一天的。\n\n恐怕这是年岁问题，而不是疾病所致，但我能尽力帮助他缓解一部分痛苦。\n\n你愿意去附近的花园里收集一些金鱼草花、浅滩百合和纯净水吗？如果你能找到足够多的材料，我就可以调配一种止痛药。', '', '', '', '', '', '', 47936),
(70239, 'zhCN', '难言之隐', '与度罗兹和科加尔同行并寻找帮助。', '度罗兹年事已高，顽疾缠身，还和科多兽一样倔强。他非得登上飞艇来到这里，我能怎么办呢？顶多过来当他的拐棍。\n\n我见过他在痛苦中煎熬的模样，他一直都在掩饰痛楚。他的情况一日不如一日了，你能帮我们给他找位药剂师吗？酒已经不管用了。\n\n麻烦拿着我们的武器，我可以扶着他走。', '', '', '', '', '', '', 47936),
(70236, 'zhCN', '取下的龙眼', '将物品交给艾米莉亚·贝洛克。', '<这也许就是艾米莉亚·贝洛克寻找的东西。>', '', '', '', '', '', '', 47936),
(70229, 'zhCN', '秘术师博库', '在提拉凯找到博库。', '秘术师们几天前被叫去峦水居所了，只有一个留了下来。他名叫博库，就在山丘顶上的欧恩哈拉神龛那儿。\n\n他还只是个新兵，但应该有能力和欧恩哈拉沟通并获取她的赐福了。只要欧恩哈拉站在我们这边，或许就能在战争开始之前就锁定胜局。', '', '', '', '', '', '在提拉凯找到博库。', 47936),
(70221, 'zhCN', '勇气之证', '', '', '', '', '', '', '', '从托马斯·布莱特处获取匠人之勇。', 47936),
(70220, 'zhCN', '树影庇护所', '与守卫队长阿洛文、莎莉欧萨、治愈者西德拉和威拉尼库斯交谈。', '远古林枝的屏障受到了威胁，我们必须通知绿龙军团的其余成员。盖里苏斯和我还有许多事情要谈。\n\n$n，我会在你的身上放置一个标记。其他巨龙只要看到这个标记，就会明白你是我所嘱托的信使。\n\n去吧，集结我的军团，让他们为即将到来的大战做好准备。', '', '', '', '', '', '', 47936),
(70215, 'zhCN', '好奇是关键', '在安东尼达斯营地与迁跃法师黛兰德拉交谈。', '我不太愿意谈论这些符号，这并非因为我不信任你，而是由于这些符号和它们所在的石头性质不明。\n\n对，石头。其实有好几块这样的石头散落在群岛各地。\n\n<迁跃法师黛兰德拉盯着你，眼中闪动着好奇和激动之光。>\n\n你不知道。\n\n好吧，你的毅力和寻找我的决心让我明白了一点：你非常希望了解最近的发现。也许是时候详细讨论一下了。', '', '', '', '', '', '', 47936),
(70212, 'zhCN', '佩努布鲁斯', '', '', '', '', '', '', '', '', 47936),
(70211, 'zhCN', '纷至踏来', '为瓦德拉肯的塑金者库洛科制作$1oa双探险者的板甲长靴。', '探险者还在源源不断地涌向巨龙群岛，我们需要补充探险者的板甲长靴部件。就连宁铁都已经供不需求了，你赶快开工，完事后来找我。', '', '', '', '', '', '', 47936),
(70209, 'zhCN', '嘎嘎乱打', '', '', '', '', '', '', '', '', 47936),
(70207, 'zhCN', '尾巴碎片', '将物品交给艾米莉亚·贝洛克。', '<这也许就是艾米莉亚·贝洛克寻找的东西。>', '', '', '', '', '', '', 47936),
(70204, 'zhCN', '金爪', '将物品交给艾米莉亚·贝洛克。', '<这也许就是艾米莉亚·贝洛克寻找的东西。>', '', '', '', '', '', '', 47936),
(70203, 'zhCN', '捉放鱼：时光龙头鱼', '', '', '', '', '', '', '', '', 47936),
(70202, 'zhCN', '捉放鱼：天蓝刺皮鱼', '', '', '', '', '', '', '', '', 47936),
(70201, 'zhCN', '捉放鱼：副翼海蛾鱼', '', '', '', '', '', '', '', '', 47936),
(70200, 'zhCN', '捉放鱼：千噬水虎鱼', '', '', '', '', '', '', '', '', 47936),
(70199, 'zhCN', '捉放鱼：鳞腹鲭鱼', '', '', '', '', '', '', '', '', 47936),
(70198, 'zhCN', '群岛的召唤', '在杜隆塔尔与娜蕾迪亚·流光见面。', '我们的盟友已经在杜隆塔尔集结完毕，激动人心的时刻到了！\n\n和我们一起出发，$n！是时候航向巨龙群岛了！', '', '', '', '', '', '', 47936),
(70197, 'zhCN', '群岛的召唤', '在暴风城港口与托蒂·晶须见面。', '准备好来一场千载难逢的冒险了吗？我肯定是准备好了！\n\n我们的盟友已经集结完毕，补给也都堆满船舱了。你还在等什么呢？\n\n到暴风城港口来找我吧，是时候航向巨龙群岛了！', '', '', '', '', '', '', 47936),
(70196, 'zhCN', '整修禁猎区', '', '', '', '', '', '', '', '', 47936),
(70195, 'zhCN', '闪电强夺', '营救阿尔坦，并寻找和外来者相关的线索。', '根据报告，诺库德身旁有一个外来者，他操弄着我们从未见过的魔法，如风暴一般撕碎了我们的队伍。\n\n如果诺库德的盟友能造成这种破坏，我们就必须尽量探明他们的底细。\n\n我已经派我的欧胡纳阿尔坦前去搜寻这名外来者了。她到现在还没回来，我有点担心了，$n。你能去寻找外来者的踪迹，再看看我的阿尔坦有何遭遇吗？', '', '', '', '', '', '', 47936),
(70194, 'zhCN', '专精秘密：裁缝', '', '', '', '', '', '', '', '', 47936),
(70193, 'zhCN', '专精秘密：剥皮', '', '', '', '', '', '', '', '', 47936),
(70192, 'zhCN', '专精秘密：采矿', '', '', '', '', '', '', '', '', 47936),
(70191, 'zhCN', '专精秘密：制皮', '', '', '', '', '', '', '', '', 47936),
(70190, 'zhCN', '专精秘密：草药学', '', '', '', '', '', '', '', '', 47936),
(70189, 'zhCN', '专精秘密：珠宝加工', '', '', '', '', '', '', '', '', 47936),
(70188, 'zhCN', '专精秘密：铭文', '', '', '', '', '', '', '', '', 47936),
(70187, 'zhCN', '专精秘密：工程学', '', '', '', '', '', '', '', '', 47936),
(70186, 'zhCN', '专精秘密：附魔', '', '', '', '', '', '', '', '', 47936),
(70185, 'zhCN', '神奇野兽在哪里', '寻找并消灭野兽，将证明带给斥候托木尔。', '<你在泥土中发现了一处巨大的爪印。环顾四周，附近的生物并不长有利爪，体型也相去甚远。\n\n如果你能捕获这头巨兽，半人马肯定会对你刮目相看。>', '', '', '', '', '', '将孔胡拉尔的毛皮带给斥候托木尔。', 47936),
(70184, 'zhCN', '专精秘密：锻造', '', '', '', '', '', '', '', '', 47936),
(70183, 'zhCN', '专精秘密：炼金术', '', '', '', '', '', '', '', '', 47936),
(70182, 'zhCN', '胜利的滋味', '返回瓦德拉肯的创新引擎处。', '微小的事物中隐含着磅礴的潜力。瓶装精华或许轻如鸿毛，但它蕴藏着伟岸之力。\n\n带它到创新引擎处吧。', '', '', '', '', '', '', 47936),
(70181, 'zhCN', '提尔的第一个挑战：灵巧', '在碧蓝林海完成提尔的第一个挑战。', '<在你靠近时，雕像上铭刻的文字发出了淡淡的微光。>\n\n“运用守护者的力量，承载它的光芒，为我们开创更好的未来。”', '', '', '', '', '', '', 47936),
(70180, 'zhCN', '弹射起步？起！', '帮助格雷基克启动神秘装置。', '城里有人说，这个设备是传奇泰坦守护者提尔创造出来的。\n\n问题是我们没法让它运转起来！我们尝试了所有常用的法子，拆解、回转，还稍微通了通电。除了通电，别的一点用途都没有。其实……我有一个好主意。\n\n看到那边的旋翼机了吗？你跳进去，我们也许就能给这个泰坦玩意儿一点……刺激。', '', '', '', '', '', '', 47936),
(70179, 'zhCN', '一石两用', '从本地的土元素处获取建筑材料。', '幸会，冒险者！你看起来很有本事，能不能帮我一个小忙？\n\n阿兹克拉和我负责打理这座塔楼，它现在正处于“激动人心的装修前状态”。问题是，每当我们开始修理，本地的土元素就会攻击我们！\n\n于是我想，“泽弗伦，不如解决掉这些土元素，顺便再弄点建筑材料来？”这就要靠你了！你愿意帮忙吗？', '', '', '', '', '', '', 47936),
(70174, 'zhCN', '席卡尔', '觐见珊索克可汗。', '珊索克可汗是氏族里最出色的猎手。虽然她听不见，但她一次又一次地证明了自己是无与伦比的猎手与领袖。\n\n她是我们所有人的导师，一位值得信赖的领袖，也是马鲁克半人马的悍勇卫士。\n\n你能向她献言已是一份殊荣。', '', '', '', '', '', '', 47936),
(70171, 'zhCN', '微小意外的幸福', '寻找哈德森的最后一幅作品。', '<兰皮亚塔的眼眶湿润了。>\n\n因为我？我就是他失去灵感的原因？\n\n他说他爱我，但是……你也听到了无法作画让他多么沮丧。\n\n我只希望能对他好。如果我就是原因……我愿意离开。\n\n他还扔掉了最后一幅作品。他想要画完这最后一幅作品，最终还是放弃了。\n\n我不忍心让它遗落在荒野中，就把它藏在了家里。请你……带给他……就当作是纪念。', '', '', '', '', '', '', 47936),
(70170, 'zhCN', '痛击心魔', '从注能大厅、艾杰斯亚学院、碧蓝魔馆和奈萨鲁斯地下城的最终首领处找回哈德森遗落的作品。', '他会可能会很固执，我比较担心这点。\n\n但不能放弃，我们只要再试一次！\n\n还有许多被他丢弃的画作遗落在外，那些作品都落在了更危险的地方，希望你准备好迎接挑战了！', '', '', '', '', '', '', 47936),
(70169, 'zhCN', '天下何人不结伴', '与劳弗罗斯交谈。', '我知道，你和兰只是想帮上我。\n\n我觉得我已经无可救药了，灵感的火花——创作的意愿——早就……熄灭了。\n\n但兰是对的，我欠你这份情，我会尽力一试。\n\n把你那位初出茅庐的艺术家朋友介绍给我吧。', '', '', '', '', '', '', 47936),
(70168, 'zhCN', '微小意外的悲伤', '从红玉新生法池、诺库德阻击战和蕨皮山谷地下城的最终首领处找回哈德森遗落的作品。', '让你远道而来……真是对不住。\n\n我亲爱的哈德森以前很热爱绘画，那简直就是他的生命啊！我不知道是什么让他这样抵触。\n\n几周前，他结束写生回来，随后在盛怒中丢弃了所有的作品。\n\n旅行者，如果你不介意的话……能请你找回那些画作吗？它们也许能帮他找回急需的灵感。\n\n哈德森不畏艰险，只求能找到最美的风光。希望你也准备好了。', '', '', '', '', '', '', 47936),
(70166, 'zhCN', '涂绘之乐', '将劳弗罗斯的介绍画交给哈德森。', '你喜欢我的收藏吗？这些都是举世无双的画家哈德森笔下的杰作。\n\n他的画作存世稀少，价值连城。哈德森总是避世而居，很久都没有画过新的作品了。啊，可我真想见见他……能再请教一下就更好了！\n\n你……看起来胆子比较大。你能代我找到他吗？给——给你！带上我的作品吧，希望能给他留个好印象！\n\n也可能让他觉得一塌糊涂……天啊。', '', '', '', '', '', '', 47936),
(70164, 'zhCN', '修补良机', '与新生宝库废墟的时光术师弗希尔达和西布里特·噼页交谈。', '$p，方便留步吗？我好像就要取得突破了！\n\n在育幼所倒塌之后，我失去了战斗能力，还失去了龙希尔的身份。也许你能理解。\n\n我一直就喜欢把东西拼好再拆开，所以探险队看上去是个很适合的去处。但这件神器让我有点头疼。\n\n你能不能让弗希尔达和西布里特看看我写的笔记？我想证明自己是个能干的修补匠。这不仅是向他们证明……也是给自己一个交代。', '', '', '', '', '', '', 47936),
(70163, 'zhCN', '交错洞窟 - 进阶版', '滑翔穿过光圈。', '飞过标记赛道的检查点光圈。', '', '', '', '', '', '', 47936),
(70161, 'zhCN', '交错洞窟', '滑翔穿过光圈。', '飞过标记赛道的检查点光圈。', '', '', '', '', '', '', 47936),
(70159, 'zhCN', '家的滋味', '问问周围龙鳞先遣营地的部落成员，看看他们能否借给你所需食材。', '噢，总算来了！又一个愿意帮忙的龙希尔。\n\n我和我的兄弟想要烹煮一点口粮，但是……\n\n<斯卡拉雷什向周围的环境比划着手势。>\n\n这里的一切都大不相同，根本找不到以前用来烹饪的食材。\n\n但我们可以适应环境。去找部落问问，有没有能够替代蔬菜、蛋白质和乳液的东西。接下来我们就能用餐了。', '', '', '', '', '', '', 47936),
(70158, 'zhCN', '花园休闲赛 - 进阶版', '滑翔穿过光圈。', '飞过标记赛道的检查点光圈。', '', '', '', '', '', '', 47936),
(70157, 'zhCN', '花园休闲赛', '滑翔穿过光圈。', '飞过标记赛道的检查点光圈。', '', '', '', '', '', '', 47936),
(70156, 'zhCN', '远古觉醒', '强化界门。', '我身后就是界门。我们并不知道这容器上逐渐消散的魔法还有多久就会完全消失，甚至于崩解，这就更糟了。\n\n释放出的动荡能量可能会造成灾难。\n\n我们继续吗？', '', '', '', '', '', '', 47936),
(70155, 'zhCN', '一观二听三呼吸', '和斯雷希拉克一起钓鱼。', '你好，$r。很少有人过来打招呼，坐下来的就更少了。大部分人都是匆匆忙忙地赶往下一个目的地。\n\n你愿意陪我钓会儿鱼吗？', '', '', '', '', '', '', 47936),
(70154, 'zhCN', '通向未知的界门', '跟随迁跃法师黛兰德拉前往界门的位置。', '附魔可以保护我们，抵御内部不稳定的能量的影响。\n\n我会打开前往最近一块石头的道路。\n\n等你通过之后也别走远，等我们都到了，我还需要你帮忙为设备充能。', '', '', '', '', '', '', 47936),
(70148, 'zhCN', '迷途浪人', '在翼眠大使馆寻找爪兵艾瑟希。', '我能占用你一点时间吗？\n\n我很担心另一个路过这里的龙希尔。他向我们提出了许多问题，但似乎……对回答不太满意。\n\n他说自己是“爪兵艾瑟希”。他在你们的队伍里应该军阶不高吧？\n\n我觉得他可能需要帮手，你能帮我维护平安吗？\n\n我看到他在那边和寇玛尔交谈。', '', '', '', '', '', '', 47936),
(70139, 'zhCN', '条条大路结界挡', '评估提尔要塞水库的结界石受到的损伤。', '水库以前由提尔布设的三块结界石保护着。\n\n它们的用途是稳定巨龙群岛随处可见的元素魔法。\n\n在你唤醒我的时候，我察觉到西侧的结界已经受损。恐怕所有结界石都已遭拜荒者毒手。\n\n然而，为了明确下一步的行动，我们必须先评估目前的损害。', '', '', '', '', '', '', 47936),
(70136, 'zhCN', '无暇思痛', '在索德拉苏斯的起伏森林中取回时光旅行者法杖和时光旅行者笔记，并消灭疯狂的熊群头领。', '呃……让我缓一缓……\n\n我的第一个任务……不稳定的时间能量渗入了森林……影响到了野生动物……需要评估影响状况，为时光旅行者收集魔法……\n\n<赛拉摇了一会儿脑袋。>\n\n我当时在检查一群龙麒的情况，突然被一头满溢时间魔法的疯熊袭击了。我根本没有防备，好不容易才捡回一条命。\n\n你能帮我找到丢失的装备吗，$c？呃，你也许还得解决掉那头熊。', '', '', '', '', '', '', 47936),
(70135, 'zhCN', '侵蚀元素', '在翼眠大使馆消灭$1oa个原始元素。', '龙鳞探险队的手艺人、工匠和探险家装备欠佳，无法应对激烈的战斗。\n\n但我们可不一样，$p。\n\n在巨龙群岛，我们将发挥自己的力量，保护那些无力自保的人。\n\n去清除盘踞在北方的元素，让探险队能够全心投入到高贵的求索事业中。', '', '', '', '', '', '', 47936),
(70134, 'zhCN', '回忆', '取回维利提斯塔兹的时间胶囊。', '感谢你聆听我的故事，年轻人。我有一个不情之请。\n\n别担心，你不用再听故事了。\n\n我们离开这里的时候，我留下了一个……时间胶囊。能不能……能不能请你帮忙把它取回来？我记得它就在红玉新生圣地底部的一根柱子后面。\n\n我用印记把它藏了起来，只要你激活它，就能看到我的时间胶囊了。', '', '', '', '', '', '', 47936),
(70132, 'zhCN', '英雄留步', '坐一会儿，看看风景。', '<年迈的矮人眉头紧锁，遥望着大好风光，没有对你的到来做出任何反应。眼前的景色美不胜收，你或许应该驻足歇息，欣赏风景。>', '', '', '', '', '', '', 47936),
(70129, 'zhCN', '恶心的堵趾', '帮助罗威消灭恶心的堵趾。', '你说得对，我没有足够的力量……没法独自对付这只雪人！\n\n但有你在啊！\n\n那个恶毒的雪人叫恶心的堵趾，它的巢穴就在前面。那个洞穴挺……大的，但不吓人！也许有一点点吓人。\n\n你能不能去让它消停一点？我……我马上就到！', '', '', '', '', '', '', 47936),
(70126, 'zhCN', '画龙点睛', '说服米格尔的客户将未来的制造订单交托给他。', '啊，$p，真高兴见到你。\n\n你给工匠商盟，也给托马斯和我帮了大忙了。谢谢你。\n\n身为匠人，你还需要掌握一项技巧，那就是要和客户拉近距离。\n\n我今天为一名客户完成了制造订单，你能替我去和他聊聊吗？尽量说服他以后有需要的时候还来找我，也提醒一下他，如果想要质量上乘的东西，可以私下联系我。', '', '', '', '', '', '', 47936),
(70125, 'zhCN', '拉希奥呢？', '询问森德拉克斯巨龙预计何时抵达。', '嗯，拉希奥此刻在哪儿？\n\n他说他会在这里等我们，另外还会有一位巨龙的女王，阿莱克丝塔萨，生命的缚誓者派遣的大使。\n\n巨龙应该不会背弃承诺。\n\n好吧！至少这位热心的龙人是来迎接我们的。你去问问其他人什么时候到？', '', '', '', '', '', '', 47936),
(70124, 'zhCN', '练手材料', '收集$1oa片原始始祖雏龙之鳞。', '这里的始祖龙和我以前见过的都不一样。\n\n它们的鳞片生来就能抵抗烈火，比钢铁更强韧，并且没有丧失弹性。真不可思议。\n\n我的工匠正嚷嚷个不停，他们都想弄到这样的龙鳞。\n\n就先从龙崽开始吧。小鳞片比较柔软，我们能先用它们锻炼技术。', '', '', '', '', '', '在翼眠大使馆与塞林·暗砧见面。', 47936),
(70123, 'zhCN', '原始龙害', '在狂野海滩消灭$1oa条原始始祖幼龙。', '<阿苏拉泰疑心重重地瞥了一眼身后山脊上潜伏的始祖龙。>\n\n我发誓，只要我转过身，这些始祖龙就会朝营地挪一步……\n\n这不是拉希奥邀请我们前来结交的巨龙。\n\n始祖龙是残忍无情的掠食者，并非通情达理之辈，我们只能以无情的攻击作为回敬。\n\n削减它们的数量，让它们收起野心，否则探险还没开始就要覆灭了。', '', '', '', '', '', '在翼眠大使馆与鳞长阿苏拉泰见面。', 47936),
(70122, 'zhCN', '探险者遇险', '在狂野海滩营救3名龙鳞探险队成员。', '别把探险队的学术求索精神当做是软弱，$p。\n\n我们不是躲在偏远塔楼里钻研书本的隐士。\n\n我们是冒险者，我们会前往艾泽拉斯的每个角落，亲自猎取知识！\n\n对冒险的这份热情有时会让我们走上危险的路途，有几名探险队成员也惹上了自己应付不了的麻烦……\n\n但是嘛，有危险才有乐趣啊！', '', '', '', '', '', '在翼眠大使馆与托蒂·晶须见面。', 47936),
(70100, 'zhCN', '碧蓝林海编目', '', '', '', '', '', '', '', '', 47936),
(70074, 'zhCN', '掠夺碎焰', '', '', '', '', '', '', '', '', 47936),
(70070, 'zhCN', '鸭子的大英雄', '找到鸣火鸭，确保它回到格拉库斯身边。', '等一等……不太对劲……\n\n<格拉库斯环顾四周。>\n\n鸣火鸭！那家伙肯定又沿着河漂下去了！不管我唠叨多少次，它就是想要和龙蛙玩耍！\n\n请你去看看它。希望它别又被吞了。', '', '', '', '', '', '将你的见闻告知格拉库斯。', 47936),
(70069, 'zhCN', '再任弼鸭温', '喂养$1oa只小鸭子，随后返回格拉库斯处。', '我已时日无多……但职责未尽。\n\n鸭群应该就在河边。我把它们留在那里，希望它们能学会独立。很快它们就必须保护自己了。\n\n今天它们还可以依靠你。请把你找到的食物带给它们，然后把小鸭子接回来。看着点飞行员，它总是喜欢乱跳。', '', '', '', '', '', '', 47936),
(70062, 'zhCN', '先做捕虫人', '收集$1oa个飞裔甲虫部位。', '啊，年轻的$r，我需要你的帮助。我已经在这里抚育了数代生命。\n\n我最喜欢的还是这些小鸭子。虽然我年事已高，身体衰弱……但循环更迭不会为我停歇。\n\n我需要你为我的小鸭子取一些食物来。', '', '', '', '', '', '', 47936),
(70061, 'zhCN', '羽翼训练', '指导一条雏龙，消灭$2oa个焦躁的小草，$3oa个入侵的幼崽钉刺者和$4oa个无情强风。', '巨龙离开群岛的时日太漫长了，$p。实话实说……我们的一些能力代代相传，最终没落了。\n\n这些雏龙应该学得很快，但你肯定会忙着跟它们斗嘴。\n\n哎呀。\n\n我知道就连管理者瑟利斯特拉都愿意把关键任务托付给你。你能不能帮我们一把，帮扶一下哪条雏龙？', '', '', '', '', '', '', 47936),
(70060, 'zhCN', '学院爬升赛 - 进阶版', '滑翔穿过光圈。', '飞过标记赛道的检查点光圈。', '', '', '', '', '', '', 47936),
(70059, 'zhCN', '学院爬升赛', '滑翔穿过光圈。', '飞过标记赛道的检查点光圈。', '', '', '', '', '', '', 47936),
(70058, 'zhCN', '好友待修', '在红玉新生圣地附近收集$1oa根柔软的红玉羽毛，$2oa份布料碎块，以及$3oa个玻璃念珠，帮助修复欢乐鸭。', '在我们四处飞行的时候，欢乐鸭受伤了……本来好好的，然后我……我撞上了一棵树\n\n<莉莉斯塔萨指着头顶上损坏的毛绒鸭鸭。>\n\n他的衬料都掉出来了！羽毛都折断了！有一只眼睛也不见了！不！\n\n你能修好欢乐鸭吗？', '', '', '', '', '', '', 47936),
(70057, 'zhCN', '塔拉赛盗贼', '', '', '', '', '', '', '', '', 47936),
(70052, 'zhCN', '山崖环道 - 进阶版', '滑翔穿过光圈。', '飞过标记赛道的检查点光圈。', '', '', '', '', '', '', 47936),
(70051, 'zhCN', '山崖环道', '滑翔穿过光圈。', '飞过标记赛道的检查点光圈。', '', '', '', '', '', '', 47936),
(70042, 'zhCN', '机遇无处不在', '为潜行者维西获取几件物品。', '你吓死我啦，还以为我要被抢啦！\n\n你瞧瞧这些打算征服巨龙群岛的勇敢冒险者……包里塞满了工具和装备。\n\n我们要在这里发财啦！\n\n去看看你能不能弄几件过来，利润我会分你一份。', '', '', '', '', '', '', 47936),
(70041, 'zhCN', '噬雷之龙的狂怒', '骑乘卡德加的飞碟，抵挡拜荒者大军。', '莱萨杰丝企图撕裂高塔中的奥术魔法，将它彻底夷为平地！\n\n卡雷苟斯正在全力阻止她，而我正在施展魔法补充魔网能量。\n\n我们恐怕成不了太久。就在说话的当口，更多拜荒者正在赶来这里，企图压垮我们！\n\n带上我改造的奥术圆碟，挡住汹涌而来的拜荒者……期盼能有奇迹降临。', '', '', '', '', '', '在瓦克索斯脚下与卡雷苟斯交谈。', 47936),
(70040, 'zhCN', '坠越时间', '集结你的盟友，随后与诺兹多姆交谈。', '当青铜龙和永恒龙的魔法交汇碰撞，克罗诺姆和伊特努丝就不受控制地落入了崩塌的时间中。\n\n她们越坠越远，撕裂了时间的丝缕，在时空中激荡起无数涟漪。我们必须找到她们，把她们带回来，那样才能阻止产生进一步的损害。你得想办法阻止克罗诺姆继续坠落。\n\n我恳请你集结盟友，拯救克罗诺姆。我需要一点时间，才能专注于她的魔法。', '', '', '', '', '', '集结你的盟友，随后与诺兹多姆交谈。', 47936),
(70034, 'zhCN', '工匠补给：蝾螈之鳞', '将3份蝾螈之鳞交给红玉新生圣地的海菲斯塔。', '你在找活干吗，剥皮工？工匠商盟请我为他们的客户采集一些蝾螈的鳞片。\n\n我可是个工匠，不是给人跑腿的！\n\n但是……啊，你也许能找些鳞片来？', '', '', '', '', '', '将3份蝾螈之鳞交给红玉新生圣地的海菲斯塔。', 47936),
(70033, 'zhCN', '工匠补给：先锋的皮革靴子', '将先锋的皮革靴子交给红玉新生圣地的海菲斯塔。', '你在找活干吗，皮匠？工匠商盟请我为他们的客户制作几双靴子。\n\n他们显然不知道我有多受欢迎。你知道今天有多少探险者过来跟我抱怨吗？都说自己的鞋子上全是破洞。\n\n如果你有时间，那就量量尺码吧。也许对你来说，这个工匠商盟是一个不错的商机。', '', '', '', '', '', '将先锋的皮革靴子交给红玉新生圣地的海菲斯塔。', 47936),
(70032, 'zhCN', '工匠补给：珠宝匠的镜片', '将裂痕玛瑙放大镜交给红玉新生圣地的海菲斯塔。', '你在找活干吗，珠宝匠？工匠商盟请我为他们的客户制作几副镜片。\n\n要我干！我哪有工夫啊！\n\n你应该能代劳吧？', '', '', '', '', '', '将裂痕玛瑙放大镜交给红玉新生圣地的海菲斯塔。', 47936),
(70031, 'zhCN', '工匠补给：大厨的光滑擀面杖', '将一根大厨的光滑擀面杖交给红玉新生圣地的海菲斯塔。', '你在找工作吗，铭文师？\n\n我收到了一个叫工匠商盟的企业发来的订单。\n\n这个任务好像很简单，你这样的学徒工匠都能干。', '', '', '', '', '', '将一根大厨的光滑擀面杖交给红玉新生圣地的海菲斯塔。', 47936),
(70030, 'zhCN', '工匠补给：质量保证光学眼镜', '将一副质量保证光学眼镜交给红玉新生圣地的海菲斯塔。', '啊，一个工程师！来得正好。\n\n我还忙着搞定结构图呢，结果有个高个子的女士找我制作一副光学眼镜。\n\n你肯定知道该怎么做吧？\n\n等你做好了眼镜，把它带到红玉新生圣地去。那女士说自己是什么工匠商盟的。', '', '', '', '', '', '将一副质量保证光学眼镜交给红玉新生圣地的海菲斯塔。', 47936),
(70029, 'zhCN', '工匠补给：符文宁铁棒', '将$1oa根符文宁铁棒交给红玉新生圣地的海菲斯塔。', '你好像通晓魔法，附魔师。愿意帮我完成一份订单吗？\n\n工匠商盟的一位客户想要使用宁铁制作魔棒，但符文附魔并不是我的强项。\n\n如果你愿意的话，红玉新生圣地的海菲斯塔会为你的心血和投入支付酬劳！', '', '', '', '', '', '', 47936),
(70028, 'zhCN', '工匠补给：盐层', '将$1oa份盐层交给红玉新生圣地的海菲斯塔。', '你想要给自己找份活干吗，矿工？\n\n我之前跟海菲斯塔聊过，她说工匠商盟要为客户准备一批盐。\n\n现在我得自己动手了，可是，嘿，我不想做。\n\n要不你做个好人，给他们弄点儿盐来，成吗？', '', '', '', '', '', '将$1oa份盐层交给红玉新生圣地的海菲斯塔。', 47936),
(70027, 'zhCN', '工匠补给：勘探员的布质腕带', '将勘探员的布质腕带交给红玉新生圣地的海菲斯塔。', '你在找活干吗，裁缝？工匠商盟请我为他们的客户制作一些腕带。\n\n那些探险家对我们的织物感兴趣，我当然十分感谢，但我没空应付这些需求。\n\n也许你有兴趣接手这个活？', '', '', '', '', '', '将勘探员的布质腕带交给红玉新生圣地的海菲斯塔。', 47936),
(70026, 'zhCN', '工匠补给：熔火甲虫', '将$1oa只熔火甲虫交给红玉新生圣地的海菲斯塔。', '你在找活干吗，草药师？工匠商盟请我为他们的客户收集几只甲虫。\n\n这片土地十分富饶，但还没富饶到出门走几步就能满足需求的地步。\n\n但如果你要出去冒险，也许能在路上顺便捉几只甲虫？', '', '', '', '', '', '将$1oa只熔火甲虫交给红玉新生圣地的海菲斯塔。', 47936),
(70025, 'zhCN', '工匠补给：龙银镰刀', '将一把龙银镰刀交给红玉新生圣地的海菲斯塔。', '你看起来像个无业人士，在找工作吗？\n\n我这里有一份制造订单，要为工匠商盟制作一把龙银镰刀。我可以轻松搞定，但作为学徒，我觉得更应该让你来试试手。\n\n把镰刀锻出来，然后带到红玉新生圣地去，一个叫海菲斯塔的德莱尼会付你钱的。', '', '', '', '', '', '将一把龙银镰刀交给红玉新生圣地的海菲斯塔。', 47936),
(70012, 'zhCN', '保护渔网！', '', '', '', '', '', '', '', '', 47936),
(69992, 'zhCN', '风暴印记', '将风暴印记交给杜隆塔尔的风暴猎手苏赫拉卡。', '<通晓魔法的人可能会有兴趣研究这个发现。>', '', '', '', '', '', '将风暴印记交给杜隆塔尔的风暴猎手苏赫拉卡。', 47936),
(69987, 'zhCN', '野性战场复刻：沼泽惊魂魔！', '', '', '', '', '', '', '', '', 47936);
INSERT INTO `quest_template_locale` (`ID`, `locale`, `LogTitle`, `LogDescription`, `QuestDescription`, `AreaDescription`, `PortraitGiverText`, `PortraitGiverName`, `PortraitTurnInText`, `PortraitTurnInName`, `QuestCompletionLog`, `VerifiedBuild`) VALUES
(69984, 'zhCN', '金箍龙牙', '将物品交给艾克萨德里亚。', '<你发现了陨落巨龙的残存之物，艾克萨德里亚也许想要看看这个。>', '', '', '', '', '', '', 47936),
(69983, 'zhCN', '焰刻之骨', '将物品交给利爪猎手卡薇亚。', '<神秘古怪的贾拉丁符文刻写在白骨之中。利爪猎手卡薇亚也许想要看看这个。>', '', '', '', '', '', '', 47936),
(69981, 'zhCN', '客户满意度', '向工匠商盟的客户询问他们对再造订单是否满意。', '嘿，$c，有没有一种想要帮忙的冲动？\n\n我们最看重的几位客户通过工匠商盟发来了再造订单，但后来就没了消息。\n\n如果你刚好碰到他们，能不能帮帮忙了解下他们对货品满意吗？一定要让客户乐乐乐！', '', '', '', '', '', '将装备交给剪河交汇口的玛赫拉·折树。', 47936),
(69979, 'zhCN', '相配的狩猎', '消灭千里，荒古雄鹿。', '智慧得来不易，应当努力争取。如果你希望证明自己的价值，就要像我的人民一样行事，学习我们的所作所为。\n\n寻找并狩猎千里，荒古雄鹿，它已经逃脱了数代人的追猎。\n\n你将由此获得渴求的智慧。', '', '千里，荒古雄鹿躲过了数代猎人的追捕，也许你真有机会擒获这头野兽。', '千里', '', '', '', 47936),
(69975, 'zhCN', '妮拉·火祸', '', '', '', '', '', '', '', '', 47936),
(69974, 'zhCN', '皮普斯巴克·雷裂', '', '', '', '', '', '', '', '', 47936),
(69973, 'zhCN', '鲁恩·冰风', '', '', '', '', '', '', '', '', 47936),
(69972, 'zhCN', '祖加兹·破核', '', '', '', '', '', '', '', '', 47936),
(69971, 'zhCN', '冰刃三人组', '', '', '', '', '', '', '', '', 47936),
(69970, 'zhCN', '凯恩·火印', '', '', '', '', '', '', '', '', 47936),
(69969, 'zhCN', '沃拉兹卡', '', '', '', '', '', '', '', '', 47936),
(69968, 'zhCN', '普罗泽拉·风击', '', '', '', '', '', '', '', '', 47936),
(69967, 'zhCN', '哨兵莫德伦', '', '', '', '', '', '', '', '', 47936),
(69965, 'zhCN', '质量保证', '使用附近的晶簇，为工匠商盟检验海菲斯塔的工具。', '你在找工作吗，$c？\n\n我代表一家新成立的商贸公司，工匠商盟。公司会通过制造订单系统，把工匠和客户凑到一块儿。\n\n龙鳞探险队下了单，要制作一些附魔的采矿工具。工具都已经做好了，但在完成订单之前，我们得先检验一下。\n\n当然，我们会为你准备酬劳的。', '', '', '', '', '', '', 47936),
(69964, 'zhCN', '恶岩元素', '', '', '', '', '', '', '', '', 47936),
(69963, 'zhCN', '远古保卫者', '', '', '', '', '', '', '', '', 47936),
(69962, 'zhCN', '腐化的始祖龙', '', '', '', '', '', '', '', '', 47936),
(69961, 'zhCN', '弗洛基昂', '', '', '', '', '', '', '', '', 47936),
(69960, 'zhCN', '格拉弗里昂', '', '', '', '', '', '', '', '', 47936),
(69959, 'zhCN', '盖尔基昂', '', '', '', '', '', '', '', '', 47936),
(69957, 'zhCN', '提尔要塞试炼', '滑翔穿过光圈。', '飞过标记赛道的检查点光圈。', '', '', '', '', '', '', 47936),
(69956, 'zhCN', '灰石', '', '', '', '', '', '', '', '', 47936),
(69955, 'zhCN', '恩布拉基昂', '', '', '', '', '', '', '', '', 47936),
(69954, 'zhCN', '因菲纳姆', '', '', '', '', '', '', '', '', 47936),
(69953, 'zhCN', '卡兰土恩', '', '', '', '', '', '', '', '', 47936),
(69952, 'zhCN', '克里斯塔路斯', '', '', '', '', '', '', '', '', 47936),
(69951, 'zhCN', '波德隆', '', '', '', '', '', '', '', '', 47936),
(69946, 'zhCN', '工艺大师', '寻找卡丁大师，请教专业智慧。', '在穿越这片平原的时候，我在北边的一个洞穴里遇到了一位年迈的半人马，似乎已经掌握了非凡的技艺，愿意将知识传授他人。\n\n这位半人马也帮助我理解了从巨龙群岛获取的知识。\n\n如果你希望在专业中有所精通，就该去探求这位大师的智慧。其人名叫卡丁，属于提莱氏族。', '', '', '', '', '', '与卡丁的洞穴中的卡丁交谈。', 47936),
(69938, 'zhCN', '垂钓热！', '', '', '', '', '', '', '', '', 47936),
(69936, 'zhCN', '破坏主谋赞布尔', '击败监督者赞布尔。', '很好，那些亵渎者不能再继续逼迫我们的先祖为他们作战了。但是我们还要解决那个发号施令的狂徒。\n\n那就是他们的监督者赞布尔，必须想办法阻止他。\n\n去干掉他。', '', '', '监督者赞布尔', '', '', '', 47936),
(69934, 'zhCN', '豆腐心肠', '交付医疗物资。', '药水准备好了，现在该送去了。\n\n将一个箱子送到下方河谷中的小洞穴里。虽然不会有人在那里收货，但放心好了，它肯定会得到妥善的利用。\n\n把另一个箱子送到格利基尔岗哨的医护站去，有个老朋友正在那里照看病患。\n\n我……我明白这不是你的义务，也不是我的。但你确实发挥了惊人的作用，这些药物能拯救许多性命啊。', '', '', '', '', '', '', 47936),
(69933, 'zhCN', '好奇的代价', '割断难除的藤蔓。', '你看看河谷对面，$r。拜荒者几天前袭击了格利基尔岗哨，战火仍在肆虐。\n\n那里的人需要药膏和针线。我可以给他们准备一些，但材料已经快见底了。既然你不告而来，那肯定会自愿帮忙吧。\n\n到我的花园里去，找到最大的一条藤蔓，把它连根折断后带给我。', '', '', '重步鞭笞者', '', '', '', 47936),
(69932, 'zhCN', '生命宝贵', '收集材料以更换小急流的敷料。', '给格利基尔制作药剂意味着我无暇其它事务了。\n\n有一只鸭子落在了我的花园里，它的肋骨断了。我已经处理过它的伤势，但敷料现在需要更换了。既然你是个热心肠……\n\n<查莱兹将一张材料清单塞到你的手里。>\n\n你需要弄到这些，剩下的交给我。', '', '', '', '', '', '', 47936),
(69931, 'zhCN', '连扑带拿', '', '', '', '', '', '', '', '', 47936),
(69929, 'zhCN', '斯图恩兰', '', '', '', '', '', '', '', '', 47936),
(69928, 'zhCN', '利斯卡诺兹', '', '', '', '', '', '', '', '', 47936),
(69927, 'zhCN', '巴祖阿尔', '', '', '', '', '', '', '', '', 47936),
(69925, 'zhCN', '平息风暴', '从卡利姆多和东部王国各地活跃的原始风暴处的敌人身上收集$1oa份原始能量微粒。', '这些拜荒者残忍无情，他们在东部王国和卡利姆多掀起了元素的浩劫。\n\n你也必须展现出同等的决心，$n，只有这样才能阻止他们。\n\n找到他们的下一次入侵，抓紧时间消灭原始风暴处的敌人，粉碎他们的图谋。\n\n我们必须守护艾泽拉斯！', '', '', '', '', '', '', 47936),
(69923, 'zhCN', '原始威胁', '从卡利姆多和东部王国各地活跃的原始风暴处的敌人身上收集$1oa份原始能量微粒。', '莱萨杰丝正在不遗余力地组建拜荒者部队。\n\n肯瑞托发现，卡利姆多和东部王国的多个战略要点都出现了巨型风暴。\n\n拜荒者正在释放元素以增强军力。看来他们不仅想在巨龙群岛制造混乱，联盟和部落的土地也是他们的目标。\n\n去找出那些敌人，研究他们的行事方法。必须尽快阻止他们，否则就太迟了。', '', '', '', '', '', '', 47936),
(69919, 'zhCN', '急需手艺', '与阿兹雷交谈，了解如何完成制造订单。', '你像是个技艺精湛的工匠，想不想为其他冒险者完成几张制造订单，赚上几笔大大大钱？\n\n我会把和工匠商盟合作的规则告诉你，然后你就能在巨龙群岛的任意一个制作站接受制造订单了。', '', '', '', '', '', '', 47936),
(69918, 'zhCN', '动摇基业', '消灭灭石者托卡拉、研磨者摩尔卡和他们释放的元素。', '贾拉丁缚石者正试图击碎堡垒的根基！必须阻止他们！\n\n光靠我们根本无法夺回堡垒，它还有可能在我们脚下土崩瓦解。决不能坐视此事发生。\n\n尽你所能吧，$n……也就是干掉他们！', '', '和灭石者托卡拉一起，技艺娴熟的摩尔卡操纵着堡垒底部坚硬的黑曜石。', '研磨者摩尔卡', '', '', '', 47936),
(69915, 'zhCN', '针对性广告', '从剪河山羊和惹麻烦的山羊处取回传单。', '嗨嗨嗨！你想打工吗？\n\n我们很快就会隆重推出新的制造订单服务，现在要做的就是引起关注！但一阵风吹跑了我的传单，还有些土生土长的山羊追着它们跑了。\n\n你能把传单找回来吗？', '', '', '', '', '', '', 47936),
(69914, 'zhCN', '贾拉丁苏醒', '接受管理者瑟利斯特拉的命令。', '真希望我们有时间做个愉快的自我介绍，但总不可能人人都像克罗诺姆那样吧？\n\n我是瑟利斯特拉，阿莱克丝塔萨，生命的缚誓者，巨龙的女王麾下的管理者。\n\n阿莱克丝塔萨女王请我向你转达她最和善的致意，并要我护送你前往新生法池与她见面。\n\n但在前去觐见之前，我恐怕还需要你鼎力相助。\n\n我们的远古宿敌贾拉丁结束了深藏地底的沉眠，他们已经袭击了附近的一处岗哨！', '', '', '', '', '', '在翼眠大使馆与森德拉克斯见面。', 47936),
(69912, 'zhCN', '首次紧急情况！', '说服森德拉克斯发射应急信号照明弹，提醒巨龙你已抵达。', '<森德拉克斯满面困惑。>\n\n我从不知道管理者会迟到，何况是这么重要的事情，还迟到了那么久。\n\n这太反常了……\n\n<一个想法令森德拉克斯振作了精神。>\n\n我可以使用应急信号照明弹通知他们你已经到了，他们肯定会立刻冲过来找你！\n\n但我以前从没发射过应急信号照明弹……', '', '', '', '', '', '在翼眠大使馆与拉希奥见面。', 47936),
(69911, 'zhCN', '杂乱不堪，请别见怪', '帮助法斯塔兹大使修复大使馆。', '真希望我知道该如何欢迎你来到巨龙群岛，可惜我只是个哨兵。\n\n<森德拉克斯向身后的高塔指指点点。>\n\n你应该去访客中心和法斯塔兹大使谈谈。在巨龙抵达之前，他也许能够多解答几个问题。\n\n在里面的时候要小心脚下，我记得他之前还在清理碎石呢。', '', '', '', '', '', '', 47936),
(69910, 'zhCN', '拉希奥呢？', '询问森德拉克斯巨龙预计何时抵达。', '真奇怪。\n\n艾比西安说，拉希奥正等着我们来呢。另外还有一位巨龙女王、阿莱克丝塔萨，生命的缚誓者派遣的大使。\n\n巨龙通常不会违背承诺。\n\n至少这位热心的龙人是来迎接我们的。你愿不愿意去和他谈一下，其他人什么时候到？', '', '', '', '', '', '', 47936),
(69904, 'zhCN', '出奇寂静', '在安东尼达斯营地寻找诺莉柯的学徒。', '能不能耽搁你一会儿，$p？我有两个学徒，斯克朗皮和塔基，在不久之前失去了音讯。\n\n这非常令人不安。\n\n我派他们为旅店补充补给品，他们不可能走得太远……\n\n麻烦你去找到他们，还请当心，他们……挺会惹事的。', '', '', '', '', '', '', 47936),
(69902, 'zhCN', '理论付诸实践', '协助提尔贡治疗生物。', '$n，我需要你的协助……\n\n我想没人会指望我能同时制作、制服龙崽、治疗它，以及教这些小孩子！一心多用根本没有说的那么靠谱。\n\n你就先开始利用这些花朵吧。我需要先用几分钟时间来准备医治龙崽。\n\n希望孩子们能从这次事件中……学到什么。', '', '', '', '', '', '', 47936),
(69901, 'zhCN', '专家出马', '收集$1oa朵日光花朵。', '艾雅丽说这个生物受了多久的折磨？它伤得太重，已经无法进食了。我们必须赶快医治它。\n\n龙鳞探险队的营地里会通常备齐治疗这只龙崽所需的一切，但将物资送到巨龙群岛这里的“前沿地带”并不容易。我们的补给路线遭遇了重大的延误。\n\n不过别担心，这片土地什么都有！如果你能为我采一些日光花朵，我就可以制作一种镇静药膏，在我治疗的时候安抚这只龙崽。', '', '', '', '', '', '', 47936),
(69900, 'zhCN', '溯本追源', '在狂野禁猎区中消灭做试验的拜荒者。', '根据孩子们所说的情况来看，狂野禁猎区中很可能游荡着拜荒者。\n\n这就需要立刻着手调查了。\n\n根据其他调查员的观察，拜荒者好像很喜欢偷蛋，并且热衷于为雏龙注入能量以进行腐化。那些无法适应这一过程的雏龙会慢慢死去……而拜荒者对此毫不在意……\n\n我们得把他们赶出禁猎区。留心一点，我会尽力让孩子们平静下来。千万别让他们知道这种事。', '', '', '', '', '', '', 47936),
(69899, 'zhCN', '秘密调查', '帮助艾雅丽及其朋友。', '我知道……我的行为是很古怪。对不起！\n\n你也许猜到了，我说的不是真话。\n\n如果你想的话……我可以把秘密说给你听，但你必须保证不告诉大人们！', '', '', '', '', '', '', 47936),
(69898, 'zhCN', '科学肉疗法', '收集$1oa块超美味的淡水兽肉。', '我有了，呃，更多作业……提尔贡教授的课好难啊！他要我们查清楚始祖龙崽，呃，吃什么！对……\n\n我已经知道答案了！是淡水兽的肉！\n\n你能给我带一块淡水兽的肉吗？我的项目需要一些淡水兽肉作为“视觉辅助材料”。\n\n但一定要是一块很好的肉，好吗？就像……粗短淡水兽的肉。就像始祖幼龙妈妈会给龙崽吃、让它们变得更强壮的肉，因为，呃，这会让提尔贡先生高兴。', '', '', '', '', '', '', 47936),
(69897, 'zhCN', '行为分析“作业”', '抚摸$4oa只安眠的雏龙，随后向艾雅丽报告。', '我得和了解始祖雏龙的人谈谈。比如了解狂野禁猎区里那些龙的人！\n\n它们会和大大龙一样生气吗？它们会咬你或者朝你喷火吗？\n\n如果我……呃……你，抚摸了始祖雏龙呢？它们会知道你很友善，而且是在帮它们吗？\n\n我当然是从科学的角度提问的。提尔贡总要我们证实自己的拆……不对……揣……哼！“拆”想……呃！理论！\n\n我认为它们喜欢抚摸，这会让它们感到开心。你能帮我测试一下吗？', '', '', '', '', '', '', 47936),
(69896, 'zhCN', '灾难之旅', '在新生宝库废墟与元素师泰阳见面。', '我知道加入龙鳞探险队就要勇闯危险地带。但我没想到还要对付这些元素啊！\n\n我们的挖掘现场就在新生宝库废墟，那里已经乱套了！有岩石怪物拔地而起！我们请来了一位元素师，但她肯定需要更多帮助，越多越好。\n\n也许你能去帮助她？营地就在河对岸。', '', '', '', '', '', '', 47936),
(69895, 'zhCN', '召唤的毁灭者', '', '', '', '', '', '', '', '', 47936),
(69882, 'zhCN', '领主艾波克布勒格', '', '', '', '', '', '', '', '', 47936),
