(69872, 'zhCN', '瓦克里尔，最强的海象人', '', '', '', '', '', '', '', '', 47936),
(69870, 'zhCN', '绘制使命', '在充盈急流附近与编目员阿昆达和枪手福伦见面。', '图片会让人们走到一起，$p。\n\n我们的编目员通常会结对外出，这样才能保障安全。来自不同阵营和背景的成员为了追求群岛上的知识而联手合作，这样的场景多么可爱啊。\n\n有一对双人组目前正在勘探觉醒海岸中央的河流。\n\n如果你愿意帮助他们，就和他们一起编目那里的动物吧。', '', '', '', '', '', '在充盈急流附近与编目员阿昆达和枪手福伦见面。', 47936),
(69869, 'zhCN', '编目员的天堂', '与龙鳞先遣营地的编目员科拉莉交谈。', '<纳纳斯博士上气不接下气地递来一封信，邀请你返回龙鳞探险队的先遣营地接受训练。他热切地希望向你解释。>\n\n好精灵，骄傲的小人，许多镜头。懂？\n\n<纳纳斯博士兴奋地点着头，等待着你的回应。>', '', '', '', '', '', '与龙鳞先遣营地的编目员科拉莉交谈。', 47936),
(69868, 'zhCN', '织巢者阿拉兹奈', '', '', '', '', '', '', '', '', 47936),
