(69864, 'zhCN', '被遗忘的造物', '', '', '', '', '', '', '', '', 47936),
(69862, 'zhCN', '救狐龙一命', '查明希尔维焦躁不安的理由。', '既然希尔维已经恢复了，它肯定是想让我们看什么东西。\n\n我们的工作还没完成呢，$n！去看看它为什么焦躁不安吧。', '', '', '', '', '', '', 47936),
(69861, 'zhCN', '特里瓦鲁斯·织识者', '', '', '', '', '', '', '', '', 47936),
(69859, 'zhCN', '风暴之杉达纳', '', '', '', '', '', '', '', '', 47936),
(69858, 'zhCN', '荒裘', '', '', '', '', '', '', '', '', 47936),
(69856, 'zhCN', '弗尔古尔布', '', '', '', '', '', '', '', '', 47936),
(69855, 'zhCN', '攀登客的召唤', '与龙鳞先遣营地的探路者杰布交谈。', '<纳纳斯博士上气不接下气地递来一封信，邀请你返回龙鳞探险队的先遣营地接受训练。他热切地希望向你解释。>\n\n杰布大哥的，好朋友，现在就爬。懂？\n\n<纳纳斯博士兴奋地点着头，等待着你的回应。>', '', '', '', '', '', '与龙鳞先遣营地的探路者杰布交谈。', 47936),
(69852, 'zhCN', '领地水滨幼崽', '', '', '', '', '', '', '', '', 47936),
