(69097, 'zhCN', '解封宝库', '在龙鳞先遣营地与编目员杰克斯交谈。', '<纳纳斯博士上气不接下气地递来一封信，邀请你返回龙鳞探险队的先遣营地。他热切地希望向你解释。>\n\n大嗓门矮人，苦瓜脸精灵，等你，懂？\n\n<纳纳斯博士兴奋地点着头，等待着你的回应。>', '', '', '', '', '', '在龙鳞先遣营地与编目员杰克斯交谈。', 47936),
(69096, 'zhCN', '泰瓦恩的使命', '尝试安慰半人马孤儿琪美。', '你看到那个年轻人了吗？就是坐在溪岸边的那个？\n\n<她指着东北方，你看到一个面容年轻的半人马正凝视着水面。>\n\n琪美在诺库德的袭击中失去了双亲。我治愈了身体的创伤，但琪美就是不肯进食，也不肯说半个字，只是干坐在那里瞪着水面。\n\n我已经无能为力了，现在也没了主意。你能想办法和她谈一谈吗，$n？', '', '', '', '', '', '', 47936),
(69095, 'zhCN', '归乡之犬', '骑乘泰瓦恩返回马鲁凯。', '多亏有你和泰瓦恩在，大家的情况都稳定下来了，但许多村民都需要在马鲁凯再休养一阵。\n\n不如就由你们两个把队伍领回去吧！毕竟你们都是今天的大英雄！', '', '', '', '', '', '', 47936),
(69094, 'zhCN', '拯救半人马', '在达鲁汉村中营救受伤的半人马。', '背信弃义的诺库德氏族根本没有底线！达鲁汉村内只有工匠，他们在劫掠者面前毫无生机。\n\n我们急需你的帮助，$n。诺库德氏族仍在附近，而我们必须照顾伤者！\n\n搜索村庄，把你找到的幸存者都带出来。我们会分类伤员，尽量稳定他们的情况！', '', '', '', '', '', '', 47936),
(69093, 'zhCN', '新的奥秘', '与龙鳞先遣营地的娜蕾迪亚·流光交谈。', '<纳纳斯博士上气不接下气地递来一封信，邀请你返回龙鳞探险队的先遣营地。他热切地希望向你解释。>\n\n密封的门，泰坦秘密。懂？\n\n<纳纳斯博士兴奋地点着头，等待着你的回应。>', '', '', '', '', '', '与龙鳞先遣营地的娜蕾迪亚·流光交谈。', 47936),
(68799, 'zhCN', '返回红玉新生圣地', '返回红玉新生圣地。', '这只是驭龙之旅的起点！\n\n瞪大眼睛，在巨龙群岛各地留意新的冒险和体验，也可以到我们的任意一处岗哨来做客。\n\n现在，你先回去找阿莱克丝塔萨，继续探索这片土地。', '', '', '', '', '', '返回红玉新生圣地的阿莱克丝塔萨身边。', 47936),
(68798, 'zhCN', '巨龙魔符与你', '在天顶观察站收集巨龙魔符，随后与莉兹拉苟萨交谈以使用天赋。', '显然为这些冒险者付出良多的不只有格伦赛拉和我。莉兹拉苟萨很期待帮你精进驭龙术，你也已经见过杰出的塞罗尔穆了。\n\n巨龙群岛的各地有一些魔符，可以让你学会更多驭龙术的技巧和技能。其实，天顶观察站就有一个。\n\n等你找到了，莉兹拉苟萨可以帮你使用它！', '', '在巨龙群岛周围发现这些魔符，它们将帮助你学习更多驭龙术技巧和能力。', '巨龙魔符', '', '', '', 47936),
(68797, 'zhCN', '新生犄角', '与格伦赛拉见面，并使用幻形讲坛自定义你的幼龙。', '和凡人一样，巨龙对外表非常在意。你的幼龙也可以根据你的发现和经历来改变自己的外表。\n\n与幻形讲坛旁的格伦赛拉交谈，然后亲眼见证吧！', '', '', '', '', '', '', 47936),
(68796, 'zhCN', '天顶观察站', '前往觉醒海岸的天顶观察站。', '这就是驾驭幼龙的基础技巧！你做得好极了。\n\n现在，我想向你们介绍加入冒险的其他同伴。我们在天顶观察站建起了一个新家。\n\n塞罗尔穆可以引导你前往那里。等你准备好翱翔天际了，就去和他谈谈吧！\n\n到那儿见！', '', '', '', '', '', '在天顶观察站与安德斯塔兹领主见面。', 47936),
(68795, 'zhCN', '驭龙术', '与红玉新生圣地的安德斯塔兹领主交谈。', '你可能已经发现了，巨龙群岛很大，可谓广袤无边。\n\n有些年轻的龙表示自己很有兴趣探索新大陆每一个角落和秘密的藏身处，甚至那些无法从地面上平稳抵达的地方。他们很希望能在旅程中多得到一份帮助，做为回报他们会带你穿越这片土地。\n\n与红玉新生圣地的安德斯塔兹领主交谈，他会解释它们的意图。', '', '', '', '', '', '与红玉新生圣地的安德斯塔兹领主交谈。', 47936),
(68794, 'zhCN', '龙之友', '与瓦德拉肯守护巨龙之座的阿莱克丝塔萨交谈。', '你对巨龙群岛的援助不会被忽视，$n。\n\n生命的缚誓者本尊希望向你展示一些东西，奖励你对巨龙一族的贡献。\n\n到高塔的顶部去与她相谈，所有的守护巨龙正在等你。', '', '', '', '', '', '与瓦德拉肯守护巨龙之座的阿莱克丝塔萨交谈。', 47936),
(68644, 'zhCN', '和气友善', '协助治疗希尔维。', '好了！救助希尔维所需的一切都备齐了！\n\n而且很及时，我觉得它没法继续坚持下去了。\n\n但是……我需要有人帮我。我想请卡里的，但……你愿意再帮我一把吗？\n\n等你准备好了就告诉我，$n。', '', '', '', '', '', '', 47936),
(68643, 'zhCN', '维生素与矿物质', '收集$1oa瓶矿泉水', '我真应该事先想到，斯泰丽雅肯定会因为我要你和动物搏斗而深感不安……\n\n当然也有其他的方法能完成研究。\n\n带上这些瓶子，从附近的冰晶上收集一些水。\n\n根据我的理论，其中的矿物应该注有魔网水晶能量——甚至造成了这里的魔法能量爆发。', '', '', '', '', '', '', 47936),
(68642, 'zhCN', '无棘之谈', '收集$1oa根奥术注能棘刺。', '我想帮助希尔维，但也不想继续给卡里拖后腿了。\n\n为了给希尔维配药，我需要从晶刺猪身上拔取的奥术注能棘刺，不知道它们介不介意让你拔几根！\n\n还要注意獒犬！它们会捕食晶刺猪，如果你触碰它们，也许还会发狂。如果你不得不保护自己，也可以从它们身上收集一些棘刺。\n\n不过……尽量别这么做，拜托了。', '', '', '', '', '', '', 47936),
(68641, 'zhCN', '青苔入药', '收集$1oa份德拉克苔块。', '可怜的姑娘……\n\n它肯定是吃了被污染的东西，所以才生病了。\n\n好在我的祖父是一个德鲁伊，他教过我如何治疗奥术引发的疾病。\n\n我身上没有带着所有材料，但我们可以用附近的材料将就一下。\n\n首先，我需要一些德拉克苔。这种稀有的苔藓只会生长在龙骨上。', '', '', '', '', '', '', 47936),
(68639, 'zhCN', '极地徘徊猎手', '消灭$1oa只感染的寒裘熊。', '我们是被派来研究寒裘熊物种的。\n\n它们的狩猎场遭到了魔网的污染，奥术能量渗入了水和植物当中……以及狐龙这样的掠食动物体内。\n\n和其他有机生物不同的是，寒裘熊挺了过来，还从中获得了力量。\n\n它们也变得更有侵略性了，这就是问题所在。你去和几头熊交手，我会记录它们的力量与侵略性。\n\n我的报告会帮助肯瑞托决定如何应对它们。', '', '', '', '', '', '', 47936),
(68087, 'zhCN', '达鲁汉的危险', '与提莱信使交谈，了解赛尔贝克的紧急请求。', '看来我也做不了什么，只能把你和泰瓦恩送回马鲁凯了。\n\n等等……正在走过来的是谁？希望不要又是一个带着巨型獒犬的陌生人了！', '', '', '', '', '', '', 47936),
(68085, 'zhCN', '牧者养成', '在马拉科教泰瓦恩放牧绒羊。', '你要我将你的獒犬训练成牧犬？嗯，我们这里确实可以，但是我从来没有训练过体型这么大的……\n\n不过绒羊似乎没有因为它的出现而受惊，相信我，它们很擅长判断性格。\n\n我愿意让它试一试，但牧犬需要的不只是温和的性情，还要有聪明的头脑。如果它们没办法执掌牧群，绒羊就不会服从。看上去很容易，实际上可难啦！去吧，让它试一试，我会在一旁看着。', '', '', '', '', '', '', 47936),
(68084, 'zhCN', '温柔的巨犬', '将泰瓦恩派往马拉科的牧羊人泰瓦特伊处接受训练。', '如果泰瓦恩真的像加达尔说的那么“不凶猛”，那它也许更适合成为牧犬！\n\n艾拉格氏族是放牧绒羊的专家，而且他们也不会骄矜到要收取昂贵的礼物才肯帮助其他的氏族。\n\n请你把泰瓦恩带给马拉科的牧羊人泰瓦特伊。那个地方就在西南边的两座丘陵之间，他们就是在那儿训练獒犬的。\n\n欧恩哈拉保佑，希望这能管用，否则我真的无计可施了。', '', '', '', '', '', '', 47936),
(68083, 'zhCN', '再来，泰瓦恩！', '返回马鲁凯的治疗者赛尔贝克处并带去坏消息。', '返回提莱氏族，就说我也没法把泰瓦恩训练成猎犬，它完全没有这个本事。\n\n它是我见过的最不凶猛的獒犬。要我说，如果放着不管，它肯定会去和猎物交朋友呢！哈！', '', '', '', '', '', '返回马鲁凯的治疗者赛尔贝克处', 47936),
(67921, 'zhCN', '猎犬', '与泰瓦恩一同狩猎危险的野兽，证明它有资格接受训练。', '和你的巨型獒犬一起猎捕附近的野兽吧。猎物越大越好。我会在这里观察，并判定它有没有资格接受席卡尔的训练。\n\n听好了，我只接受强者中的强者。', '', '', '', '', '', '', 47936),
(67772, 'zhCN', '泰瓦恩的纷扰', '帮助治疗者赛尔贝克为泰瓦恩准备训练。', '你好朋友，欢迎回到马鲁凯。我是提莱氏族的治疗者赛尔贝克。\n\n你和动物相处得如何，$n？或许我现在正好需要新面孔的影响力。\n\n这是泰瓦恩，一位非常出色的伙伴，不过也是我们氏族的负担。我担心的是，如果我们没法让它派上用场，可能就要把它送走。你愿意帮帮我吗？', '', '', '', '', '', '', 47936),
(67742, 'zhCN', '档案限界 - 进阶版', '滑翔穿过光圈。', '飞过标记赛道的检查点光圈。', '', '', '', '', '', '', 47936),
(67741, 'zhCN', '档案限界', '滑翔穿过光圈。', '飞过标记赛道的检查点光圈。', '', '', '', '', '', '', 47936),
(67724, 'zhCN', '火光庇护', '收集$1oa份寒网丝。', '卡蒂加特和我想要证明自己，所以就来阻止碎裂之焰、取回瓦尔祖克斯了。\n\n结果这个精灵被寒冰蛛咬了几口，我们就只能困在这里守着她。我们还没有和碎裂之焰交过手，但在找到这个机会之前，蜘蛛也许就会要了我们的命！\n\n我们必须把它们赶跑。\n\n幸好有一种逼退它们的办法。燃烧蛛茧的丝就能产生一种气味，可以将蜘蛛驱离。\n\n去找一些蛛丝来，我会把它丢进火里，这样它们就不敢靠近了！', '', '', '', '', '', '', 47936),
(67700, 'zhCN', '出发！巨龙群岛！', '乘坐粗犷龙鳞号，从暴风城港口前往巨龙群岛。', '好消息，$p！我们的先遣探险队已经在巨龙群岛登陆了。\n\n多亏了你和其他龙鳞探险队成员的努力，我们在巨龙群岛建立了一处防备完善的登陆点，并且和巨龙军团的使者取得了联络。\n\n你准备好和我们一起登上前往巨龙群岛的下一班船了吗？', '', '', '', '', '', '在巨龙群岛的海岸与托蒂·晶须见面。', 47936),
(67606, 'zhCN', '树妖疗法', '获取一份可口的幼雏点心，用其喂养沮丧的小鸭子。', '在你离开的时候，我听到一只梦兔说，这里的一只小鸭子最近闷闷不乐。但我知道怎么让它振作起来！\n\n在我感到情绪低落的时候，我会用甜蜜美味的零食来平复身心！作为可爱动物的专家，我知道这个方法也对它们有用。\n\n这只特别的小鸭子很喜欢一种本地的甜点，叫做可口的幼雏点心。你能不能找一份点心来，然后喂给这个可怜的小家伙？毕竟树妖就是这么做的！', '', '', '', '', '', '', 47936),
(67566, 'zhCN', '霜土飞越 - 进阶版', '滑翔穿过光圈。', '飞过标记赛道的检查点光圈。', '', '', '', '', '', '', 47936),
(67565, 'zhCN', '霜土飞越', '滑翔穿过光圈。', '飞过标记赛道的检查点光圈。', '', '', '', '', '', '', 47936),
(67564, 'zhCN', '工匠邮差', '将工匠商盟发票带给托马斯·布莱特。', '冒险者，你是要去新生圣地吗？\n\n你能将这张发票带给托马斯·布莱特吗？他订购了几个定制瓶子，我们的玻璃匠总算结清了材料的价钱。\n\n你沿着路走应该就能找到他，他肯定正在向某些可怜人炫耀，说米格尔多么多么棒了……\n\n我相信他肯定会付钱答谢你的。', '', '', '', '', '', '将工匠商盟发票交给红玉新生圣地的托马斯·布莱特。', 47936),
(67299, 'zhCN', '净除幼龙', '使用奥术轰击者，击败$1oa只始祖幼龙。', '拜荒者的幼龙无休无止地袭击着我们的营地！\n\n我们的护盾勉强能够挡住他们，但我们需要更多援手，才能从空中击落他们。\n\n使用我们的轰击者，把那些幼龙打下来！', '', '', '', '', '', '', 47936),
(67298, 'zhCN', '世界奇观', '查明托马斯如何洞悉工艺的奥妙。', '托马斯在这片原始的土地上不断探索，他已经收获了许多见解。\n\n也许到他的休息处拜访一下，你也能获得启发？', '', '', '', '', '', '', 47936),
(67297, 'zhCN', '伊斯卡拉锦标赛 - 进阶版', '滑翔穿过光圈。', '飞过标记赛道的检查点光圈。', '', '', '', '', '', '', 47936),
(67296, 'zhCN', '伊斯卡拉锦标赛', '滑翔穿过光圈。', '飞过标记赛道的检查点光圈。', '', '', '', '', '', '', 47936),
(67295, 'zhCN', '我的专长', '与米格尔·布莱特交谈，了解专业技能专精。', '那么说，你开始学习专精了？这是好事，你现在要拥有于自己的独门绝技了。\n\n作为工匠商盟的一员，我很高兴能帮助你在求索过程中磨炼专精。\n\n你想听听我的智慧之言吗，还是想学点什么，好帮助你接着冒险？', '', '', '', '', '', '', 47936),
(67221, 'zhCN', '精益求金', '在烬齑矿层中收集$1oa块晶化龙银。', '为了充分发挥出大地守护者熔炉的潜力，你必须掌握如何制作黑曜焦灼合金。只有这样，你才能追随先人的脚步，成为奈萨里奥最伟大的铁匠。\n\n前往烬齑矿层深处，给我找一块晶化龙银。然后我才会传授你所渴求的知识。', '', '被内部的龙银矿石蕴藏的力量所驱动，极其危险。', '晶化钢铁碎片', '', '', '', 47936),
(67178, 'zhCN', '白眼青龙', '帮助游马多姆击败瀬人苟萨。', '$PC，你能尽力保障比赛的公平吗？\n\n瀬人苟萨总是自私地践踏规则。\n\n我不想看到游马多姆因为瀬人苟萨作弊而输了对局。', '', '', '', '', '', '', 47936),
(67177, 'zhCN', '通缉：吞食者', '消灭吞食者，取回它的角。', '如果你要和海象人和谐相处，就必须学会助人为乐！\n\n最近啊，有一头被我们称为“吞食者“的野兽，它在附近安了家。\n\n它的更多同族似乎也在迁往这片区域。我们可以利用这一点。\n\n消灭吞食者，把它的角带给我。我们需要这些建筑补给来扩建哨站。', '', '一头远离平日猎场的巨型野兽。', '吞食者', '', '', '', 47936),
(67175, 'zhCN', '玩具爆炸船拆解指南', '与图尔克的妈妈交谈，随后取回玩具船。', '我很不想让一个孩子和他的玩具道别，但如果肯瑞托能研究这件玩具的价值，了解它如何吸收大量奥术能量，我们会获益匪浅的。\n\n而且……我不想冒犯新结交的海象人盟友。我也没有能够驱散魔法的魔杖……\n\n我们去和图尔克的妈妈聊聊，然后再决定该怎么办。', '', '', '', '', '', '', 47936),
(67174, 'zhCN', '奥术检测', '在库里的钓鱼点调查海象人物品，寻找奥术魔法的迹象。', '幸会！我是米瓦·星目，我正在这片区域中开展奥术调查。\n\n碧蓝林海到处都有魔法。有些魔法平和无害……有些却很危险。\n\n我的责任是确保不会有奥术能量栖居在海象人的物品中。\n\n我们已经遇到了一起意外，安东尼达斯营地的一个钓鱼箱突然就自燃了！\n\n你能带上我的探测器，去检查几件物品吗？我还需要继续和加尔克谈谈。', '', '', '', '', '', '', 47936),
(67173, 'zhCN', '扒窃豺狼人', '', '', '', '', '', '', '', '', 47936),
(67167, 'zhCN', '对决时间！', '对$1oa个龙希尔发起炉石传说挑战。', '现在我取回了套牌，可以专心给俱乐部招募新成员了！我在考虑是不是要去邀请龙希尔……\n\n噢，这件事也得麻烦$n帮忙！\n\n我一直忙着让其他巨龙加入，也很想龙希尔加入我们。\n\n你能代我和他们聊聊吗？不过要注意，很多龙希尔之前都没玩过牌。', '', '', '', '', '', '', 47936),
(67154, 'zhCN', '熵之残迹', '从变换流沙的生物身上收集$1oa份玻璃化的沙子。', '当实体穿越时间流时，时间之沙有时会积聚在他们身上。\n\n这些沙子通常很快就会消散，但有些时候，时空旅行所固有的熵波动会将沙子炼化成玻璃，在这种情况下，它会变得难以去除。我有好几双鞋子都被弄坏了。\n\n玻璃化的沙子具有强大的能量，可以帮助我们达成目的。我们应该竭尽所能地收取这些沙子。', '', '', '', '', '', '', 47936),
(67143, 'zhCN', '以心予人', '使用任意制造专业，制作一个瓶中之心|A:Professions-Icon-Quality-Tier3-Small:20:20|a。', '我们已经集齐了元素精华，你能把它们放进这个瓶子里吗？\n\n这个配方非常简单，就在我的工作台旁试试手吧，做法就和其他的配方一样。\n\n如果你弄丢了，或是用完了高品质的材料，你总能从龙蛙陷坑的元素身上找到更多材料。', '', '', '', '', '', '将礼物交给红玉新生圣地的米格尔·布莱特。', 47936),
(67142, 'zhCN', '龙饲料', '从烬琉河的硬壳潜虫处收集被熔岩烧焦的血肉。', '保护黑曜堡垒并坚持作战可是个体力活儿，而巨龙的食量都很大。我们需要补充库存了。\n\n在硬化的岩浆底下，在滚烫的熔岩之中，潜伏着非常可口的蠕虫。虽然可能不合你的胃口，但在饥肠辘辘的巨龙眼里，这就是绝顶珍馐。\n\n带上我们的仆从古尔查克，使用指示器引导他前往熔岩中的扰动位置，他就能把虫子引出来。', '', '', '', '', '', '', 47936),
(67137, 'zhCN', '专业装备', '与玛赫拉·折树交谈', '嘿，我听海菲斯塔说，你也是个挺能干的工匠啊。\n\n我们打算给你配备一些专业装备，都是免费的。生意伙伴就是派这个用的，对吧？\n\n与我们的裁缝玛赫拉·折树谈谈，给你弄一身服帖的。', '', '', '', '', '', '与红玉新生圣地的玛赫拉·折树交谈。', 47936),
(67111, 'zhCN', '病弱的学徒', '收集$1oa份冰冻的毒腺。', '这个任务从一开始就大错特错了。阿莉亚·舞阳征召我们来阻止碎裂之焰，以免他们染指一件危险的神器。我们追踪它来到了这片废墟。\n\n可碎裂之焰把我们打得落花流水，这地方还到处都是蜘蛛。阿莉亚身中剧毒，如果没有解毒剂，我怕她坚持不了多久了。\n\n我能制作解毒剂，可我需要从附近的蜘蛛身上采来的毒腺。我不敢把她抛下，你能替我去找一些来吗？', '', '', '', '', '', '', 47936),
(67100, 'zhCN', '赠予米格尔', '向托马斯了解品质，随后在龙蛙陷坑附近为米格尔的礼物收集$2oa个烈火精魂。', '$p，能麻烦你帮个忙吗？\n\n我想给米格尔准备一份礼物。\n\n他对我意义重大，但我最近一直都很忙，没有时间为他制作礼物。\n\n你能帮我给他做一些优质的礼品吗？', '', '', '', '', '', '', 47936),
(67099, 'zhCN', '巨龙之目', '在附近区域中与米里迪安、泽法里奥和艾沃立安交谈。', '我们知道贾拉丁会直接发起袭击，但我担心还有别的危险潜伏在表面之下。\n\n我派出了三条巨龙侦查附近的区域，标记潜在的威胁。\n\n去找到他们，替我收取他们的报告。收集到情报之后再回来找我，这样才能准备应对贾拉丁的图谋。', '', '', '', '', '', '', 47936),
(67095, 'zhCN', '起伏森林航线', '滑翔穿过光圈。', '飞过标记赛道的检查点光圈。', '', '', '', '', '', '', 47936),
(67094, 'zhCN', '树妖不得闲', '帮助莎伦德拉照顾瓦德拉肯的大量小动物。', '能看到瓦德拉肯恢复活力真是太好了，但在我们疏忽千年之后，还有许多东西正枯萎凋零，更不用说城里这些可爱的小动物！唉，我们没有足够的树妖来一一照看它们。\n\n你愿不愿意担任瓦德拉肯名誉树妖一职？城里这些可爱的小伙伴走得太远了，都没有带上自己最喜爱的零食。你能不能帮我照顾它们？', '', '', '', '', '', '', 47936),
(67093, 'zhCN', '异样神龛', '想办法收集隐藏在迷沙圣殿内的圣物，随后返回瓦德拉肯守护巨龙之座的诺兹多姆身边。', '我的研究团队在附近找到了一处古怪的密室。我们辨认出了密室外围刻写的部分文字，那是泰坦的符文。其中应该有多处地方提到了诸位泰坦的首领——众神之父阿曼苏尔。\n\n我们想要仔细观察，结果肯定是触发了密室的防御系统。一个巨大的砂砾融合怪挡住了我们的去路，我们好不容易才逃出生天。\n\n我们不确定它是在保护什么，但那肯定很重要。你能前去调查一下吗？', '', '', '', '', '', '返回瓦德拉肯的诺兹多姆处。', 47936),
(67084, 'zhCN', '白银使命', '将上古泰坦精钢铸块放入熔炉，完成提尔留下的任务。', '<耳边出现了提尔的回响。>\n\n你的任务就在眼前了，朋友们。\n\n将铸块投入烈火，激活熔炉。我已经为你们准备好了必要的程序。\n\n银鳞就是保存结构图的关键，你即将揭晓它的使命。', '', '', '', '', '', '与提尔要塞的阿莱克丝塔萨交谈。', 47936),
(67081, 'zhCN', '注能大厅：材质注能', '在注能大厅取回$1oa份上古泰坦精钢铸块，并击败原始海啸。', '<提尔的影像再次开口。>\n\n你们已经重启了熔炉，下一个任务不会这么简单了。\n\n银鳞内铭刻了一份结构图，我希望你们能替我锻造。我已经托付了一位看护者，伊里度斯来保管必需的材料。这些材料来源独特，现存稀少。\n\n在注能大厅中找到伊里度斯，希望在他的精心看护之下，设施还能够有序运转。', '', '', '', '', '', '', 47936),
(67080, 'zhCN', '工匠补给：巨龙的炼金溶液', '使用回收制剂配方，为红玉新生圣地的海菲斯塔制作$1oa瓶巨龙的炼金溶液。', '你在找工作吗，炼金师？\n\n工匠商盟联系了我们，下达了一个炼金溶液的“制造订单”。我跟那些龙裔一样，都想摸清楚这里的生意经，可我就是有点儿小忙。\n\n也许这对你来说是个不错的机会，学徒。回收你之前的制剂，制作一份炼金溶液，然后顺着路一直走，把她交给海菲斯塔。', '', '', '', '', '', '', 47936),
(67079, 'zhCN', '锁死难题', '在提尔要塞中取回主要安保圆盘和次要安保圆盘。', '熔炉的安保比提尔要塞的其他区域更为严格，这对我们是个不小的挑战，$c。\n\n只有堡垒附近附近的特定单元才能绕过安保措施，为了防止损坏，破解协议还需要多条代码。\n\n这些单元不会将覆写装置拱手相让，你只能靠武力夺取了。多加小心，$n。', '', '', '', '', '', '', 47936),
(67078, 'zhCN', '离别指示', '将白银之鳞放在提尔要塞的熔炉中。', '<回响里传来了古老的声音。>\n\n致我亲爱的各位朋友，此次不告而别，我深表歉意。\n\n但我保证，你们并不会孤立无援。我知道你们已经迎来危难时刻，但为了确保这件礼物不被滥用，我必须请你们完成一系列任务。\n\n第一个任务很简单：重新激活提尔要塞的熔炉，白银之鳞便是钥匙。', '', '', '', '', '', '与提尔要塞的科拉诺斯交谈。', 47936),
(67077, 'zhCN', '往日回忆', '与诺兹多姆交谈，见证往昔的回忆。', '我们就是在这里最后一次见到提尔，我们的朋友。\n\n我们当时并不理解他为什么非走不可，只知道兹事体大。\n\n虽然我们难以承受那样的悲痛，但这缕火花将我们唤来此地，肯定就是为了再次目睹那个时刻。在诺兹多姆的帮助下，我们可以重温那一刻，或许就能发现提尔留下的其他线索。', '', '', '', '', '', '', 47936),
(67076, 'zhCN', '发现的火花', '在提尔要塞中调查泰坦火花。', '这个火花起源怪异，但我产生了熟悉的感觉。我不知道它的用途，但它也许能带你迈出下一步，揭露这个奥秘。\n\n跟上它，摸清它的作用，我会在这里继续探索。', '', '', '', '', '', '与提尔要塞的卡雷苟斯交谈。', 47936),
(67075, 'zhCN', '内藏秘法', '在提尔要塞的控制台处吸取隐藏的魔法，揭露银鳞的秘密。', '真有意思，这座堡垒里隐藏着那么多奥妙，只有守护者提尔本人才能理解。如果我们要继续揭露秘密，就需要深入探索提尔要塞。\n\n我相信这枚鳞片可以发掘出这里隐含的秘密。\n\n不过有一个难题，提尔要塞的守护者依然……不太稳定。他们或许会将你的探索视作惊扰或妨害。带上这个导体，它能帮你解决棘手的守护者。', '', '', '', '', '', '', 47936),
(67074, 'zhCN', '银色馈赠', '与阿莱克丝塔萨交谈，揭露提尔的赠礼。', '在离世之前没多久，守护者提尔赠予了我们一枚用至纯白银锻造的龙鳞。在离去的时光里，我们将它保管在瓦德拉肯的宝库之中。我觉得是时候再次令它重见天日了。\n\n虽然我们不清楚这件纪念品的用途，但对我们而言，它始终是友谊与团结的象征。作为巨龙一族名副其实的盟友，我们希望与你共享。等你准备好了就告诉我，$n。', '', '', '', '', '', '', 47936),
(67073, 'zhCN', '赤红拂晓', '找到阿莱克丝塔萨。', '我们的力量就要恢复了……如果莱萨杰丝在我们恢复力量之前得手，恐怕时间线就会被扭曲，艾泽拉斯也将走向黑暗的未来。\n\n我们决不能让此事发生，$n！\n\n快，你必须找到阿莱克丝塔萨并帮助她，否则就全完了！', '', '', '', '', '', '', 47936),
(67071, 'zhCN', '千奇百妙的悠长旅途', '与卢米亚斯塔萨交谈。', '$n！正是我和莫塞尔在找的人！\n\n我们从长着翅膀的内心深处，向你表示诚挚的感谢。\n\n我们创办了红玉盛宴，想和艾泽拉斯的所有种族分享美食文化，同时也会向他们学习。虽然我们让你在这处挚爱的群岛上跑了个遍，但你帮助我们实现了梦想，让每一位尊贵的来宾都能参加这场盛宴。\n\n身为朋友，我们想赠予你一件礼物。我们的贮藏就在大锅后面，拿走最上面那份笔记吧。', '', '', '', '', '', '', 47936),
(67068, 'zhCN', '微风拂面', '收集一枚微风猎手之卵。', '微风猎手？！这些猎鹰惹出了不少麻烦。就在前几天，我们的兽栏管理员玛尔伦在驯服猎鹰的时候差点摔死。\n\n她非常骄傲，所以把错都推给了微风猎手。她说，只要猎鹰不觉得自己的卵受到的袭击，就不会那么咄咄逼人地把她赶下悬崖。\n\n我猜这意味着，你可以在那里找到需要的卵？就在东边的山丘上。', '', '', '', '', '', '返回瓦德拉肯红玉盛宴的卢米亚斯塔萨处。', 47936),
(67067, 'zhCN', '探究跃空玉米', '收集$1oa根野生的跃空玉米。', '瓦德拉肯有个巨龙大厨？真的？我要请她尝尝我的弧光浓汤！这是历史悠久的家常菜了。\n\n我知道你所说的那种植物，它就生长在这里的溪流附近，但也引发了不少问题。\n\n跃空玉米的茎秆似乎是甲虫和小型蝾螈的天然聚食地，后者则是龙蛙的天然猎物。如果你在开阔处发现它们，那不会有什么问题，可有一些生长在很不起眼的地方。\n\n如果我是你，我一定会留意背后。', '', '', '', '', '', '返回瓦德拉肯红玉盛宴的卢米亚斯塔萨处。', 47936),
(67066, 'zhCN', '深掘好味', '收集一条美味变异粗鳍鱼。', '卢米和莫塞尔？\n\n哎呦，那真是好久以前了。和巨龙鸭子二人组一起吃鱼，听起来就像是长老波雅给小孩子们讲的故事的开头。我们无论如何都不会忘记这种事情！\n\n那是一条美味变异粗鳍鱼，是海象人的绝顶珍品！它们非常稀少，但在这里的海岸边就能找到。\n\n不过一定要当心，现在是碧齿鱼交配的时令。如果你搅和了它们喜爱的零食，这群嗜血的怪物肯定会对你张开血盆大口。', '', '', '', '', '', '返回瓦德拉肯红玉盛宴的卢米亚斯塔萨处。', 47936),
(67065, 'zhCN', '未来的鲜菇', '在拜荒者的未来捕捉7个轰时松露。', '美味的蘑菇？不同时间线的未来可不是让你翻找零食的橱柜。\n\n不过……如果说我不想再尝到卢米和莫塞尔的手艺，那无疑是在撒谎。\n\n那好！我准许你通过传送门，不过我建议你带上几个旅伴。\n\n我的卫士以前就提到过这种黑暗的蘑菇。它们显然不会在一个地方停留太久。利用好这一点吧。', '', '', '', '', '', '返回瓦德拉肯红玉盛宴的卢米亚斯塔萨处。', 47936),
(67064, 'zhCN', '闲适美差', '收集$1oa个闪光的蔓藻球茎。', '喔，卢米亚斯塔萨！我和树妖姐妹赛琳娜与菲琳娜度过了一个愉快的烹饪之夜。\n\n我们平常吃的海藻是一种独特的品种，叫做闪光的蔓藻。成群的褶鱼都在海岸边吞食它们。如果你在海床上采收它们的食物，就算遭到袭击也不令人意外。\n\n见到大厨们的时候，请替我向他们转达最诚挚的问候。这处庇护所永远欢迎他们。', '', '', '', '', '', '返回瓦德拉肯红玉盛宴的卢米亚斯塔萨处。', 47936),
(67063, 'zhCN', '万年烤制', '收集$1oa份辣味熔岩香料。', '香料？噢！你肯定跟那个老龙厨子是一伙的，就是脑袋上顶个小鸭子的那个。\n\n你要的辣味熔岩香料就在底下那些烈火元素身上。\n\n别用这种眼神看我！那是贾拉丁的叫法，跟我没关系！\n\n祝你好运，如果是我，肯定不会一个人去。', '', '', '', '', '', '返回瓦德拉肯红玉盛宴的卢米亚斯塔萨处。', 47936),
(67053, 'zhCN', '和平之机', '向部落代表介绍自己。', '圣光庇佑你，$p。\n\n这次探险同时受到部落和联盟的保护。我们的命令清晰明确：对龙鳞探险队的所有成员，不管阵营归属，一律提供协助。\n\n部落的代表督军恐斧和她的女儿修加正在营地的另一头站岗。\n\n我和督军恐斧一起对抗过天灾军团。她心怀荣耀，会为探险队鞠躬尽瘁。\n\n向她伸出你的援手，向她证明联盟会遵守协议。', '', '', '', '', '', '与翼眠大使馆的督军布雷卡·恐斧交谈。', 47936),
(67051, 'zhCN', '巨龙之目', '在附近区域中与巴斯基兰、瓦扎利亚和泽法里奥交谈。', '我们知道贾拉丁会直接发起袭击，但我担心还有别的危险潜伏在表面之下。\n\n我派出了三条巨龙侦查附近的区域，标记潜在的威胁。\n\n去找到他们，替我收取他们的报告。收集到情报之后再回来找我，这样才能准备应对贾拉丁的图谋。', '', '', '', '', '', '', 47936),
(67050, 'zhCN', '霜齿：表里症结', '在碧蓝林海中放置图腾，解救被困的海象人猎手。', '元素依然寄宿在这些图腾里，$r。释放它们，打破坚冰，救出你的海象人朋友。', '', '', '', '', '', '', 47936),
(67047, 'zhCN', '驱寒暖流', '收集$1oa片寒流簇叶。', '你在寻找的那种植物应该长着精细、狭长的红色叶片。\n\n不过，你在收集时肯定会遇上烦人透顶的爬蛛。我建议你尽量避开它们，不然就准备一把趁手的武器吧。\n\n顺便转告你的巨龙朋友，下次我进城的时候，他们可以用一两杯茶水来答谢我。', '', '', '', '', '', '返回瓦德拉肯红玉盛宴的卢米亚斯塔萨处。', 47936),
(67039, 'zhCN', '奇妙之旅', '寻找失踪的动物。', '在上次往返营地的旅途中，氏族里有几只宠物走散了。它们不是猎兽，我想它们很难在野外照顾好自己！\n\n你能去寻找它们吗？虽然不是狩猎伙伴，但它们是氏族成员的心头肉啊！', '', '', '', '', '', '', 47936),
(67036, 'zhCN', '肯瑞托之怒', '使用奥术轰击者，帮助卡德加击败拜荒者。', '我把你取回的装置部件组装好了。\n\n把它放在卡德加附近，用它击退拜荒者！\n\n我们必须继续坚持，撑到卡雷苟斯抵达。', '', '', '', '', '', '', 47936),
(67035, 'zhCN', '保存知识', '在安东尼达斯营地附近寻找$1oa本远古典籍。', '你好，$r。我是阿萨努斯。我本希望能够在不那么……混乱的时候和你见面。\n\n我们正在协助肯瑞托研究此地的历史，没过多久，拜荒者就发起了袭击。\n\n恐怕还有许多典籍散落在外面，我担心它们很可能会在骇人的袭击中受到破坏。\n\n求求你，你必须把它们找回来！如果典籍被毁，这里的历史就会永远失落。', '', '', '', '', '', '', 47936),
(67033, 'zhCN', '组装工事', '找回$1oa个奥术轰击者部件。', '自从我们抵达碧蓝林海，拜荒者就一直在猎捕肯瑞托。他们对我们的奥术魔法恨之入骨。\n\n我会告诉卡雷苟斯，让他尽快从碧蓝档案馆返回。与此同时，我们必须挡住他们。\n\n在第一轮袭击中，我们有主要奥术工事被毁了。将部件带回来，我能重新把它组装起来。', '', '', '', '', '', '', 47936),
(67032, 'zhCN', '瓦克索斯攀升赛 - 进阶版', '滑翔穿过光圈。', '飞过标记赛道的检查点光圈。', '', '', '', '', '', '', 47936),
(67031, 'zhCN', '瓦克索斯攀升赛', '滑翔穿过光圈。', '飞过标记赛道的检查点光圈。', '', '', '', '', '', '', 47936),
(67027, 'zhCN', '死亡暗影', '', '', '', '', '', '', '', '', 47936),
(67015, 'zhCN', '铸成答案', '', '', '', '', '', '', '', '', 47936),
(67007, 'zhCN', '档案援助', '在瓦德拉肯的档案馆与凯莫拉交谈。', '<清爽整洁的笔迹和隽永的字体迅速化为了羊皮纸上的潮湿污墨，留下一缕发酵酒饮的气味。>\n\n热诚冒险家，档案爱好者——\n\n档案馆向所有寻求答案、渴望发现、希望揭露过去和未来秘密的人发出号召！\n\n这个任务不适合心力憔悴、意志薄弱之人。\n\n唯有好奇求知的勇敢之士才可申请。\n\n——凯莫拉', '', '', '', '', '', '', 47936),
(67004, 'zhCN', '大盒装好货', '为我找到大地守护者的宝库，如果你能将它带回来，我们可以分享其中的财富。', '努力之下，我们获得了打开大地守护者的宝库所需的一切。堡垒下方就有几个宝库，找到一个，我就会奖励你。\n\n我制作了锁链来帮忙搬运。如果你能将宝库带来，我们可以分享其中的财富。\n\n注意搬运中的宝库，我也派遣其他人前去寻找了。', '', '', '', '', '', '返回司炉工沃尔莱克斯身边，无论是否找到大地守护者的宝库。', 47936),
(67002, 'zhCN', '碧蓝林海障碍赛', '滑翔穿过光圈。', '飞过标记赛道的检查点光圈。', '', '', '', '', '', '', 47936),
(66998, 'zhCN', '制火靠……水', '在迸发岩窟中消灭熔岩元素。', '我照顾熔岩元素这么多年，还没见它们有过这种反应！我们都没法把它们控制在洞穴里了。\n\n你有空吗？我们能守住出口，你进去削减它们的数量。\n\n给，带上这个瓶装水元素吧。\n\n在照顾熔岩元素的时候，它已经无数次救了我的命。', '', '', '', '', '', '', 47936),
(66997, 'zhCN', '护理指南', '在红玉新生法池的花园中与瓦艾罗斯见面。', '我很感谢拉斯塔克能够接受使命，成为雏龙护理员。<一只雏龙咬住了他的耳朵，轻轻地向下推挤，令他的面孔一阵抽动。>毕竟有这么多小宝贝都长牙了。\n\n另外，育幼花园也确实面临着许多挑战。雏龙都很紧张，护理员则——比往常更紧张。\n\n拜托了，如果你有空的话，请到下面的花园里来找我。我们真的需要你的帮助！', '', '', '', '', '', '', 47936),
(66989, 'zhCN', '有益的收获', '', '', '', '', '', '', '', '', 47936),
(66972, 'zhCN', '老石牙', '在安东尼达斯营地附近放倒老石牙。', '我有个艰难的任务要交给你，$p。并非每次狩猎都是为了展示技术。有些时候，这么做是为了展现慈悲。\n\n在安东尼达斯营地东边的森林里，漫步着一头年迈的雄性猛犸象。我就在远处望见了他，也能时长听见他悲伤的吼啸。他肯定深陷痛苦。\n\n他已经开始践踏低矮的灌木了，我担心他很快就会对其他人构成威胁。\n\n如果你能让这个疲惫的灵魂安息，我这个老头才能露出笑脸。把他的牙齿带回来，让我们能够纪念他。', '', '一头古老的猛犸公象，对自身和他人都是个威胁。', '老石牙', '', '', '在僻壤营地与赫米特·奈辛瓦里二世交谈。', 47936),
(66971, 'zhCN', '死亡的面孔', '在冬裘谷北部猎捕霜颚。', '告诉我，朋友。你直视过死亡的面孔吗？\n\n<奈辛瓦里停顿了片刻，想营造出戏剧性效果。>\n\n我在说什么胡话？你肯定这么做过。\n\n毕竟，死亡有千百张面孔。\n\n我听伊姆布海象人说，它的一张面孔就住在这群山之间。就连提起它的名字，都是在向冰冷的惨死发出邀请：\n\n霜颚\n\n<奈辛瓦里警惕地四处张望。>\n\n现在看在我的份上，你得去狩猎它！', '', '预示着死亡的冰上传奇。', '霜颚', '', '', '在僻壤营地与赫米特·奈辛瓦里二世交谈。', 47936),
(66970, 'zhCN', '升腾者泰弗恩', '', '', '', '', '', '', '', '', 47936),
(66969, 'zhCN', '平原氏族', '向马鲁凯的珊索克可汗报告。', '在你等待使者抵达的时候，珊索克可汗想听听氏族会议的状况。她派我前来找你，请你去马鲁凯的中心与她详谈。', '', '', '', '', '', '', 47936),
(66968, 'zhCN', '削减族群', '在罗宁之盾附近猎捕耶托尔。', '<奈辛瓦里朝道路的一旁比划着。>\n\n看到雪地中的足迹了吗？\n\n那是雪人的踪迹。\n\n它们肯定是被某些东西激怒了，才会来到道路的近旁狩猎。去看看你能不能放倒他们族群的首领。我们可不能让它们伏击旅行者！\n\n如果他凶蛮粗暴，就把他的徽记取回来。这样肯定能吓阻其他雪人。', '', '比大个雪人更要命的，是呼朋唤友的大个雪人。', '耶托尔', '', '', '在僻壤营地与赫米特·奈辛瓦里二世交谈。', 47936),
(66964, 'zhCN', '落入敌手的神器', '在碧蓝林海的失落废墟中寻找阿莉亚·舞阳。', '我们这里有许多——不对，有数不清的麻烦！\n\n天呐，该从哪儿说起呢！\n\n肯瑞托发现了碎裂之焰的图谋。他们在寻找一件名叫“瓦尔祖克斯”的神器。\n\n它具有非凡的力量，或许还具有……情感认知？如果你一直在留意状况，就会明白它极其危险。\n\n有一个叫阿莉亚·舞阳的人带着两个海象人到南边去调查碎裂之焰了。她早就应该回来了。\n\n请去找到她的行踪，帮忙阻止碎裂之焰获得这件神器！', '', '', '', '', '', '', 47936),
(66963, 'zhCN', '正在派件', '在附近的营地中告诉编目员乌尔菲德，他的补给品一时半会儿到不了了。', '我本来想告诉维维西，我能把车从烂泥里拖出来。\n\n但他就是不肯，非得要用魔法……你看看他都干了什么。\n\n<搬运工本内特长叹不止。>\n\n在我尝试和维维西讲道理的时候，你能不能跑到山上的营地去，帮我转告编目员乌尔菲德，他又要从伯拉勒斯运一箱摄影器材来了？', '', '', '', '', '', '为龙鳞先遣营地的编目员乌尔菲德带去噩耗。', 47936),
(66960, 'zhCN', '升腾者克罗基克', '', '', '', '', '', '', '', '', 47936),
(66959, 'zhCN', '商栈一日游', '从收集者的宝箱处收取商贩标币，游览商栈，随后向希里出示传单。', '<一张传单随风而来，在你的手中哗啦作响。>\n\n来自艾泽拉斯各地的稀世珍奇！虽然众口难调，本店面面俱到！\n\n众多稀罕宝贝只此一家，朋友。\n\n到奥格瑞玛的力量谷来，亲眼见证我们准备的奇迹和奥妙！\n\n——赞希里商栈\n\n<你眯起眼睛阅读微小的字体。>\n\n向老板出示传单还能获赠更多商贩标币！', '', '', '', '', '', '', 47936),
(66958, 'zhCN', '保护与驱赶', '在伊斯卡拉东部狩猎血角。', '那天，我正在和伊斯卡拉外的猎人们聊天，他们说自己遇到了一个骇人的场景。\n\n似乎有一头凶残成性的犀牛，它名叫血角，一直在袭击区域中的小型水牛。\n\n就算没有这个莫名出现的凶残暴徒，水牛在碧蓝林海遭遇的竞争本来就够多了，不能在因为它而损失成员了！\n\n把它的角给我摘来。我想给海象人朋友们留个好印象！', '', '重创本地驼牛种群的可憎野兽。', '血角', '', '', '在僻壤营地与赫米特·奈辛瓦里二世交谈。', 47936),
(66957, 'zhCN', '冰中幽影', '调查俯瞰安东尼达斯营地的冰川顶部。', '我在经过安东尼达斯营地的时候听到了窃窃私语。说在冰封的平原之上，到处都是被残忍毁坏的动物遗骸。有些甚至只剩下了淋漓的血渍。\n\n不管那是什么，它已经把法师们吓坏了，本地的野生动物也都心惊胆战。\n\n你去冰川的顶部打探一下吧。如果我是个好赌的矮人，我肯定会这么下注。任何名副其实的巅峰捕食者都会夺占那片领地。\n\n把它的一个部位带给我，我们就能让肯瑞托放宽心了。', '', '喜好玩弄猎物的歹毒猎人。', '霜拳', '', '', '在僻壤营地与赫米特·奈辛瓦里二世交谈。', 47936),
(66956, 'zhCN', '猎龙者伊戈尔丹', '', '', '', '', '', '', '', '', 47936),
(66953, 'zhCN', '全是毛茸茸', '从巨龙群岛的绒羊处，为瓦德拉肯的多赛诺斯收集20张茸裘。', '裁缝们都急着想进一批蓬松的绒羊毛。这种羊毛能帮它们在巨龙群岛的冰冷山脉中活下去。', '', '', '', '', '', '', 47936),
(66951, 'zhCN', '数量控制', '从巨龙群岛的石牙兽和驼牛处，为伊斯卡拉海象人的滕娜育收集25张回收的皮革。', '巨龙群岛最近有多个物种数量激增。确切地说，是石牙兽和驼牛。\n\n当然，我们也不想浪费资源。你尽量从这些物种身上多收集一些皮革。', '', '', '', '', '', '', 47936),
(66949, 'zhCN', '饰品盗匪', '从巨龙群岛的豺狼人处，为伊斯卡拉海象人的滕娜育收集25件失窃的饰品。', '这些豺狼人收集了不少饰品，海象人的饰品，都是从我们的村子里偷来的，甚至是从英勇牺牲的海象人身上搜刮来的。这些饰品都是我们的传家之物，理应留在我们身边。\n\n如果你能把饰品带回来，我可以教你制作饰品的技巧。', '', '', '', '', '', '', 47936),
(66948, 'zhCN', '使者驾到', '了解翡翠花园的状况。', '我得承认，我这辈子都没离开过翡翠花园，因此从未遇见过半人马，更不用说来自陆地上的凡人了。\n\n然而我来到这里并非只是为了拜访，而是恳请半人马提供援助，帮我们保护誓言石，守护我们的使命。\n\n你能赶来相助真是太好了。我们有许多事情需要讨论。', '', '', '', '', '', '', 47936),
(66947, 'zhCN', '碧蓝林海冲刺 - 进阶版', '滑翔穿过光圈。', '飞过标记赛道的检查点光圈。', '', '', '', '', '', '', 47936),
(66946, 'zhCN', '碧蓝林海冲刺', '滑翔穿过光圈。', '飞过标记赛道的检查点光圈。', '', '', '', '', '', '', 47936),
(66945, 'zhCN', '寒冰墨水', '从巨龙群岛的寒冰蛛和冰熊处，为瓦德拉肯联军的多赛诺斯收集20份寒冰排泄物。', '寒冷生态圈中的冰霜野兽能分泌一种稀有的神秘液体。这种液体具有独特的性质，可以用作理想的墨水黏合剂。由于我是个左撇子，这种不用把书页弄脏的可能性令我很感兴趣。', '', '', '', '', '', '', 47936),
(66942, 'zhCN', '破敌工程学', '从巨龙群岛的拜荒者处，为龙鳞探险队的诺克林·异圈收集10份原始仪式。', '虽然听起来有违常理，但我们应该可以研究拜荒者的仪式，并从中学习引导元素能量的新方法。等我们参透了他们的魔法通路，应该就能借此制作许多开创性的工程学产品。', '', '', '', '', '', '', 47936),
(66939, 'zhCN', '猎捕狩猎大师', '在伊姆布之盾附近击败狩猎大师克拉兰克。', '我听僻壤营地的一名守卫说，附近有一个混球正在残害本地的野生动物。那家伙管自己叫“狩猎大师”。\n\n狩猎是正经事，但我不能容忍有人折磨活物。\n\n另外，我的马车正好需要一个幸运符。\n\n<奈辛瓦里朝一旁吐了一口唾沫。>\n\n把它的爪子给我带来。', '', '以折磨无辜的野生动物取乐的恶毒豺狼人。', '狩猎大师克拉兰克', '', '', '在僻壤营地与赫米特·奈辛瓦里二世交谈。', 47936),
(66938, 'zhCN', '猛犸牙髓', '从巨龙群岛的猛犸象处，为马鲁克半人马氏族的杜蕾尔收集20份牙髓。', '开发新颖非凡的美酒是我们的众多专长之一。虽然我们很享受尝试奇妙原料的过程，但我们也一直储备着几种常用原料。\n\n其中之一就是猛犸象牙的牙髓。我们现在牙髓短缺，非常感谢你能为我们的炼金师收集一些。', '', '', '', '', '', '', 47936),
(66933, 'zhCN', '镜天湖飞驰', '滑翔穿过光圈。', '飞过标记赛道的检查点光圈。', '', '', '', '', '', '', 47936),
(66931, 'zhCN', '谁人作乱？', '查明红玉新生圣地的骚动。', '那样的晃动不太寻常。', '', '', '', '', '', '', 47936),
(66929, 'zhCN', '一张都不能少', '找回游马多姆的套牌。', '$PC，你愿意帮助我把卡牌找回来吗？\n\n我告诉瀬人苟萨，我需要卡牌才能教其他学生玩炉石传说。我打算组建一个正式的俱乐部，可她不肯把卡牌还给我！\n\n她总是对我很粗鲁，但这次比以往更过分。', '', '', '', '', '', '', 47936),
(66925, 'zhCN', '[DNT] Boar-B-Q', '', '', '', '', '', '', '', '', 47936),
(66921, 'zhCN', '马鲁凯飞驰', '滑翔穿过光圈。', '飞过标记赛道的检查点光圈。', '', '', '', '', '', '', 47936),
(66903, 'zhCN', '清理宝库', '', '', '', '', '', '', '', '', 47936),
