(66893, 'zhCN', '复苏之喙', '在充盈急流治疗$1oa只受伤的角行鸟。', '我可能对水元素一窍不通，但我很了解角行鸟！\n\n我准备了一种药膏，可以让角行鸟保持健康，并可以投入战斗。虽然还没有机会对角行鸟真正使用这种药膏，但能做的所有研究我都已经做好了。\n\n是时候让它们勇敢起来了！', '', '', '', '', '', '', 47936),
(66892, 'zhCN', '泛滥两难', '在充盈急流消灭$1oa个水元素。', '元素正在屠戮角行鸟！我练习过如何与大型动物搏斗，但从来没有想过必须和元素生物战斗！它们和那些超大号的雷霆蜥蜴宝宝一点都不像……\n\n<达扎克罗丝忧伤地叹息着。>\n\n请你解决一些元素。角行鸟的判断力很强。如果你能削减元素的数量，角行鸟就能发起反击！', '', '', '', '', '', '', 47936),
(66886, 'zhCN', '翡翠花园攀升赛 - 进阶版', '滑翔穿过光圈。', '飞过标记赛道的检查点光圈。', '', '', '', '', '', '', 47936),
(66885, 'zhCN', '翡翠花园攀升赛', '滑翔穿过光圈。', '飞过标记赛道的检查点光圈。', '', '', '', '', '', '', 47936),
(66884, 'zhCN', '防火装备', '从巨龙群岛的贾拉丁处，为伊斯卡拉海象人的滕娜育收集10件防火装备。', '贾拉丁的盔甲能够抵御最猛烈的火焰。我们可以用这种极品装备对付他们！\n\n看看你能从贾拉丁那里收集到什么，我们可以研究一下，然后在自己的装备上重现这种附魔。', '', '', '', '', '', '', 47936),
(66883, 'zhCN', '古老的角环', '将物品交给艾克萨德里亚。', '<艾克萨德里亚可能想要这个。>', '', '', '', '', '', '', 47936),
(66882, 'zhCN', '失落的战斗背包', '将物品交给利爪猎手卡薇亚。', '<利爪猎手卡薇亚可能想要这个。>', '', '', '', '', '', '', 47936),
