(66879, 'zhCN', '角行浩劫', '在充盈急流与达扎克罗丝见面。', '角行鸟！它们的喙能咬断骨头，而且它们的脚程很快，能够迅速逃离危险。群岛上的所有东西都能成为它们的食物。\n\n这次的使命是最简单的了！就是我和我挚爱的大鸟共度时光。就算出了事，我也知道该怎么对付岛上的所有动物。\n\n你要不要跟我去北边的角行鸟高地啊？我不介意在准备的时候多个帮手。', '', '', '', '', '', '', 47936),
(66878, 'zhCN', '泽地漫游 - 进阶版', '滑翔穿过光圈。', '飞过标记赛道的检查点光圈。', '', '', '', '', '', '', 47936),
(66877, 'zhCN', '泽地漫游', '滑翔穿过光圈。', '飞过标记赛道的检查点光圈。', '', '', '', '', '', '', 47936),
(66874, 'zhCN', '保护过去：注能大厅', '从注能大厅的原始海啸处获取全息分配仪。', '你知道吗？在提尔要塞的深处有一个巨大的设施，叫做……注能大厅。太神秘了！太迷人了！那么多的可能性啊！\n\n守护者提尔将许多秘密藏在了那里。不知道都有些什么呢？他可是所有守护者中最有智慧的那个。\n\n<凯莫拉满眼希望地注视着你。>\n\n然而，拜荒者把那里弄得一团糟。如果不阻止他们，他们肯定会对守护者提尔的奇迹造成破坏。请你去除掉他们，以免他们造成过多破坏。', '', '', '', '', '', '', 47936),
(66873, 'zhCN', '保护过去：碧蓝魔馆', '从碧蓝魔馆的安布雷斯库获取辛达苟萨的记录。', '碧蓝魔馆珍藏着令人瞠目的远古圣物和研究成果。蓝龙军团肯定发现了惊人的奇迹！\n\n请你深入碧蓝魔馆，看看能不能取回些什么。我相信肯定有许多东西值得学习！不过要小心一点，那里同样“珍藏着”不该单独留存的危险之物。', '', '', '', '', '', '', 47936),
(66870, 'zhCN', '保护过去：红玉新生法池', '从红玉新生法池的基拉卡处获取原始注能龙蛋。', '天啊，拜荒者部队占领了红玉新生法池，我们的幼童危在旦夕。\n\n我听说他们将元素魔法注入了我们的龙蛋，天知道这会发生什么意外！也许……\n\n$p，请你进入法池，想办法从拜荒者身上给我取回一件信物。我可以参考一些研究成果，看看能不能救助已经注能的龙蛋。', '', '', '', '', '', '', 47936),
(66868, 'zhCN', '保护过去：提尔的遗产', '从奥达曼的时空领主戴欧斯处获取迷时珍品。', '我一直在档案馆中翻查守护者提尔的信息。令人意外的是，每一处提到奥达曼的地方都被扯了下来，只有这半页纸上提到了其中隐藏的秘密。\n\n是不是很有意思？我相信他肯定在那里隐藏着别的秘密。也许你和你的朋友可以进去搜寻一下。不管你能给我带回什么，我都会多加珍重的。', '', '', '', '', '', '', 47936),
(66866, 'zhCN', '圣物回收：注能大厅', '从注能大厅的原始海啸处获取水合腐蚀核心。', '显然守护者提尔在提尔要塞下方建造了一处巨型设施。凯莫拉已经因为其中的“可能性”而欣喜若狂了。\n\n据我所知，这个守护者拥有许多秘密和发明，都很实用。如果你碰巧闯了进去，只要四处张望一下，就能找到一些……奇妙的东西。\n\n对了，有些拜荒者可能捷足先登了。解决掉他们，别让珍贵的泰坦圣物毁于一旦。', '', '', '', '', '', '', 47936),
(66865, 'zhCN', '圣物回收：碧蓝魔馆', '从碧蓝魔馆的安布雷斯库处获取水晶法器。', '据说碧蓝魔馆中贮藏着最古老、最强大的神器和圣物。拥有如此伟力的东西都必须得到……保管。\n\n去吧，深入碧蓝魔馆，看看能不能取回些什么。记得带上几个朋友，那地方可能充斥着各种危险而荒唐的魔法怪物。', '', '', '', '', '', '', 47936),
(66858, 'zhCN', '商栈一日游', '从收集者的宝箱处收取商贩标币，游览商栈，随后向陶妮·海髯出示传单。', '<一张传单随风而来，在你的手中哗啦作响。>\n\n你是不是收藏家？生意人？或是冒险家？\n\n我们走遍了艾泽拉斯的天涯海角，为你这样的客人甄选了优质精品！\n\n到暴风城法师区新开张的门面来，瞧瞧时下最新的商品吧！\n\n——陶妮和怀尔德商栈\n\n<你眯起眼睛阅读微小的字体。>\n\n向老板出示传单还能获赠更多商贩标币！', '', '', '', '', '', '', 47936),
(66848, 'zhCN', '风之征兆', '协助欧恩·森什滕举行仪式。', '欧恩哈拉诉说的语言与我们不同。她的声音将由四风传递。我们这些秘术师接受过训练，能够感受她的存在，听从她的呼唤，解读她的讯息。\n\n我已经使用你收集的材料，将图腾与这次特别的呼唤连结在一起。协助我举行仪式，汇聚她的声音，让我能解读她的歌曲。', '', '', '', '', '', '', 47936),
(66847, 'zhCN', '化身巨龙牢窟：噬雷之龙的怒火', '进入化身巨龙牢窟，击败莱萨杰丝。', '不！我们囚禁了化身巨龙，保护这个世界不被他们蹂躏。而现在，莱萨杰丝企图释放他们！\n\n决不能让她成功，$n。如果不能阻止她，那么艾泽拉斯将会毁于一旦。\n\n我必须返回守护巨龙之座，和诺兹多姆一起为未来做好谋划。但不必担心，我不会让你孤立无援。等你进入了牢窟，卡雷苟斯和卡德加会与你会合。\n\n祝你好运，勇士。', '', '', '', '', '', '在瓦德拉肯的守护巨龙之座与卡雷苟斯谈谈。', 47936),
(66846, 'zhCN', '套牌核心', '帮助幻影制作一张新卡牌。', '巨龙群岛开始沉眠的那一天，是我最后一次对局的日子。命运如此残酷无情，在比赛之前，我弄丢了自己最强力的卡牌。\n\n你瞧，郭熙的那张卡牌就是我的。我不知道她的先祖是在哪里捡到的。\n\n唉，那张卡牌在她的家族中代代相传，我不能随随便便将它据为己有。我犯了个愚蠢的错误。\n\n也许我们可以制作一张卡牌？一张独一无二的卡牌……没错！你愿意帮我吗？\n\n你准备好了就告诉我。', '', '', '', '', '', '', 47936),
(66845, 'zhCN', '传奇踪迹', '找到龙人幽灵并取回传说卡牌。', '昨晚，我躺在铺盖上，正在翻过来滚过去，就有一股异常的寒意涌入了酒馆。\n\n然后不知道从什么地方冒出来了一个龙人的幽灵！它穿过了我的行李，就这么凭空消失了！\n\n我一觉醒来，才知道最可怕的是什么……那个幽灵肯定偷走了我最珍贵的卡牌！\n\n你能不能做个大好人，帮我把它找回来？那是我最宝贵的资产。', '', '不管出于什么目的，总有比偷摸扒窃更好的选择。', '神秘幻影', '', '', '', 47936),
(66844, 'zhCN', '巨狐修卡利', '消灭飞天雌狐修卡利。', '我在这里见过不少东西，最高傲的是修卡利，一头飞天的大雌狐狸。\n\n遗憾的是，她捕食了一个豺狼人萨满祭司，现在已经被腐朽逼疯了。我看到她吃下了一头幼崽，就知道情况肯定不对了。\n\n我把它的幼崽带到了这里，但修卡利袭击了我，一下横扫就把我打飞了。我好不容易才捡回一条命。\n\n必须想办法终结修卡利。如果腐朽侵蚀了她的心智，那她很快就要来捕食我们了。', '', '这只曾经无比高贵的狐龙统治着森林的空域，如今已被腐朽之力逼疯了。', '飞天雌狐修卡利', '', '', '', 47936),
(66843, 'zhCN', '无路克走', '找到路克的下落。', '啊！你见过我的助手路克吗？\n\n那小子本来说要出去转转，结果都一个小时了，现在还没回来！\n\n我跟他说这里不安全，别走得太远了，但那小子就和公羊一样倔强。\n\n也不是我要责怪他，这荒郊野岭的，他还特别喜欢鲜花。\n\n你能帮我找找他吗？三瀑勘查点还等着我和这辆货车呢！', '', '', '', '', '', '', 47936),
(66841, 'zhCN', '往昔的碎片', '取回神器并将其交给萨奈莎·银树。', '我看到你一直在营地这儿忙里忙外，帮助别人。那你能帮老加纳尔一个忙吗？\n\n调查这片区域的时候啊，我这双老眼发现了一些东西，可能是个古老的陶器或罐子，它就在南方的瀑布边上。\n\n我不太会游泳，如果你能把这个发现带给萨奈莎·银树，我愿意付你钱。', '', '', '', '', '', '将神器带给萨奈莎·银树。', 47936),
(66840, 'zhCN', '饮水安全', '将三份水源样本带给玛尼·利德。', '我最重要的职责，就是确保所有人都能喝上清洁的水。\n\n东边的豺狼人正在操弄腐蚀，我必须确保营地安全无虞。\n\n亲自采样可能会惊动别人，但我觉得还是有必要进行检验的。\n\n你去附近的三个瀑布采集一些样本，我就给你丰厚的报酬。', '', '', '', '', '', '', 47936),
(66839, 'zhCN', '酿酒时间！', '收集血莓、青铜号角莓和巨龙箔金花。', '大伙儿刚好有了歇息的时候，都想着要喝上一杯了，我们就挤到旅店里去了。\n\n结果呢，啊！我是真的不敢相信！他们不卖酒！这算哪门子旅店？也就强链那家人开得出这种破店！\n\n自己动手，美酒不愁！东边的森林里长着花花草草，能用来酿造甜美的蜜酒。想不想帮我一把，去摘几朵花？你也会拿到好处的。', '', '', '', '', '', '', 47936),
(66838, 'zhCN', '高处不胜寒', '从厚鬃熊处收集厚厚的熊毛皮。', '要当好旅店老板，你就得预测客人的需求。不幸的是，我没预见这地方会有那么冷，唉哟！\n\n我的客人们需要毯子，要优质的厚毯子。熊皮应该也行？\n\n东边的森林里就有几头大熊，如果你能把它们的皮毛带来，我会付你酬金！\n\n帮帮忙吧？替这些冒险者想想，他们的脚都要冻坏了……', '', '', '', '', '', '', 47936),
(66837, 'zhCN', '饥一顿', '从三瀑勘查点南方的龙麒阔步者和条纹驼牛身上收集肉类。', '我的兄弟瓦尔多本来应该订购更多补给，结果都整整一周了，什么都没送来。\n\n我倒是一点都不惊讶，那头懒驴肯定又打瞌睡了！现在我们食物匮乏，我忙着处理自己的杂活，还要收拾瓦尔多的烂摊子，根本没空出去打猎！\n\n你能帮我们狩猎吗？南边有不少龙麒阔步者和条纹驼牛，它们的肉能维持厨房的运转，一直撑到我订购的补给送来。', '', '', '', '', '', '', 47936),
(66836, 'zhCN', '阳斑灌木林巡回赛——进阶版', '滑翔穿过光圈。', '飞过标记赛道的检查点光圈。', '', '', '', '', '', '', 47936),
(66835, 'zhCN', '阳斑灌木林巡回赛', '滑翔穿过光圈。', '飞过标记赛道的检查点光圈。', '', '', '', '', '', '', 47936),
(66834, 'zhCN', '博学者雷伦', '在供奉之穴中献上供品，见证雷伦的各个教诲。', '把你的供奉带到中央的洞穴吧。你将见证博学者雷伦的传奇，是他创立了半人马所知的生活之道。', '', '', '', '', '', '', 47936),
(66831, 'zhCN', '蛙之所在才是家', '在新生法池与凯希姬见面，并释放救出的青蛙。', '青蛙都聚集起来了，$n！我们该把它们带去找阿柯拉。在龙蛙感到厌倦并纷纷离开之前，青蛙在新生法池里会很安全的。\n\n唔，好吧，我想我们并没有找到能让阿柯拉开心的东西。希望她能理解……', '', '', '', '', '', '', 47936),
(66830, 'zhCN', '龙蛙向导！', '使用凯希姬的萤火虫罐，将$1oa只被霸凌的青蛙引诱到安全处。', '噢，这些龙蛙都快把我逼疯了！\n\n<凯希姬生气地跺着脚，把眼镜都弄歪了>\n\n这群大块头的贪心鬼就爱欺负人！这地方是以它们命名的，但不代表它们能四处乱蹦，还把所有比自己小的东西全吞进肚里！\n\n给，这是萤火虫罐——青蛙关怀人士的好朋友。它能抚平青蛙的情绪，这样你就能收集它们，免得它们受到伤害。\n\n如果有龙蛙挡了你的道，别害怕，给它们一点颜色看看！', '', '', '', '', '', '', 47936),
(66828, 'zhCN', '陷坑环抱', '在龙蛙陷坑与凯希姬见面。', '我从没见过阿柯拉那么不安。她通常和自己种的花一样阳光，但那个传说对她来说很重要。她一直把传说挂在嘴边。嗯……\n\n<凯希姬摆弄着眼镜。>\n\n我对植物一窍不通，而且我觉得青蛙只能让我高兴起来，对她没什么用……\n\n不过北边有一个宁静的地方，龙蛙陷坑，我通常会在那里冥想。也许我们可以在那里找到让她开心的东西？或者说，至少能想个办法来帮帮她？', '', '', '', '', '', '', 47936),
(66827, 'zhCN', '劳作之花', '在花园附近收集$1oa个成熟的巨龙果、$1oa朵芳香的龙花和$1oa个茏葱种荚，并供奉给巨龙之灵。', '传说巨龙之灵只为热爱生命的人歌唱。\n\n我多年来一直打理着这座花园……我想，我的植物和我终于准备好了。\n\n我会在池边开始布置。你可以帮我收割！\n\n采集灌木下方的种荚、阳光原野上的龙花，还有树梢间高挂的巨龙果。我的旧耙子可以借给你。注意了——植物有些时候也会发狂的！', '', '', '', '', '', '', 47936),
(66825, 'zhCN', '红玉焕生使命', '在红玉新生圣地参加焕生使命仪式。', '$p！你真是走运！我们正要开始举行焕生使命仪式，你能来帮忙的话就真是荣幸之至了。\n\n龙兽的使命非常特别，有些会成为熟练的园丁，有些则负责照看特定的生物。\n\n这些年轻的龙兽刚刚完成训练，正准备接受第一个使命。我知道他们都很期待你能参加。等你准备好了，就向他们展示这张桌子上的物品吧。', '', '', '', '', '', '', 47936),
(66805, 'zhCN', '忠诚之钥', '收集$1oa把巨型黑曜钥匙。', '', '', '', '', '', '', '将组合好的钥匙交给黑曜堡垒的萨贝里安。', 47936),
(66788, 'zhCN', '期盼未来', '帮助抚育者伊莱奥恢复区域。', '我简直不敢相信！黑龙军团的龙蛋！真是不容易啊！\n\n但你看看这地方的状况啊！这可不行！这些蛋应当得到更好的照料。\n\n但那两个呆瓜像顽童一样，为生命缚誓者的青睐而争吵不休，他们根本不会替我们着想。但是有你在，你肯定不会坐视老护卵者孤立无援吧？', '', '', '', '', '', '', 47936),
(66787, 'zhCN', '翼眠环线 - 进阶版', '滑翔穿过光圈。', '飞过标记赛道的检查点光圈。', '', '', '', '', '', '', 47936),
(66786, 'zhCN', '翼眠环线', '滑翔穿过光圈。', '飞过标记赛道的检查点光圈。', '', '', '', '', '', '', 47936),
(66785, 'zhCN', '最后的护卵者', '与抚育者伊莱奥交谈。', '我理解你的担忧，$c，但一切马上就会水落石出。啊，看起来我们有伴了。\n\n你可以留下来见证接下来的事，一定能让你大开眼界的。\n\n等你有空了，就去和我们的护卵者谈谈，她肯定需要援助。', '', '', '', '', '', '与抚育者伊莱奥交谈', 47936),
(66784, 'zhCN', '扼制风暴', '消灭拜荒风暴召唤者，关闭风暴走廊传送门。', '作为一个只能用两条腿站着的生物，你已经打得很好了！\n\n但只要拜荒者仍能招来援军，我们再顽强也无济于事。我们必须关闭传送门，就是那道风暴长廊！\n\n冲进附近的洞穴里，消灭支撑传送门的拜荒风暴召唤者！我会尽力协助你。', '', '', '', '', '', '', 47936),
(66783, 'zhCN', '修复誓言', '帮助珊索克可汗、提嘉里可汗、尊可汗萨雷丝特和麦琳瑟拉交换礼物。', '千百年前，我和最初的半人马立下了友谊与合作的誓言。虽然时过境迁，但我们应该重修旧好。\n\n为了帮助世世代代的半人马铭记他们与绿龙军团的友谊，我们谱写了一首诗歌。每节诗歌都需要可汗献上供品作为回应。我希望半人马依然记得它们最初的意义。\n\n赠礼的选择至关重要，选择合适的供品，我们就能铸成盟约。', '', '', '', '', '', '', 47936),
(66781, 'zhCN', '口感问题', '在捕鲸者海角为莫迪干·铁腭寻找一块石头。', '太无礼了！\n\n有几个臭气熏天的鳄鱼人偷走了我的一丁点设备，我们就得全体停工……哈！在你长成个小宝宝之前，我就在舔石头了！根本用不着什么花里胡哨的侏儒装置。\n\n给我找块石头，我就给你示范！', '', '', '', '', '', '返回莫迪干·铁腭身边。', 47936),
(66780, 'zhCN', '王位宣称者', '与拉希奥的追随者交谈。', '我致力于从毁灭的边缘拯救艾泽拉斯，而这个白痴竟然觉得自己能够横插一脚，将守护巨龙的头衔据为己有？这可不行。\n\n去和我的人民谈谈，$n。看看他们如何看待我，看待我为这个世界所做的一切。', '', '', '', '', '', '', 47936),
(66779, 'zhCN', '顺位继承人', '与萨贝里安的追随者交谈。', '我是奈法利安的继承人，黑龙军团残部的在世领袖，真没想到我与生俱来的领导权竟会遭到挑战。何况是一个狂妄自大、比你都年轻的龙崽子。\n\n无所谓了，如果你觉得这些显而易见的事实还不够充分，大可以去问问军团里的成员。不必听信我一人之言。', '', '', '', '', '', '', 47936),
(66778, 'zhCN', '乌克图鲁特急流 - 进阶版', '滑翔穿过光圈。', '飞过标记赛道的检查点光圈。', '', '', '', '', '', '', 47936),
(66777, 'zhCN', '乌克图鲁特急流', '滑翔穿过光圈。', '飞过标记赛道的检查点光圈。', '', '', '', '', '', '', 47936),
(66737, 'zhCN', '更好的开始', '在$1oa块肥沃土壤中撒播种子，并使它们生长成熟。', '瓦艾罗斯勤勤恳恳，但雏龙总有办法惹是生非。他们当然不会来惹我——但我想，并不是每条龙都能明白自己所处的地位。\n\n我不想鼓励这种在外面贪玩而不去学习的行为，但我也想帮助你更有效地保卫花园。带上这些种子，把它们种在附近吧。等它们成熟了，盛放的花朵就会散发出一种令昆虫厌恶的香气。\n\n园丁可以帮你，如果你谦逊有礼，我的青铜龙同胞也可能愿意相助。', '', '', '', '', '', '', 47936),
(66735, 'zhCN', '稍加修剪', '修剪$1oa株过度生长的灌木。', '蜜蜂把雏龙吓坏了，这还不是唯一头疼的问题。虽然授粉通常是一件好事，但蜂群已经让花朵生长失控了。\n\n你能不能带上我的剪刀，去修剪一下灌木？有些灌木已经开始萌芽，要长出危险的鞭笞者了，希望我们能阻止其他灌木生长到这个地步。毕竟治疗为辅，预防为主嘛。\n\n而我现在……非常需要一大堆预防工作，$n。', '', '', '', '', '', '', 47936),
(66734, 'zhCN', '狂蜂浪蝶全走开', '使用烟雾散播器安抚并收集$2oa只讨厌的蜜蜂，然后在湖边将它们放生。', '哦，感谢生命的缚誓者！总算有人腾出手来了！\n\n这些花园本来是雏龙的游乐场，但最近花开繁盛——引来的蜜蜂已经失控了。雏龙都吓坏了，巨龙也很恼火，可昨天有一只雏龙被蛰了一下，它就——\n\n<瓦艾罗斯靠深呼吸让自己恢复镇静，随后殷切地看着你。>\n\n你能不能把蜜蜂收集起来，把它们迁到湖边去？带上这个烟雾散播器，它能让蜂群平静下来。', '', '', '', '', '', '', 47936),
(66733, 'zhCN', '绝顶树冠激流冲刺 - 进阶版', '滑翔穿过光圈。', '飞过标记赛道的检查点光圈。', '', '', '', '', '', '', 47936),
(66732, 'zhCN', '绝顶树冠激流冲刺', '滑翔穿过光圈。', '飞过标记赛道的检查点光圈。', '', '', '', '', '', '', 47936),
(66730, 'zhCN', '真正的幸存者', '在碧蓝林海的冰封湖附近寻找老灰牙并与其交谈。', '我知道我们遇到了挫折，但我们不能忘记此行的目的。我们的人民还指望着我们，我可不打算在今天辜负他们。我们需要在这处蛮荒之地找一处临时的安身之地，而我刚好知道那个地方。\n\n都别发牢骚了，动起来。', '', '', '', '', '', '在碧蓝林海的冰封湖附近寻找老灰牙并与其交谈。', 47936),
(66728, 'zhCN', '烬琉航线 - 进阶版', '滑翔穿过光圈。', '飞过标记赛道的检查点光圈。', '', '', '', '', '', '', 47936),
(66727, 'zhCN', '烬琉航线', '滑翔穿过光圈。', '飞过标记赛道的检查点光圈。', '', '', '', '', '', '', 47936),
(66726, 'zhCN', '狂野禁猎区巡回赛 - 进阶版', '滑翔穿过光圈。', '飞过标记赛道的检查点光圈。', '', '', '', '', '', '', 47936);
INSERT INTO `quest_template_locale` (`ID`, `locale`, `LogTitle`, `LogDescription`, `QuestDescription`, `AreaDescription`, `PortraitGiverText`, `PortraitGiverName`, `PortraitTurnInText`, `PortraitTurnInName`, `QuestCompletionLog`, `VerifiedBuild`) VALUES
(66725, 'zhCN', '狂野禁猎区巡回赛', '滑翔穿过光圈。', '飞过标记赛道的检查点光圈。', '', '', '', '', '', '', 47936),
(66724, 'zhCN', '冰湖垂钓者', '获得$1oa条冰湖鱼并将其放入供品篮。', '很抱歉把你牵扯进来了，旅行者。\n\n我的兄弟总是有些……三心二意。这还是他最近一次犯蠢，但没准就会丢了性命。\n\n他就是不肯听我的，估计也不会听你的劝。\n\n但他最挂念的就是我们的先祖，冰湖垂钓者考里克。她的话也许有用。\n\n请抓捕几条冰湖鱼，把它们带到这里来。她的灵魂依然留存在这块石头里，我能用冰湖鱼和她沟通。', '', '', '', '', '', '', 47936),
(66722, 'zhCN', '狂野禁猎区障碍赛 - 进阶版', '滑翔穿过光圈。', '飞过标记赛道的检查点光圈。', '', '', '', '', '', '', 47936),
(66721, 'zhCN', '狂野禁猎区障碍赛', '滑翔穿过光圈。', '飞过标记赛道的检查点光圈。', '', '', '', '', '', '', 47936),
(66719, 'zhCN', '退一步', '保护自己，抵抗召唤。', '朋友，我怀着沉痛的心情告诉你，我非常熟悉你们一族在这些废墟中所遭遇的困境。如果你继续深入，肯定也会像他们一样屈从于疯狂。\n\n说是后天养成也好，说是天生本性也罢，你听到的召唤源于生理结构，你有一种必须被满足的渴望。\n\n我很遗憾要这么说，我有一种方法，能够满足这种诅咒导致的渴望。虽然不太寻常，但是可以让你正常行动……至少暂时可以。', '', '', '', '', '', '', 47936),
(66718, 'zhCN', '豺狼人必须死', '', '', '', '', '', '', '', '', 47936),
(66715, 'zhCN', '大撤离', '在碧蓝林海的雪皮营地中营救海象人。', '眼下最重要的就是把我的人带回来，最好是完整地带回来。\n\n而且，虽然我很不想这么说，但我这个状态不适合战斗。\n\n你愿意帮我们一把吗？', '', '', '', '', '', '与霜齿交谈，进一步了解海象人猎手。', 47936),
(66712, 'zhCN', '闪霜飞越 - 进阶版', '滑翔穿过光圈。', '飞过标记赛道的检查点光圈。', '', '', '', '', '', '', 47936),
(66711, 'zhCN', '暗中老饕', '为哈达莉收集$1oa个淡水螺。', '由于我们氏族本身的性质，有些资源总是短缺。我们没法负担起宝贵的时间，没空向这片土地索要金属资源。\n\n已故的尊可汗和许多人建立了贸易往来，我觉得没有理由终止他们的服务。\n\n附近的河湾里有不少水坑，我们会在那里捕捉淡水螺。对我们的地下邻居来说，这算是一种美味。把它们带给我的联络人，就能换取矿石了。', '', '', '', '', '', '', 47936),
(66710, 'zhCN', '闪霜飞越', '滑翔穿过光圈。', '飞过标记赛道的检查点光圈。', '', '', '', '', '', '', 47936),
(66709, 'zhCN', '战地医师入门', '帮助老灰牙从伤势中恢复。', '<这名负伤的海象人在森林中不知躺了多久，如果没有救助，他应该撑不了多久。>', '', '', '', '', '', '', 47936),
(66708, 'zhCN', '驭雪而行', '在碧蓝林海寻找失踪的海象人猎手。', '你好，$c。这处魔法穹顶真是壮观，你说呢？虽然它能让我们不受冰风啃噬，不受荒野之苦，但我们也不能永远依赖肯瑞托。\n\n几天之前，我们最老道的几名猎手深入森林去寻找食物和补给，结果到现在也没有回来。尽管领头的老灰牙是位经验丰富的远行者，同时也是个老练的猎人，但我还是担心他和猎团的安危啊。\n\n你能帮我寻找他们吗？', '', '', '', '', '', '在碧蓝林海寻找失踪的海象人猎手', 47936),
(66704, 'zhCN', 'Mugurlglrlgl！', 'Murglgulglrrlglgul！', 'Mrglgulglrrlglgul！Grurguglullgurl！\n\nGruglrlgllrugl rrgulgrulgrgl grugll gurgull gur。Murgllgllrugl gurgllglrl Murgul gruggullgl。Murguglegurgllgur gurgll gurgulgul guruulgurllgr guuglrllgl。\n\nMgrgulllglll gurl gugll。\n\n<你不确定这到底是什么意思，但看着频繁出现的捅刺动作，也许这个鱼人希望你消灭什么东西。>', '', '', '', '', '', '', 47936),
(66703, 'zhCN', '雪球效应', '从碧蓝林海的雪皮萨满处取回$1oa个雪皮图腾。', '雪皮豺狼人很聪明，他们知道把食物放在冰上，食物就能保留更久。但冰保不住，魔法冰更好！\n\n这就需要萨满了。它们把霜齿放在这里，让他看着美味的海象人肉活活饿死。\n\n如果$r想帮助海象人，时间就要没有了。\n\n但霜齿知道怎么打破那种魔咒。\n\n为什么霜齿帮你？他也不喜欢萨满。', '', '', '', '', '', '', 47936),
(66700, 'zhCN', '幽黑位点', '将幽黑位点带给传送师艾瑞琳。', '这可太吊人胃口了。碎裂之焰承受不住位点的力量，但它在我的手中却很合适。真有趣啊。\n\n<阿戴内多摇了摇头。>\n\n还是算了吧，今天不行，不能重演了。把它从我身边带走，这不是我该承受的重担。\n\n再会了，亲爱的朋友。', '', '', '', '', '', '', 47936),
(66699, 'zhCN', '当地包打听', '与安东尼达斯营地附近的海象人交谈。', '卡雷苟斯很聪明，他选择寻求海象人的帮助。他们世代生长在这里，因此通晓这片土地。\n\n在前往林海各处的营地时，许多海象人都会来到这里休息一阵。\n\n去问问吧！肯定有人了解本地的魔网。', '', '', '', '', '', '', 47936),
(66692, 'zhCN', '红玉新生圣地赛道 - 进阶版', '滑翔穿过光圈。', '飞过标记赛道的检查点光圈。', '', '', '', '', '', '', 47936),
(66690, 'zhCN', '诺库德阻击战：最后的先祖', '在诺库德阻击战中击败巴拉卡可汗，并收集先祖勋章。', '你证明了自己是我们的盟友，也是真心想要了解我们的价值观和处世之道。我还可以向你介绍一位先祖，不过也更为危险。\n\n消灭背信弃义的诺库德领袖巴拉卡，弑父的孽子。他一直戴着一枚珍贵的护符，把它带给我，我会永远欠你一份情。', '', '', '', '', '', '', 47936),
(66689, 'zhCN', '不只是石头', '向瓦图展示雷触碎片。', '<这些碎片触感光滑，微微灼热，核心深处的闪电火花闪烁不灭。>\n\n<也许瓦图或欧勒克对它们略知一二。>\n\n<与碎片分离的想法令你产生了一种冲动，你只想紧紧地抱着这枚碎片，将它永远留在身边。>', '', '', '', '', '', '返回松木哨站的瓦图处。', 47936),
(66688, 'zhCN', '风之迹印', '收集风之供品，将其放在鸣歌之石附近的供品容器中。', '元素是这个世界真正的原初居民，当它们向半人马发出挑战，希米亚带着我们的赐福前去迎战：风的赐福。\n\n平原中伫立着一块吟歌之石，你可以在那里献上风之供品，唤起她的回忆。这些供品在我们身旁随处可见——鸟羽、苞芽、河畔芦苇。', '', '', '', '', '', '', 47936),
(66687, 'zhCN', '猛兽之地', '收集$1oa张纺影者的网，$2oa个狐龙之爪和$3oa枚雷背兽鳞。', '你肯定听说过博学者雷伦，他给了半人马在无情大地上求生的能力。要见证他的回忆，就必须献上相称的野兽作为供品。\n\n多加小心，旅行者。它们虽然不如千万年前那么危险，但依然是这片平原上数一数二的掠食者。', '', '', '', '', '', '', 47936),
(66684, 'zhCN', '追逐风暴', '消灭拜荒者并摧毁风暴魔法的源头。', '<瓦图扯出了碎片，疼痛令他大气直喘。>\n\n我……完全失控了。欧勒克是对的。这种可怕的魔法肯定是拜荒者捣的鬼。快去阻止他们，求你了！\n\n我必须把兄弟带回营地。', '', '', '', '', '', '', 47936),
(66683, 'zhCN', '最后分析法', '在松木哨站调查雷触碎片的信息。', '<瓦图双眼紧闭，两手交叉，止不住地喃喃自语。>\n\n是啊，在这么多动物里，我居然被牡鹿顶伤了。现在我也是个需要帮助的倒霉蛋，而所有的功劳全都归我兄弟，所有家里人早就习以为常了。\n\n<瓦图抬起了头。>怎么？你手里的那是什么？闪亮的石头？我见过，但其他的都交给别人了。我是个猎手，不是考古学家。<瓦图轻蔑地哼了一声，紧盯着自己的大腿。>也许这表示我该换份工作了。走吧，你都证明自己比我更有用了。', '', '', '', '', '', '', 47936),
(66681, 'zhCN', '风暴附体', '在贤冠松林消灭$1oa只雷触野兽。', '如果你要到松树林里冒险，请消灭那些被雷霆沾染的动物。我也不想做出这种请求，但它们显然深陷痛苦，无可救药，还在不断地散播攻击性。\n\n我怀疑这是拜荒者捣的鬼，肯定是从他们的岗哨附近蔓延开的，我在那里看到过一个古怪的魔法祭坛。\n\n我要再去调查一下。如果你回来的时候没找到我，斥候瓦图会给你分派其他任务。什么样的帮助都好。', '', '', '', '', '', '', 47936),
(66680, 'zhCN', '数绒羊', '使用食物与祈愿交上朋友，随后使用祈愿的哨子，在贤冠松林中拯救$3oa只失落的绒羊。', '太令人沮丧了，在我和兄弟欧勒克外出侦查的时候，一只发疯的牡鹿把我弄成了这样。\n\n<瓦图指着自己鲜血淋漓的腿，面孔抽搐了一下。>\n\n你是来帮忙的吗？在拜荒者的袭击过后，我们放牧的绒羊都散落在了松林里。它们的绒毛和羊奶是维系这处营地生存的关键。\n\n带上这个哨子，它能命令祈愿把绒羊带回家。如果她需要一些鼓励的话，屠夫松多那里有她最喜爱的点心。', '', '', '', '', '', '', 47936),
(66679, 'zhCN', '红玉新生圣地赛道', '滑翔穿过光圈。', '飞过标记赛道的检查点光圈。', '', '', '', '', '', '', 47936),
(66676, 'zhCN', '悄悄潜入', '返回欧恩伊尔清泉的拉蒂亚处。', '这是莉姬……她就是我的秘密朋友。自从她被母亲所抛弃，我就一直在照顾她。\n\n这样子可不妙啊。我不知道他们对她做了什么。我必须带她回家。接下来我可能必须照看欧恩，但莉姬必须得到帮助。我很感谢你的帮助，$p。很抱歉给你添了意料之外的麻烦。\n\n如果你不介意再冒一次险……能不能请你和我一起面对欧恩的怒火？请回到泉水那里找我！', '', '', '', '', '', '返回欧恩伊尔清泉的拉蒂亚处。', 47936),
(66675, 'zhCN', '力之守护巨龙', '在誓言母石处协助阿莱克丝塔萨。', '誓言母石是泰坦给予巨龙军团的一件远古赠礼。如果我们了解的情况属实，我可以重新激活它，从而恢复守护巨龙的力量。\n\n虽然我们不知道会有什么后果，但只要还有一丝机会，我就必须尝试。\n\n$n，如果你愿意和我一起，我感激不尽。', '', '', '', '', '', '', 47936),
(66671, 'zhCN', '偏僻之途', '与碧蓝林海僻壤营地的马迪·散射见面。', '你看起来像是个有心又有力的冒险者！愿不愿意到龙鳞探险队来帮忙啊？\n\n我们在荒野之中搭设了一个温馨的小营地。\n\n如果你愿意去一趟，那里有许多活计可以交给你。\n\n等你到了，就和我的姐妹马迪谈谈。她能帮你都安顿好。', '', '', '', '', '', '与碧蓝林海僻壤营地的马迪·散射见面。', 47936),
(66660, 'zhCN', '就位……预备……', '与安但丁诺姆和西雅赛拉泰一同巡游往昔。', '<诺兹多姆的目光游移漂散。>\n\n她们坠得越远，就移动得越快，在时间的结构里撞出了个大洞，激荡出波澜涟漪。你必须迅速行动，才能抓住她们。\n\n<诺兹多姆的锐利目光转移到了你的身上。>\n\n我会派时光旅行者帮助你探寻时间流，加快你的搜索。不要和现时的当地生物产生纠葛，在找到克罗诺姆之前也不要停止搜寻！\n\n快去，时间宝贵。', '', '', '', '', '', '', 47936),
(66658, 'zhCN', '诺库德阻击战：创始人的守护者', '进入诺库德阻击战，击败提拉和马鲁克，将他们的武器放置在库尔干的提拉凯。', '在我们阻止唤墓者阿尔班之前，提拉和马鲁克的武器都被夺走了。我们最伟大的先祖也许又要在这片土地上……为诺库德征战了。\n\n快加入诺库德阻击战，找到马鲁克和提拉。等你制服了他们，就把他们的武器带回墓葬之地提拉凯。我们会让他们在一个更容易保护的地方，带着应有的荣耀再度安息。', '', '', '', '', '', '', 47936),
(66657, 'zhCN', '死得妙！', '进入主库尔干，击败唤墓者阿尔班。', '唤墓者阿尔班钻进了最大的库尔干里，那是初代马鲁克先祖的安息之地。快去阻止阿尔班，别让他复活马鲁克和提拉！', '', '', '', '', '', '', 47936),
(66656, 'zhCN', '理应的永眠', '击败每一个著名的半人马灵魂，随后使用佐理格的息心图腾释放它们。', '先祖被黑暗的魔法掌控了，他们在顺服之前一定会恶战一场。尤克赫尔复活了我们最悍勇的战士和猎手。阻止他们并非易事。\n\n我会来帮你的，我母亲的长矛是时候派上用场了。\n\n使用这个图腾，帮助每一个被制服的灵魂找到归冢之路。', '', '', '', '', '', '', 47936),
(66655, 'zhCN', '除灵密料', '从复生的同伴处收集$1oa个完整的徽记和$2oa块神圣的土壤。', '我担心的是，即使我们从尤克赫尔的魔掌中释放了这些灵魂，他们也找不到自己的归宿了。\n\n尤克赫尔还复活了在生前指引并保护先祖的动物伙伴。\n\n将这些动物的徽记带来，还有被敌人扰动的神圣土壤。将它们结合起来，这种材料就能让先祖找到安宁。', '', '', '', '', '', '在永恒库尔干深处与佐理格见面。', 47936),
(66654, 'zhCN', '渎圣者的克星', '消灭诺库德亵渎者和尤克赫尔惊坟者，夺回被他们取走的先祖武器。', '我的母亲曾经是一位英雄，她理应得到安详的长眠，而不是……奴役！这不是英雄该有的结局。\n\n他们必须为亵渎付出代价，先祖们也必须带着武器和荣耀再度安息。从这些亵渎者手上夺回武器吧！', '', '', '', '', '', '在永恒库尔干深处与佐理格见面。', 47936),
(66652, 'zhCN', '归于疗愈者', '调查附近坟堆中的尤克赫尔仪式。', '我在这里看不清他们的行动，但恐怕他们是在亵渎库尔干。\n\n请前往最近的坟墓，想办法阻止他们的仪式。\n\n如果你找到了能够揭露他们意图的证据，请把它带回来。', '', '', '', '', '', '将长矛还给佐理格。', 47936),
(66651, 'zhCN', '诺库缺德', '在永恒库尔干与新兵佐理格见面。', '诺库德和尤克赫尔氏族占领了永恒库尔干。他们的意图肯定十分邪恶。因为我们最崇敬的先祖就埋葬在那里。\n\n我已经派遣新兵佐理格前去调查了，但他现在还没回来。\n\n他有足够的能力，却一直缺乏自信。请帮助他去阻止他们的恶毒行径！', '', '', '', '', '', '', 47936),
(66650, 'zhCN', '宿命终点', '击败$1oa个不同的宿命团队副本首领。', '<你很平静。这种经历的本质依然无从得知，但对于你来说早已不陌生。克服这类磨难对你而言已然得心应手，而真相将是最大的奖赏。>\n\n<清晰的思维和坚毅的双手将帮助你最后一次踏上旅程。塑造你自己的命运，命运之路就在你的脚下。>', '', '', '', '', '', '', 47936),
(66647, 'zhCN', '元素不器', '取回元素法器。', '我和卡雷苟斯在山脉上方的天空中遭到了凶猛的袭击。拜荒者的攻势冷酷无情，他们的部队源源不绝。\n\n我和卡雷苟斯很快就被大军击垮了。\n\n但我有了一个计划。\n\n山脚下有一个心神不宁的兽人，她名叫鲁文·磨石。肯瑞托和她争斗过许多次。\n\n她拥有一个设备，能够吸收并重导元素能量。\n\n把她的设备弄来，随后在山脉深处与我会合。', '', '鲁文手中握有威力非凡的元素法器。', '鲁文·磨石', '', '', '在瓦克索斯山脉深处与卡德加的投影见面。', 47936),
(66646, 'zhCN', '伤亡控制', '消灭时间元素。', '永恒龙迫使时间能量发起了袭击，这下糟了。\n\n请消灭你遇到的所有时间元素，协助克罗诺姆大使。我会留在这里帮助她压制伊特努丝。', '', '', '', '', '', '', 47936),
(66635, 'zhCN', '再续前缘', '与伊瑟拉交谈并撤下屏障。', '这样应该足够了。我感知到其他人就在林地的外围，准备进入梦境。\n\n等你准备好了就告诉我，我会打破冰墙并摧毁屏障。希望我的变化不会让军团灰心。\n\n我们的任务还没有结束，但我们终将再次团聚。', '', '', '', '', '', '与远古林枝的麦琳瑟拉交谈。', 47936),
(66633, 'zhCN', '鲜明立场', '将黑龙军团的战旗插在$1oa个贾拉丁的遗体上。', '这些贾拉丁相信，黑龙军团已经完蛋了。他们不再畏惧拉希奥，不再敬重他的权威。\n\n我们需要表明立场，提醒他们黑龙军团已经归来，并且比往昔更加强大。\n\n消灭贾拉丁，在他们的遗体上留下标记，让他们不敢忘记谁才是这里的主人。', '', '', '', '', '', '', 47936),
(66622, 'zhCN', '任性的工具', '营救$1oa个任性的工具。', '太可怕了！我一没留神，我的*嗝*工具就不翼而飞了。我不敢去想*嗝*它们孤零零地待在外头，肯定都吓呆了！\n\n你能不能帮我把它们赶到一块儿？耐心点，*嗝*让它们别紧张，我保证它们马上就跟你熟络了！', '', '', '', '', '', '', 47936),
(66620, 'zhCN', '翡翠的召唤', '与欧恩哈拉平原麦琳瑟拉的守望的麦琳瑟拉交谈。', '绿龙军团现任的领袖麦琳瑟拉请你去翡翠花园与她见面。\n\n来自碧蓝龙军团的一位使者前来打听花园的消息。考虑到蓝龙并不总是爱好和平，她必须维持友善而积极的关系。\n\n她就在翡翠花园树影庇护所上方的栖息处，那个名叫“麦琳瑟拉的守望”的地方。', '', '', '', '', '', '与欧恩哈拉平原麦琳瑟拉的守望的麦琳瑟拉交谈。', 47936),
(66612, 'zhCN', '螃蟹照看者的窘境', '在崖滴营地消灭$1oa个鳄鱼人。', '螃蟹们有危险！\n\n这群螃蟹刚刚度过一个惨淡的季节，它们原有的栖息地被拜荒者洗劫了，我就把它们带到了这里，结果遭到了鳄鱼人的入侵！\n\n我本以为它们在这里会很安全，但鳄鱼人只会给螃蟹灌输暴力，让它们早早夭折！\n\n求你了，去击败那些鳄鱼人，让螃蟹有机会逃走！', '', '', '', '', '', '', 47936),
(66598, 'zhCN', '夜知子', '在碧蓝林海的安东尼达斯营地找到迁跃法师黛兰德拉。', '我对远古符号一窍不通，不过……\n\n<塞林在自己的物品中翻找起来，最后掏出了一张地图。羊皮纸的顶部写着名字“安东尼大斯”，硕大的字体歪斜潦草。>\n\n啊哈！找着啦！\n\n虽然要走很远的路，但一群会用魔法的老家伙就在……这里。\n\n<他指着地图上的一个小点。>\n\n也许他们能给你帮助。', '', '', '', '', '', '', 47936),
(66597, 'zhCN', '老忠石', '检查铭文远古巨石。', '我身后的这块石头可能是一件，你们是怎么说的……远古科技杰作。这是我们在岛上偶然发现的。\n\n问题是，我们不太确定这是做什么用的，真是令人费解。\n\n我们已经给几名朋友传了话，看看他们有没有头绪。至于现在，也许你能探索一下它的用途？', '', '', '', '', '', '', 47936),
(66596, 'zhCN', '风中耳语', '与暴风城的大法师卡德加交谈。', '你好，$p。好久不见了，真希望我们有空能叙叙旧。\n\n但如你所见，我正在和一位老友进行一段别开生面……不如说是醍醐灌顶……对，一段醍醐灌顶的对话。\n\n有些时候，揭示真相对大家都有好处。\n\n我要告诉你刚刚我得知了什么。', '', '', '', '', '', '', 47936),
(66595, 'zhCN', '沉眠的发现', '将信息传达给觉醒海岸红玉之鳞岗哨的塞林·暗砧。', '<别纠结这张古怪的羊皮纸是怎么落到你包里的，最重要的是上面记录的内容。>\n\n致龙鳞探险队的各位成员：\n\n我们需要大家的协助！请尽快赶往红玉之鳞岗哨报到！\n\n<你还没来得及查看签名，纸条上的魔法文字就在白色的云雾和蓝色的尘埃中消散了，只剩下空空荡荡的纸面，还有空气中残留的芬芳。>', '', '', '', '', '', '', 47936),
(66589, 'zhCN', '探险协同', '在暴风城为前往巨龙群岛的探险队招募探险者、工匠和学者。', '我叫托蒂。我会扛起龙鳞探险队的大旗，引领一伙活泼欢快的冒险者。我们接下来再谈细节。至于现在嘛，你可以帮我们把同伴召集起来。\n\n每支名副其实的探险队都包含了各种各样的人才，我们需要学者和工匠，当然还有探险者。\n\n嗯？你还呆站着干什么？快去组建队伍！', '', '', '', '', '', '将你成功的消息报告给暴风城港口的托蒂·晶须。', 47936),
(66588, 'zhCN', '长老斯沃格', '在宠物对战中击败斯沃格。', '', '', '', '', '', '', '', 47936),
(66586, 'zhCN', '提尔的遗产：往昔秘密', '在荒芜之地进入奥达曼，探索扰动的根源。', '要阻止莱萨杰丝解救其他化身巨龙，我们必须让守护巨龙恢复力量。\n\n但这个任务并不简单。泰坦音讯全无，守护者提尔也早已丧命。\n\n阿莱克丝塔萨女王有一个计划。荒芜之地坐落着一处名为奥达曼的泰坦设施，她相信提尔的同伴将贮藏着提尔回忆的圆盘藏在了深处。\n\n带领你的盟友们前往奥达曼，为巨龙的女王找回这枚圆盘。希望提尔的知识能帮助守护巨龙重获力量。', '', '', '', '', '', '', 47936),
(66582, 'zhCN', '能量采购', '在安东尼达斯营地中为迁跃法师黛兰德拉收集容器中的能量。', '通常情况下，捕捉能量并不是什么大问题。不过呢，我们需要大量的不稳定能量。这件附魔容器应该可以安全地运输它。\n\n西南方的地区里有许多充满能量的生物，它们体内的异常能量非常强大，而且极不稳定。\n\n捕获这些生物的能量，然后再回来找我，我们可以一起踏上后续的旅途。', '', '', '', '', '', '', 47936),
(66577, 'zhCN', '守护巨龙之邀', '与拉希奥交谈，了解议会的会面。', '啊，$p。真会挑时候！\n\n我刚才面见了总司令图拉扬和他的盟友，他们已经接受了守护巨龙的邀请，会前往巨龙群岛。\n\n你肯定也会来吧？没了你可就大不一样啦！\n\n我猜你注意到了，这里聚集了许多陌生的面孔。长翅膀的那些是龙希尔。他们是不久之前才认识我的，但现在已经成了我的仰慕者。\n\n啊，我真是失礼了。我们该好好聊一聊。', '', '', '', '', '', '', 47936),
(66559, 'zhCN', '返回营地', '返回捕鲸者海角的考察者罗威处。', '我看到莫迪干像着魔一般跑了出去。我要去追上他，确保他安然无恙地回到大家身边。\n\n如果走到悬崖边上，顺着瀑布跳下去，应该就不会激怒那些鳄鱼人。\n\n我们回营地再见。', '', '', '', '', '', '', 47936),
(66558, 'zhCN', '罗威', '寻找罗威。', '你就是那个从蕨皮山谷和大部队一起回来的人吧？那你肯定知道卡基阿塔的境遇了……\n\n布莉娜和其他人一起返回时，唯独缺了她的身影。她的儿子罗威一直心烦意乱。我会留在这里，希望他能自己回来。你能不能出去找他？\n\n我觉得他可能跑到东边的冰窟里去了。他之前说过要去对付那里的雪人！', '', '', '', '', '', '', 47936),
(66557, 'zhCN', '学术往来', '在僻壤营地寻找其他熊怪语专家。', '哎呀，冬裘熊怪语真是个硬核桃，连我都觉得难懂。\n\n我在僻壤营地有几位同事，他们也许能帮上忙。我听说这片区域里还有其他熊怪部族，对比这些方言的音节也许能给我们一点启发。', '', '', '', '', '', '', 47936),
(66556, 'zhCN', '我洞你的意思', '调查洞穴。', '嗯，你的口音真是太差劲了，与世隔绝一万年和语言漂移都没什么用，但我应该理解了大致的意思。\n\n在你尝试重复的话语里一个共同点，说是什么“糟糕的洞穴风”，或者“邪恶的风暴洞穴”。应该是这样，不然就是说，他们也是在周四洗衣服？\n\n这就和学习侏儒语一样，总得打几个嗝。我相信肯定和洞穴有关系，那就从这里入手吧。', '', '', '', '', '', '', 47936),
(66555, 'zhCN', '容我一言', '协助索诺瓦进行翻译。', '哎呀，听起来那里已经乱套了——好像有一阵风暴席卷而过，把整个地方都毁了。我能理解他们为什么拿起武器了，可为什么要袭击我们呢？\n\n如果我们能心平静气地谈谈，那就轻松多了。但冬裘熊怪是出了名的少言寡语，好像也不会说常见的几种熊怪语。还是叫熊怪话？呃，你懂我意思。\n\n我猜你在拜访他们的时候，也没能和他们好好谈上几句吧？', '', '', '', '', '', '', 47936),
(66554, 'zhCN', '防卫过当', '击败$1oa个冬裘熊。', '冬裘熊怪陷入了狂乱，我想他们肯定不会允许你在那里闲逛。\n\n如果他们先挑起事端，不要多虑，动手保护自己。我得提醒你，下狠手也许就能让他们恢复理智。\n\n但尽量别让他们丧命，行不行？我知道你的冒险通常会演变成什么模样。', '', '', '', '', '', '', 47936),
(66553, 'zhCN', '谷地寻踪', '在冬裘谷发现$1oa个线索。', '冬裘熊怪是众多熊怪中的一个特例。\n\n我会把他们归类为“孤立主义者”。他们是谷地中的幽灵，皮毛能够和雪地混为一体。\n\n以前还算安分守己，现在却变得蛮横啦。他们莫名其妙地就袭击了我们的营地！\n\n肯定是出了什么大麻烦，才把他们逼成了这样。我没法问他们究竟发生了什么，或许你能在他们的村子里找到线索？', '', '', '', '', '', '', 47936),
(66550, 'zhCN', '[PH]风暴连绵！', '', '', '', '', '', '', '', '', 47936),
(66549, 'zhCN', '觉醒海岸拉力赛', '', '飞过标记赛道的检查点光圈。', '', '', '', '', '', '', 47936),
(66534, 'zhCN', '探路假期', '探索奥格瑞玛。', '看来我们的到来还是引起了注意。也许这些人还有希望。\n\n我将与艾比西安和部落的领袖们沟通，并试图平息此事。你负责侦察。\n\n看看在这里能有什么发现。毕竟，我们可能会在这里待上一段时间。\n\n之后回来找我们。希望那时候我们已经解决这些无聊的琐事了。', '', '', '', '', '', '', 47936),
(66529, 'zhCN', '千言万语', '在始祖龙骨附近为德薇希安拍照。', '根据我们所了解的情况，不留点纪念怎么能走呢？\n\n你再帮我一把，拍一张我和这个远古化石的照片吧？', '', '', '', '', '', '', 47936),
(66528, 'zhCN', '无冕之王', '调查始祖龙骨。', '这只上古始祖龙在生前肯定是一头雄壮的生物，也许是狂野禁猎区里个头最大的猛兽。\n\n但这还不够。去仔细观察它的骨骼，也许就能了解它在生命中的最后一刻。', '', '', '', '', '', '', 47936),
(66527, 'zhCN', '专业摄影', '使用垂直强化装置，为沉眠的始祖龙拍照。', '我从没训练过像你这样优秀……还活到现在的摄影师。这份差事非常危险。\n\n说到危险，我们的最后一个目标是一头巨大的始祖龙，它可能是禁猎区中的巅峰捕食者之一。我们要靠近它，拍张照！', '', '', '', '', '', '', 47936),
(66526, 'zhCN', '保护荒野', '释放5只被捕获的始祖龙崽或被抓住的始祖幼龙。', '狂野禁猎区是少数几个始祖龙能够繁荣兴盛的地方，但拜荒者正在滋扰它们的栖息地，似乎还派人捕捉始祖龙崽和始祖幼龙，想要拿它们做实验。\n\n不要对他们手下留情，找到这些拜荒偷猎者，干掉他们，把被捕获的龙全都放出来。始祖龙一族的未来都交给你了。', '', '', '', '', '', '', 47936),
(66525, 'zhCN', '摄影竞赛', '为一枚注能的始祖龙蛋和一头注能始祖幼龙照相。', '嗯，既然你已经学会了入门级的摄影，不如接下来试试更刺激的活动？\n\n我发现后面的这片区域里有一头华丽的始祖幼龙，它长着优美的犄角，鳞片中涌动着噼啪的电流……也许这是拜荒者搞出来的，但艺术就是艺术啊！\n\n你想办法给这头始祖幼龙拍一张照片，再拍下它的几枚龙蛋。为了拍个好镜头，你也许还要爬到高处！', '', '', '', '', '', '', 47936),
(66524, 'zhCN', '业余摄影', '拍摄始祖龙的照片。', '这么说，你想成为和我一样老道的编目员？你来对地方啦！\n\n狂野禁猎区里到处都是等待探索与记录的知识！你问我是怎么做的？当然是靠我便携的“编你目3000巨龙群岛版”！现已推出动捕增强功能！\n\n要积累经验，你就去给一枚始祖龙蛋、一只学飞的雏龙和一只狩猎的始祖幼龙拍照吧。到那头上古始祖龙的骨架旁来找我，我会来评价你的照片。', '', '', '', '', '', '', 47936),
(66523, 'zhCN', '打理熔炉', '在安东尼达斯营地附近收集龙蛙皮革和休眠的灰烬球果，剥取核心，为熔炉准备材料。', '如果你想找我做导师，那不好意思，我……啊，你不是学徒！真对不起。请允许我做个自我介绍。\n\n我是管理者维纳苟斯，这片废墟的看护者之一。确切地说，让这地方恢复往昔荣光的重担，就全都压在我这劳累的肩头了。\n\n你能不能助我一臂之力？我需要的材料就在这附近：冰元素之核、灰烬球果、龙蛙皮……\n\n都是很普通的东西，很容易拿到，你说呢？', '', '', '', '', '', '返回安东尼达斯营地的管理者维纳苟斯处。', 47936),
(66517, 'zhCN', '武器新来源', '从巨龙群岛的碎裂之焰处，为马鲁克半人马氏族的杜蕾尔收集25件完好的龙希尔武器。', '这帮碎裂之焰对我们的边界构成了重大威胁。他们的武器是个大麻烦。尽可能收集他们的武器——我们可以研究其中的弱点，甚至可以利用这些军备来自我防卫。\n\n我对你有信心，外来者。只要你帮我们走一趟，我就把锻造的独门秘方传给你。', '', '', '', '', '', '', 47936),
(66513, 'zhCN', '探路假期', '探索暴风城。', '既然这座城市是我们的新家，或许我们该了解一下它。如果你愿意，就把这当做是侦察任务吧。\n\n去吧，看看这地方都有些什么。我会跟着拉希奥走，尽我所能地提供帮助。\n\n但你尽量别去打搅本地人。他们很多人估计都不习惯身边有巨龙。\n\n等你摸清此地的布局之后，再来与我们会合。', '', '', '', '', '', '', 47936),
(66511, 'zhCN', '伊斯卡拉海象人名望', '与伊斯卡拉的穆里克交谈。', '你又一次证明了自己是我们社区中的关键一员。\n\n为了纪念这条纽带，请到伊斯卡拉来找我，我准备了一大包补给来协助你。', '', '', '', '', '', '', 47936),
(66508, 'zhCN', '轻轻摇晃过的礼品', '', '', '', '', '', '', '', '', 47936),
(66507, 'zhCN', '冬幕节礼物', '', '', '', '', '', '', '', '', 47936),
(66503, 'zhCN', '为他人之所爱', '调查安东尼达斯营地的荒弃高塔的塔顶。', '啊，我看到学徒们把你拐进他们的小游戏里了。\n\n<诺莉柯咯咯地笑着。>\n\n他们和你似乎都——遇上了棘手的问题。这些废墟原本的用途正在慢慢显露，其中不只有褪色的影像和曲调……\n\n有什么东西正从高塔的顶端发出呼号。\n\n我看到了你眼中的好奇，去吧，你得到了我的批准。\n\n看看你能发现些什么。', '', '', '', '', '', '返回安东尼达斯营地的诺莉柯处。', 47936),
(66500, 'zhCN', '观像之道', '在安东尼达斯营地揭露远古影像。', '我们什么也没做！什么也没做啊！\n\n等等……\n\n你好像是个重要的$r……想听一个秘密吗？\n\n这些废墟里似乎有一种魔法技艺，我们能看见它！\n\n<斯克朗皮自豪地挺起胸膛。>\n\n我也可以让你瞧瞧！只是……先别告诉诺莉柯。', '', '', '', '', '', '', 47936),
(66493, 'zhCN', '送信了！', '将包裹投递给安东尼达斯营地的肯瑞托的学徒。', '<你听到传送门的另一头传来沉闷的嘟囔声。>\n\n嘿！嘿，你！\n\n我有邮件要送给野外的学徒。有补给包，有礼物，有他们通过魔法信使订购的玩意儿。\n\n标准运费，真的。\n\n你能不能帮个忙，把东西都送出去？', '', '', '', '', '', '', 47936),
(66489, 'zhCN', '布置防线', '强化安东尼达斯营地的碧蓝防御者。', '管理者赛妮苟丝和我正在讨论拜荒者的袭击对钴蓝集所突袭计划有何影响，而我有了一个主意。\n\n<塞勒斯特从长袍的夹层里掏出一根魔杖。>\n\n带上我的魔杖，为他们的武器附魔！\n\n一点火焰应该就够了……', '', '', '', '', '', '', 47936),
(66488, 'zhCN', '通缉：弗里基鲁斯', '在安东尼达斯营地附近消灭弗里基鲁斯。', '<纸页上的文字闪动着微弱的蓝光。>\n\n元素弗里基鲁斯曾是玛里苟斯珍爱的玩物，主人的忽视令它心生悲苦。\n\n曾经充满欢声笑语的废墟现在分崩离析，邪恶的力量荼毒了这片土地，这个粗鲁淘气的生物也被其扭曲。\n\n一定要将它安然除去。\n\n向管理者赛妮苟丝报告成功的喜讯吧。', '', '', '弗里基鲁斯', '', '', '', 47936),
(66473, 'zhCN', '苏醒的土地', '在格利基尔瞭望台击败始生狂怒和始生冰雹。', '我无力解决洞穴里的怪物。\n\n<夏纳克斯疲惫地咳嗽了一声。>\n\n我知道你有什么本事。\n\n我需要你消灭这些元素，以免它们发挥全部的潜力。不能让拜荒者掌控提尔要塞！', '', '', '', '', '', '', 47936),
(66472, 'zhCN', '原始清单', '将一叠拜荒者指令带给格利基尔瞭望台桥上的指挥官萨德祖斯。', '传送门关闭了，元素被消灭了，拜荒者也被阻止了……暂时是这样。\n\n<夏纳克斯笑了起来。>\n\n有什么是我们做不到的吗，$c？也许只有时间才能揭晓。\n\n把计划带给指挥官吧，我相信他得知我们的成功之后肯定会很高兴。', '', '', '', '', '', '与格利基尔瞭望台桥上的指挥官萨德祖斯交谈。', 47936),
(66471, 'zhCN', '精打细算', '从格利基尔瞭望台上层平台附近的拜荒者处收集$1oa个拜荒者指令。', '指挥官命令我建立一处前沿基地，并斩除遇到的任何抵抗力量。我做到“斩除”这一步时才意识到一件事。\n\n<夏纳克斯发出一声悠长的叹息。>\n\n拜荒者提到了提尔要塞。\n\n除非你极为精通讯问，否则，我需要你去揭露他们的计划。', '', '', '', '', '', '在格利基尔瞭望台外的洞穴中与夏纳克斯见面。', 47936),
(66470, 'zhCN', '穷追猛赶', '获取雾触、大地与冰铸传送门之石，并关闭$7oa个元素传送门。', '<夏纳克斯挠着下巴。>\n\n指挥官说得对，拜荒者正在从元素位面中召唤援军。\n\n<夏纳克斯得意地笑了。>\n\n如果他们的传送门出了什么闪失，那就太遗憾了，$c。', '', '', '', '', '', '在格利基尔瞭望台与夏纳克斯见面。', 47936),
(66468, 'zhCN', '我们的曾经', '击败占据格利基尔瞭望台的拜荒者。', '<萨德祖斯用满脸的讥讽迎接你的到来、>\n\n你这个凡人是实干派吗，$c？不然就赶快让到一边去！\n\n前方的那些拜荒者已经令我折损了许多优秀的士兵。\n\n我们知道他们有什么打算，但必须先想办法挫败敌人，救出我的部下。', '', '', '', '', '', '与格利基尔瞭望台的夏纳克斯交谈。', 47936),
(66467, 'zhCN', '艺术源于生活', '消灭大型毒芽。', '上一次来到这个洞穴的时候，我画下了一株巨大的花朵，其中不断滴落着肮脏的黏性汁液。这是我最棒的画作之一，我根本无法忘记。\n\n我可以肯定的是，塔拉赛长矛上涂的就是这种汁液。他们肯定是开始采收汁液为武器涂毒了。\n\n那种植物非常美丽，要消灭它真是令人遗憾。但我们不能让塔拉赛继续采收汁液了。$n，请你清除这种植物，阻止这场闹剧。', '', '', '大型毒芽', '', '', '', 47936),
(66465, 'zhCN', '摧毁长矛贮藏', '摧毁$1oa个淬毒长矛贮藏。', '就算没了领袖，塔拉赛也不会因为我们好言相劝就停止使用淬毒长矛。这些武器可能会令毫不设防的旅行者惨遭毒手，我不能冒这个险。\n\n必须彻底销毁它们。如果你发现池塘边的箱子里没有，那么烬齿肯定是将长矛留在了来源附近。\n\n决不能让其他人因为我的大意而遇害了。进入洞穴，销毁你能找到的所有武器箱。', '', '', '', '', '', '', 47936),
(66464, 'zhCN', '野性战场：狩猎大师！', '击败狩猎大师阿玛亚。', '就是这样，你和你的朋友们赶上好时候了。你们要和冠军狩猎大师阿玛亚本人来一场比赛。先别给自己打气，要知道，她从来不留情面。很高兴这辈子认识了你。\n\n等你丢了性命，你的东西能归我吗？', '', '', '', '', '', '', 47936),
(66463, 'zhCN', '野性战场：元素复仇记！', '击败拜荒者勇士。', '我们在最后时刻调整了一下参赛阵容。有个拜荒者大佬想要在赛场上和你交锋，我可不敢拒绝愤怒的元素巨龙啊。\n\n我相信你会没事的，否则嘛，呃……你签过免责声明了吧？', '', '', '', '', '', '', 47936),
(66462, 'zhCN', '野性战场：迷梦沉沦！', '击败谢拉兹和塔蕾什。', '你知道吗，这里是巨龙群岛，但我其实没见过多少巨龙。我们这里确实来了一对龙裔，他们在报名时还要求并肩作战。\n\n他们似乎非常渴望能够证明自己，那祝你好运啦！', '', '', '', '', '', '', 47936),
(66461, 'zhCN', '野性战场：火山上的来客！', '击败和平终结者希卡。', '在最早报名的一批参赛者里，有一个是从觉醒海岸来的。那是个体型壮硕的贾拉丁，还不像他的同胞们那么怒气冲天。\n\n他好像非常喜欢角斗这项运动，嘿，那正合我意。', '', '', '', '', '', '', 47936),
(66460, 'zhCN', '野性战场：衰朽之王！', '击败夜腐。', '我之前费尽力气，想给这场大赛弄一个讨厌的豺狼人来。遗憾的是，我的助手都不知道怎么和他们对话。\n\n我们好不容易抓住了他们的一个骇人造物，肯定能算是个好对手！等你准备好挑战第二轮了就告诉我！', '', '', '', '', '', '', 47936),
(66459, 'zhCN', '野性战场：沼泽惊魂魔！', '击败玛尼特。', '欢迎各位来到野性战场！\n\n这片角斗场本来是举办传统活动的场地，但慷慨大方的半人马允许我在淡季开办业务，说这是个考验他们力量和获得荣耀的好办法。\n\n你想摘得冠军的头衔吗？那么，你做好准备就告诉我，然后就去面对入门比赛吧。', '', '', '', '', '', '', 47936),
(66457, 'zhCN', '终结蓝色', '消灭蓝鳞。', '所有烬齿都追随着一个体型硕大无朋的蛮兵，我管他叫蓝鳞。他向来咄咄逼人，但在此之前，他们的大群清道夫一直都和主干道保持着距离。他们确实有领地意识，但敌对行为？这是最近才有的。\n\n蓝鳞肯定要为突然恶化的局势负责。找到他，干掉他。', '', '烬齿的首脑。不接受谈判。', '蓝鳞', '', '', '', 47936),
(66456, 'zhCN', '剧毒调和', '收集8根淬毒之矛。', '我虽然学艺不精，但在学习的时候至少还是用了心的。每个对得起自己一身龙鳞的守路者都知道如何调配解毒剂。我只需要足量的毒药，就能正确地调和出来。\n\n诺丽说袭击她的塔拉赛在长矛上涂了毒药。去找到它们，把长矛带给我。如果我的预感没错，我可以使用矛尖残余的毒液调出解毒剂来。\n\n但愿时间站在我们这一边。', '', '', '', '', '', '', 47936),
(66449, 'zhCN', '斩手行动', '救出$1oa条遇险的雏龙，并且消灭$2oa个灼爪凤凰和缚灰者托奈查。', '卡拉希缚尘者正试图囚禁我们的雏龙。他们的领袖似乎打算将它们用于某种歹毒的目的。不能让他们得逞！\n\n但贾拉丁不是此地唯一的敌人。凤凰也在追踪我们的雏龙，使它们处境更艰难了。\n\n你必须保护雏龙，消灭威胁它们的敌人。欧索利亚会协助你的。', '', '一个危险的对手，擅长操纵灰烬和煤烟。', '缚灰者托奈查', '', '', '', 47936),
(66448, 'zhCN', '歧路守路者', '寻找守路者阿尔威。', '从我有记忆开始，守路者就一直守护着索德拉苏斯的道路，让旅行者能够安全往来。这是我们家族世世代代肩负的光荣责任。\n\n唉，我的姐妹阿尔威近来对这份荣耀不怎么感兴趣了。她每天早晨都应当向我报告，但我已经一整天没有听到她的消息了。\n\n如果你在东面发现一个游手好闲、胡思乱想的青铜龙人，请你让她到我这儿来。否则我就自己去找她。', '', '', '', '', '', '', 47936),
(66447, 'zhCN', '跨越屏障', '在新生宝库废墟中调查新生宝库。', '既然屏障已经消失，我们该探索宝库了！', '', '', '', '', '', '', 47936),
(66445, 'zhCN', '逝者的荣耀', '取回$3oa个阵亡防御者的戒指，$1oa个大地守护者的焰刃，以及$2oa个斯考克希亚之角。', '贾拉丁对堡垒的神圣意义不屑一顾，对我们同胞的遗体更是毫无敬意！他们碾碎了亡者的骨头，还夺走了他们的私人物品作为纪念。\n\n这种丧尽天良的行为在每一条骄傲的黑龙心中刻下了伤痕。他们理应获得荣耀。\n\n贾拉丁从牺牲者的身上夺走的东西，你都要把它们夺回来。', '', '', '', '', '', '', 47936),
(66442, 'zhCN', '理论依据', '帮忙对新生宝库废墟的泰坦屏障进行测试。', '现在我们集齐四个元素宝珠了！我们来看看哪个猜想行之有效吧。', '', '', '', '', '', '', 47936),
(66441, 'zhCN', '蒸馏法', '在新生宝库废墟东部洞穴中消灭艾斯奎安。', '能找到原始之石宝珠算是撞大运了，但阿卡迪娅和泰莎拉对屏障提出了相左的猜想。\n\n我也有自己的推论。也许找到更多元素宝珠之后，答案自然就会浮出水面。\n\n我们的一位探险者在附近的洞穴里发现了一只体型庞大的水元素。击败那个元素，也许你就能找到另一个宝珠。', '', '斥候报告称，这个元素的体型正在迅速增长。', '艾斯奎安', '', '', '', 47936),
(66439, 'zhCN', '火急火燎', '从龙蛙陷坑的拜荒者部队处收集原始火焰碎片。', '元素宝珠是吧？只要有土的地方绝对就有火！\n\n龙蛙巢穴附近的拜荒者正在用熔岩重塑这片土地。如果说有谁对原始火焰宝珠有兴趣，那准是他们了！\n\n去干掉他们，找找有没有什么有用的线索！', '', '', '', '', '', '', 47936),
(66438, 'zhCN', '目标远大', '在龙蛙陷坑寻找斥候里塔尔。', '空气是一种强大的元素。空气能割裂岩石，能鼓满风帆，带领我们航向目标。\n\n我的猜想是，空气应该最适合消除这道屏障。就是这么简单。\n\n斥候报告称，他们找到了原始狂风宝珠。斥候里塔尔能带你去找它。他们就在龙蛙陷坑附近。快去！', '', '', '', '', '', '', 47936),
(66437, 'zhCN', '关键元素', '将原始之石宝珠交给新生宝库废墟的元素师泰阳。', '<宝珠充盈着能量，微微地抖动着。>\n\n<元素师泰阳或许知道该怎么处理它。>', '', '', '', '', '', '', 47936),
(66436, 'zhCN', '捣蛋鬼入土', '在新生宝库废墟消灭$1oa个土元素。', '土元素不只是想击退我们，他们还在摧毁神器和设备！就好像它们被设定了摧毁任何与泰坦有关的东西……\n\n我们正在拖延，但是只要他们还在，我们就不能继续在这里展开研究。请帮助我们击退他们，为我们保留更多的探索空间！', '', '', '', '', '', '', 47936),
(66435, 'zhCN', '现场回收', '在新生宝库废墟中解救$1oa个被围困的探险者。', '作为萨满祭司，我和许多元素打过交道，但我从没见过这么有攻击性的！\n\n探险队在这里发现了一处泰坦宝库，但有一堵屏障在保护着内室。当我们在尝试驱散屏障的时候，可能触发了某种保护机制……突然到处都出现了愤怒的元素！\n\n元素发动袭击的时候，许多探险者还在挖掘现场工作。很多人都被困在了那里，而且他们都不擅长战斗。\n\n请前往挖掘现场，帮助他们撤离！', '', '', '', '', '', '', 47936),
(66429, 'zhCN', '铭记于心', '在僻壤营地外与拉南见面。', '我……我还需要一会儿，麻烦你了。\n\n返回僻壤营地吧，$p，我会在那儿等你。', '', '', '', '', '', '', 47936),
(66428, 'zhCN', '谊所应当', '使用R.A.D.D.E.R.E.R.装置驱散奥术屏障。', '好啦！R.A.D.D.E.R.E.R.装置校准完毕，准备启动——给你去用吧！\n\n为什么我还不使用它？道理很简单！\n\n你得先想想清楚，考虑到所有可能性。\n\n假如它爆炸了怎么办？如果我身负重伤，意识模糊，甚至一命呜呼了，你想象得出来吗？\n\n现在得由你去驱散屏障，这样我们才能返回营地去救拉索斯。我就……站远点吧。', '', '', '', '', '', '', 47936),
(66427, 'zhCN', '威胁突现', '消灭萨罗恩。', '在能量场中，我受到的奥术创伤无法愈合。恐怕我伤势沉重，无法继续战斗了。\n\n$n，我还有一个不情之请。\n\n你一定要找到萨罗恩，阻止她过载更多控制台。\n\n这样也许能给拉南争取宝贵的时间，让他能校准R.A.D.……R.A.D.D.E.R装置，随便他叫什么吧。\n\n也许我们可以挫败碎裂之焰的阴谋。', '', '碎裂之焰的首脑之一，为了掌控卡恩萨尔遗迹的力量而不惜代价。', '奥术操纵者萨罗恩', '', '', '', 47936),
(66426, 'zhCN', '时不我待', '抵达东部的高塔。', '就在我们说话的同时，我能感觉到奥术激涌在不断增强。\n\n我怀疑过不了多久，这处废墟就会把拉南的J.A.M.装置送上天，变成遥远的星星了。\n\n我们得赶过去阻止它。\n\n务必小心，$p。\n\n到东边的高塔来找我们，我们要在那里评估局势。', '', '', '', '', '', '在东部高塔与拉南和拉索斯见面。', 47936),
(66425, 'zhCN', '奥术超载', '帮助拉南驱散奥术泡泡。', '好啦！搞定！\n\n我要向你展示的是……R.A.D.D.E.R.装置！\n\n铛铛铛铛！\n\n我按照巨龙控制台周围的能量校准了频率，还在上面刻了一个驱散魔法雕文。\n\nR.A.D.D.E.R.装置能够驱散魔法并关停巨龙控制台，不过雕文的效果在每次使用后都会衰弱。\n\n是不是超级方便？\n\n我检测到附近有四个控制台，去关掉它们吧！', '', '', '', '', '', '', 47936),
(66423, 'zhCN', '担忧与证实', '寻找关于废墟起源的线索。', '这些碎裂之焰的成员横死当场，这更表明卡恩萨尔遗迹极其危险。\n\n但拉南觉得只要再调整一下R.A.D.装置，它就可以平息这里的能量。\n\n我们又是在治标不治本啊。\n\n去搜索遗迹，看看你能否查明它原本的功用。动作快，$n，时间紧迫。', '', '', '', '', '', '', 47936),
(66422, 'zhCN', '继续探险！', '与拉南和拉索斯在高塔前见面。', '一个古老的地方，一伙动机不明的人，还有拉南的R.A.D.装置和它的分析结果……\n\n这一切都让我心中的探求欲望躁动不已。\n\n我们必须继续调查，探明这里的真实情况。\n\n南边的台阶通向一处高塔，我们该继续前进了。', '', '', '', '', '', '', 47936),
(66421, 'zhCN', '风暴战痕', '', '', '', '', '', '', '', '', 47936),
(66419, 'zhCN', '忠诚为一', '', '', '', '', '', '', '', '', 47936),
(66412, 'zhCN', '继续前行，巴希尔顿', '在花园中和巴希尔顿交谈。', '在你离开之前，我这个老龙人还有一个不情之请。\n\n在以前，我和巴希尔顿勋爵刚认识的时候，我们结伴踏上了各种各样的冒险之旅。我觉得这就是他到处漫游的原因，他很想念探险的滋味。\n\n我是没办法再陪他探险啦，但是你行啊！我知道，你能带他看看那些我做梦都不敢想的地方。\n\n但是，我们应该先问问巴希尔顿自己的想法。', '', '', '', '', '', '', 47936),
(66402, 'zhCN', '龙母无犬女', '见证麦琳瑟拉的晋升。', '从我再次踏入梦境的那一刻起，我就知道情况有所不同了。但我们已经击败了莱迈克和他的拜荒者，我必须思考这一切所带来的影响。\n\n在我殒命之后，我的女儿竭尽全力，希望维护绿龙军团的团结。现在她理应成为晋升之人。\n\n该由麦琳瑟拉来领导翡翠军团了。', '', '', '', '', '', '与露恩黛的麦琳瑟拉交谈。', 47936),
(66401, 'zhCN', '沉睡者', '释放梦境位点的力量。', '我们克服重重困难才来到这里，现在只剩最后一件事了。萦绕露恩黛的力量只会对有能力掌控翡翠梦境的人做出回应。\n\n我以为只有我的母亲能做到，但是……我看到了她的改变。\n\n我不知道这样的差别是福是祸，但它是真实存在的，我必须接受它。\n\n来吧，让我们一起面对这个时刻。', '', '', '', '', '', '', 47936),
(66400, 'zhCN', '凛冬之末', '击败莱迈克。', '<索姆尼库斯渐渐冻僵了，他的呼吸变得越发吃力。>\n\n我试着……阻止他靠近树。希望我的力气没有白费。\n\n现在莱迈克唯有一死了。就全看你的了。\n\n告诉伊瑟拉和麦琳瑟拉，我这条……多愁善感的老龙……很抱歉。', '', '他靠阴谋诡计溜进了翡翠梦境。现在该请他滚蛋了。', '莱迈克', '', '', '在露恩黛与麦琳瑟拉交谈。', 47936),
(66399, 'zhCN', '船到桥头', '摧毁冰霜之核并找到索姆尼库斯。', '我们必须想办法阻止这场暴风雪！为了给你足够的支持去抵抗莱迈克和他的仆从，我们翅膀可不能被冻住。\n\n我感觉到附近有强大的冰霜之核存在，可能就是它们在维持暴风雪。如果你能摧毁它们，我们很快就能除掉莱迈克的仆从。\n\n索姆尼库斯也在那儿，他就像着了魔一样，朝着莱迈克直奔而去。我们需要尽快赶到他的身边。', '', '', '', '', '', '在露恩黛与索姆尼库斯交谈。', 47936),
(66398, 'zhCN', '翡翠龙军团', '与盖里苏斯交谈，和麦琳瑟拉与伊瑟拉一同飞往露恩黛。', '如果我们要在翡翠梦境中根除拜荒者的踪迹，就必须控制住露恩黛。我儿子说，莱迈克已经赶去了那里。\n\n那是萌芽的世界树的最后一道防线。那里有一件远古神器，在它的遮蔽下，萌芽的世界树才不会被找到。其中蕴藏着强大的力量，足以彻底驱逐所有敌人。\n\n我不知道母亲是否还有能力掌控它、使用它。但我们先要找到并阻止莱迈克，随后再来处置神器。\n\n与我们同志同心，一起飞翔吧。', '', '', '', '', '', '在露恩黛与盖里苏斯见面。', 47936),
(66397, 'zhCN', '全力以赴', '解救翡翠鳞卫和翡翠护卫。', '我们需要援军，越快越好。但由于屏障的阻拦，麦琳瑟拉无法到林地中与我们会合。我们必须在梦境里自力更生。\n\n消灭那些拜荒者，从他们身上搜寻必要的工具，以便融化寒冰牢笼，解救被困的林地守卫。', '', '', '', '', '', '', 47936),
(66396, 'zhCN', '坚守的感谢', '将莱迈克的礼物送给$1oa名卫兵。', '我知道守卫要地的工作总是令人身心俱疲。而且我们龙人和龙兽的辛劳通常不会得到感谢。\n\n我想向远古林枝的守卫们表达自己的感激之情。\n\n去吧，给他们送去这些礼物，展现一下我们的友情。希望这种真诚的态度能够表达我的感激之情。', '', '', '', '', '', '', 47936),
(66395, 'zhCN', '叽喳的石头', '调查可疑的冻土并消灭冰川地道蛛。', '麦琳瑟拉不必为我担心。我没事，我儿子的死……我没事。\n\n如果你真的想帮我分忧，那确实有这么一件事。我怀疑拜荒者打算再次入侵这片土地，但和上次不同，他们应该不会光明正大地发动袭击。他们知道自己必败无疑。\n\n看到那边的石头了吗？那些颜色黯淡、气味逼人的石头。我听见有东西在它们底下移动，也许是拜荒者潜伏在附近！你能不能去调查一下？碾碎你找到的家伙。', '', '', '', '', '', '', 47936),
(66394, 'zhCN', '纤薄帷幕', '关闭远古林枝中的屏障锚点。', '肯定有办法撤下林地中的屏障，我感觉到周围有几个增强屏障的锚点。\n\n如果你能关闭足够多的锚点，我们就能降下屏障，让其他人能与我们会合。', '', '', '', '', '', '', 47936),
(66393, 'zhCN', '寻找索姆尼库斯', '在远古林枝附近的誓言石附近与索姆尼库斯和莱迈克见面。', '自从索姆尼库斯的儿子死后，他就一直沉浸在悲伤和抑郁中无法自拔。\n\n虽然我们都承受过伤逝之痛，但我无法想象，假如盖里苏斯也遇到了这种大难，我的心中会作何感想。\n\n和莱迈克去小岛上，看看我们能做些什么。索姆尼库斯怀疑拜荒者即将发起另一次袭击，我担心他会在冲动之下做出傻事。\n\n别担心，在翡翠誓言石的帮助下，你可以轻松穿过屏障。', '', '', '', '', '', '', 47936),
(66392, 'zhCN', '集结自然盟友', '在树影庇护所集结德鲁伊，并收集强化的锚点。', '我们不能就这么向绝望屈服，我们必须继续前进，用别的办法穿越屏障。\n\n首先我们需要盟友。莱迈克召唤的无数元素正在涌入传送门，我们也需要一支能够像我们一样自由出入梦境的大军。\n\n去树影庇护所集结德鲁伊和半人马。是时候召唤他们履行誓言，保护林地了。', '', '', '', '', '', '与树影庇护所的索姆尼库斯见面。', 47936),
(66391, 'zhCN', '废墟里见！', '在卡恩萨尔遗迹与拉南和拉索斯见面。', '你有兴趣了解一下我发明的R.A.D.装置吗？没有？\n\n嗯，但我还是要说，因为它有了发现。\n\n今天它检测到卡恩萨尔遗迹的奥术能量出现了剧烈涌动。拉索斯觉得这肯定是碎裂之焰干的。现在是展示R.A.D.装置的绝佳机会！\n\n你要来吗？它超厉害的。', '', '', '', '', '', '', 47936),
(66369, 'zhCN', '大地结界', '激活大地结界。', '我用你收集到的戒指为一处结界注入了能量，结界将附近的岩石汇聚到一处，创造出了一个守护领地的活体大地守护者。\n\n去找大地结界测试一下，确保它能正常运行。', '', '', '', '', '', '', 47936),
(66368, 'zhCN', '风暴中的岛屿', '消灭$1oa个火光化身和融化者伊格纽斯。', '我们根本无暇休整，元素的威胁无休无止。\n\n如果能有片刻停歇，那是再好不过了，我还能抽出时间制作更多护符来巩固防御。\n\n看看你能不能缓解边界地带的攻势吧。', '', '', '融化者伊格纽斯', '', '', '', 47936),
(66363, 'zhCN', '蜥蜴圆盾', '从巨龙群岛的蜥蜴身上为马鲁克半人马氏族的杜蕾尔收集20张僵硬的蜥蜴皮。', '层叠相扣的鳞片是阻停箭矢的关键。我们制作的圆盾是平原上最精良的，可我的蜥蜴皮已经不够完成下一批订单了。\n\n我知道你有兴趣学习这门生意。帮我在巨龙群岛收集20张僵硬的蜥蜴皮，我就给你指点一二。', '', '', '', '', '', '', 47936),
(66356, 'zhCN', '铁木', '', '', '', '', '', '', '', '', 47936),
(66354, 'zhCN', '火花', '重组受损的誓言石碎片。', '熔炉准备就绪，现在只需生火。\n\n将受损的誓言石碎片放在熔炉上，拉希奥会点燃火花，让工序就此开始。', '', '', '', '', '', '', 47936),
(66353, 'zhCN', 'R.A.D.装置异常', '使用R.A.D.装置驱散三个奥术异象。', '这里的奥术能量太多啦……\n\n但是！R.A.D.装置都能搞定！这个装置可厉害了，恰如其名：“拉南的厉害装置”！它能够检测并驱散奥术能量。\n\n给……拿稳了！你有没有感觉到手中的力量啊？没有？\n\n嗯，既然它都在你手里了，快去把异象驱散吧！', '', '', '', '', '', '', 47936),
(66352, 'zhCN', '窥敌先机', '寻找碎裂之焰文件，并将其交给拉索斯。', '我们必须判别碎裂之焰在这些废墟中的任务，还有它和奥术激涌之间的联系。\n\n我们这次要用老法子：侦查与刺探。\n\n这片废墟里到处都是碎裂之焰的信众，肯定有几个携带着命令，能够揭晓他们的神秘目的。\n\n用尽一切必要的手段，把文件弄到手。', '', '', '', '', '', '', 47936),
(66351, 'zhCN', '山外青烟', '寻找探路者伊普斯的飞机。', '<探路者杰布眺望着营地上方的山脊，抽了抽鼻子。>\n\n我不喜欢这样。探路者伊普斯几天前就该来了，还要帮我教会这批新人怎么爬柱子。\n\n我现在却看到远处升起了浓烟。\n\n我一点儿也不喜欢。', '', '', '', '', '', '', 47936),
(66349, 'zhCN', '训练石头', '移除$1oa块石头', '移除那些石头！', '', '', '', '', '', '', 47936),
(66344, 'zhCN', '风之助力', '与盖里苏斯和麦琳瑟拉同行。', '拜荒者招募了诺库德氏族。\n\n我们暂时还能抵御拜荒者，但诺库德氏族获得了一种新的武器：一架灭龙者弩炮。恐怕索雷苏斯不会是最后一条在恶毒的风暴魔法中殒命的巨龙。\n\n来吧。我会带你前往巨龙的树影庇护所。在尊可汗集结部队的同时，你可以把诺库德的情报告诉我。我们必须为下一步做好准备。', '', '', '', '', '', '', 47936),
(66340, 'zhCN', '融入碧蓝', '在剪河交汇口与睿智的玛苏德见面。', '我们已经履行了义务，但我必须留在这里看护誓言石，引导绿龙军团。你虽然就要离去，但我们的感激和信念与你相随。\n\n我收到了消息，肯瑞托正在募集帮手，希望找回碧蓝誓言石。帮他们一把，我们就离治愈艾泽拉斯又近了一步。\n\n去找肯瑞托的帕基娜和睿智的玛苏德，他们会给你后续指示。愿你旅途平安，安眠美梦，$n。', '', '', '', '', '', '', 47936),
(66339, 'zhCN', '诺库德阻击战：天为风之所归', '在诺库德阻击战中击败巴拉卡可汗，营救欧恩哈拉。', '你和我们相处的时光结束了吗，$n？你愿意再次协助我们吗？\n\n我的斥候报告称，巴拉卡已经撤回了要塞，欧恩哈拉也被囚禁在那里。这种行径不可原谅！\n\n与此同时，他的诺库德劫掠者开始横扫平原，肆意破坏。在我们激战的时候，你可以趁机潜入诺库德要塞，营救欧恩哈拉。你愿意帮这个忙吗？', '', '', '', '', '', '', 47936),
(66337, 'zhCN', '风暴克星', '击败柯罗莱丝。', '$n，到这儿来！胜利近在咫尺了！\n\n拜荒者的阵线崩溃了，但战争还没有结束，我们的成败与否就取决于最后一战，面对拜荒者的首领柯罗莱丝。\n\n你我携手，我们会终结这场战争！奋战到底！$G兄弟:姐妹;！', '', '这个拜荒者领袖企图摧毁绿龙的圣所。', '柯罗莱丝', '', '', '', 47936),
(66336, 'zhCN', '翡翠之岛', '在远古林枝与麦琳瑟拉见面。', '我注意到了你所发挥的作用，凡人。多亏了你的勇敢，我们才能击败这些拜荒者。\n\n我邀请半人马到远古林枝与我一聚，我们的家园欢迎尊可汗、她的人民，还有你。\n\n沿着这条道路穿过拱门，渡过水面，进入前方的树林。我会在那里等你。', '', '', '', '', '', '', 47936),
(66335, 'zhCN', '拆除更多的水晶塔', '使用附魔种子标记拜荒者晶塔。', '这些恶毒的武器已被摧毁，绿龙军团可以全力投入战局了。\n\n我们更熟悉地面上的局势，我们需要点亮目标，让麦琳瑟拉和她的巨龙从空中发起攻击。\n\n麦琳瑟拉把这些附魔种子交给了我。把它们放在拜荒者的晶塔附近，它们发出的光芒可以引导巨龙从空中发起攻击。', '', '', '', '', '', '', 47936),
(66333, 'zhCN', '为索雷苏斯复仇', '消灭$1oa个诺库德好战者并摧毁$2oa台灭龙者弩炮。', '只要还有一头绿龙气息尚存，不经过一场血战，这些拜荒者就休想玷污远古林枝。\n\n我们渴望在战斗中尽一份力，但只要战场上还留有灭龙者弩炮，我们就难以靠近。这些灭龙者弩炮有诺库德最强大的战士保护，我们需要你去把他们也打倒。\n\n摧毁这些弩炮，凡人。消除这个威胁，绿龙就能扭转战局。', '', '', '', '', '', '', 47936),
(66331, 'zhCN', '拜荒者前线', '在风暴战痕与斥候托木尔、阿莉和贝丽卡、欧恩·瑟什滕和麦琳瑟拉交谈。', '尊可汗传来消息，她和她的部队已经抵达了翡翠花园。他们找到了柯罗莱丝和她的拜荒者，敌人似乎正在北部的海滩上集结待命，准备入侵。\n\n她做出了明智的决定，派遣几位斥候监视战场周围的战略要地。去收集他们的报告，随后到前线与我的部队会合。荣耀在战斗中等着我们，而胜利还将带来复仇。', '', '', '', '', '', '', 47936),
(66329, 'zhCN', '吹响号角', '见证巴拉卡与柯罗莱丝的毒谋。', '他们为什么会把欧恩哈拉带来这里？除非是……\n\n$n！我觉得巴拉卡并不希望摧毁号角，我觉得这是个陷阱！我们必须想办法穿过狂风，快！', '', '', '', '', '', '', 47936),
(66328, 'zhCN', '绿龙坠落', '在积水浅坑与尊可汗见面。', '那些巨龙在西部的平原上降落了。我们必须赶在诺库德之前找到他们。\n\n我们不想让他们因为巴拉卡的行为而误会，觉得所有马鲁克半人马都是敌人。', '', '', '', '', '', '', 47936),
(66327, 'zhCN', '追风的人', '聆听斥候托木尔的报告。', '我们必须暂时停下脚步，仔细考虑一下战术。\n\n我们需要欧恩哈拉的祝福，才可以吹响德鲁萨尔之角召唤绿龙。没有他们的援助，这场战争就毫无胜算。诺库德氏族的数量远胜于其他氏族，他们的军队现在还得到了拜荒者的加持。而且柯罗莱丝还抓走了我们的风之母。所以，在诺库德氏族发起总攻并包围马鲁凯之前，我们必须找到欧恩哈拉。\n\n我会立刻派出所有斥候前去探访。希望我们能及时找到她。', '', '', '', '', '', '', 47936),
(66324, 'zhCN', '从未忘却', '在支援育幼所中营救幸存者和收集物品。', '解毒剂已经配好了，就用它在支援育幼所寻找幸存者吧。动作快，药效持续不了多久，你可能需要再次服用。\n\n如果我们的人还一息尚存，请你救救他们。\n\n如果他们不幸身故，请你带回他们的角戒，让他们的名字得以留存。\n\n也许你能在里面留意一下这起侵扰的线索。', '', '', '', '', '', '', 47936),
(66321, 'zhCN', '重挫锋芒', '消灭贾拉丁部队。', '贾拉丁的部队正企图进攻我们的位置，我的双爪都已经感觉到了。\n\n我们应该先发制人，不能让他们有调动的机会！\n\n快前往燃烧高地，让那里的贾拉丁部队不得安生。', '', '', '', '', '', '', 47936),
(66320, 'zhCN', '光阴流转', '前往变换流沙，与克罗米交谈。', '时间流的丝缕如同江河一般蜿蜒曲折，分流变向。时间的流动偶尔也会发生变化。如果置之不理，产生的异象可能导致我们走上错误的时间线，从而招致毁灭。\n\n我们正在快速接近其中一个异象，我已经派克罗米前往变换流沙调查，修复正确的时间线。\n\n我预见到你的协助对我们至关重要。\n\n请伸出援手，去找克罗米吧。', '', '', '', '', '', '', 47936),
(66308, 'zhCN', '燃焰饲火', '收集$1oa块烬齑之煤。', '大地守护者熔炉制作的武器和护甲将帮助我们最终战胜贾拉丁。\n\n熔炉的火焰不能熄灭，必须不断提供燃料。烬齑之煤能产生极致的热能，是铸造武器的必需品。\n\n你能从烬齑矿层的矿点和元素处找到烬齑之煤。', '', '', '', '', '', '', 47936),
(66299, 'zhCN', '爆蛋时刻', '消灭尖翔巢母。', '原型大获成功！太棒了！\n\n接下来就该上主菜了，这次你来掌勺。\n\n只需要稍加调整，你就能再次穿上伪装了。然后你带上我们专业级的爆蛋，把它丢进这一锅烂糊里，找到巢母的洞穴，为她上菜，然后滑翔回来，感受身后的爆炸！\n\n如果计划顺利，她肯定会大快朵颐，接下来就会发生爆炸，炸她个里焦外嫩。', '', '神出鬼没的尖翔鹰身人巢母！你能满足她的饥渴吗？是用啾讽的炸弹，还是用自己的血肉？', '巢母阿薇赛拉，尖翔鹰身人的首领', '', '', '', 47936),
(66279, 'zhCN', '准点新徒', '将怀表交给花园里的欧力兹穆。', '对，这块怀表属于我的一位管事，他在帮我打理花园。\n\n他是诺兹多姆的部属，好像叫欧力兹穆？我记不大清所有孩子的名字了。大部分时候，他就站在阿莱克丝塔萨的树附近的沙漏旁边，一动不动，眼睛都不眨。\n\n要我说，诺兹多姆的那群龙一直都很古怪。但如果你把怀表带给他，他肯定会心存感激。', '', '', '', '', '', '将怀表交给花园里的欧力兹穆。', 47936),
(66278, 'zhCN', '彼之垃圾', '将怀表交给花园中的格里尔姆佩奇。', '<一块闪亮的怀表静静地躺在垃圾堆里。或许格里尔姆佩奇知道该怎么处置它。>', '', '', '', '', '', '将怀表交给花园中的格里尔姆佩奇。', 47936),
(66270, 'zhCN', '痛打豺狼人', '击败想成为领军者的豺狼人。', '圣光在上……又来了更多豺狼人！怎么会这样啊？\n\n我精心设计的一切！我在这个腐臭的池塘里躲藏了那么久！我的行刺计划！\n\n这本该让他们陷入混乱，令他们的组织土崩瓦解，但甚至没有拖慢他们的速度！\n\n也许……也许你是对的，$n，我从一开始就是错的……\n\n不！绝对不可能！木已成舟，我们现在不能收手。\n\n去吧……解决那些新来的。我需要一点时间来振作精神。', '', '', '', '', '', '', 47936),
(66269, 'zhCN', '除恶务尽', '消灭$1oa个雷牙元素师。', '就干脆……你看着谁会魔法，谁懂组织，谁有野心，就全干掉吧。\n\n就这样，全靠你自己定夺。\n\n你的“定夺”是不和我说话的意思？拜托，$c！他们……显然是在做一些不堪的事情！', '', '', '', '', '', '', 47936),
(66268, 'zhCN', '失不过三', '消灭血爪。', '什么？又有一个上位了？一有空当就上位？起码稍微等一段时间，等默哀期过去，才有机会摆摆大场面吧？\n\n这帮家伙不懂体面吗？不懂礼仪吗？不尊重制定好的方案吗？我连图都做好了啊！\n\n去干掉这个叫血爪的，我想一个人静静。\n\n而且，我不需要你絮絮叨叨的评论，免开尊口，谢谢！', '', '谁在咽气前提拔他做领军的？', '血爪', '', '', '', 47936),
(66267, 'zhCN', '仁法会', '解救$1oa只被虐待的动物。', '这群怪物！不止谋财害命，居然还虐待动物？这我可不能忍。\n\n豺狼人设置了陷阱，捕捉动物并喂给那些贪婪的土狼杂种。想办法释放那些毛茸茸的俘虏，让这群恶棍瞧瞧，法师对待动物时有多么仁慈！\n\n当然，从我最近的行动来看，这在道德上是有意义的。你到底想影射什么？', '', '', '', '', '', '', 47936),
(66266, 'zhCN', '污秽杂种', '消灭$1oa只土狼巢母和$2oa只混血土狼。', '狗娘养的混血豺狼人杂种！它们根本不通礼数，你不敢相信它们去哪儿方便。更糟糕的是，就算我的幻象举世无双，它们也能嗅出我的气味。\n\n帮文明社会一个忙，请走这些野蛮畜生。', '', '', '', '', '', '', 47936),
(66265, 'zhCN', '下一个', '消灭裂齿。', '啊哈，看来有其他豺狼人接过领导权了。我就知道，很好。\n\n培养一名值得信赖的副手，保障统治的连续性，这很合理，是不是？我们只需要稍微制造一些不快，他们的官僚体系就要倾塌了。\n\n什么？你问我要不要稍微反思一下，我是否对他们太武断了？荒谬！那可是豺狼人！\n\n赶快！趁热打铁，消灭裂齿，否则他们就要选举了！', '', '一只豺狼人才能养几条土狼啊？', '裂齿', '', '', '', 47936),
(66264, 'zhCN', '嚣张都靠武器', '获取$1oa件啮骨武器。', '老实说，有这么多豺狼人在这儿挥舞着武器，确实令人有些不安。缴除一些武器应该就能平息局势，起码能平息我的紧张。\n\n没了武器他们还能怎么办呢？赤手空拳和你斗？哈！', '', '', '', '', '', '', 47936),
(66263, 'zhCN', '精准除害', '消灭剥皮之拳。', '豺狼人是一种差劲的生物，臭气熏天，总是挠个不停，而且笑声非常险恶！我有说过我过敏吗？这里的豺狼人已经够多了，还有更多在陆续抵达。我们，我是说“你”，如果像割麦子一样成天收割他们，那就永远都别想走了。\n\n我们要换个方法，打蛇还要打七寸嘛！干掉他们的头领，迟疑和绝望马上就会令他们瘫痪。\n\n为什么要这么做？这不是明摆着吗？他们是豺狼人！还需要什么别的理由吗？', '', '没了敬爱的头领，他们能有几分胜算啊？', '剥皮之拳', '', '', '', 47936),
(66262, 'zhCN', '废水清洁', '在湖中清理$1oa个腐烂之堆。', '首先——我需要夺回我的行动基地！但由于元素在这里肆虐，我连一个立足点都找不到。\n\n当然，这都是那些豺狼人混账搞出来的麻烦。\n\n豺狼人倾倒了一大堆垃圾破烂，还有连圣光都不知道的其他东西，已经把本地的元素逼得狂暴了。\n\n我们该发发善心，在情况失控之前清理掉这堆烂摊子。最重要的是，别让它把我的袍子弄脏，脏到永远洗不干净！', '', '', '', '', '', '', 47936),
(66261, 'zhCN', '区区挫败', '找到得特莱。', '啊，冒险者！还是我最希望遇到的、全副武装的冒险者！\n\n我带着肯瑞托的重要任务，泡进了这货真价实的一潭死水里。瞧，我才刚开始搭建营地，就被肮脏污秽的豺狼人赶了出来。\n\n其实，附近集结了一伙豺狼人，数量有些令人担忧，都足够对林海的广阔区域产生威胁了。\n\n但不必害怕，因为我自有妙计！到那边的湖旁来见我，我再跟你细说。', '', '', '', '', '', '', 47936),
(66259, 'zhCN', '噩耗汹涌', '将报告呈递给马鲁凯的尊可汗。', '$n，我们得把这里发生的情况通报给尊可汗，包括欧恩哈拉被囚的消息。\n\n你必须尽快赶往马鲁凯，还必须独身前去。我在坠落时伤得不轻，现在只会拖累你。\n\n别担心我了，我稍后会追上来的。去吧！', '', '', '', '', '', '', 47936),
(66258, 'zhCN', '不，欧恩哈拉！', '在博库尝试解救欧恩哈拉时击败敌人。', '那个拜荒者正在束缚欧恩哈拉，但只能勉强维持。她似乎没有注意到我们。\n\n提嘉里可汗会说，“微风轻抚，危石倾覆”。如果我能扰乱她的法术，只要稍稍干扰一下，欧恩哈拉就有机会挣脱。\n\n你去引开那些卫兵，我有一个主意。', '', '', '', '', '', '', 47936),
(66257, 'zhCN', '武禽戏法', '使用博库的风之图腾，摧毁诺库德货车。', '在传说中，欧恩哈拉为我们的先祖马鲁克的长矛注入了自己的力量。巴拉卡可汗肯定将这个传说告诉了拜荒者。\n\n他们偷走了欧恩哈拉之子的魔法，并用风暴的影响污染了它，还将这种力量注入了弩炮的箭矢中。诺库德为什么需要这种武器？\n\n我们不能坐等答案浮出水面，这些风暴箭矢已经被装上货车等待转移。带上我的图腾，把它放在你找到的货车顶上。我的风之魔法会将它击成碎片。', '', '', '', '', '', '', 47936),
(66256, 'zhCN', '隼派主义', '在风歌高地解救$1oa只欧恩哈拉之子，并消灭$2oa个拜荒者。', '我们发现了诺库德氏族收集秘术师图腾的目的：他们想使用图腾囚禁欧恩哈拉之子。虽然这些图腾都是诺库德偷走的，但拜荒者才是亵渎行径的幕后主使。\n\n欧恩哈拉之子是神圣的欧胡纳，受到过风之母的赐福。$n，请你救出见到的欧胡纳！如果你遇到了拜荒者……\n\n<博库没有说下去，但他露出了严肃而坚定的神色。>', '', '', '', '', '', '', 47936),
(66254, 'zhCN', '悲观的秘术师', '将强化图腾放置在博库周围。', '战争？巨龙？你要我联系欧恩哈拉？\n\n我不行！我根本听不到欧恩哈拉的呼唤。我只是一个新兵，欧恩哈拉好像也收回了对我的赐福。也许我还不够优秀……\n\n<博库开始在口袋中翻找。>\n\n导师将我派到这个氏族的时候，她向我赠送了几个小小的图腾。她说，如果我怀疑自己的能力，它们就会赐我力量。\n\n你能帮我摆好它们吗？我会再次尝试呼唤欧恩哈拉。', '', '', '', '', '', '', 47936),
(66252, 'zhCN', '战况报告', '返回瓦德拉肯，向德莱恩队长报告。', '拜荒者的威胁已经式微，$n。部队很快就会从瓦德拉肯赶来，轻轻松松就能扫清余党。\n\n你应该赶回城中，向德莱恩队长通报这里的事态。她肯定很想得知指挥官艾拉诺格的遭遇。\n\n再次感谢你所做的一切，$n。', '', '', '', '', '', '', 47936),
(66251, 'zhCN', '火焰斗士', '消灭岩浆之爪。', '指挥官艾拉诺格背叛了我们，留下了这头野兽横行无忌。\n\n你已经帮了我许多次，但以我现在的状态，我无法独自面对那头野兽。\n\n请你，帮我这最后一个忙，别让南岗大门落到这群拜荒者手里。\n\n我们必须斩除他们的首脑！\n\n祝我们一臂之力吧，$n。', '', '袭击南岗大门的拜荒者头目。', '岩浆之爪', '', '', '', 47936),
(66250, 'zhCN', '长官何在？', '陪同卫士维罗米尔，检查南岗大门的瞭望塔。', '$n，就剩这部分要塞还没搜查过了。如果指挥官艾拉诺格还在世，那就肯定在这里。\n\n<维罗米尔瞥了一眼附近的门廊>\n\n看看我们会有什么样的发现。', '', '', '', '', '', '', 47936),
(66249, 'zhCN', '净空行动', '控制一架攻城蝎弩，使用它清除空中的岩浆之誓正统者。', '你找来了这些长矛和绳子，干得不错。有了它们，这些高高在上的拜荒者就别想掌握天空了！\n\n台阶上方的平台里有几架攻城蝎弩，将绳子当做弓弦，用长矛作为弹药，你就能打击飞在高空的岩浆之誓巨龙了！\n\n解决它们以后，通往尖塔的道路就会肃清，我们也能继续搜寻指挥官艾拉诺格。', '', '', '', '', '', '在南岗大门的瞭望塔上与卫士维罗米尔见面。', 47936),
(66248, 'zhCN', '绑扎系固', '收集$1oa卷沉重的绳索。', '这卷沉重的绳索看起来状况良好。\n\n卫士维罗米尔说过，要时刻注意有用的材料。如果你能多收集几卷绳索，他也许就能给它们找个好用处。', '', '', '', '', '', '', 47936),
(66247, 'zhCN', '九点五成新', '收集$1oa根岩浆之誓长矛。', '考虑到原先主人的情况，这杆长枪的状况还算不错。\n\n卫士维罗米尔说过，要时刻注意有用的材料。也许你能从岩浆之誓处多收集几杆长枪。', '', '', '', '', '', '', 47936),
(66246, 'zhCN', '战争迷雾', '在南岗大门搜寻卫士维罗米尔所属部队的成员。', '拜荒者毫无征兆地突然袭来，我的小队本打算找到指挥官艾拉诺格，但还没抵达要塞的另一侧就被拦住了。\n\n在激烈的战斗中，队长塔格里克军士独自一人挡住了三个拜荒者，卡奥拉、米科尔和我在一旁与敌人缠斗。\n\n我只记得自己听见了几声惊叫，随后就倒地不起了。\n\n求求你，$r，如果你发现了我们部队的踪迹，请告诉我他们怎么样了。', '', '', '', '', '', '', 47936),
(66245, 'zhCN', '追思牺牲者', '收集$1oa个南岗要塞玺戒。', '我的许多同胞都已牺牲。\n\n我们……要收集他们的身份玺戒，这样他们的名字才不会被人淡忘。', '', '', '', '', '', '', 47936),
(66244, 'zhCN', '去往瓦德拉肯', '前往瓦德拉肯，与阿莱克丝塔萨，生命的缚誓者见面。', '多亏有你，我们死里逃生，避免了一场全面灾难。\n\n然而，我们应该和其他守护巨龙会合，向他们传达此地的境况。\n\n请你到瓦德拉肯的守护巨龙之座来找我，我相信其他人会明白莱萨杰丝和她的拜荒者究竟有何企图。\n\n东北边的道口通向索德拉苏斯，虽然风景不错，不过别耽搁太久了。', '', '', '', '', '', '', 47936),
(66242, 'zhCN', '气象控制', '消灭$1oa个雷缚精华和$2oa个唤雷者新兵。', '这场非自然的风暴里充满了魔法。看起来，诺库德正在学习如何掌控风歌高地的神圣精华来创造风暴元素。有些人还取得了异乎寻常的成功……\n\n<博库指了指附近不走运的诺库德新兵，闪电灼烧留下的烟雾还在萦绕。>\n\n$n，不能让他们继续了。', '', '', '', '', '', '', 47936),
(66239, 'zhCN', '腐朽蔓延', '在交易站与贸易岗哨见面。', '<布莉娜用粗壮的双手翻弄着卡格波的图腾。>\n\n卡格波不过是一枚棋子。他不是这种腐朽的根源。我们必须找到它，否则腐朽就会蔓延无边。\n\n离这里最近的海象人都在贸易岗哨里，那地方就在通往伊斯卡拉的路上，过了桥就到了。\n\n我们必须检查他们的情况……时不我待。', '', '', '', '', '', '', 47936),
(66237, 'zhCN', '灵魂盟友', '与管理者交谈。', '我们抵达了这里，但还是引起了注意。\n\n在进入前，请允许我先和他们谈谈。我和议会还有一些渊源。\n\n之后还有时间再做介绍。', '', '', '', '', '', '', 47936),
(66236, 'zhCN', '捕风捉雷', '在风歌高地与博库见面。', '诺库德正在收集图腾，拜荒者在捕捉欧胡纳，而欧恩哈拉静默不语。\n\n不管诺库德有什么打算，都不能让他们得逞。你和博库必须赶往风歌高地，我们的敌人可能已经到了。\n\n你们要在那里寻找欧恩哈拉。如果她的子嗣处境危险，她肯定会去解救它们，我们必须伸出援手。虽然风之母力量非凡，但我担心这些拜荒者也神通广大。', '', '', '', '', '', '在风歌高地与博库见面。', 47936),
(66232, 'zhCN', '咸盐攻势', '在鳄鱼人海滨收集$1oa份晶体薄片。', '我们不介意招待你和你的伙伴们，这里只是小地方，没那么多人造访。但如果你要去泉水附近，能不能像个好邻居一样，顺道为我带点晶体薄片来？我们需要它们来给各类食物保鲜。这里保存食物还是很重要的。\n\n那些体型壮硕的鳄鱼人身上都覆盖着这种东西。也许你可以去弄一点过来？', '', '', '', '', '', '', 47936),
(66230, 'zhCN', '糊图请求', '取回阿尔威的“账本”并将其归还给守路者阿尔威。', '塔拉赛将能触及的一切全都夺走了，包括我的侦查账本。\n\n这些生长过头的蜥蜴攫取了大堆饰品和战利品。它们肯定也把我的账本藏起来了。你在穿过小径的时候，能不能替我留心一下？\n\n$n，还有一件事。如果你找到了它，千万别打开。里面的内容有些……隐私。', '', '', '', '', '', '', 47936),
(66228, 'zhCN', '安东尼达斯营地', '在安东尼达斯营地与过目不忘的诺莉柯见面。', '肯瑞托在此地南部设立了主营，安东尼达斯营地。\n\n我想诺莉柯和卡德加正在那里征召冒险者，打算协助卡雷苟斯夺回碧蓝誓言石。\n\n如果你愿意帮助我们，就赶去那里吧。', '', '', '', '', '', '在安东尼达斯营地与过目不忘的诺莉柯见面。', 47936),
(66227, 'zhCN', '垂钓快乐', '在库里的钓鱼点捕捉$3oa条蓝尾鲦鱼。', '又有新的人手了！我正需要有人帮忙捕鱼，好让我准备大餐。\n\n肯瑞托的这帮人似乎都在担心区域中的什么“魔法异象”。\n\n只要你肯出力帮忙，你在这里想住多久都行。\n\n扛上钓鱼竿，开始钓鱼吧。众人钓鱼锅才满嘛！', '', '', '', '', '', '', 47936),
(66226, 'zhCN', '精神支柱伙伴', '从峦水居所的诺库德手中营救无辜的动物。', '请别伤害我……\n\n什么？你是来帮忙的？你可要救救那些动物！\n\n诺库德氏族毫无预警地发起了袭击，我们都在仓皇逃命！我潜进了湖底才逃过一劫。\n\n可那些动物！我们把它们抛下了。请你，求你，去救救那些动物。天知道诺库德会用什么样的残忍行径对待它们。', '', '', '', '', '', '', 47936),
(66225, 'zhCN', '囤积图腾', '从峦水居所的诺库德氏族处收集$1oa堆图腾。', '博库问我为什么将所有秘术师都叫到峦水居所来。\n\n我没发出过召集令。肯定是巴拉卡特意将我的秘术师诱入了陷阱，想要重创欧恩伊尔氏族。\n\n不过，也许还有第二个理由。诺库德氏族正在全力收集秘术师图腾，这些图腾都受到过欧恩哈拉的赐福。\n\n他们的动机尚不明了，但休想夺走欧恩哈拉的赐福。你要尽力夺回这些图腾。', '', '', '', '', '', '', 47936),
(66224, 'zhCN', '秘术师的奥秘', '与博库见面并前往峦水居所。', '对不起，但我没能与欧恩哈拉沟通。你得找其他人来执行尊可汗的命令了。\n\n几天前，其他秘术师都被召集到峦水居所去了，说是提嘉里可汗有要事相约。他们应该还在那里。\n\n到镇外来找我吧，我现在能做的就剩下给你指路了。', '', '', '', '', '', '', 47936),
(66223, 'zhCN', '能养他吗？', '从伊斯卡拉的商人处购买，或者在巨龙群岛的海洋水域中垂钓，为尼娄带去$1oa条寒鱼。', '他肯定是因为饿坏了，才会想要吃我们！\n\n鱼！没人能拒绝冰爽可口的生鱼！\n\n寒鱼最棒了。你可以在伊斯卡拉各处钓上它们！就算你不会钓鱼，金库图克那里肯定也有得卖。\n\n给我多带几条鱼来，这样他就再也不会挨饿了！', '', '', '', '', '', '', 47936),
(66222, 'zhCN', '风暴前的宁静', '向提拉凯的镇民传达杰博泰的命令。', '诺库德氏族非常强大，还有许多盟友。我们倾尽全力才能勉强挡住他们。\n\n$n，尊可汗信赖你。遵照她的命令，我们要集结朋友，让人民都做好准备。\n\n我需要你的帮助，让侯金调动剩余的可汗卫士，通知斥候肯于格诺库德氏族可能来袭，命令阿古拉准备接收伤员，要基恩赛准备好军需物资。\n\n至于秘术师，他们最近刚刚离开，我会确认是否还有谁留在提拉凯。', '', '', '', '', '', '', 47936),
(66221, 'zhCN', '勇往直前', '在瓦德拉肯的守护巨龙之座与阿莱克丝塔萨谈谈。', '青铜誓言石已经修复，阿莱克丝塔萨可以继续推进计划了。\n\n该前往瓦德拉肯了，$n。她肯定希望得知你成功的消息。', '', '', '', '', '', '', 47936),
(66218, 'zhCN', '蹦跳顽童', '寻找尼娄和那乌。', '又见面了。\n\n你能帮我和诺卢克一个忙吗？我们的孩子尼娄和那乌出门玩耍，他们应该知道回家的时间到了。\n\n我现在腾不出手，麻烦你前去寻找他们。他们应该不会身处险境，我的孩子都知道怎么照顾自己。', '', '', '', '', '', '', 47936),
(66217, 'zhCN', '通缉：克洛杰克，海滨巡游者', '消灭克洛杰克，海滨巡游者。', '多年以来，我们一直盯着那条名叫克洛杰克的巨鲨，一直在等待猎捕它的最佳时机。\n\n它的狩猎场离岸边越来越近了，也就是说，时机来了。让狩猎小队集合，把它拿下！', '', '海滨巡游者曾是本地生态系统的重要一员，但他的狩猎场现在离伊斯卡拉太近了。', '克洛杰克，海滨巡游者', '', '', '', 47936),
(66213, 'zhCN', '编造故事', '向长老波雅讲述一个和鱼相关的可疑故事。', '我挚爱的妻子波雅是一名出色的说书人。\n\n不过，都已经过了整整三十年，她还是一遍又一遍地讲着那些相同的故事！$c，帮帮忙，去和波雅聊聊，让她有新的故事能讲。\n\n什么？跟她讲一个你的冒险故事？别犯傻了，我不想听！最好的故事肯定和鱼有关。你要讲个鱼的故事，哪怕是瞎编的也行！', '', '', '', '', '', '', 47936),
(66212, 'zhCN', '钓鱼：副翼海蛾鱼', '从巨龙群岛周围的海域中钓起$1oa条副翼海蛾鱼。', '就没有人知道该怎么正常地钓鱼吗？\n\n<鲁科图卢克恼火地抽动着鼻子。>\n\n你，那副表情的家伙，去给我弄点鱼来。要上好的鱼，不能有乏味鱼！', '', '', '', '', '', '', 47936),
(66211, 'zhCN', '蕨皮山谷：直击本源', '进入蕨皮山谷，挑战腐朽主母怒眼。', '你协助我们击退了蕨皮豺狼人，我们的感激之情无以言表。\n\n但他们仍在不断地聚集力量，还在操控着来自蕨皮山谷深处的腐朽魔法。更糟的是，那里的海象人已经和我们失联了数周！\n\n我担心那里发生了可怕的事情。我们必须保护好我们的家园。请你赶快集结部队，找到我们的族人，想办法解决这股腐朽之力！', '', '', '', '', '', '', 47936),
(66210, 'zhCN', '聚集家庭', '在伊斯卡拉附近收集$1oa份葬礼祭品，并将它们放在葬礼船上。', '你的朋友卡雷苟斯想要谈谈魔网的事，但我们必须为葬礼做好准备。\n\n在我与他见面的时候，你能不能在伊斯卡拉周围收集最后的供品，将它们放在老波诺里亚克身旁的葬礼船上？\n\n希望你也能借这个机会游览一下村子！我的人民都会热情欢迎你的，何况你还在蕨皮山谷帮了忙呢。', '', '', '', '', '', '', 47936),
(66201, 'zhCN', '战争之蹄', '将尊可汗的信息交给提拉凯的可汗卫士杰博泰。', '巴拉卡会统军上阵，我也一样，然而敌众我寡。\n\n巨龙曾经请求过我们的帮助，我们可以借助他们的力量扳回局势。为了响应盟友的召唤，我必须吹响德鲁萨尔之角，但我需要先获得欧恩哈拉的赐福。你能帮助我吗？\n\n快前往提拉凯，将我的宣战命令传达给副官杰博泰。他会统帅我的军队，并带你找到能够与欧恩哈拉沟通的秘术师。', '', '', '', '', '', '将尊可汗的信息交给提拉凯的可汗卫士杰博泰。', 47936),
(66196, 'zhCN', '嘎嘎坠地', '将泡泡里的小鸭子带回生态学家的营地。', '<这只小鸭子在泡泡中疯狂地拍着翅膀，惊恐地嘎嘎乱叫。>\n\n<也许生态学家知道该怎么帮助它？>', '', '', '', '', '', '将泡泡里的小鸭子带回生态学家的营地。', 47936),
(66191, 'zhCN', '天涯之隔', '与麦琳瑟拉交谈。', '我不能像以前一样溜进梦境了。远古林枝的防御已经激活，我们被彻底隔绝了。\n\n恐怕接下来的情况只会更糟，$n。\n\n我相信莱迈克不仅戏耍了我们，溜进了翡翠梦境。我猜他肯定正在里面寻找一件无比珍贵、无比强大的东西，那件我誓要守护的东西。\n\n就连盖里苏斯和索姆尼库斯都不知道它的存在。但现在我已走投无路，你必须知晓真相。', '', '', '', '', '', '', 47936),
(66190, 'zhCN', '咫尺之遥', '与莱迈克一起进入梦境之门。', '我必须借此机会感谢你，$n，感谢你一直以来帮助。\n\n我从未想过来能有机会到远古林枝，在这里欣赏翡翠梦境！我不过是一个微不足道的大使而已！多么善良啊。\n\n索姆尼库斯勋爵慷慨大方，他邀请让我进入林地观赏传送门。如果你愿意和我一起去，我将不胜荣幸。\n\n我这辈子都会记住这个时刻，和我一起同享吧。', '', '', '', '', '', '在梦境之门林地外与麦琳瑟拉交谈。', 47936),
(66189, 'zhCN', '由死及生', '与伊瑟拉一起突破翡翠梦境之路，进入远古林枝。', '我们不能耽搁。我感觉到重生的力量在我体验涌动，我已经准备好返回翡翠梦境了。\n\n从死亡的国度重返生命的世界。\n\n跟我一起走过觉醒之门，我们要穿过梦境之路，赶往远古林枝。我们应该还会遭到抵抗，不要放松戒备。', '', '', '', '', '', '通过炽蓝仙野和翡翠梦境之路，在远古林枝与伊瑟拉见面。', 47936),
(66188, 'zhCN', '风停雨止', '在觉醒林地中激活复生之球。', '我们要一起前往觉醒林地。只有寒冬女王才能将这种联系从伊瑟拉身上转移给我。我相信她会同意的。她在紧要关头援助了伊瑟拉，现在伊瑟拉也能回过头来帮助我们。\n\n如果寒冬女王同意这么做，这种联系的重担也许会让我无法清醒太久。\n\n假以时日，希望我还能再次苏醒，凝望新种下的那棵树木，看到它枝繁叶茂的模样。', '', '', '', '', '', '在觉醒林地与伊瑟拉交谈。', 47936),
(66187, 'zhCN', '疯莫迪干与结晶王', '让鳄鱼人海滨的莫迪干·铁腭脱离结晶状态。', '我侦察过边界地带了。要问莫迪干在哪儿，他肯定在洞穴里。\n\n<模糊不清的咒骂和辱骂声在洞穴的入口处回响。>\n\n他肯定就在这个洞穴里。\n\n菲茨考格说，这些水晶具有危险的脱水属性。你看看能不能让他远离这些……地质发现。尽量别弄伤他。\n\n他在这一领域可是德高望重。', '', '探险队的地质学家正在思考。', '莫迪干·铁腭', '', '', '与艾尔娜拉交谈。', 47936),
(66186, 'zhCN', '代价', '见证抉择。', '我渴望重返翡翠梦境，从化身巨龙和他们的爪牙手中保护花园。但我与寒冬女王联系尚存，我还无法离开炽蓝仙野。\n\n我不敢恳请任何人这么做，除非他们愿意接受后果，就像我一样。\n\n但有一个人能够接替我的位置。', '', '', '', '', '', '', 47936),
(66185, 'zhCN', '穿越帷幕', '在炽蓝仙野的觉醒林地与索姆尼库斯交谈。', '是时候了。我是说过自己没事，但自从索雷苏斯死去，我似乎就丢失了某种至关重要的东西。\n\n我还活着，他却已经离去，这种感觉太奇怪了。\n\n但也许我还有办法让事情走向正轨。只有伊瑟拉能帮我们重夺远古林枝，我可以帮助她返回现世。\n\n穿越帷幕已经变得愈发困难了，这一次务必要成功。\n\n泰兰德和玛法里奥会在那里等我们。', '', '', '', '', '', '在炽蓝仙野的觉醒林地与索姆尼库斯交谈。', 47936),
(66184, 'zhCN', '锚定生命', '使用翡翠之泪强化失能锚点。', '根据我的研究，肯定有某种办法能让伊瑟拉恢复与翡翠梦境的联系，这样我们才能让她靠近艾泽拉斯。\n\n在伊瑟拉死去时，寒冬女王运用自己的力量，在炽蓝仙野令她复苏。现在她被束缚在那里，但我们应该可以让伊瑟拉回到翡翠梦境，并使用这些锚点留住她。\n\n我已经做好了万全的准备。\n\n首先，我们要为这些锚点注入翡翠之泪的力量。', '', '', '', '', '', '', 47936),
(66183, 'zhCN', '翡翠之泪', '收集$1oa份翡翠之泪。', '我们最近才刚刚回到翡翠花园，但我们心中怀有的感情却传承已久。\n\n许多人依然在为我的祖母伊瑟拉的故去而悲伤，我也不例外。我希望能够和她再多相处一段时间，多聆听她的教诲。她在生前见证过多少惊人的奇迹啊！\n\n在翡翠花园等地，当我们洒下泪水，它们就会凝结成水晶，其中蕴藏着非凡的力量。我有一个想法，能够将这些凝结的悲伤派上用场。', '', '', '', '', '', '', 47936),
(66182, 'zhCN', '盖里苏斯的研究', '在翡翠花园深处与盖里苏斯见面。', '绿龙军团肩负着许多职责，打理花园只是其中之一。我们还需要保护翡翠梦境。有些绿龙则将注意力投向了更远的地方。\n\n比如我儿子盖里苏斯，他一直都对各类魔法感兴趣。\n\n你和莱迈克去找到他，看看他正在忙些什么，并提供必要的帮助。', '', '', '', '', '', '在翡翠花园深处与盖里苏斯见面。', 47936),
(66181, 'zhCN', '狂乱的卫士', '消灭狂乱的林地之爪。', '我发现这些花园里具备了多种多样的防御力量，有巨龙、龙人和古树，甚至还包括了野生动物！\n\n不过有一名防御者的保护欲似乎太过狂热了，我来到这里的时候，它甚至想朝我猛扑过来！\n\n我们知道这些林地里的某些东西正在痛下毒手，再怎么谨慎也不为过。\n\n不幸的是，我们不得不除掉这个生物，以免它造成更多的伤害。', '', '这只掠食性猛禽，是不是有点儿贪得无厌了？', '', '', '', '', 47936),
(66180, 'zhCN', '唤醒古树', '使用麦琳瑟拉的借来的龙息，唤醒翡翠花园中的古树守卫。', '许多方法都能保障花园的安全，盟友也会来帮助我们。\n\n有几棵古树正在林地中沉睡，这些参天大树誓言要守护森林，保护其中的生物。\n\n使用我的龙息碎片来唤醒它们吧。', '', '', '', '', '', '', 47936),
(66179, 'zhCN', '未来之种', '从多种鞭笞者处收集种子，并将其交给花园姐妹。', '拜荒者的袭击在翡翠花园留下了自己的烙印，我真希望能看到它继续成长、再度盛放。\n\n花园的这边生长着过多的鞭笞者。花园姐妹可以使用它们的种子，在受损的林地中培育植物。\n\n摘除一些鞭笞者，收集它们的种子，再把种子交给姐妹们。她们有时不愿伤害任何生物，即便这是为了花园中万物的福祉。', '', '', '', '', '', '', 47936),
(66178, 'zhCN', '林中一日游', '在翡翠花园的芳叶休憩所与麦琳瑟拉和莱迈克见面。', '莱迈克受蓝龙军团委派而来，负责了解并保护我们的花园。\n\n我很高兴他们愿意提供支持。我们人数寥寥，但损失实在是太大了。蓝龙军团掌控着强大的魔法，我们都可以从彼此身上学到许多。\n\n来吧，让我们展示一下绿龙军团在巨龙群岛的重要职责。', '', '', '', '', '', '在翡翠花园的芳叶休憩所与麦琳瑟拉和莱迈克见面。', 47936),
(66177, 'zhCN', '一个矮人都不能少', '跟随莫迪干·铁腭的足迹，穿过鳄鱼人海滨。', '真是盐度爆表了！我们需要找到莫迪干，把他赶紧捞出来。他现在肯定已经脱水，奄奄一息了。\n\n他才走了没几个小时，你赶快去找找，那个暴脾气的矮人老头到底走了哪条路？', '', '', '', '', '', '在鳄鱼人海滨寻找艾尔娜拉。', 47936),
(66175, 'zhCN', '现场试验', '帮助LOU-C在捕鲸者海角进行测试。', '多亏有你，我们的地质学考察才能达到将近96%的效率！\n\n<菲茨考格愁眉紧锁。>\n\n这数据不怎么样啊。\n\n用我的地质扫描仪289-07来分析你收集到的样品，这样我们才能获得基准，了解高地上到底发生了什么事情。', '', '', '', '', '', '与捕鲸者海角的LOU-C·菲茨考格交谈。', 47936),
(66169, 'zhCN', '现世报', '在南岗大门消灭$1oa个岩浆之誓拜荒者。', '这些拜荒者突然袭来，令我们措手不及。\n\n<维罗米尔厌恶地啐了一口。>\n\n其他卫士都被这些怪物开膛破肚了。要不是你及时出现，我肯定也和他们一样命丧沙场了。\n\n我听到远处依然传来战斗的声响。也许还有人活着，也许指挥官艾拉诺格还没倒下。\n\n请帮我引开敌人，好让我转移到更近的位置。\n\n最好能够消灭几个所谓的“岩浆之誓”。', '', '', '', '', '', '', 47936),
(66167, 'zhCN', '南侧遇袭', '前往南岗要塞。', '根据你发现的状况，我猜拜荒者正在袭击指挥官艾拉诺格位于南岗的要塞。但我不能将鳞誓者调派出城，否则城内将会毫无防备，这正中拜荒者下怀。\n\n我又需要你出手相助了，$n。\n\n快前往南岗，打探我们面对的是什么样的敌人。如果可能，就和要塞的守军取得联系。', '', '', '', '', '', '', 47936),
(66166, 'zhCN', '耳聪目明', '在瓦德拉肯寻找线索。', '拜荒者一直在向瓦德拉肯的居民鼓吹自己的主张。\n\n我们的敌人非常狡猾，不会当着鳞誓者的面吐露半点风声。但你也许有机会凑到近旁，窃听他们的对话，看看能不能打听到重要信息。\n\n我在地图上标注了几个需要进一步调查的位置。\n\n再带上这块附魔石。只要你把它拿在手里，我们就可以进行交流。\n\n你准备好了吗？', '', '', '', '', '', '', 47936),
(66164, 'zhCN', '浑水摸鱼', '在鳄鱼人海滨找回$1oa份失窃的零件。', '莫迪干已经去舔石头了，我们可以来处理问题的关键了……\n\n那些背信弃义的渔夫盗走了我的零件！\n\n我们来到了这个巴掌大的小村子，还没过一个小时，哐啷！鳄鱼人就蜂拥而至。罗威在惊呼，艾尔娜拉在惨叫，我则像个发了疯的侏儒一样，拿着扳手抡个不停！\n\n看看你能不能收拾一下残局，帮我找点零件回来！', '', '', '', '', '', '', 47936),
(66163, 'zhCN', '无处可藏', '在瓦德拉肯消灭$2oa个拜荒渗透者。', '欢迎来到瓦德拉肯，$r。\n你可能会发现，这段时间城市里的情况比较烫手。我说的可不是天气。\n\n拜荒者就潜伏在各处，挑唆那些对城市心怀不满的异见者。\n\n我们的敌人诡计多端。他们将自己伪装成城市居民，以此躲过鳞誓者的耳目。他们知道如何回避我的守卫，但绝不会对一名外来者起疑。\n\n拿上巨龙之眼宝石，它可以帮你看破拜荒者的伪装。\n\n去吧，揪出并干掉那些渗透者！', '', '', '', '', '', '', 47936),
(66159, 'zhCN', '凶恶之讯', '在瓦德拉肯的守护巨龙之座与阿莱克丝塔萨交谈。', '在你抵达之前，卡雷苟斯不肯透露碧蓝林海发生了什么。\n\n但不论怎样，我都有一种不祥的预感，$n。', '', '', '', '', '', '', 47936),
(66156, 'zhCN', '龙鳞探险队名望', '在龙鳞先遣营地与编目员杰克斯交谈。', '你的义举没有被忽视，你要继续证明自己会成为声名远播的探险者！\n\n返回龙鳞先遣营地吧。我为你准备了一些补给，帮助你推进探索事业。', '', '', '', '', '', '', 47936),
(66155, 'zhCN', '路力克的激流勇进', '乘坐掠瀑号顺流而下。', '真没想到我兄弟会点头答应……不过这是好事，都一样。\n\n时候到了！看看我们的辛劳能不能得到回报！\n\n和我一起登上掠瀑号吧，$n。我们要顺流而下，在途中为伊斯卡拉多多捕鱼！', '', '', '', '', '', '', 47936),
(66154, 'zhCN', '催涎采样', '在鳄鱼人海滨收集$1oa份唾液样本。', '<枯瘦的亡灵捏着自己的鼻梁，沉重地喘息着。>\n\n这下我的记录肯定要丢人现眼了。只不过一天功夫，我们就和本地的鳄鱼人起了冲突，丢失了半数的设备，还折了一个矮人。\n\n在这种情况下，根据规定，我们要尽量保持效率。你去除掉几只牙齿尖尖的坏家伙，顺便带一点唾沫回来用于测试。\n\n注意，只要优质的那部分。', '', '', '', '', '', '', 47936),
(66152, 'zhCN', '敢问家在何方', '在僻壤营地与加尔兹见面。', '我们不能留在这里。\n\n我不知道接下来该做什么……该去哪里……\n\n我们会返回你的僻壤营地，得让海象人知道锈松之巢的遭遇。\n\n如果我们把自己的遭遇传述下去，也许就不会重蹈覆辙了……', '', '', '', '', '', '', 47936),
(66151, 'zhCN', '铁石心肠', '消灭石心。', '我们悲痛地为酋长呼号，但他还活着。\n\n失去自我的石心就在前面的洞穴里。有许多人试过和他理论。\n\n他们都被害了……纳尔恩也差点没命。\n\n他是个怪物！这就是拜荒者的目标。他们想把我们转化成石头和火焰，然后侍奉他们。\n\n他已经不是锈松熊怪了，必须赶快消灭他，否则其他人也会迎来同样的命运。', '', '拜荒者的赐福将锈松酋长的身体转化成了坚硬的岩石。', '石心', '', '', '', 47936),
(66150, 'zhCN', '营救拉兹达', '营救拉兹达·雷掌。', '拉兹达·雷掌是我们的灵魂守护者，她坚守着我们的传统和历史。\n\n拜荒者的信仰违背了我们氏族恪守的一切，我知道她会抗拒石心的！\n\n石心会用尽一切手段让她屈服，但没有拉兹达的祝福，就不会有酋长！\n\n纳尔恩说，酋长的卫兵卡加尔·五牙想要粉碎她。如果拉兹达死了，氏族也会一同消亡。\n\n去救救她，$n。做好准备，不大打出手，他就不会放她走。', '', '', '', '', '', '在锈松之巢与拉兹达·雷掌见面。', 47936),
(66149, 'zhCN', '元素影响', '摧毁$1oa个拜荒者地缚图腾，然后在锈松之巢与纳尔恩见面。', '纳尔恩说锈松之巢没有全部被石心或拜荒者说服。\n\n抵抗的都被抓住了，图腾中涌出的岩石和泥巴困住了他们……直到他们顺从。\n\n打碎图腾，放了他们！', '', '', '', '', '', '在锈松之巢与纳尔恩见面。', 47936),
(66148, 'zhCN', '熊弟阋墙', '消灭$1oa个锈松熊怪和元素，然后在锈松之巢与纳尔恩见面。', '拜荒者来了。他们给我们新的力量：能够号令元素。\n\n我本以为石心不会接受他们的礼物。我们氏族不需要力量。但他没有考虑到代价。\n\n他做了无法挽回的可怕决定。魔法像侵蚀树根的疾病一样，腐蚀了我的氏族。\n\n虽然我痛心疾首，但没有别的办法，必须净除受腐蚀者。', '', '', '', '', '', '在锈松之巢与纳尔恩见面。', 47936),
(66147, 'zhCN', '水晶水中浸', '在鳄鱼人海滨收集$1oa份水晶样本。', '虽然看起来可能不像，但我们都是专业人士。探险队委托我们在这片区域中寻找一簇稀有水晶。你喜欢的话就管这叫地质调查吧。\n\n我们被鳄鱼人袭击了，我现在还惊魂未定呢。你能不能行行好，帮我去寻找这种水晶？如果可以，再带一些样本回来。', '', '', '', '', '', '', 47936),
(66141, 'zhCN', '礼崩乐坏', '在通往锈松之巢的路上与加尔兹和纳尔恩见面。', '我的熊怪同伴已经迷失了自我。他们干出了……坏事。现在他们变成了更可怕的东西。\n\n熊怪从来不会和熊怪内斗！\n\n我的兄弟和我都逃了出来。我是来求救的。他还留在氏族的巢穴。\n\n帮帮我们，否则整个氏族就全没了！', '', '', '', '', '', '', 47936),
(66139, 'zhCN', '终末之焰', '使用浓缩的水之精华，在花园中击败炽光地狱火。', '好啦，年轻人。我将所有水元素的精华都放在了你面前的罐子里。\n\n只要把它朝那个大家伙扔过去，应该就能起效了。我是说，用水灭火不是常理吗？肯定万无一失的。\n\n呃，那高温对我的关节不太好，所以我还是留下吧。我相信你能行的。\n\n祝你好运，年轻人！', '', '导致团结花园一片混乱的火元素。', '炽光地狱火', '', '', '', 47936),
(66138, 'zhCN', '流沙过隙', '在花园中收集$1oa堆风卷时间之沙。', '就和其他花园一样，诺兹多姆的沙漏也不得不经受躁动元素的侵扰。紊乱的风元素席卷而来，吹散了沙漏中的魔力之沙。\n\n没有这些沙子，诺兹多姆在此处的影响力就会大大衰弱。\n\n作为受训中的管事，我负责时时刻刻照看沙漏的情况。如果你愿替我收集沙子，我将对你感激不尽。', '', '', '', '', '', '', 47936),
(66137, 'zhCN', '鞭笞一击', '在花园里消灭$1oa个入侵的亡灵花和鞭笞者芜花。', '我想魔荚人并不是唯一犯浑的生物。\n\n对我来说，阿莱克丝塔萨的树就和肉中刺一样。她的生命魔法引来了各类动植物，好的坏的都有。猜猜谁来对付那些坏家伙？老格里尔姆佩奇，就是我！\n\n守护巨龙在上，我老了，干不动了。\n\n那些管事也没有接受过战斗训练，所以生命缚誓者的杂草问题也只能靠你来打理了。', '', '', '', '', '', '', 47936),
(66136, 'zhCN', '元素提炼', '在花园中收集$1oa份水流精华。', '就在几天前，一个巨大的火元素摧毁了池塘。我觉得这场骚乱就是由它引起的，但它太大了，我们不是它的对手，应该先想办法削弱它。\n\n别觉得老格里尔姆佩奇派不上用场，我有一个好计划！\n\n有些水元素在蓝龙军团的露台上安了家。如果你能从它们身上收集精华，我们就能使用它们的魔法来回敬它们。\n\n以火制火，是这么说的吗？我猜应该是以水灭火。\n\n反正，你也许该动身了。', '', '', '', '', '', '', 47936),
(66135, 'zhCN', '园丁的学徒', '清扫垃圾堆，在花园棚屋中搜寻巴希尔顿勋爵。', '巴希尔顿！巴希尔顿勋爵，你在哪里？\n\n巴希尔顿勋爵是我的执行助理和学徒，他现在不知去向！他热爱探索，但他保护自己的本事还不如我呢。而我不是什么战士，只是区区园丁啊！\n\n能不能请你把这个浪荡公子找回来？我这里需要他，这样我才好思考。他通常会待在棚屋里，在垃圾堆中刨来刨去。\n\n不过小心点，他一开始挺容易动怒的。', '', '', '', '', '', '', 47936),
(66134, 'zhCN', '艾泽拉斯虫害控制', '在花园中消灭$1oa个焦躁的幼苗。', '那边的那个！年轻人！\n\n能不能帮我一把？这些魔荚人正在毁坏我的植物！\n\n各种各样的元素都在侵袭花园，它们看起来……还影响到了野生动物。它们的能量将这些向来平和的魔荚人逼疯了！比往常还疯狂！\n\n光是应付这三个，我就已经忙不过来了。求求你！别让它们把花床都糟蹋了。', '', '', '', '', '', '', 47936),
(66133, 'zhCN', '忠诚之钥', '收集$1oa把巨型黑曜钥匙。', '', '', '', '', '', '', '在黑曜堡垒上交组合好的钥匙。', 47936),
(66131, 'zhCN', '解锁过去', '收集$1oa把组合好的钥匙', '来把组合钥匙', '', '', '', '', '', '向黑龙堡垒中的任意派系上交组合好的钥匙', 47936),
(66130, 'zhCN', '解锁过去', '收集$1oa把组合好的钥匙', '来把组合钥匙', '', '', '', '', '', '向黑龙堡垒中的任意派系上交组合好的钥匙', 47936),
(66129, 'zhCN', '解锁过去', '收集$1oa把组合好的钥匙', '来把组合钥匙', '', '', '', '', '', '向黑曜堡垒中的任意派系上交组合好的钥匙。', 47936),
(66126, 'zhCN', '解锁过去', '收集$1oa把组合好的钥匙', '来把组合钥匙', '', '', '', '', '', '向黑曜堡垒中的任意派系上交组合好的钥匙。', 47936),
(66124, 'zhCN', '胜利转进', '与管理者瑟利斯特拉一起逃离闪霜飞地。', '据我所见，女王撤回了狂野孵化场，那是一处用于监视本地始祖龙的岗哨……希望那里的防御足够牢固。\n\n我们必须立刻赶去那里！', '', '', '', '', '', '', 47936),
(66123, 'zhCN', '擒贼先擒王', '在闪霜飞地击败加得基杰斯。', '加得基杰斯是莱萨杰丝麾下一名臭名昭著的副官，现在正趾高气扬地领导着此地的拜荒者。\n\n去让他们瞧瞧，与我们作对会有什么下场。', '', '如果不阻止莱萨杰丝的副官，她就会带来接二连三的麻烦。', '加得基杰斯', '', '', '', 47936),
(66122, 'zhCN', '始祖战术', '在闪霜飞地击败$2oa头始祖龙。', '这些始祖龙憎恨我们。他们相信我们是扭曲堕落的龙族，是任由泰坦摆布与束缚的玩物。他们根本不理解。\n\n所以他们派遣部队前来袭击城墙，自己却高枕无忧。\n\n它们错了。\n\n带上这根长矛，$p，消灭我们的敌人。', '', '', '', '', '', '在闪霜飞地与管理者瑟利斯特拉见面。', 47936),
(66121, 'zhCN', '抢救龙蛋', '在闪霜飞地营救4枚龙蛋。', '拜荒者窃取了我们的龙蛋，还在他们无耻的仪式上使用！必须阻止他们。\n\n你要帮我夺回龙蛋，否则就来不及了。找到龙蛋之后就做好标记，$p，我一定把它们安全地转移出来。', '', '', '', '', '', '在闪霜飞地与管理者瑟利斯特拉见面。', 47936),
(66119, 'zhCN', '红玉新生法池：拜荒者入侵', '进入红玉新生法池，阻止拜荒者的袭击。', '拜荒者撕开道路，闯入了我们的家园。我们无力应付如此凶猛的袭击……只有几个人逃出生天。\n\n有一个龙人决定挺身犯险，跟踪他们，结果至今都没能回来报告发现。我担心情况不妙。\n\n我会继续在这里坚守，只要一息尚存，谁都别想突破我们的城墙，但你必须阻止那些偷溜进来的敌人。\n\n去吧！', '', '', '', '', '', '', 47936);
INSERT INTO `quest_template_locale` (`ID`, `locale`, `LogTitle`, `LogDescription`, `QuestDescription`, `AreaDescription`, `PortraitGiverText`, `PortraitGiverName`, `PortraitTurnInText`, `PortraitTurnInName`, `QuestCompletionLog`, `VerifiedBuild`) VALUES
(66118, 'zhCN', '磐石来袭', '在闪霜战地摧毁$1oa个暴怒峭岩。', '莱萨杰丝和她的拜荒者召唤了高大的土元素，企图击碎我们的城墙。必须阻止他们！', '', '', '', '', '', '', 47936),
(66117, 'zhCN', '肃清战场', '', '', '', '', '', '', '', '', 47936),
(66116, 'zhCN', '首要威胁', '在闪霜战地寻找指挥官里萨纳克。', '这里有太多脆弱的龙蛋，我们无法一一保护。如果敌人突破进来，那就全完了！\n\n我相信卫兵已经集结在场，正在想办法击退敌人。去和指挥官里萨纳克谈谈，他应该会让你的力量有用武之地。', '', '', '', '', '', '', 47936),
(66115, 'zhCN', '红龙信条', '与红玉新生圣地的看护者交谈。', '我们的使命是照护与怜悯，帮助其他巨龙军团并不只是为了他们，更是为了巨龙全族。\n\n也许和红玉新生圣地的龙兽聊聊，你就能深入理解我们。', '', '', '', '', '', '', 47936),
(66114, 'zhCN', '为了女王的福祉', '与管理者瑟利斯特拉同行，前往红玉新生圣地。', '我们保护着这些珍贵的龙蛋，守护着所有巨龙军团的未来。拜荒者的行径所带来的并不仅仅是骇人的痛苦。\n\n他们企图灭绝我们。\n\n我必须立刻通报女王。', '', '', '', '', '', '', 47936),
(66112, 'zhCN', '可劲造', '收集始源大地核心和始源熔火核心。', '你见过如此强大的元素吗？！\n\n<格伦欢呼起来。>\n\n我听守卫们抱怨说，他们要没完没了地和元素作战。但他们没抓住重点……元素越大，制作材料就越大！\n\n在你清除元素、为我们保障安全，或是干其他什么事儿的时候，别忘记捡起那些最大块的材料，我好用它们做点东西出来！', '', '', '', '', '', '', 47936),
(66111, 'zhCN', '侵蚀元素', '在翼眠大使馆消灭$1oa个原始元素。', '龙鳞探险队的手艺人、工匠和探险家装备欠佳，无法应对激烈的战斗。\n\n但我们可不一样，$p。\n\n在巨龙群岛，我们将发挥自己的力量，保护那些无力自保的人。\n\n去清除盘踞在北方的元素，让探险队能够全心投入到高贵的求索事业中。', '', '', '', '', '', '', 47936),
(66110, 'zhCN', '和平之机', '向联盟代表介绍自己。', 'Aka\'Magosh，$p。\n\n这次探险同时受到部落和联盟的保护。我们的指示清晰明确：对龙鳞探险队的所有成员，不管阵营归属，一律提供协助。\n\n联盟的代表嘉里克船长和她的儿子正在营地的另一头站岗。\n\n我和嘉里克船长一起对抗过天灾军团。她心怀荣耀，值得尊敬，会为探险队鞠躬尽瘁。\n\n向她伸出你的援手，向她证明部落会遵守协议。', '', '', '', '', '', '在翼眠大使馆与嘉里克船长交谈。', 47936),
(66108, 'zhCN', '猛药重拳', '消灭索格勒莫格勒，潮喉之王和威格勒古格勒，风鳍之王。', '我很高兴萨鲁现在明白了我的观点，我也很感谢他。在我踟蹰不前的时候，他就让你动手营救野生动物了。\n\n现在的情况比我们预期的更为凶险，确实应该像他一样采取行动。以我们目前得知的消息来看，恐怕元素的狂轰滥炸不会就此停止，除非我们能够搞定鳄鱼人。\n\n如果我是萨鲁，并且从行动的角度思考，我会直击他们的首领。缺少了团结众人的首领，这场纷争很快就会烟消云散，湿地的威胁将不攻自破。', '', '', '', '', '', '', 47936),
(66107, 'zhCN', '荒野救生', '在惊扰湿地营救野生动物。', '你不必成为生态学家，也能意识到湿地正面临困境。\n\n伊斯卡害我们留在这里检验死尸，而我们本该主动出击，挽救生命！红龙军团的存在是为了保护生命而非解剖生命！\n\n我爱伊斯卡，他也擅长自己的事业。但如果我们只能坐着干等，等他在这里磨蹭完了，就什么都救不了了。\n\n我会让他别想太多。但你得到野外去，即使弄脏靴子，也要救出那些野生动物。', '', '', '', '', '', '', 47936),
(66106, 'zhCN', '如芒在贝', '从潮喉和风鳍鳄鱼人处收集$1oa个水流灌注贝壳和$1oa个狂风灌注贝壳。', '伊斯卡坚称情况不如表面这么简单，但我居然犯蠢质疑他。他要不是总能想在前面，快我两步，又怎么会成为我的同伴呢？\n\n我们当然可以通过行动来答谢他。如果这些贝壳引发了元素的混乱，你不如到他们的营地里去，从他们黏糊糊的手里夺走这些贝壳？\n\n你要带回足够多的狂风贝壳和流水贝壳，好让伊斯卡能够随心所欲地开展研究。', '', '', '', '', '', '', 47936),
(66105, 'zhCN', '轻剂疗法', '消灭$1oa个狂暴之水和$1oa个狂暴之风。', '我相信我们从这里安全地收集到了足够多的数据，可是……\n\n萨鲁是一位杰出的生态学家，他更希望我们采取行动。但是这里的生态系统非常脆弱，如果我们稍不小心，就可能会造成破坏。不过我也同意我们时间确实有限。\n\n看来还是可以稍微迁就一下他的。\n\n清除肆虐的元素应该就能争取到一些时间，也不会妨碍我们的研究。一定要注意，两方清除的数量必须相等，我们也不想打破平衡啊。', '', '', '', '', '', '', 47936),
(66104, 'zhCN', '法医生态学', '解剖鳄鱼人遗骸。', '我已经无计可施了，$n。萨鲁和我一路走来，几乎翻遍了每一具遗骸。结果到了最后，就因为我们方法不同，一拍两散了。他要是能听我的该有多好啊！\n\n<生态学者伊斯卡叹息着。>\n\n就目前这情况，巨大的压力快把我们俩压垮了。我甚至提不出什么靠谱的猜想来。\n\n你好像是个处变不惊的人。你能不能接手这最后两个鳄鱼人？我的解剖刀可以借给你。', '', '', '', '', '', '', 47936),
(66103, 'zhCN', '唯愿精进', '在黑曜壁垒考验$1oa名黑爪刺客和黑爪复仇者的技艺。', '我们需要更多部队来守备黑曜堡垒。既然立足之地已经拿下，接下来就必须为我们的大业补充新鲜血液。\n\n黑曜壁垒还有一些后备部队，能够增援我们。\n\n他们都是精兵强将，如果能再由你这样出色的英雄训练一番，那肯定再好不过，这样才算是做好了战斗的准备。', '', '', '', '', '', '在黑曜壁垒与无情的法沃见面。', 47936),
(66101, 'zhCN', '上九天揽月', '使用勘测员的圆盘弹射升空，侦查区域。', '托蒂和娜蕾迪亚申请了一份周边区域的调查报告，还说立刻就要。\n\n好消息是，我弄到了一个附魔望远镜，还有勘测员的圆盘。有了它们，我们就可以在安全的云层中侦查附近的区域了。\n\n坏消息是，我恐高得要命，我甚至不敢踩上那个装置。\n\n你应该不恐高吧？', '', '', '', '', '', '', 47936),
(66100, 'zhCN', '补给重担', '收集$1oa袋守路者补给。', '我这次真的搞砸了。我才离开了营地没多久，一回来就看到，塔拉赛把我没钉死的东西全都搬走了。\n\n那些补给非常昂贵，我真的没法再要一批了！我的姐妹诺丽肯定会怪我无能的。\n\n如果你真的要前往山谷，能不能请你帮助留意一下散落的补给袋？', '', '', '', '', '', '', 47936),
(66087, 'zhCN', '终止时间', '在变换流沙中消灭迷时敌人，增强青铜龙盟友，交还失落的神器，关闭时光裂隙，协助时光旅行者。', '侵袭将这条时间线压迫到了崩溃的边缘。要是能有一整队时光旅行者就好了！\n\n虽然你是个刚拿到法杖的新兵，但我听说你已经为我们提供了莫大的帮助。只要稍微辅助一下，你肯定可以继续援助我们的事业。\n\n要是平时，我会让你接受一整套训练，可这个时期有些……异样。带上这个记载着深奥知识的卷轴，使用它来击退入侵者！动作快，它的效果只能持续一小会儿。', '', '', '', '', '', '', 47936),
(66085, 'zhCN', '倘若光阴倒转', '在变换流沙与西雅赛拉泰一同关闭时光裂隙。', '合格的时光旅行者绝不会在解决危机时半途而废。必要的工具已经在手，为什么还要干等着呢？\n\n你找到了我原来的法杖，我也找到了一根备用的，肯定不会有人想念它的。我的计划是，我们不如一起对付这些裂隙，共同解决今日的危机。\n\n你意下如何？这个任务应该很简单吧？', '', '', '', '', '', '', 47936),
(66084, 'zhCN', '时势如此', '从变换流沙的迷时敌人处收集$1oa份时光残渣。', '虽然训练有些磕磕绊绊，但你肯定做好了协助我们的准备。\n\n山谷中的扭曲令不同的时期与我们的时间交汇在了一起。我们不知道为什么会与这些时间线相连，这一点令人不安，还需要收集更多情报。\n\n看看你能否从不同时间线里涌来的生物身上找到线索。它们穿过时间流时肯定留下了残渣。只要研究这些残渣，我们也许就能跑在危机前面。', '', '', '', '', '', '', 47936),
(66083, 'zhCN', '宛如初见', '与安但丁诺姆交谈，接受时光旅行者培训。', '引导时间流是一项危险的职责。\n\n虽然你不是时光旅行者，但克罗诺姆大使相信你能帮上大忙。不过，为了确保你的安全，我们必须先进行适当的培训。\n\n可惜我们的导师依然音讯全无。我会尽力帮忙的，不知道我们两个会有怎样的表现。克罗诺姆大师现在就靠我们两个了。', '', '', '', '', '', '', 47936),
(66082, 'zhCN', '瓶装时间', '在索德拉苏斯的起伏森林里消灭时间充能的动物，收集时间能量。', '太好了！时光旅行者法杖完好无损！但它的能量肯定耗尽了。\n\n我知道了！你可以使用汇集在野生动物身上的时间能量为它充能。可惜的是，这需要先击败受到影响的林中生物。时间能量令它们变得凶暴而危险，我们不得不想办法削减它们的数量……\n\n有些时候，人必须为了大义而做出牺牲。你能帮忙吗？我还需要一点时间。', '', '', '', '', '', '', 47936),
(66081, 'zhCN', '时光飞逝', '在索德拉苏斯的起伏森林中收集$1oa个时光收集器。', '青铜龙神殿遭到了袭击，时间能量正散逸到山谷中的各个角落。\n\n时光旅行者在森林各处安放了收集器，希望收集错乱的魔法。收集到的一切都可以用作额外的力量！这倒是件好事，我们几乎在危机中竭尽了资源。\n\n本该是由我来取回收集器的，可我还需要再喘息一会儿。\n\n你能帮我取回它们吗？', '', '', '', '', '', '', 47936),
(66080, 'zhCN', '临时困扰', '在索德拉苏斯的起伏森林中寻找失踪的新成员。', '你好，$c。你来得正是时候！\n\n神殿里发生了一些骚乱，导致时间流变得不再稳定，开始从山谷中溢出。这还不是唯一的问题，有好些时光旅行者也失踪了！\n\n我们征求过更多帮手，但有一个新人尚未抵达。\n\n你能去寻找她吗？一定要小心，山谷中的时间变化不休，谁知道附近徘徊着怎样的危险！', '', '', '', '', '', '', 47936),
(66079, 'zhCN', '拉希奥在等待', '在黑曜壁垒与拉希奥见面。', '这些龙蛋代表着新一代的龙族，必须得到保护和呵护。然而……我心痛不已，我还为拉希奥担心，只怕他一意孤行，最终会做出蠢事。\n\n你是他信赖多年的好友，$n，也许你能代替我，助他一臂之力。\n\n他去黑曜壁垒了，请你保护好他。他的军团已经所剩无几了。', '', '', '', '', '', '在黑曜壁垒与拉希奥见面。', 47936),
(66078, 'zhCN', '刀锋训练', '考验$1oa名黑爪刺客和复仇者的技艺。', '多年以来，我一直在培养黑爪，训练他们、鼓励他们，希望让他们能够与你比肩。\n\n他们也许还没像你一样取得多么崇高的成就，但他们至少不辱使命。他们令我感到自豪。\n\n如果你能考验他们的技艺，他们都会感到光荣。你也许还会看到自己的影子。', '', '', '', '', '', '', 47936),
(66076, 'zhCN', '上古龙蛙', '', '', '', '', '', '', '', '', 47936),
(66074, 'zhCN', '原始镰螳虫后', '', '', '', '', '', '', '', '', 47936),
(66071, 'zhCN', '大鹏展翅', '协助$1oa只受伤的蓝羽大鹏。', '我是哈琳·啾讽教授，举世闻名的珍奇禽鸟学家！我来巨龙群岛，是为了研究神秘莫测的蓝羽大鹏。但我想，现在有更大的飞禽要对付了。\n\n我想这些鹰身人是在群岛显现的时候从卡利姆多飞来的。她们极具侵略性，还在凶狠地捕食这些大鹏，就和在锈水港赌场里狼吞虎咽的食人魔一样。\n\n我们要让这里的大鹏有机会回击。带上这个医疗包，对那些受伤的大鹏使用，帮助它们恢复力量。', '', '', '', '', '', '', 47936),
(66070, 'zhCN', '辉刃之骨', '', '', '', '', '', '', '', '', 47936),
(66057, 'zhCN', '修复信仰', '修理黑曜誓言石。', '四散的碎片已经重组，我们可以修复誓言石了。\n\n去吧，帮助拉希奥完成修复。', '', '', '', '', '', '在黑曜王座与拉希奥见面。', 47936),
(66056, 'zhCN', '铸成新未来', '准备大地守护者的熔炉。', '大地守护者的熔炉是所有现存的巨龙熔炉中最强大的。为了保护艾泽拉斯，我们的先祖使用它锻造了至强的武器和护甲。\n\n熔炉的炉膛中蕴藏着重铸誓言石碎片所需的力量。\n\n我们走吧，让熔炉准备好迎接后续的工作。', '', '', '', '', '', '将烬齑之煤交给熔炉主管巴则恩图斯。', 47936),
(66055, 'zhCN', '崩解的过去', '找回$2oa块誓言石碎片。', '誓言石受损，有几块碎片不见了。\n\n尽你所能地找回碎片……也许还有办法能够修复誓言石！', '', '', '', '', '', '', 47936),
(66049, 'zhCN', '黑曜誓言石', '找到黑曜誓言石。', '奈萨里奥成为大地守护者的时候，他立下了一个守护世界的誓言，$n。他立誓守护深层的大地，和自己的军团一同成为艾泽拉斯的守护者。黑曜誓言石就代表着这个承诺。\n\n我们必须激活誓言石，让巨龙群岛知道，黑龙军团回来了！\n\n跟我来，$n。', '', '', '', '', '', '', 47936),
(66048, 'zhCN', '最佳计划与打算', '与拉希奥麾下部队的多名成员一起检查作战计划。', '向掌控黑曜堡垒的贾拉丁发起攻击并非易事。就算有拉希奥和黑爪部队的支援，这也会是一场硬仗。拉希奥或许成竹在胸，但我……我没法那么肯定。\n\n我们可以和规划战术的人员谈谈，也许还能找到改进的空间。', '', '', '', '', '', '向黑曜壁垒的拉希奥报告你的发现。', 47936),
(66044, 'zhCN', '雄踞高墙', '消灭三架攻城强弩和勇士乔卢克。', '萨贝里安和其他巨龙暂时击退了贾拉丁。我们必须迅速行动，占据高塔，取得胜利。\n\n你和我要一起拔除从上方威胁我们的攻城强弩。\n\n你准备好了就告诉我。', '', '', '', '', '', '面见拉希奥', 47936),
(66040, 'zhCN', '回到未来', '保护盟友，抵抗黑暗帝国，直到时间传送门开启。', '我们没有继续跌进未来，但我们正处于过去，遥远的过去。“泰坦都没来得及造访艾泽拉斯”的那种过去。回家实在是有些……难办。\n\n但我们巨龙一定能行！\n\n我们需要你挡住背后这些黑暗帝国的爪牙，应该用不了多久的！\n\n我想是吧。\n\n大概吧。\n\n别怕！你只要赶走这些骇人的怪物，其他的都交给我们！很轻松吧！', '', '', '', '', '', '', 47936),
(66039, 'zhCN', '克罗米时间', '寻找克罗米并完成时间稳定仪式。', '这是……黑暗帝国。我们回到了很久很久以前的过去。\n\n瞧！我看见克罗诺姆大使和伊特努丝了！我们得赶快完成仪式。\n\n我真的没有兴趣打探他们下次会穿越到哪里。', '', '', '', '', '', '', 47936),
(66038, 'zhCN', '与时间赛跑！', '争分夺秒，追随克罗米和伊特努丝的脚步。', '$n，我们必须迅速行动，才能追上克罗诺姆大使。我是说真的。\n\n赛拉和我会尽力加快进程，但我们必须尽量避免和这个时期发生纠缠。那样会减缓我们的速度，也许就没法留住大使了。到了那时候，就连诺兹多姆都无计可施了。\n\n我们一刻也不能错失！\n\n|cFF0000FF（接受该任务将开启倒计时）|r', '', '', '', '', '', '', 47936),
(66037, 'zhCN', '回到现实', '返回现世的诺兹多姆身边。', '我们可以强化克罗诺姆大使与我们这个时间的联系。我相信等我们再次找到她，就能结束仪式了。\n\n至于现在，我们应该返回现世，以及一个……少一点鱼人的世界。', '', '', '', '', '', '', 47936),
(66036, 'zhCN', 'Mugurlglrlgl！', 'Murglgulglrrlglgul！', 'Mrglgulglrrlglgul！Grurguglullgurl！\n\nGruglrlgllrugl rrgulgrulgrgl grugll gurgull gur。Murgllgllrugl gurgllglrl Murgul gruggullgl。Murguglegurgllgur gurgll gurgulgul guruulgurllgr guuglrllgl。\n\nMgrgulllglll gurl gugll。\n\n<你不确定这到底是什么意思，但看着频繁出现的捅刺动作，也许这个鱼人希望你消灭什么东西。>', '', '', '', '', '', '', 47936),
(66035, 'zhCN', '鱼人微粒', '汲取$1oa个时光微粒。', '一条由鱼人诞生的时间线？？！\n\n请原谅我的自私，但在你寻找克罗诺姆大使的时候，能不能收集一些时间能量飘散的微粒？\n\n只要走向它们就行，剩下的就交给法杖吧。等到我们不必在艾泽拉斯的时空缝隙中穿梭的时候，我就能检查数据了，你懂的。', '', '', '', '', '', '', 47936),
(66033, 'zhCN', '走向……过去？', '使用传送门，在艾鱼拉斯与安但丁诺姆见面。', '很遗憾我们没能让克罗诺姆稳定下来，但也许我们能在另一个潜在位置上找到她，让她不用继续在时光中坠落。\n\n<诺兹多姆皱起了眉。>\n\n这条时间线的往昔一幕……很古怪，其中还有我曾经目睹过的景象。\n\n保持警惕，$n。我不知道你会遭遇什么，但它很强大……而且异常的熟悉。', '', '', '', '', '', '使用传送门，在艾鱼拉斯与安但丁诺姆见面。', 47936),
(66032, 'zhCN', '返回现世', '返回现世的诺兹多姆身边。', '这条时间线只有黑暗和混乱，扰动情况非常严重。我应该在这里多留一会儿，想办法解决时间线中可能出现的涟漪。\n\n回去找诺兹多姆吧。他肯定希望得知我们成功的消息，虽然也没我们希望的那么成功。', '', '', '', '', '', '', 47936),
(66031, 'zhCN', '争分夺秒', '为幸存者营地收集元素精华。', '我想，发现自己来到这里也不该令我意外。\n\n这不是我想要的艾泽拉斯，却是我拥有的世界。我们为了守护仅剩的一切、夺回这个世界而战。但你的到来引起了麻烦。\n\n我们一直在使用那些元素的精华来维系防护工事，保障我们的安全。看到那种护盾了吗？只有依靠它，我们才能不被发现，不被毁灭。可你耗尽了我们的资源。带一些精华回来，我们才能再挺过一天。', '', '', '', '', '', '', 47936),
(66030, 'zhCN', '抵抗并非徒劳', '在拜荒者的未来治疗抵抗军战士。', '时间涟漪给我们的人民带来了许多麻烦。敌人会莫名出现，还会比原本更强更凶。这些变化虽说微不足道，但也可能招致灾难。\n\n请你帮助我们在此地的抵抗力量，治愈他们的创伤，让他们再次投入战斗。将他们的时间线拨回正轨，就像从未与我们有过往来一样。这些都不是大事，但能帮上他们。', '', '', '', '', '', '', 47936),
(66029, 'zhCN', '临时调整', '在拜荒者的未来对伊特努丝和克罗米使用时空水晶，以免她们从时空中滑落。', '克罗诺姆和伊特努丝在时间中坠落，但我感觉到，她们偶尔会停止片刻。这些稍纵即逝的时刻就是拦下她们的最佳机会。\n\n<诺兹多姆召唤出一块小巧的时空水晶。>\n\n我在这块水晶中注入了力量，还有我自己的时间共鸣。她们前往了一个可能的未来……相当麻烦的未来。找到她们，使用水晶，希望你能修正她们在时间中的位置，别再和她们失之交臂。', '', '', '', '', '', '返回现世的诺兹多姆身边。', 47936),
(66028, 'zhCN', '走向未来！', '前往拜荒者的未来。', '我追踪克罗诺姆和伊特努丝来到了一个可能的未来。我不知道你会发现什么，只知道那里黑暗一片，混沌无序。\n\n索莉多米已经带领几名时光旅行者出发前往那个未来，他们会稳定时间联系。因为她必须使出全部的力量才能维持传送门，所以必须依靠你的才能了。\n\n等你找到索莉多米，她会向你下达更多指示。\n\n快，$n，一定要找到克罗诺姆。', '', '', '', '', '', '在拜荒者的未来与索莉多米交谈。', 47936),
(66027, 'zhCN', '呼叫蓝龙', '观看卡雷苟斯召回蓝龙军团。', '我不再害怕将蓝龙重新团结起来，$n。我们应该组成一个大家庭……而不是成为过去的碎片。\n\n即使无法夺回誓言石，我也能够利用它的力量，向所有蓝龙发出信息。\n\n他们该收到消息了……守护巨龙的消息。', '', '', '', '', '', '', 47936),
(66026, 'zhCN', '需要紧急措施', '在蕨皮外围区与布莉娜见面。', '这些袭击肯定都是蕨皮豺狼人干的。\n\n我们和蕨皮豺狼人斗争了几个世代，但在此之前，他们只能算得上是小麻烦。\n\n我们别无选择，只能对豺狼人采取紧急措施了。他们污秽的腐朽将会毁灭碧蓝林海，包括你所要找的东西。\n\n到蕨皮外围来找我，我们需要所有可能的援手。', '', '', '', '', '', '', 47936),
(66025, 'zhCN', '诺库德威胁', '讨论下一步。', '诺库德氏族的军队正在攻占马鲁凯。\n\n我们到可汗大厅去谈谈下一步行动吧。必须保证马鲁克半人马的安全。', '', '', '', '', '', '', 47936),
(66024, 'zhCN', '绝命断后', '消灭守卫巴希尔。', '诺库德对我们一族在远古时期的战争故事颇为青睐。其实他们才是弱者，一群装模作样的臭小子。在那一记惊雷之下，他们斩断了自己和欧恩哈拉的联系。\n\n呵！如果他们走上腐蚀之路，企图挑起战争，那我们一定奉陪。\n\n当然，巴希尔留了下来，指挥部队掩护他撤离。她的鲜血很快就会倾洒在大地上。', '', '被巴拉卡留下发号施令，巴希尔为这一刻已经等了太久。', '守卫巴希尔', '', '', '返回尊可汗萨雷丝特身边。', 47936),
(66023, 'zhCN', '破约弃盟', '消灭$1oa个诺库德部队成员。', '巴拉卡令他的氏族颜面扫地。他盲目地渴望力量，带领他们卷入了风暴。\n\n这场背叛显露出了他们的软弱，干掉他们。', '', '', '', '', '', '', 47936),
(66022, 'zhCN', '尊可汗', '向可汗卫士阿卡托报告，和杰米萨兹一同觐见尊可汗。', '我不能在半人马的土地上久留，必须尽快返回花园。\n\n尊可汗答应了我们的求援。她正在马鲁凯中央的库塔伊顶部等我。\n\n按理说我应该先行一步，独自前去觐见她，但也欢迎你与我同行。', '', '', '', '', '', '', 47936),
(66021, 'zhCN', '讨厌的外来者', '击败$1oa个诺库德半人马。', '哼！瞧瞧你那弱小的样子，简直跟把你领来的废物猎人一模一样。\n\n你想了解诺库德？那就靠战斗说话吧。\n\n我们的战斗仪式被称作“塔巴尔”。我们通过训练，通过战斗，变得愈发强悍。弱者在氏族里没有容身之地。\n\n闲话已经够多了，开战吧。', '', '', '', '', '', '返回斥候托木尔身边。', 47936),
(66020, 'zhCN', '兆示焚香', '收集$1oa朵吮蜜之花，将其磨成吮蜜熏香，随后在仪式中协助欧恩·瑟什滕。', '我已将进入马鲁凯之前收到的征兆禀告提嘉里可汗，她表达了自己的忧虑，她也感觉到了风中的冷冽。\n\n我们在这里栽培了一种特别的花，焚烧花朵就能产生梦幻般的效果，可以加强我们与征兆的联系。\n\n我请你去采集一些花朵，让我们制作焚香。在可汗的协助下，我们也许能探明欧恩哈拉身处的困境。', '', '', '', '', '', '', 47936),
(66019, 'zhCN', '光耀先祖', '帮助卡尔因·多图尔为先祖准备盛宴。', '我们的先祖乘着欧恩哈拉之风，在我们身旁行走，指引我们、保护我们。所有马鲁克半人马，无论是生是死，都会在呼拉尔放下兵戈。\n\n盛宴的香气会将先祖招来火旁。当他们抵达这里，呼拉尔就会开始。', '', '', '', '', '', '', 47936),
(66018, 'zhCN', '诺库德氏族', '陪同托木尔去找守卫巴希尔。', '<珊索克可汗做了个手势，欧吉尔便为她代言。>\n\n诺库德氏族是新近崛起的一支部族。他们上一代的可汗迦坎还在世时，集结了一支强大的军队，夺占了前任的土地。这就是我们人民的生活方式。\n\n图古尔赢得了众人的尊敬，但他的儿子没有。巴拉卡弑父犯上，夺取了氏族的领导权。从那以后，他们就变得更为孤立。然而，要想了解马鲁克，你就必须了解他们。', '', '', '', '', '', '在诺库德营地旁与斥候托木尔见面。', 47936),
(66017, 'zhCN', '欧恩伊尔氏族', '在秘术师之池旁与欧恩·瑟什滕见面。', '<珊索克可汗做了个手势，欧吉尔便为她代言。>\n\n我们土地上的秘术师，比如欧恩·瑟什滕，都属于欧恩伊尔氏族。构成这个氏族的并不是一个个家庭，而是来自平原各地、与欧恩哈拉天生就存在关联的半人马。他们付出一生维护这种关联，磨炼自己的本事。最终，他们会被指派到各个氏族，保护我们的土地。\n\n欧恩·瑟什滕去向她的可汗通报自己收到的征兆了。去找到她，了解欧恩伊尔的故事。', '', '', '', '', '', '在秘术师之池旁与欧恩·瑟什滕见面。', 47936),
(66016, 'zhCN', '提莱氏族', '向卡尔因·多图尔报告。', '<珊索克可汗做了个手势，欧吉尔便为她代言。>\n\n提莱氏族是尊可汗的氏族，是我们与马鲁克先祖最直接的关联。他们恪守我们的传统，传述我们的故事。\n\n想要了解马鲁克，你就必须了解提莱氏族。尊可汗的一位女儿卡尔因·多图尔正在为先祖准备宴席。去帮帮她，她就会助你了解我们的人民。', '', '', '', '', '', '向卡尔因·多图尔报告。', 47936),
(66015, 'zhCN', '蓝龙誓言石', '陪同卡雷苟斯夺回蓝龙誓言石。', '碧蓝林海的情况算是稳定了，更多蓝龙也及时出现。\n\n该返回碧蓝档案馆，夺回誓言石了。\n\n我也需要你亲自前往那里，$n。在之前的一路艰险里，你一直都是我们的助力。', '', '', '', '', '', '', 47936),
(66011, 'zhCN', '追忆伊瑟拉', '再次寻找瑟拉姆斯。', '不！我现在明白了。瑟拉姆斯……很想念伊瑟拉，而她再也回不来了。\n\n来吧！我可能知道他去了哪里。我们不会继续叨扰他了，但最好还是要跟他道个歉，然后为他留出想要的空间。\n\n我们都是为了彼此，我们都在同一个大自然的怀抱里。', '', '', '', '', '', '', 47936),
(66009, 'zhCN', '瓦克索斯防御战', '击败毁灭者寇兹罗克斯。', '是时候了，$n。你搞定了地上的装置，空中的拜荒者部队就独木难支了。\n\n多亏了你的努力，莱萨杰丝派出了一名副官来增援拜荒者部队。\n\n我需要你去处理这个怪物，我会继续抵抗莱萨杰丝，援助卡德加。\n\n在战斗中注意我的魔法，我会全力协助你的。\n\n该让莱萨杰丝面对魔法守护巨龙的怒火了！', '', '莱萨杰丝的副官之一，一心为蓝龙带去毁灭。', '毁灭者寇兹罗克斯', '', '', '在瓦克索斯上方与卡德加交谈。', 47936),
(66007, 'zhCN', '解放天空', '摧毁$1oa个熔岩道标。', '拜荒者在使用这些巨大的宝珠抵挡卡雷苟斯。\n\n照目前这个速度，卡雷苟斯很快也会伤痕累累，无力作战。如果他倒下了，我将无力与莱萨杰丝抗衡。\n\n你手中的强化宝石应该可以改变你的样貌，让你变成元素的模样偷偷潜入。\n\n使用宝石摧毁宝珠，让卡雷苟斯有机会施展自己的力量。\n\n我会集中精神庇护塔楼，让莱萨杰丝无法染指。', '', '', '', '', '', '在瓦克索斯峰的一处洞穴中与卡雷苟斯见面。', 47936),
(66006, 'zhCN', '返回罗莎身边', '将补给品交给蹄铁匠罗莎。', '巴巴休息好了，罗莎的补给品也找回来了。我们这样子回去，她肯定不会再发火了。\n\n你走的时候捎上几箱，剩下的我派战士们来搬。', '', '', '', '', '', '', 47936),
(66005, 'zhCN', '失落友人勋章', '将失落友人勋章交给卡萨尔。', '<这个被嚼烂的金属块曾经是一件精美的装饰品，对一位席卡尔半人马意义重大。\n\n卡萨尔或许认识它的主人。>', '', '', '', '', '', '将失落友人勋章交给卡萨尔。', 47936),
(66004, 'zhCN', '加尔格雷什', '', '', '', '', '', '', '', '', 47936),
(66003, 'zhCN', '环驭众火', '收集$1oa个熔火缚环。', '这里的贾拉丁真是胆大妄为，竟然将烈焰元素束缚在一起，让他们在这片区域横冲直撞。野生动物都逃走了，危险的元素离我们的营地很近。\n\n好在我已经建造了一座小型坚石堡垒，用以抵挡来势汹涌的炽焰风暴……我们绝不能倒下！\n\n收集束缚这些烈焰元素的魔法缚环，我们要用它们来加强防御工事。', '', '', '', '', '', '', 47936),
(66001, 'zhCN', '最后的希望', '营救最后一个注能的龙卵。', '一整窝雏龙都不见了……\n\n<森德拉克斯挺起了背，咬紧了牙。>\n\n我们还有一个地方没搜过。附近有一片广阔的仪式场地，那头始祖龙应该会把龙蛋放在那里。\n\n我们要一起冲破他们的残酷防线，$p，尽力多救出几个。', '', '', '', '', '', '', 47936),
(66000, 'zhCN', '阿莱克丝塔萨的藏书馆', '拯救$1oa件重要的文化作品。', '<这本书的内页已经烧成了焦黑。\n\n拜荒者似乎打算焚烧这里的远古典籍，巨龙军团的历史危在旦夕。看起来拜荒者希望将巨龙军团从历史中彻底抹除。\n\n尽你所能，拯救历史。>', '', '', '', '', '', '', 47936),
(65999, 'zhCN', '齿爪尽红', '消灭$1oa个拜荒者入侵者。', '指挥官里萨纳克警告我们这些新兵，说他收到了噬雷之龙莱萨杰丝越狱的报告。她的奴仆似乎紧随而至，威胁着我们珍爱的一切。\n\n他们的动作很快，根据上次巡逻的报告，这片废墟当时并无人迹。\n\n我们必须阻止这里的拜荒者。\n\n为了生命的缚誓者，为了所有巨龙军团！', '', '', '', '', '', '', 47936),
(65998, 'zhCN', '军团的未来', '营救红玉龙蛋。', '在龙人毕业之后，他们最崇高的使命就是以性命保护每一颗龙蛋。\n\n这就是我们受训，我们活着的原因。\n\n我不能继续躲在这里观望了，$p。拜荒者会偷走龙蛋并注入力量，整个巨龙军团的未来都悬于一线！\n\n虽然我们势单力孤，但你愿意和我并肩作战吗？你愿意为拯救巨龙军团而战吗？', '', '', '', '', '', '', 47936),
(65997, 'zhCN', '追逐森德拉克斯', '在生命缚誓者花园废墟中寻找森德拉克斯。', '学员森德拉克斯才走了没多久。\n\n她传达了指挥官里萨纳克的命令，让所有龙人返回新生法池集结待命。我们的整支防御部队很快就朝那个方向开拔了。\n\n不过我们的斥候已经在古老的废墟中巡逻了，所以她赶去那里征集他们了。', '', '', '', '', '', '在生命缚誓者花园与森德拉克斯见面。', 47936),
(65996, 'zhCN', '老兵援军', '帮助受伤的卫兵并找到森德拉克斯。', '指挥官里萨纳克一直见解独到。我们需要最资深的守卫才能阻止他们的威胁。对于森德拉克斯这样的学员来说，集结部队是一个合适的任务，但她也可能需要援助。\n\n森德拉克斯这一路会前往西部地区，那里可能正在遭受新兴威胁的猛攻，他们同样需要救援。带上这瓶合剂，向他们提供援助。', '', '', '', '', '', '在档案岗哨与森德拉克斯见面。', 47936),
(65995, 'zhCN', '黑曜堡垒', '将卡拉希计划交给拉希奥。', '<乍一看，这似乎是贾拉丁营地之间的内部通讯。\n\n“黑曜堡垒”这几个字顿时映入眼帘。\n\n也许拉希奥有兴趣看看这个。>', '', '', '', '', '', '', 47936),
(65994, 'zhCN', '制裁贾拉丁', '', '', '', '', '', '', '', '', 47936),
(65993, 'zhCN', '败兴而归', '在碎鳞要塞消灭绞肉者索泰克。', '啊，没错。\n\n我刚刚抵达这里，就看到有个巨人在劫掠过后满载而归。她正在营地的某个地方庆祝自己的凯旋呢。\n\n如果有人砸了她的场子扫了兴，那可就太遗憾了。你说呢？', '', '龙心岗哨遇袭的元凶。', '绞肉者索泰克', '', '', '在碎鳞要塞内与拉希奥见面。', 47936),
(65992, 'zhCN', '黑爪谍报', '与藏匿在碎鳞要塞各处的拉希奥的间谍交谈。', '我和瑟利斯特拉在空中吸引注意的同时，暗影正在他们的防线中步步进逼。\n\n我的黑爪特工正在监视要塞的一举一动。去和他们接头，告诉他们你是自己人，他们会和你分享与敌人有关的珍贵情报。', '', '', '', '', '', '在碎鳞要塞内与拉希奥见面。', 47936),
(65991, 'zhCN', '清算已至', '在碎鳞要塞与拉希奥和管理者瑟利斯特拉见面。', '学员森德拉克斯将管理者的计划告诉了我。感谢生命的缚誓者，他们愿意提供帮助。只要他们出手，我们就能腾出手来，为新生法池里的伤患提供救治。\n\n我希望能给瑟利斯特拉派去援军，但我必须将卫兵留在伤患身边。你要尽快赶去敌人的据点与他们会合。\n\n如果还有其他能够扼制贾拉丁的办法就好了，可现在……\n\n做你该做的事吧。', '', '', '', '', '', '', 47936),
(65990, 'zhCN', '挽龙崽于毒手', '从龙心岗哨拯救$1oa只幽咽的雏龙。', '我们还没来得及做出反应，他们就扑过来了。我的卫兵全力御敌，争取时间，让我们能疏散无力自保的老幼，但岗哨里恐怕还有更多需要营救的人。\n\n跨过桥去，寻找幸存者。', '', '', '', '', '', '', 47936),
(65989, 'zhCN', '贾拉丁进犯', '在龙心岗哨消灭$1oa个贾拉丁。', '即使无力夺回岗哨，我们也不会不战而降。\n\n让他们瞧瞧，我们依然有点本事。', '', '', '', '', '', '', 47936),
(65977, 'zhCN', '肯瑞托救援行动', '营救$1oa个濒死的法师。', '拜荒者袭击了我们的远征军，我当时以为许多法师都丢了性命。\n\n看来他们只是被拜荒者抓走了，这会儿正在被严刑拷打呢！\n\n请你救出被遗留在此的法师。他们也许没法参战，但总不能抛下他们吧。', '', '', '', '', '', '在瓦克索斯山脉深处与卡德加的投影见面。', 47936),
(65962, 'zhCN', '无尽倒计时', '准备好后与克罗米交谈。', '没想到为了拯救神殿，我们居然要拆掉用来保护它的安全系统，不过没有别的办法了！\n\n净除时间元素之后，我们的时光旅行者就脱困了，守卫们也整装待发了。该捅破这最后一个静滞气泡，解决伊特努丝了。\n\n等你准备好了就告诉我。我知道有你在一定能万事顺利。', '', '', '', '', '', '', 47936),
(65958, 'zhCN', '原始力量', '使用元素法器，从被消灭的拜荒者和元素身上吸取元素能量。', '恐怕我已经维持不住镜像了。拜荒者正在集结全部力量，想将我从空中击落。\n\n不必担心……我自有计划。\n\n我需要你带上取回的宝珠，从被消灭的拜荒者身上收集元素魔法。\n\n我们接下来需要用到那种元素力量，将他们的部队从我身旁引走。', '', '', '', '', '', '在瓦克索斯山脉深处与卡德加的投影见面。', 47936),
(65957, 'zhCN', '既生贾拉丁……', '消灭摩达克·焰喷、穿刺者盖格拉和熔火者奥尔菲斯。', '就我们观察到的情况而言，贾拉丁的社会构建在力量之上。强者成为榜样模范，鼓舞其他人越战越勇。\n\n在下方的大军里，我们发现了三个最强大的贾拉丁……也就是你的目标。\n\n你，$n，要单枪匹马地消灭他们，这样就能重挫他们的锐气。', '', '', '', '', '', '', 47936),
(65956, 'zhCN', '利爪打击', '干扰贾拉丁防线。', '在你的帮助下，我的黑爪刺客会砍翻防守外围阵线的贾拉丁。用小型眩晕炸弹标记目标，他们就会赶来援助你。\n\n快速前进，消灭任何可能阻碍我们进军的目标。', '', '', '', '', '', '', 47936),
(65955, 'zhCN', '半人马最好的朋友', '救出卡萨尔，并在洞穴中与他见面。', '留在开阔地不安全，$p。\n\n鳄鱼人逼迫我的狩猎伙伴巴巴躲进了东面的洞穴里。\n\n快放了我，我们一起去救巴巴。等道路肃清了，我会在洞穴里和你碰头。', '', '', '', '', '', '', 47936),
(65954, 'zhCN', '释放猎犬', '解救席卡尔獒犬。', '我听到了熟悉的嘶嚎和吠叫声，是我们营地里失踪的獒犬。\n\n我们挚爱的猎犬被困在了笼子里，等着被这些……玩意儿……生吞活剥。\n\n我们有义务照顾好同伴。救出它们，然后见证席卡尔獒犬真正的力量吧。', '', '', '', '', '', '', 47936),
(65953, 'zhCN', '神谕之陨', '从鳄鱼人萨满处收集$1oa个图腾。', '在鳄鱼人村庄的一片疯狂之中，我发现最恼人的莫过于鳄鱼人萨满。\n\n他们非常恶毒，性情鲁莽，不计后果地操弄着风暴的魔法。\n\n我们必须阻止他们。去消灭他们，把图腾带回来，我们的秘术师对它们很感兴趣。', '', '', '', '', '', '', 47936),
(65952, 'zhCN', '传奇酋长', '消灭格勒格勒美什酋长。', '这处沼泽里的鳄鱼人曾经还是纯良的生物。虽然会惹麻烦，但从来不偷不抢，更不会吃狗。\n\n是他们的酋长格勒格勒美什，是他带领族群偏离了本性。\n\n只要终结这个恶徒，鳄鱼人就不会再构成威胁了。', '', '最威武不屈的鳄鱼人。除了绝望之外，格勒格勒美什已经征服了一切。', '格勒格勒美什酋长', '', '', '', 47936),
(65951, 'zhCN', '独行供货商', '在森林中寻找卡萨尔。', '罗莎非常恼怒！她不眠不休地埋头苦干，为车队做准备，结果补给品全被讨厌的鳄鱼人偷走了。\n\n她已经失去了太多，我正在全力协助她。\n\n卡萨尔可能独自去找她的补给品了，一句话都没留下。他总是这幅样子。可他这次去的时间太久了，我们还丢失了许多犬只。\n\n你能不能去寻找卡萨尔和犬群的下落，$p？', '', '', '', '', '', '在泥鳍村与卡萨尔交谈。', 47936),
(65950, 'zhCN', '鳄鱼人窃贼', '从泥鳍村夺回失窃的补给品。', '蹄铁匠罗莎受邀加入车队了吗？没有！那么谁来给车队供应蹄铁呢？蹄铁匠罗莎！泥鳍鳄鱼人又偷谁的东西呢？还是蹄铁匠罗莎。我呸。\n\n我本来想派卡萨尔出去，可谁知道他这会儿溜达到哪里去了？\n\n去寻找我的补给品，让那些贼子明白，别偷蹄铁匠罗莎的东西。\n\n去吧！', '', '', '', '', '', '在泥鳍村与卡萨尔交谈。', 47936),
(65949, 'zhCN', '独身修理匠', '将勋章还给蹄铁匠罗莎。', '我们去风中与欧恩哈拉相会时，会将勋章留给后世。\n\n虽然我帮忙打造了这枚勋章，但它并不归我所有。\n\n你应该将它还给罗莎，这是她的爱人留下的最后一件纪念品。\n\n还给她，抚慰她的哀痛，让她重获平静。', '', '', '', '', '', '', 47936),
(65948, 'zhCN', '时光碎块', '使用东侧与西侧水晶，进一步为时光旅行者法杖充能。', '神殿封锁的时候，卫士们也被封在了大门之内。我们需要戳破静滞气泡，把他们放出来！不幸的是，只有完全充能的时光旅行者法杖才能做到这一点……\n\n有了！你可以吸取平台上的水晶的力量！它们能为法杖提供足够的力量。\n\n它们都放在自己的静滞力场里，把它们拽出来，用法杖吸收它们的能量吧。\n\n如果它们碎了也别担心，即使破碎成片，力量依旧在里面！', '', '', '', '', '', '', 47936),
(65947, 'zhCN', '凝时旅行者', '从时空气泡里救出$1oa个时光旅行者。', '很高兴你也在这里！安但丁与赛拉会帮我挡住永恒龙，我需要你去稳定平台上的局势。\n\n伊特努丝意外出现，想要夺取誓言石的时候，神殿的安全措施将她封锁在了静滞气泡中。遗憾的是，我们的时光旅行者也被安全措施波及了。\n\n你的时光旅行者法杖肯定可以释放他们，只要你能搞定愤怒的时间元素就行！', '', '', '', '', '', '', 47936),
(65944, 'zhCN', '熔岩爆裂', '摧毁$1oa个熔岩宝珠。', '拜荒者撕裂了群山，让部队能够源源不断地赶往瓦克索斯！\n\n我侦查到入口通道处有一些熔岩宝珠，他们就是用这些来扩散元素混乱的。\n\n摧毁它们就能延缓进军的速度。我会留在这里全力协助卡雷苟斯。', '', '', '', '', '', '在瓦克索斯山脉深处与卡德加的投影见面。', 47936),
(65943, 'zhCN', '拜荒攻势', '在瓦克索斯击败$1oa个拜荒者。', '我和卡德加尽力挡住了天空中的拜荒者，但我们无法再朝塔楼前进一步了。\n\n我们需要你削弱他们的地面部队，这样我们才能在失势之前接近莱萨杰丝，想办法阻止她。\n\n你要穿过前方的拜荒者阵线。如果我能集中精神，那里还会有其他镜像等着你。', '', '', '', '', '', '在瓦克索斯山脉深处与卡雷苟斯的镜像见面。', 47936),
(65940, 'zhCN', '一路颠簸', '与席卡尔车队一同前往河流交汇口。', '希望你不怕把鞋子弄湿。我们接下来的一段旅程要跨过两条河呢。\n\n欧恩·瑟什滕想跟你讲一个故事，说的是我们蒙受祝福的看护者欧恩哈拉。我很高兴能让你接受她的看护。', '', '', '', '', '', '', 47936),
(65939, 'zhCN', '决意与勇气', '控制黑曜堡垒。', '下一场战斗将会无比艰难，但凭借我们的勇气和决心，乌合之众根本不足为惧。\n\n我需要依靠你的卓绝战技，带领部队夺取胜利。\n\n等你做好准备，我们就发起袭击。', '', '', '', '', '', '', 47936),
(65938, 'zhCN', '永恒之伍', '使用时光旅行者法杖，捅破神殿大门前的静滞气泡。', '好了！让我们撤下神殿大门周围的静滞气泡，释放我们的卫士！准备好与时间来一场声势浩大的拉锯战了吗？\n\n就像你之前用水晶做的那样，戳破门前的泡泡。小心，释放出的所有时间能量肯定会汇聚起来攻击你。我不知道你会遭遇些什么，但至少你救出的卫士都会和你并肩作战。\n\n祝您好运，$n！', '', '', '', '', '', '', 47936),
(65937, 'zhCN', '渎职罪证', '寻找并向瑟拉姆斯出示丁香漫林受到破坏的证据。', '我们不能放弃！他必须明白这里发生的情况！如果他不肯离开洞穴，我们就要直接让他看到。\n\n我相信什么都可以，从腐化的植物到敌对的动物，这里的混乱简直数不过来！', '', '', '', '', '', '', 47936),
(65935, 'zhCN', '追赶克罗米', '在时光流汇平台上与克罗米见面。', '你帮助我们重新掌控了时之沙，但我察觉到神殿平台那里发生的事情还要糟糕。我们要飞上天空，在那里和克罗米会合。\n\n时间宝贵，一如既往。', '', '', '', '', '', '', 47936),
(65930, 'zhCN', '搏风战水', '在考里克闪光河湾附近直面克劳诺特，空气之灵。', '现在我们应该去直面灵魂了。\n\n路力克没提过吗？按照我们部族的传统，我们必须先在战斗中直面灵魂，随后才能向它们请求恩惠。你能给它们留下多深的印象，它们就会赐予你多强的祝福。\n\n也许这就是冰湖垂钓者坚持要我们合作的理由。\n\n如果你能对付克劳诺特，空气之灵，路力克和我就去对付欧图罗克，水流之灵。\n\n它们就栖息在附近的一处瀑布背后。我们到那里会合，冒险者。', '', '考里克闪光河湾周边区域中反复无常的风之灵，喜欢接受渴望证明自己的年轻海象人的挑战。', '克劳诺特', '', '', '', 47936),
(65929, 'zhCN', '破冰者', '从考里克闪光河湾附近的寒冰中释放冻结之水。', '我就知道先祖会同意的！\n\n我对灵魂一窍不通，考吉才是萨满祭司。但我们需要安抚伟大的空气之灵和流水之灵，它们才会愿意现身。\n\n不管是谁应该都发现了，山上的水元素开始缓慢冻结，但这不是自然现象。最近，严寒正从群山之中弥漫而下，这非同寻常。如果放任不管，我们的整条河流都将冻结。\n\n快将它们从寒冰的囚牢里解救出来！', '', '', '', '', '', '', 47936),
(65928, 'zhCN', '乖僻狂风', '从考里克闪光河湾附近的不安狂风处收集$1oa份不安微粒。', '呸！她说合作？\n\n但是……如果冰湖垂钓者觉得我们有机会帮助其他部族……我们就必须尽力一试。\n\n为了让空气之灵克劳诺特认可我们，我们必须先照顾好它的元素。自从这片土地开始苏醒，附近的风元素就变得躁动不宁。\n\n我会检查你们两个建造的这条船，你去对付那些风元素，然后把它们的不安微粒带给我。那样的话，这片区域应该就能重获安宁了。', '', '', '', '', '', '', 47936),
(65926, 'zhCN', '乘风掠瀑', '帮助路力克建造掠瀑号。', '你听说过冰湖垂钓者的传说吗？她建造了一条牢固的船，穿过了瀑布！\n\n长老娜瓦就爱讲这个故事。\n\n我觉得只有用昂图克猛犸象的遗骨再次建造出这样的船，才算是真正向他们高贵的灵魂致敬。\n\n我的兄弟觉得这行不通，但如果我们成功了，就能为挣扎求生的姐妹部族带去鲜鱼。\n\n你已经证明了自己的卓绝技巧和热情！我们一起合作，一定能够造出杰作。', '', '', '', '', '', '', 47936),
(65925, 'zhCN', '剔除灾星', '在考里克闪光河湾附近消灭冰原滑行者和冰面钻洞者。', '这些冰虫不属于这里。我不知道是什么把它们从地底的巢穴中赶了出来，但现在是帮不了它们了。\n\n我们不能放任它们摧残本地的生灵。\n\n消灭这些冰虫，$n。如果你坚持，也可以留下它们的一些部位，完成之后到闪光河湾来找我。', '', '', '', '', '', '在考里克闪光河湾与路力克见面。', 47936),
(65921, 'zhCN', '莱弗提的惩戒', '在提尔要塞水库中消灭拜荒者，营救莱弗提。', '我实在无法摆脱这个念头，$p。那么多姐妹惨遭屠戮！那么多性命就此消逝……她们不会白白牺牲的！\n\n我的战士追查到了拜荒者的下落，他们说有几名姐妹一息尚存。\n\n我们必须救出她们，还要让拜荒者领教到我的怒火！', '', '', '', '', '', '', 47936),
(65920, 'zhCN', '为了结界！', '使用缺失的钥石修复水库结界，随后激活控制台。', '总算可以修复结界了。我们损失惨重，但工作必须完成。\n\n$p，我们又需要你的帮助了。将所有钥石带到它们应属的地方，就能让结界恢复完整。\n\n完成之后你再回来，我们一起激活控制台，让水库恢复秩序。', '', '', '', '', '', '', 47936),
(65918, 'zhCN', '防范性维护', '在提尔要塞水库消灭$1oa个狂放的元素。', '原始元素正在不受控制地涌现。原本我和姐妹们通常都能对付它们，但由于拜荒者的恶毒袭击，我们现在无力与它们抗衡。我们已经失去太多战士了。\n\n另外，我们这些幸存者还有其他事务需要关注。\n\n<祖提吉痛苦地抽动了一下。>\n\n这就需要你大显身手了，$p。你能去摆平元素吗？', '', '', '', '', '', '', 47936),
(65916, 'zhCN', '不与拜荒者谈判', '在提尔要塞水库中消灭拜荒者的首脑寇约，夺回缺失的结界碎片。', '拜荒者自以为能够征服提尔的力量，他们大错特错了。\n\n我的莱弗提追踪拜荒者来到了不远处的一个洞穴里。如我所料，丢失的钥石就藏在那里。\n\n勇士，如果我们要修复水库，就必须先找回钥石。\n\n另外，必须除掉他们的首脑，才能阻止他们二度来袭。', '', '', '', '', '', '', 47936),
(65914, 'zhCN', '象命也是命', '从考里克闪光河湾附近死去的昂图克猛犸象处收集昂图克皮碎片和昂图克长牙。', '我们部族世世代代驯养着昂图克猛犸象群，这曾是我们的骄傲，但它们现在……没了。\n\n它们在劫难中惨死，灵魂因愤怒而徘徊不去。我们必须善待它们的遗骸，向它们的生命表达尊敬。\n\n然而骸骨实在太多，光凭我们根本收拾不过来。请你帮帮忙，从幼象和主母的身上收集材料，随后到考里克闪光河湾来找我。', '', '', '', '', '', '在考里克闪光河湾与路力克见面。', 47936),
(65913, 'zhCN', '守护？看护？', '从提尔要塞水库的拜荒者手中营救守护者玛拉。', '感谢泰坦！$C，我们需要你的帮助！\n\n拜荒者刚刚袭来，我和姐妹们想要抵抗，但损失惨重……\n\n等我的看护者们安全了再哀悼也不迟！有一队拜荒者在我们作战的时候突破了防线，如果他们胆敢伤害我们的看护者……\n\n你必须快去救她，否则就太迟了！', '', '', '', '', '', '', 47936),
(65911, 'zhCN', '碧蓝盟会', '返回碧蓝档案馆的卡雷苟斯处。', '这个社区的纽带……他们之间的友谊和亲情。\n\n我……从未拥有过。蓝龙军团从未拥有过。也许这是因为，我们从没有过这样的机会。\n\n而现在就有一个机会，我必须集结同族。\n\n到碧蓝档案馆来找我，还有很多事情要做。', '', '', '', '', '', '返回碧蓝档案馆的卡雷苟斯处。', 47936),
(65907, 'zhCN', '酷爱水果', '在欧恩伊尔喷泉收集野生的灌木果，并为$1oa个懒散的踏泥者喂食。', '秘术师训练非常枯燥，我要成天盯着水面，而我兄弟早就出门狩猎幼龙和拜荒者、为这个世界带来变化了。\n\n反正，我答应过让你看看炫酷的东西！你知道踏泥者喜欢吃灌木果吗？它就生长在附近的喷泉之间。去采摘一些来，我们可以一起喂养它们。', '', '', '', '', '', '', 47936),
(65906, 'zhCN', '苦闷的新兵', '在欧恩哈拉平原的欧恩伊尔清泉与新兵拉蒂亚交谈。', '我收到了一封从欧恩伊尔清泉寄来的有趣信件。\n\n信件的内容十分详细，原话是“可怕的坐牢环境，管头管脚的导师，而且无聊透顶枯燥至极”。信上还有正式的署名，“新兵拉蒂亚”。还有一张速写，一只雄鹰……把一个名叫梅伦的半人马踢下了悬崖。\n\n嗯，我猜这应该是在求助吧，你要是真想，就该去亲眼看看。老实说，我觉得拉蒂亚估计没出什么大事。她经常寄来类似的信件。', '', '', '', '', '', '在欧恩哈拉平原的欧恩伊尔清泉与新兵拉蒂亚交谈。', 47936),
(65905, 'zhCN', '荒草萋萋', '在丁香漫林中清理增生和怪物。', '也许我们应该给瑟拉姆斯留出一点空间。\n\n但我们也不能闲着，这片林地正在自我毁灭，请帮助我们。', '', '', '', '', '', '', 47936),
(65904, 'zhCN', '适可而止', '向瑟拉姆斯出示丁香漫林的损伤证据。', '不管是不是心有怨言，这都是瑟拉姆斯应当肩负的责任。但他躲在里面，根本不知道自己的缺席造成了什么后果。\n\n我们一起去，让他看清楚证据。', '', '', '', '', '', '', 47936),
(65903, 'zhCN', '毛茸茸势不可挡', '抓捕$1oa只林木欢跳者。', '可怜的瑟拉姆斯。我有个办法能让他振作起来！\n\n带上这张网，去抓一些本地的欢跳者。它们虽然很温顺，但是动作非常灵活。它们就住在海岸边。\n\n只要把它们带给瑟拉姆斯，毛茸茸的感觉很快就会令他难以招架！', '', '', '', '', '', '', 47936),
(65902, 'zhCN', '吃喝还是玩乐', '将香草海龟肉和林木欢跳者带给瑟拉姆斯。', '瞧瞧这美味多汁的香草海龟肉！我当然是从客观角度来描述的，我是素食主义者。\n\n去吧！他肯定一整天都没吃东西。', '', '', '', '', '', '', 47936),
(65901, 'zhCN', '偷溜出门', '在欧恩伊尔清泉放置图腾，并通知拉蒂亚。', '我被无限期禁足了！欧恩不知道我下个春天就满十六岁了吗？我想走就可以走。\n\n你好像可以帮我。我有一个逃跑计划：我可以引导这些图腾来浓缩空气，然后引发一阵骚动。但我不能出去摆放它们，因为大伙儿都紧盯着我呢。就连托苟都不肯帮我。\n\n但如果你能帮忙……求求你！我答应会让你瞧瞧炫酷的东西。', '', '', '', '', '', '在镜天湖旁与拉蒂亚见面。', 47936),
(65900, 'zhCN', '香料怪肉排', '收集$1oa块无比鲜嫩的海龟肉，$2oa个爬行类的蛋壳，以及$3oa朵酸花。', '我姐妹的想法很有趣，但瑟拉姆斯需要来点劲大的才行。\n\n真是好多的酸花呀。我通常会用它们制作药膏，然后涂抹在他最喜欢食物上：海龟肉！\n\n你能帮我收集材料吗？', '', '', '', '', '', '', 47936),
(65899, 'zhCN', '寻找瑟拉姆斯', '搜索附近的洞穴，寻找瑟拉姆斯。', '$R！你是来访问美丽的丁香漫林的吗？很抱歉让你看到这幅光景，我保证这里平时不是这样的。\n\n花园的守护者瑟拉姆斯本该在今天和我们见面，一起处理这些难题。他最近总是没有精神打理花园，所以我和菲琳娜就来帮忙了，但我们也忙不过来。\n\n你能不能去找找他？也许他忘记了。', '', '', '', '', '', '返回赛琳娜·脆叶处。', 47936),
(65898, 'zhCN', '始祖难题', '获取位点并击败保护它的始祖幼龙。', '我不喜欢碎裂之焰，但他们把自己撕成碎片的时候，我也没法无动于衷。这一切真是太熟悉了。\n\n不管那个位点是什么，在我们手里总比落到他们手中安全。我们跟着死尸的痕迹走，估计很快就能找到它。\n\n多加小心，$p。那个巢穴看起来是被废弃了，但实际上可不一定。', '', '', '', '', '', '', 47936),
(65896, 'zhCN', '开始治愈', '帮助暴风城的人民疗伤。', '你真觉得自己能在我的眼皮子底下踏进这座城市？没门！\n\n我当初对你们一族的看法果然没错，我可不会再让巨龙摧毁我的家园了。\n\n这里曾是一处充满了喜悦与宁静的公园。后来你们的祖先死亡之翼来了。没错，我对他知根知底。\n\n你去亲眼看看毁灭之力所留下的遗产吧。伤痛依然在街头巷尾徘徊不去。', '', '', '', '', '', '', 47936),
(65895, 'zhCN', '竞争伙伴', '收集关于碎裂之焰的信息。', '呸！痛宰劳工根本给不了线索。\n\n去找出他们的头领，总有一个知道我们需要的信息。\n\n还有，$n，这次在干掉他们之前，听听他们都说些什么。你或许会从中得到一些有用的情报。', '', '', '', '', '', '在遗迹顶部附近与阿戴内多见面。', 47936),
(65893, 'zhCN', '圣物查探', '收集$1oa块奈萨扎恩神器碎片。', '碎裂之焰也在这里。你会相信一帮自称“碎裂”的家伙，把宝贵的神器交到他们手里吗？\n\n我觉得不行。不管怎么样，如果我们要继续开展工作，就得先搞清楚他们的意图。从他们那里收集你能找到的碎片，然后回来向我报告。\n\n这个问题很复杂，比这些碎裂的神器还要复杂得多。', '', '', '', '', '', '', 47936),
(65892, 'zhCN', '碎焰崩毁', '', '', '', '', '', '', '', '', 47936),
(65891, 'zhCN', '建言工具', '对$1oa堆碎石部署魔法工具。', '好极了，我正好需要你这样的冒险者，又顽强又结实，还愿意为一笔小钱出大力气。\n\n总感觉你就是为我而存在的，干得好，我是说我自己。这些废墟似乎吸引了其他人的注意，我们不能指望他们会好好挖掘。他们肯定会把样本污染的！\n\n这个给你，把它放在废墟周围的重要神器附近。它经过附魔，能够履行必要的义务。', '', '', '', '', '', '', 47936),
(65890, 'zhCN', '奈萨扎恩废墟', '在奈萨扎恩废墟与苍穹撰写师阿戴内多见面。', '龙鳞探险队需要你的协助。\n\n之前，有一名苍穹撰写师被派往废墟收集情报。按理说，废墟里应当并无人烟，但我从这里都能听到他的高呼。\n\n隔着这么远还能听到他的喊声，他的处境肯定十分危险。\n\n在这个探险队里，我们都要互帮互助，就算是难以容忍的人也要去扶一把。你去找到他，别让他因为什么危险而遭了难。', '', '', '', '', '', '', 47936),
(65887, 'zhCN', '进入山区', '在瓦克索斯山脉的山脚下与卡德加和卡雷苟斯的镜像见面。', '卡德加和卡雷苟斯在天空中和拜荒者激战，从这里看真是一番奇景！\n\n他们召唤了几个自身的镜像，好帮助你穿过拜荒者弄出的庞然大坑。\n\n有一组镜像就在山脚下。\n\n如果情况不妙……呃，我会把消息通报给碧蓝林海的全体人员。', '', '', '', '', '', '在瓦克索斯山脉的山脚下与卡德加和卡雷苟斯的镜像见面。', 47936),
(65886, 'zhCN', '前往罗宁之盾', '在高塔瞭望台与德洛克·刺卷见面。', '莱萨杰丝和拜荒者正在全力袭击瓦克索斯。决不能让她得逞！\n\n卡德加和我会赶往那里，从空中控制局势。\n\n与此同时，你需要前往罗宁之盾，那是肯瑞托在这片区域的最后几处营地之一。\n\n要是从档案馆顶部骑乘幼龙腾飞而起，你就能更快抵达目的地。\n\n确保肯瑞托在那里安然无恙，然后就向瓦克索斯进发吧。\n\n我们就指望你在地面上提供援助了。', '', '', '', '', '', '在罗宁之盾与德洛克·刺卷见面。', 47936),
(65875, 'zhCN', '龙之假日', '为瓦扎利亚寻找多种饮料。', '我这辈子都是在外域度过的……一直都在战斗，从没时间休闲！\n\n有些时候，龙也需要坐在海边，握着冰镇饮料，安享舒心的假日。\n\n嘿，也许你能帮我休闲！帮我一个忙，替我们找几种饮料来补充物资。', '', '', '', '', '', '', 47936),
(65873, 'zhCN', '影足头豺', '消灭卡格波，取回他的图腾。', '卡格波是这片森林中豺狼人真正的头目。我们以前和他有过一些……不太愉快的遭遇。\n\n但这一次情况有变。他带着一个古怪的图腾，似乎让他的心灵更加扭曲了。\n\n必须阻止卡格波，夺回这个图腾。我担心豺狼人正在摆弄某种超乎想象的黑暗力量。', '', '卡格波一直心肠歹毒，但他现在带着污秽的图腾，也变得更咄咄逼人了。', '恶臭者卡格波', '', '', '', 47936),
(65872, 'zhCN', '豺狼人的恶意', '在卡格波之穴中消灭$1oa个影足豺狼人。', '我在风中闻到了一股怪味，这里的情况不大对劲……\n\n哈努说洞穴中的豺狼人表现古怪……病殃殃的。我们应该深入调查是什么导致了这一现象。\n\n不要放松戒备，虽然他们外表病态，但心肠依旧歹毒。', '', '', '', '', '', '', 47936),
(65871, 'zhCN', '豺狼当道', '营救诺卢克和其他$1oa名海象人俘虏。', '我追踪被捕的海象人来到了这个洞穴，我的丈夫诺卢克也在其中。\n\n诺卢克总是顾不上自己，所以照顾他的职责就交给我了。但我太骄傲了，不愿向其他人求助。\n\n请你去救救他们！', '', '', '', '', '', '', 47936),
(65870, 'zhCN', '补给！', '取回狩猎补给箱。', '我们失窃的狩猎补给在大树丘并无踪影，肯定是藏在那个洞穴里了。\n\n注意寻找补给容器，做好应对任何状况的准备。\n\n我不相信豺狼人会把货物丢在那里不管。', '', '', '', '', '', '', 47936),
(65869, 'zhCN', '伏击再现', '与阿基乌恩交谈，并检查$2oa具附近的遗体。', '这是一场悲剧，但可能只是开了个头。\n\n你去看看阿基乌恩知道些什么，然后检查那些在袭击中遇难的人。\n\n我好像猜到这里究竟发生了什么，不知道线索是否支持我的推论。\n\n而现在，我会尽量安抚这些紧张的朋友。', '', '', '', '', '', '', 47936),
(65868, 'zhCN', '胡嚼蛮缠', '找回$1oa份葬礼祭品。', '我找到了波诺里亚克的葬礼祭品之一，它被影足豺狼人拆毁后丢弃了……上面满是牙印！\n\n伊斯卡拉酋长最近亡故，他的追悼仪式上需要用到许多祭品，可不光这一件。\n\n如此神圣的物品竟然被当成了咀嚼玩具，真是丧尽天良。请你多加留心其他祭品的下落。', '', '', '', '', '', '在大树丘的卡格波之穴入口处与哈努见面。', 47936),
(65867, 'zhCN', '大树丘豺嚎', '消灭杜尔衮、科尔瓦和巴克拉。', '那群袭击车队的豺狼人是由三个副官带队的。\n\n杜尔衮身边簇拥着一群土狼。\n\n科尔瓦在我们尝试追击却落进钢颚陷阱的时候，总会癫狂地大笑起来。\n\n巴克拉在残忍无情地嘲讽我们。\n\n要想夺回被抢走的东西，就必须先铲除他们。', '', '', '', '', '', '在大树丘的卡格波之穴入口处与哈努见面。', 47936),
(65866, 'zhCN', '破陷行动', '触发$1oa个刃颚陷阱。', '前面的山丘上散布着不易察觉的刃颚陷阱。\n\n你得有一双锐眼才能找到它们。触发陷阱的时候，你还得小心地用上海象人的老法子：长棍一戳。虽然直接踩上去也能触发陷阱，但我不是很推荐这么做。\n\n等你拆掉了足够多的陷阱，就去找哈努吧。我和长老波雅会尽快赶上来。', '', '', '', '', '', '在大树丘的卡格波之穴入口处与哈努见面。', 47936),
(65864, 'zhCN', '追赶车队', '在大树丘附近追上布莉娜。', '你应该追上布莉娜。她的车队几个小时前刚刚路过这里。\n\n他们在收集已故酋长最宝贵的财产，想要在葬礼上纪念他。\n\n车队满载了沉重的货物，她应该走不了多远。', '', '', '', '', '', '', 47936),
(65855, 'zhCN', '援助碧蓝林海', '返回安东尼达斯营地的过目不忘的诺莉柯身旁。', '在碧蓝林海的魔网修复以前，誓言石的能量将无法收复。\n\n部分魔网只有卡雷苟斯才有能力触及……但你依然能够帮上忙。\n\n如果海象人还活着，就去找他们吧。在我那会儿，他们就已经在此定居了，对这片土地也是了如指掌。\n\n与我们的奥术帮手谈谈，就能回到盟友们的身边。', '', '', '', '', '', '在安东尼达斯营地与过目不忘的诺莉柯交谈。', 47936),
(65854, 'zhCN', '收复誓言石', '见证卡雷苟斯收复碧蓝誓言石。', '做得好，朋友。看来我们修好了碧蓝档案馆内部的魔网。\n\n在蓝龙军团团结如一的那段日子里，我会告诉兄弟姐妹们，不要怀疑凡人的力量。\n\n在南方的誓言石那里找我。我会收复誓言石，随后再赶去索德拉苏斯。', '', '', '', '', '', '与辛达苟萨交谈。', 47936),
(65852, 'zhCN', '直达尖峰', '在一袋有用的物资中翻找奥术垫脚石，在奥术焦点处使用它，登上碧蓝档案馆的顶端。', '看来在高塔的顶端，有某种东西正在抽取奥术能量。\n\n你已经稳定了此地的能量，现在应该可以“骑乘”区域中的奥术魔法了。\n\n到你的包里找找“奥术垫脚石”，然后到高塔顶部来找我。', '', '', '', '', '', '在碧蓝档案馆顶部与卡雷苟斯见面。', 47936),
(65850, 'zhCN', '海洋轮回', '与布莉娜交谈，见证葬礼仪式。', '谢谢，$n。我已经从新朋友身上得到我需要的知识了。\n\n前任酋长的葬礼仪式就要开始了。伊斯卡拉海象人非常慷慨好客，在动身返回档案馆之前，我们理应先和他们一起参加仪式。\n\n与布莉娜谈谈，告诉她我们准备好了，随时都能开始。', '', '', '', '', '', '', 47936),
(65849, 'zhCN', '前往伊斯卡拉', '在伊斯卡拉与布莉娜见面。', '$n，感谢你的帮助。多亏有你，我的家人才能安全。\n\n现在我们终于可以返回伊斯卡拉，将老波诺里亚克送回大海了。他曾是我的导师，也是一位出色的酋长。\n\n你一定得来！不论是谁，都可以参加海洋轮回的纪念仪式。', '', '', '', '', '', '在伊斯卡拉与布莉娜见面。', 47936),
(65848, 'zhCN', '魔典束缚', '与卡雷苟斯交谈开启传送门，并使用他的召唤物消灭蕨皮化脓者，随后摧毁扭曲的古树。', '我们必须阻止那棵树！有了这些魔网水晶，我总算可以出一份力了。\n\n等你准备好了就告诉我，我会打开通往碧蓝档案馆的传送门，尽量找一些有用的帮手。\n\n退后，它可能很不稳定。', '', '', '', '', '', '在魔网水晶洞穴中与卡雷苟斯交谈。', 47936),
(65847, 'zhCN', '重新排列', '汇聚魔法水晶，摧毁3个腐朽感染。', '现在该处理这条魔网了。我的担心应验了，腐朽已经散播到了魔网之中。\n\n我们需要净除腐朽并加快治愈过程，但光凭我的镜像，我无法引导足够多的能量。\n\n将你的精神集中到这块魔网水晶上，我和你之间的连接会将我的实体传送过来，这样我才能具备足够强的力量。', '', '', '', '', '', '在蕨皮外围寻找卡雷苟斯。', 47936),
(65846, 'zhCN', '魔网零落', '在蕨皮外围区收集$1oa块魔网水晶。', '魔网就在这里——我能感觉得到！\n\n但首先，我们必须阻止豺狼人。那棵古树就是他们最强大的武器。\n\n豺狼人收集了许多魔网水晶，好在他们似乎无法理解水晶中的力量。\n\n尽量多找一些魔网水晶，它们能够强化我的镜像，帮助我从档案馆里召唤一些有用的东西，从而干掉那个怪物！', '', '', '', '', '', '', 47936),
(65845, 'zhCN', '陨落者的回响', '将布莉娜的图腾放置在$1oa个海象人的遗体旁，与他们的灵魂联系。', '这里有海象人！我的朋友……我的家人。他们是在差不多一周之前出来打猎的。\n\n现在他们已经腐朽过深，无法恢复了。\n\n他们的灵魂仍在这里，在愤怒和悔恨中徘徊不去。卡基阿塔、鲁托克、图育基……\n\n$n，请你带上这个图腾，把它放置在他们的遗骸附近，它会联系他们的灵魂……帮助他们寻得平静。', '', '', '', '', '', '', 47936),
(65844, 'zhCN', '割除腐溃', '消灭$1oa个腐烂的树人和$2oa个蕨皮掷腐者。', '这种腐朽之力肯定腐化了豺狼人的身心！\n\n虽然豺狼人热衷于破坏——但和我们一样，他们也是这片土地的原生居民。\n\n但我们发现，他们正在向大树部族散播腐朽。照这个速度，他们将会吞噬整片林海，也会毁灭自己。\n\n我们不能让这种情况发生。虽然很遗憾……但必须终结他们。', '', '', '', '', '', '', 47936),
(65842, 'zhCN', '缴械行动', '消灭武器大师沃达克并收集$1oa把灭世者武器。', '我对灭世者龙裔没什么好感。他们盲目地相信死亡之翼终将回归，不肯协助我们保护黑曜王座。\n\n武器大师沃达克曾是一位忠诚的追随者，他偷走了许多在堡垒中锻造的武器，将它们交给了灭世者。我决不允许这样的偷窃，或者说背叛。\n\n前往焖燃峰，取回那些武器……必要的话就动用武力吧。', '', '', '武器大师沃达克', '', '', '', 47936),
(65841, 'zhCN', '阻止蔓延', '', '', '', '', '', '', '', '', 47936),
(65840, 'zhCN', '老板全都一个样', '消灭天选者多文萨尔。', '灭世者龙裔很容易轻信他人。多年以来，我们追随过许多不同的领袖，认为他们都能带我们迎来暮光审判，迎接死亡之翼的回归。\n\n然而死亡之翼并未归来，暮光也不见踪影。\n\n是时候换一位新领袖了，而你能帮忙推动这次转变。', '', '一长串领袖中最新上任的那个。', '天选者多文萨尔', '', '', '', 47936),
(65838, 'zhCN', '突破蕨皮', '调查蕨皮外围区。', '如果豺狼人就是在这里发现了腐朽魔法，那么魔网甚至整片土地都会危在旦夕。\n\n我的镜像分布得太分散了，无法抵御那片森林里的元素扰动。请你深入林地，调查这种腐朽。\n\n我会和新结交的海象人朋友一同寻找能够维持镜像的地方，然后我会在那片地区的深处与你见面。\n\n我们必须阻止这一切！', '', '', '', '', '', '在蕨皮棘林与卡雷苟斯交谈。', 47936),
(65837, 'zhCN', '松木的困局', '在欧恩哈拉平原与松木哨站的哨兵欧勒克交谈。', '席卡尔高地遭到了拜荒者的袭击。\n\n如果你有什么情报，或者觉得自己能出一份力，那就去松木哨站找欧勒克。就跟他说是我派你去的。<提伦咯咯地笑着。>希望那灰头土脸的老蹄子还记得我。\n\n沿着道路走，$p。自从发生了这些变化，平原就不再安宁了。', '', '', '', '', '', '在欧恩哈拉平原与松木哨站的哨兵欧勒克交谈。', 47936),
(65836, 'zhCN', '风暴显露', '在贤冠松林与瓦图会合。', '<瓦图轻松地站了起来，仿佛伤势已经痊愈。>\n\n我……我……我把碎片扎进了体内，就再也不会感到疼痛了。我感觉好极了，棒极了，无与伦比。\n\n欧勒克迟迟不归，恐怕发生了意外，他就不该丢下我一个人去的！', '', '', '', '', '', '', 47936),
(65834, 'zhCN', '女王驾崩', '消灭寒网女王。', '好极了！一点点正式教育，一点点合理推断，在符文石上凿凿刻刻，我们做好了一个魔法去注器！消注器？排注器？\n\n管他呢！我敢保证，它能让那女王痛不欲生。如果我们真要阻止这个威胁，那她非死不可。碾碎小蜘蛛只能拖延时间，你得直接把源头铲除。', '', '不该有什么蜘蛛女王。', '寒网女王', '', '', '', 47936),
(65833, 'zhCN', '拜荒者的干预', '取回唤霜者符文石。', '拜荒者正在给蜘蛛灌注冰霜元素，把它们当做突击部队，想要冲破巨龙在林海的防御。决不能让他们得逞。\n\n有三个满头寒冰的家伙在管事，干掉他们，把用来聚焦原始魔法的符文石带给我，我们也许就能切断能量流。', '', '', '', '', '', '', 47936),
(65832, 'zhCN', '矮人防冻术', '寻找$1oa瓶矮人防冻合剂。', '我这儿有了点小麻烦，$U小伙子:小姑娘;。拜荒者那帮舔冰的杂碎把我封在了这块巨型冰块里，我还没彻底冻僵的原因只有一个，我有一堆藏好的上等货。\n\n可惜呀，那帮鸡鸣狗盗的混球冲我来的时候，藏得不够好的东西都被抢了。我都要没货了！\n\n你能不能给我这个矮人发发善心，在我的热血结冰之前，帮我弄几瓶合剂回来？\n\n还有，$U小伙子:小姑娘;，如果你要从蜘蛛的某些部位掏出几瓶来，千万别告诉我，我不想听。', '', '', '', '', '', '', 47936),
(65806, 'zhCN', '马鲁凯', '前往马鲁凯。', '<欧吉尔随着珊索克可汗的指示开口。>\n\n马鲁凯就坐落在这片树林附近的山脉一侧，我们的旅程就要结束了。\n\n马鲁克半人马会在呼拉尔召开的时候停战，但欧恩·瑟什滕看到的征兆令人不安。我们必须保持警惕。', '', '', '', '', '', '', 47936),
(65805, 'zhCN', '与欧恩哈拉沟通', '从河床上收集$1oa根河流芦苇、$2oa根禽鸟尾羽和一颗蝾螈之心。', '这里的风永不停歇，$n。欧恩哈拉正在发出号召，我必须响应。\n\n我需要一些材料来举行仪式：河畔的芦苇、野鸭的尾羽，还有一颗蝾螈的心脏。去河边收集材料，帮助我聆听她的声音。', '', '', '', '', '', '', 47936),
(65804, 'zhCN', '觅食即竞争', '从流浪者大草原的野生动物处收集$1oa份猎获的鲜肉。', '平原各处的半人马都会赶来参加呼拉尔，这场众人齐聚的盛会将数日不散。\n\n为那么多半人马提供伙食并非易事。席卡尔氏族的猎人负责为盛宴提供肉食。在前往马鲁凯的路途中狩猎是我们的传统。\n\n你也必须全力以赴。', '', '', '', '', '', '', 47936),
(65803, 'zhCN', '前往城市', '与席卡尔车队一同前往流浪者大草原。', '呼拉尔是各大氏族齐座相谈的时刻，我们会分享彼此的故事。虽然半人马氏族散落在平原各地，但我们都是马鲁克。\n\n车队已经准备好出发了，马鲁凯路途遥远，我们会在中途停歇一阵。\n\n等你准备好动身了，就到车队旁来找我。别让我们等太久了。', '', '', '', '', '', '', 47936),
(65802, 'zhCN', '旅途供给', '在森步岗哨附近收集$1oa份营地供给，并在附近的森林中收集$2oa个狂花荚。', '<珊索克可汗做了个手势，欧吉尔便为她代言。>\n\n在和我们同行的时候，你也必须尽到自己的责任。不服管教的鳄鱼人最近掠夺了我们的医疗补给，我们需要补充库存。在岗哨附近收集橙色的花朵，我们就能制作更多药膏。\n\n岗哨周围还有许多车队需要的补给。希望你在外头能收集一些。\n\n当你找到了所有补给，就把它带给托木尔吧。', '', '', '', '', '', '向斥候托木尔报告。', 47936),
(65801, 'zhCN', '自报家门', '向席卡尔氏族的成员介绍自己。', '<珊索克可汗做了个手势，欧吉尔便为她代言。>\n\n无数个世代以来，还不曾有你这样的外来者踏上我们的领地。拜荒者正在这片土地上肆虐，染指禁忌的魔法，我们的人民当然会更为警惕。\n\n如果你要和我们同行，就必须让大家了解你。先去向氏族的成员介绍自己吧。', '', '', '', '', '', '向斥候托木尔报告。', 47936),
(65795, 'zhCN', '平原下一站', '在红玉之鳞岗哨与陶拉萨大使见面。', '绿龙军团现在需要你的援助。我姐妹的女儿和她的军团进入了翡翠梦境，试图强化她们的誓言石。但自从她们陷入沉睡，我就再也没有听到过消息。\n\n你需要寻找统治着欧恩哈拉平原的半人马。如果要唤醒绿龙，他们与这片土地和灵魂的紧密关联将会是不可或缺的。\n\n不过，半人马是心高气傲、领地意识极强的种族，他们不会对冒犯一笑而过。和我们的大使谈谈，他会帮你做好准备的。', '', '', '', '', '', '在红玉之鳞岗哨与陶拉萨大使见面。', 47936),
(65794, 'zhCN', '照护之责', '见证黑龙蛋回归新生法池。', '你赢得了我的感谢，$c，也很抱歉让你同时对付这两个家伙。\n\n红龙军团负责保护并抚育所有真正的巨龙，也包括我们所厌烦的那些。\n\n黑龙军团的龙蛋回归之后，龙族才能实现一万年来未曾有过的团结。我想，这应该能够恢复红玉誓言石了。\n\n等你准备好将龙蛋带往黑曜新生法池了，就跟我说一声。', '', '', '', '', '', '', 47936),
(65793, 'zhCN', '黑车军团', '护送龙蛋前往新生法池。', '誓言石再次得到了强化，我们现在必须将种族的未来转移到新生法池。所有真正的巨龙军团，都有权利让新生法池的池水来滋养龙蛋。\n\n不幸的是，在我们现身之后，敌人一定会紧盯空域。为了躲避他们的监视，我们要用双腿走完最后一程。\n\n到黑曜壁垒附近来找我，$c。作为生命缚誓者的勇士，我欢迎你与我同行。', '', '', '', '', '', '与红玉新生圣地上方的萨贝里安交谈。', 47936),
(65791, 'zhCN', '生命缚誓者的义务', '在红玉誓言石旁与阿莱克丝塔萨见面。', '新生法池很快就会再度满溢。\n\n感谢你的助力，$n，它的意义远超我的想象。\n\n去吧，到誓言石旁找到生命的缚誓者，转告她我们准备好龙蛋了。', '', '', '', '', '', '在红玉誓言石旁与阿莱克丝塔萨见面。', 47936),
(65789, 'zhCN', '河眠之地', '从泽林沼地收集材料。', '泽林中生长着一些关键材料，我们会用它们和先祖沟通。不幸的是，泥鳍部族占据了这片区域，使我们难以在这片区域展开搜寻。\n\n如果你能在沼地里收集一些花朵，还有泥鳍部族的一些资源，我会对你感激不尽。', '', '', '', '', '', '', 47936),
(65783, 'zhCN', '营火欢迎你', '在森步岗哨与斥候托木尔见面。', '你和我们的猎人并肩作战，赢得了在营火旁落座的资格。\n\n我们的可汗正在沼泽中的狩猎岗哨里，为下一支车队进行准备。我会向她通报你的到来和目的。\n\n相信你不会迷路吧。', '', '', '', '', '', '在森步岗哨与斥候托木尔见面。', 47936),
(65782, 'zhCN', '牢狱之灾', '获取灭世者牢房钥匙并释放阿雅珊兹。', '我们听到有死亡之翼教派的存在后，管理者瑟利斯特拉命令我前来接收这些曾经的鳞裔。我们本以为都是一场误会。\n\t\n显然我们错了。\n\t\n必须解决他们的首脑，但我首先得从笼子里脱身。快帮我把钥匙找回来。', '', '', '', '', '', '', 47936),
(65780, 'zhCN', '证明自我', '消灭烈焰始祖龙。', '巨龙的赠礼也许能让一些半人马刮目相看，但席卡尔氏族必须瞧瞧你的狩猎技巧。\n\n我们的一支狩猎队刚刚击落了一头注有火焰之力的始祖龙。协助他们制服猎物，证明你的价值。', '', '当年幼的半人马成年后，通常会在期待下进行他们的第一次始祖幼龙狩猎。', '烈焰始祖龙', '', '', '', 47936),
(65779, 'zhCN', '深入平原', '在欧恩哈拉平原与席卡尔斥候见面。', '绿龙军团回到了附近平原上的花园里。阿莱克丝塔萨女王希望你能和梦境之龙麦琳瑟拉取得联系。\n\n这片平原上的半人马都是凶悍的猎手。要抵达翡翠花园，你需要先和他们建立外交关系。\n\n要心怀敬意，但千万别表现出软弱。', '', '', '', '', '', '在欧恩哈拉平原与席卡尔斥候见面。', 47936),
(65778, 'zhCN', '尖翔特供', '穿上你的伪装，对巢母的私人主厨使用原型“蛋”。', '准备好换上表演道具大显神通了吗，$n？\n\n啊？你没有道具？那就有个好消息了，我用你找来的材料制作了一套完美得无可置喙的尖翔伪装。\n\n瑟佳丽雅和我还需要一些时间才能做好那枚能干掉巢母的“蛋”。我这里有一个小号的原型版，你可以对主厨试试。\n\n别担心！裹在这一身羽毛里，爆炸对你的威胁性会降低整整12%呢！', '', '', '', '', '', '', 47936),
(65770, 'zhCN', '保证就是承诺', '向新兵拉蒂亚保证不透露秘密。', '动物们在你身旁举止自在，这表明你有着善良的灵魂。\n\n其实……你能保守秘密吗？我想向你介绍一个朋友，其他人都对它一无所知。\n\n你必须先向我保证，你不会把秘密说出去。如果被欧恩发现了，她肯定要把我逐出平原了。', '', '', '', '', '', '与欧胡纳戈多罗托交谈。', 47936),
(65769, 'zhCN', '冰网之缚', '在寒网谷解救$1oa个茧中的幸存者。', '当蜘蛛和它们的拜荒者主子突然袭来，我的许多同事和好友都被抓走了。\n\n我看到他们被困在冰冻的蛛网里，被拖向我所不敢想象的命运。\n\n请你尽量多救出几个来！', '', '', '', '', '', '', 47936),
(65761, 'zhCN', '意料之外的冒险', '与戈多罗托一同找到并营救拉蒂亚。', '<戈多罗托的凝视犀利而贪婪。她此刻满心怒火。>\n\n<也许这只欧胡纳能帮助你找到并救出拉蒂亚。>', '', '', '', '', '', '', 47936),
(65760, 'zhCN', '报到', '跟随森德拉克斯前往龙心岗哨。', '我只在书里读到过贾拉丁的事情。\n\n这些强大的巨人是巨龙的远古宿敌，他们掌握着大地和熔岩的力量……一心狩猎巨龙，企图将他们灭绝。\n\n<森德拉克斯眺望着远方的火山，皱起了眉头。>\n\n导师说，自从巨龙离去，他们就再也没有现身，一直在大地深处沉睡。\n\n如果他们苏醒了，群岛上的每一条雏龙都会有危险！\n\n跟我来，我会去龙心岗哨面见指挥官里萨纳克。', '', '', '', '', '', '与龙心岗哨的指挥官里萨纳克交谈。', 47936),
(65758, 'zhCN', '探险者格朗尼尔', '寻找格朗尼尔·钢道。', '$N！你救出了不少人，但我在探险者协会的搭档格朗尼尔·钢道依然不见踪影。他本来冲了出去，但一看到我们还没脱困，就转过头冲回来了！就他一个人啊！\n\n那个呆瓜很冲动，但确实非常勇敢，不该得到悲惨的命运。\n\n求求你……找到他。', '', '', '', '', '', '', 47936),
(65752, 'zhCN', '奥术纷扰', '消灭$1oa只进食的浮龙。', '许多法力浮龙正在吸收档案馆溢出的奥术魔法。\n\n它们吸收魔法的速度太快了，魔网能量已经失去了平衡……我也无法收复碧蓝誓言石。\n\n我会使用你收集到的不稳定的奥能，制作一种钩子。\n\n使用它消灭几只浮龙。只需要稍稍争取一些时间，我就能调整好下方的能量。', '', '', '', '', '', '', 47936),
(65751, 'zhCN', '平台整修', '在碧蓝档案馆顶部驱散$1oa个不稳定的奥术能量。', '看来最后的奥术扰动就在这里。\n\n我会继续调整魔网能量。使用你取回的奥能，驱散这里的扰动吧。', '', '', '', '', '', '', 47936),
(65750, 'zhCN', '八腿憎恶', '在寒网谷消灭$1oa个寒网爬行者或寒网爬蛛，以及$2oa个拜荒照看者。', '$C！\n\n如果你愿意的话，我需要你帮忙……\n\n这次联合探险本来是想研究这片区域中生长的蛛形生物，但你也看到了，我们的计划乱套了。\n\n我们本来以为这是自然演化，结果却是拜荒者在颠覆自然法则！\n\n我是个保护主义者，我会严肃地履行职责，但研究活体样本的时间已经结束了。不能让它们的错乱蔓延开，我们该用它们的尸体做研究了。\n\n能帮帮我们吗？', '', '', '', '', '', '', 47936),
(65711, 'zhCN', '窃雷之威', '在凯甘营地消灭风暴抽取者，营救雷背兽莉姬。', '是你啊！感谢欧恩哈拉。我当时假装负伤，想要骗过胆敢闯入的暴徒。呃——那个蠢货对我施展了某种束缚咒语。我一定要搞清楚这到底是什么。\n\n他们把莉姬抓进了洞穴，请你去救救她。我会想办法脱身的。\n\n去做你该做的事吧。', '', '', '', '', '', '', 47936),
(65709, 'zhCN', '奥术修补', '在一袋有用的物资中翻找魔网权杖，使用它修复2个平台。', '只有解决魔网能量失控的问题，我们才能激活碧蓝档案馆的誓言石。\n\n有三个龙语符文控制着它，但其中两个已经因不稳定的奥能而失灵了。\n\n对不起，但因为卡德加义务在身，我的同胞也不在场，这份重担可能要交给你了。\n\n你携带的物资里应该有一根魔网权杖。\n\n就用它来修理附近的符文吧。', '', '', '', '', '', '', 47936),
(65702, 'zhCN', '驱役成狂', '取回$1oa份不稳定的奥术能量。', '碧蓝档案馆曾是蓝龙们齐聚一堂、探讨魔法的地方。\n\n而现在，全族只有我一人站在这里。\n\n这个地方掌控着碧蓝林海地下的魔网，但它和此地的仆从都已经失控了。\n\n我想，我们只有让这里恢复秩序，才能收复碧蓝誓言石。\n\n有许多构造体和元素都充盈着不稳定的奥术能量，需要重新引导。\n\n摧毁它们，尽力收集一些。', '', '', '', '', '', '', 47936),
(65701, 'zhCN', '恩护或湮灭', '选择一项专精。', '如果这些巨龙所言不虚，那前面将会有一场恶战。我们需要你集中精神，保全力量，唤魔师。\n\n该选择你的战斗专精了。你将会庇护盟友，还是毁灭敌人？\n\n要将你的战斗技术磨炼至臻，就选择湮灭专精。\n\n要充分发掘你的治愈潜力，就选择恩护专精。\n\n两种专精都很适合你。别忘了，你稍后还可以更改或调整专精。', '', '', '', '', '', '', 47936),
(65691, 'zhCN', '翼影蔽日', '直面赛基诺兹，奈萨里奥之声。', '奈萨里奥之声就在下方，正在向他的信众们散播谎言。\n\n他好像和我一样，也是一头龙兽。不过他的龙语讲起来非常笨拙，很像个无鳞者。\n\n我怀疑事有蹊跷，可能是幻象。如果我们能制服他，那真相肯定就会水落石出。', '', '自封为纳萨里奥之声和灭世者领袖。', '赛基诺兹', '', '', '', 47936),
(65690, 'zhCN', '教徒的疑虑', '在焖燃栖地找到阿雅珊兹。', '昨天还来了另一个外来者，她说自己是什么红龙军团的“大使”，然后请求觐见我们的领袖，奈萨里奥之声。\n\n但奈萨里奥之声大发雷霆，说我们必须将她处决，这是大地守护者的考验！\n\t\n我知道我们不该信赖外来者，但也不必要了他们的命吧！请你帮我解救她。', '', '', '', '', '', '与焖燃栖地的阿雅珊兹交谈。', 47936),
(65689, 'zhCN', '卡雷众影', '使用水晶塔抵达碧蓝档案馆。', '很高兴能与你正式会面，$n。我是卡雷苟斯，肯瑞托的大法师，蓝龙的守护巨龙。\n\n由于难以修复碧蓝档案馆，我现在无法回收碧蓝誓言石。我真的需要更多的援手。\n\n我目前身处档案馆内。我激活了外围的晶塔，这样应该可以让你顺利进入。', '', '', '', '', '', '在碧蓝档案馆中与卡雷苟斯交谈。', 47936),
(65688, 'zhCN', '与卡雷苟斯会合', '获取一袋有用的物资，随后在碧蓝档案馆的底部与卡雷苟斯见面。', '恐怕我们不得不分头行动了，东部地区的拜荒者威胁不能置之不理。\n\n我得请你替我前往碧蓝档案馆，协助卡雷苟斯收复碧蓝誓言石。\n\n你应该挑选几份补给，好应对可能发生的种种意外。\n\n和我们的传送门军需官谈谈，给你找一些旅途中用得上的物资吧。\n\n祝你好运，$n。卡雷苟斯一定会感谢你出手相助。', '', '', '', '', '', '在碧蓝档案馆的底部与卡雷苟斯见面。', 47936),
(65687, 'zhCN', '拳威服众', '消灭$1oa个灭世者龙裔。', '其他信徒就比较……恶毒了。\n\n<因苟特抚摸着鼻子上新添的伤口。>\n\n以前不是这样的，但当赛基诺兹到来之后，他却说：“我们应该将力量看得高于一切”。现在大家都在打架。\n\n我试着反击，但他们的皮太厚实了……我又那么小。\n\n但你不小！你肯定一直都在和坏人作斗争。你能帮帮我吗？', '', '', '', '', '', '', 47936),
(65686, 'zhCN', '前往碧蓝林海', '在碧蓝林海与蒙福者格兰尼娅见面。', '你好，$n！\n\n帕基娜和我代表肯瑞托在这里寻求援助。\n\n肯瑞托正力图消除碧蓝林海全境的狂野奥术魔法所带来的危害。\n\n卡雷苟斯是蓝龙军团的守护巨龙，也是我们的领袖之一。他需要帮助才能在那里收复碧蓝誓言石。\n\n如果你愿意帮忙的话，就沿着路继续走，寻找蒙福者格兰尼娅。\n\n她可以将你引向需要帮助的地方。', '', '', '', '', '', '在碧蓝林海与蒙福者格兰尼娅见面。', 47936),
(65615, 'zhCN', '奥术侵扰', '调查信标。', '前面的信标……在我们被囚禁的时候，它肯定还不在那里。\n\n编织法术不是我的特长，但我一眼就能认出奥术魔法。育幼所的那条蓝龙使用的就是这种魔法.\n\n他提到了一个名字……玛里苟斯。听起来很熟悉，但大地守护者的教诲朦胧缥缈，支离破碎。\n\n如果是玛里苟斯令我们陷入了静滞，也许奥术信标就是他下令放置的。\n\n去调查这片区域，回来向我报告。决不能让信标招来敌人的援军。', '', '', '', '', '', '', 47936),
(65613, 'zhCN', '龙裔标志造型', '获得幻容形态。', '我相信你在奥格瑞玛引起了许多居民的关注。肯定有一些市民比较接受你的存在。\n\n在我还是条小龙的时候，我会换上你眼前的凡人幻容。它使我能够在至高岭的牛头人族群中生活，成为他们的盟友。\n\n虽然你所踏上的道路与我不同，但龙族的精华也在你的体内流淌，$p。也许它能令你获得自己的幻容。\n\n我们一起走走吧。', '', '', '', '', '', '', 47936),
(65606, 'zhCN', '马鲁克名望', '在马鲁凯与阿嘉丽交谈。', '你为增进氏族利益所付出的心血没有被忽视。\n\n返回马鲁凯吧，我已经为你准备了一些补给，帮助你继续与我们合作。', '', '', '', '', '', '', 47936),
(65595, 'zhCN', '害群之腐', '消灭腐朽之根。', '腐朽让豺狼人饿。\n\n腐朽伤害朋友。\n\n我们干掉腐朽，“君主”就这么做。', '', '这个可怕的树人向豺狼人传授了腐朽魔法，还有不讲卫生。', '腐朽之根', '', '', '', 47936),
(65594, 'zhCN', '豺中自有豺中王', '摧毁$2oa个腐朽图腾。', '愚蠢的腐朽觉得自己最大，但我才是最大的。现在就干掉它，软泥才是朋友。', '', '', '', '', '', '', 47936),
(65490, 'zhCN', '粪爆术', '装满啾讽自动粪便收集器。', '鹰身人完完全全是个意外，我来到这些山里只有一个目的：粪便！\n\n确切的说，是经过虫子消化的蓝羽大鹏粪便。甲虫的胃液能够使其中具有爆炸性的氮类成分增强十倍！十倍起步！\n\n给，这是啾讽自动粪便收集器。踩碎那些在洞穴里爬来爬去的甲虫，使用收集器收获成果吧。\n\n等你把机器装满了，我们就能找点真正的乐子了：炸个痛快！！', '', '', '', '', '', '', 47936),
(65486, 'zhCN', '完美照片', '和福伦一起乘坐编目员的木筏，拍摄本地野生动物的照片。', '抱歉让你久等了，我有时看着望远镜就入了迷。\n\n你会不会觉得，保持距离才能更好地理解这个世界？没有干扰，看着自然继续演化，不受我们的影响……\n\n<编目员阿昆达叹了一口气。>\n\n看来科拉莉给了你一部相机，太好了。\n\n和福伦一起顺流航行吧。拍摄野生动物在自然栖地中的照片，好让我研究一下。', '', '', '', '', '', '返回编目员阿昆达的营地。', 47936),
(65475, 'zhCN', '尖啸翻滚', '将尖翔卷轴带给位于蓝羽悬崖的哈琳·啾讽。', '<你从食鹏者鲜血淋漓的背中翻出了一张羊皮纸。你只能看清上面画着鹰身人正在吞吃大型的鸟蛋。\n\n你坚信你最喜爱的资深鸟类学家哈琳·啾讽能够理解这些莫名其妙的粗犷涂鸦。>', '', '', '', '', '', '将尖翔卷轴带给位于蓝羽悬崖的哈琳·啾讽。', 47936),
(65453, 'zhCN', '原始龙害', '在狂野海滩消灭$1oa条原始始祖幼龙。', '<欣戴赛什疑心重重地瞥了一眼身后山脊上潜伏的始祖龙。>\n\n我发誓，只要我转过身，这些始祖龙就会朝营地挪一步……\n\n它们并不是艾比西安请来与我们见面的巨龙。\n\n始祖龙是残忍无情的掠食者，并非通情达理之辈，我们只能以无情的攻击作为回敬。\n\n削减它们的数量，让它们收起野心，否则探险还没开始就要覆灭了。', '', '', '', '', '', '在翼眠大使馆与鳞长欣戴赛什见面。', 47936),
(65452, 'zhCN', '探险者遇险', '在狂野海滩营救3名龙鳞探险队成员。', '别把探险队的学术求索精神当做是软弱，$p。\n\n我们不是躲在偏远塔楼里钻研书本的隐士。\n\n我们是冒险者，我们会前往艾泽拉斯的每个角落，亲自猎取知识！\n\n这份对冒险的热情有时会让我们走上危险的路途，有几名探险队成员也惹上了自己应付不了的麻烦……', '', '', '', '', '', '在翼眠大使馆与娜蕾迪亚见面。', 47936),
(65451, 'zhCN', '练手材料', '收集$1oa片原始始祖雏龙之鳞。', '这些始祖龙和我以前在艾泽拉斯见过的都不一样。\n\n它们的鳞片生来就能抵抗烈火，比钢铁更强韧，并且没有丧失弹性。真不可思议。\n\n我的工匠个个都在嚷嚷，说他们都想弄到这样的龙鳞。\n\n就先从龙崽开始吧。小鳞片比较柔软，我们能先用它们锻炼技术。', '', '', '', '', '', '在翼眠大使馆与马格尔老板见面。', 47936),
(65444, 'zhCN', '出发！巨龙群岛！', '搭乘抗争龙鳞号，从奥格瑞玛城外的飞艇塔前往巨龙群岛。', '我们的先遣探险队已经在巨龙群岛登陆了。\n\n多亏了这些勇敢的龙鳞探险队成员，我们在巨龙群岛建立了一处防备完善的登陆点，并且和巨龙军团的使者取得了联络。\n\n你准备好和我们一起登上前往巨龙群岛的下一班船了吗？', '', '', '', '', '', '在巨龙群岛的海岸与娜蕾迪亚·流光见面。', 47936),
(65443, 'zhCN', '探险协同', '在奥格瑞玛为前往巨龙群岛的探险队招募探险者、工匠和学者。', '我是娜蕾迪亚·流光，很高兴认识你！\n\n受邀前往巨龙群岛真是令人激动啊！你觉得呢？\n\n神圣遗物学会已经和对面的探险组织展开了合作。作为龙鳞探险队的成员，我很荣幸能接待你！\n\n不过我们的第一个任务是为这次旅程招募几名成员。这就开始吧？', '', '', '', '', '', '在奥格瑞玛外的飞艇塔上与娜蕾迪亚见面。', 47936),
(65439, 'zhCN', '风中耳语', '与奥格瑞玛外的大法师卡德加交谈。', '你好，$p。好久不见了，真希望我们有空能叙叙旧。\n\n但如你所见，我正在和一位老友进行一段别开生面……不如说是醍醐灌顶……对，一段醍醐灌顶的对话。\n\n有些时候，揭示真相对大家都有好处。\n\n我要告诉你刚刚我得知了什么。', '', '', '', '', '', '', 47936),
(65437, 'zhCN', '守护巨龙之邀', '与艾比西安交谈。', '你来的正是时候，$p。\n\n我刚才拜访了部落议会，他们接受了守护巨龙的邀请，会前往巨龙群岛。\n\n当然，你也受到了邀请。\n\n你可能注意到了，奥格瑞玛多了一些陌生的面孔。这些龙希尔才刚刚抵达，你会在旅程中更深入地了解他们。\n\n来，我们谈谈。', '', '', '', '', '', '', 47936),
(65436, 'zhCN', '巨龙群岛在等待', '在暴风城与拉希奥见面。', '有个奇妙的消息，我的朋友！巨龙群岛正在苏醒！\n\n群岛在大分裂后陷入了沉睡，我的族人便离开了那里。但现在，我们终于感觉到了回家的召唤。\n\n虽然群岛中隐藏着许多奇迹，但危险也潜伏在那里。我们需要凡人盟友鼎力相助，才能夺回我们的传承。\n\n到暴风城来找我，我必须将守护巨龙的邀请呈递给联盟。', '', '', '', '', '', '', 47936),
(65435, 'zhCN', '巨龙群岛在等待', '在奥格瑞玛与艾比西安见面。', '部落的英雄，我带来了消息。巨龙群岛正在苏醒！\n\n群岛在大分裂后陷入了沉睡，但现在，它正号召我们一族重回故里。\n\n虽然群岛中隐藏着许多奇迹，但这仍是一片危机四伏的土地。我们需要凡人盟友鼎力相助，才能夺回我们的传承\n\n我将代表守护巨龙，去奥格瑞玛向部落议会发出邀请。到那里来找我，我们看看议会作何答复。', '', '', '', '', '', '', 47936),
(65421, 'zhCN', '翻山越岭', '获取攀登装备，寻找握点，攀登悬崖，营救探路者伊普斯！', '希望你学得够快，$c，因为我没时间教你！\n\n快抓上背包，找一条路，爬到山顶上去。\n\n等你爬到顶了，就把降落伞扔给我们的朋友伊普斯。风元素弄得我们坠机的时候，那个倒霉蛋卡在了藤条上！\n\n动作快，这样我们才能离开！', '', '', '', '', '', '', 47936),
(65402, 'zhCN', '图像识别', '', '', '', '', '', '', '', '', 47936),
(65374, 'zhCN', '拔毛时间', '拔下$1oa根幼雏羽毛。', '哈琳说她为你做了一身伪装！多有意思啊！但她还需要一些大鹏幼鸟的羽毛才能完善服装。\n\n幸运的是，我已经修好了拔羽器3300型！\n\n尖翔鹰身人会在低层悬崖上捕捉大鹏幼鸟，好由她们喂养长大。使用拔羽器，把幼鸟从险境中救出来。它还会自动为你拔羽毛呢！\n\n一拔二鸟？！这个说法好！', '', '', '', '', '', '', 47936),
(65373, 'zhCN', '拔扯部件', '取回4个拔羽器3300型部件。', '噢不……我犯了个天大的错误。\n\n哈琳很信任我，把闻名天下的拔羽器3300型托付给了我，这是她划时代的大发明！\n\n为了协助她的研究，我打算去南边的洞穴里拔几根大鹏的羽毛，但是鹰身人伏击了我，拔羽器在逃跑的时候摔成了碎片。\n\n请你把零件找回来！它们可能就像脱落的鳞片一样，散落在了洞穴的地上。\n\n我可以把它重新组装起来。肯定可以，呃，大概可以吧。', '', '', '', '', '', '', 47936),
(65371, 'zhCN', '巢归原主', '收集$1oa个尖翔利爪，$2oa把尖翔法杖和$3oa个溪裔之核。', '你找到的卷轴是一道命令，说要将所有蓝羽之卵带给鹰身人主厨弗莱-阿里。看来尖翔巢母不会对准备不周、调味不当的食物下嘴。\n\n我们要给她送一枚特别的蛋，一枚美味到“爆”的蛋……当然，等她咽下去了再爆。\n\n你该怎么把它送去？用伪装！\n\n消灭低层悬崖上的生物，收集这张清单里的部件，我就给你凑一身羽翼丰满的行头。', '', '', '', '', '', '', 47936),
(65313, 'zhCN', '嗜鹏饕餮', '消灭霍西亚·食鹏者。', '瑟佳丽雅是个好伙计，很擅长使用器械，但就是容易慌张。\n\n举个例子吧：我派她去往正南方的一个洞穴，结果她被一只体型异常巨大的鹰身人赶了出来。那一只好像还会向其他鹰身人发号施令。\n\n难道那就是族群的巢母？也许算是某种首领？你溜进去打探一下，$n。\n\n就算是要拔下几根羽毛也不用害怕，你懂我的意思吧。', '', '一只大得出奇的尖翔鹰身人，嗜食蓝羽大鹏的骨头。', '霍西亚·食鹏者', '', '', '', 47936),
(65307, 'zhCN', '仁德至上', '治疗受伤的龙希尔和龙人。', '育幼所附近的毒素几乎要了我们的命。在准备解毒剂的同时，我需要你去寻找伤员，救治他们。\n\n对，蓝色龙人也要。疗翼营不会对他人的苦难置若罔闻。', '', '', '', '', '', '', 47936),
(65306, 'zhCN', '腐败牧场', '从腐朽腐烂物处收集$1oa份恶臭软泥。', '腐朽恶心，难闻，痛苦。有个办法，需要软泥。去搞软泥！', '', '', '', '', '', '', 47936),
(65302, 'zhCN', '王权之钥', '收集钥匙并用其打开武器箱。', '计划需要武器，有很好的武器，但都锁起来了。豺狼人钥匙在营地里——保护武器箱。\n\n拿最尖尖的棍子，上面有最多的血渍。', '', '', '', '', '', '', 47936),
(65287, 'zhCN', '清黄不接', '收集$1oa个蓝羽之卵。', '我已经破解了卷轴，没想到吧，是坏消息！\n\n尖翔鹰身人捕食蓝羽大鹏并不只是为了果腹——原来她们发现了一些法术，能够在进食时汲取大鹏与生俱来的力量，尤其是鸟蛋！\n\n快去悬崖底下拯救大鹏的蛋，能救多少救多少。这样应该可以拖住鹰身人，让我有机会推动我的计划。\n\n要当心那些狂暴的元素，尖翔怨妇的法术已经把它们惹恼了！', '', '', '', '', '', '', 47936),
(65286, 'zhCN', '龙裔交际', '进入暴风城。', '通常情况下，单程飞行需要的时间会长得多。但青铜守护巨龙本尊加快了你的速度，使你的这次旅行创下了时间…\n\n<嗯哼>…纪录。\n\n噢，那些手持尖锐武器的士兵？别担心，不过是必要的排场。\n\n在你和阿苏拉泰摸清状况的时候，我会想办法安排你觐见总司令。\n\n幸好我在这座城市里影响力不小。', '', '', '', '', '', '与阿苏拉泰交谈。', 47936),
(65279, 'zhCN', '皇恩浩荡', '在溪齿之巢消灭$1oa个蕨皮战士和$2oa个蕨皮萨满。', '白痴豺狼人不懂王冠，只懂暴力。揍扁他们，不然我就吃你。', '', '', '', '', '', '', 47936),
(65267, 'zhCN', '鹰过拔毛', '消灭$1oa个尖翔枯萎者和$2oa个尖翔妖爪者。', '之前我对这些长着翅膀的奇特生物非常好奇，想去和他们介绍一下自己。要不是有啾讽教授和她的巨型机械猛禽在，我可能早就被吃掉了！\n\n你能帮助我们对付这片区域中的尖翔鹰身人吗？因为他们的存在，当地的蓝羽大鹏都快保不住自己的巢穴了。\n\n另外，我也不想看到其他人像我一样去做自我介绍……', '', '', '', '', '', '', 47936),
(65133, 'zhCN', '驭势能术', '俯冲穿过光圈，在目标区域着陆。', '如果你面前有障碍物，你该怎么办？\n\n只要你飞得还行，就可以保存势能，在俯冲之后再度升空。\n\n这次俯冲的时候，你的飞行路线会低于着陆区域。你要利用好势能，在飞行的末端重新拉升，就能落在目标区域里。\n\n如果你卡住了，就使用青铜计时器，塞罗尔穆会为你重置的。', '', '', '', '', '', '', 47936),
(65120, 'zhCN', '驭龙俯冲术', '先俯冲再滑翔穿过光圈，在目标区域着陆。', '滑翔能帮助你抵达目的地，可如果你想再快一点，那该怎么办？\n\n从高处起跳后向下俯冲就能获得速度加成。\n\n穿过光圈，飞到目标位置去。\n\n如果你卡住了，就使用青铜计时器，塞罗尔穆会为你重置的。', '', '', '', '', '', '', 47936),
(65118, 'zhCN', '驭滑翔术', '滑翔穿过光圈，在目标区域着陆。', '我们先从最基本的学起。\n\n如果你只会径直飞行，很快就会疲惫不堪。要巧妙地利用好重力，稍微瞄低一点，这样就能飞出很远。光圈能帮你指明滑翔所需的角度。\n\n首先，召唤出你的幼龙。\n\n然后，飞过光圈，在目标位置着陆。\n\n如果你卡住了，就使用青铜计时器，塞罗尔穆会为你重置的。', '', '', '', '', '', '', 47936),
(65101, 'zhCN', '龙裔标志造型', '变化为凡人的幻容。', '你的到来引起了全暴风城的关注，$p。肯定会有一些市民比较……接受你的存在。\n\n如你所见，为了更好地和其他种族沟通，我们巨龙都会换上一种凡人的幻容。这么做不仅能让盟友放松情绪，也方便我们穿过狭小的门廊。\n\n龙希尔的体内显然流淌着龙族的精华，你也许能和我们一样幻容易形。\n\n陪我一起走走吧。', '', '', '', '', '', '向拉希奥展示你的幻容。', 47936),
(65100, 'zhCN', '终末军令', '组织人员撤离禁忌离岛。', '莱萨杰丝释放的风暴太过强大，我们只能撤出自己仅有的家园。\n\n不会再有大地守护者来命令我们了。我们将第一次自由地做出选择，决定自己的命运。\n\n在这个新的时代里，不论你去向何方，希望你都能找到靠得住的盟友，向他们诉说我们的故事。\n\n至于我，我会留下来寻找幸存者，希望还能找到过去的答案。\n\n愿命运垂青我们，$p。', '', '', '', '', '', '向你的鳞长报告。', 47936),
(65098, 'zhCN', '勇气的后果', '寻找艾比西安。', '谢谢你治疗我，$n。希望我们能赢得彼此的信任。\n\n<拉希奥耸了耸肩。>\n\n噬雷之龙。我从没想过会面对掌握着原始元素之力的龙。如果还有其他龙和她一样……\n\n等等……艾比西安呢？他活下来了吗？你必须找到他！', '', '', '', '', '', '与安波莎交谈。', 47936),
(65097, 'zhCN', '快跑！', '撤退！', '风暴就要击垮我们了！我们必须撤退！\n\n尽你所能地多救几个，还要找到那些黑龙！', '', '', '', '', '', '与拉希奥交谈。', 47936),
(65087, 'zhCN', '内有大奖', '守卫宝库。', '所以拜荒者想夺走这座宝库里的东西？\n\n<萨卡雷斯眯起眼睛。>\n\n让他们放马过来。\n\n我们会让他们见识一下龙希尔与生俱来的能力！', '', '', '', '', '', '', 47936),
(65084, 'zhCN', '霜石宝库', '向霜石宝库集结。', '看！整个离岛上的拜荒者部队正在朝霜石宝库集结。\n\n他们寻找的风暴肯定就锁在那里。\n\n<安波莎的面容抽动了一下，她正在重新整理破碎的回忆。>\n\n我们以前与这群敌人交过手，也取得了胜利。奈萨里奥命令我们守住宝库，但我……想不起为什么……\n\n现在不是冥想的时候。到宝库那儿和萨卡雷斯的乌鳞营会合。决不能让敌人突破宝库！', '', '', '', '', '', '向霜石宝库的鳞长萨卡雷斯报告。', 47936),
(65075, 'zhCN', '疗翼营', '与安波莎交谈。', '唤魔师，感谢你在紧要关头援助我部。\n\n等疗翼营恢复力量，我们就去和其他部队汇合。\n\n欣戴跟我说，安波莎全营的士兵没有一人生还，恐怕我的魔法也没法治愈这样的心伤。\n\n安波莎非常坚忍，但她肯定对损失深感悲痛，$n。请你转告她，我这就来。', '', '', '', '', '', '与安波莎交谈。', 47936),
(65074, 'zhCN', '待宰的猎物', '消灭$1oa只镰螳。', '育幼所周围的荒野是镰螳的家园，这些贪婪的虫子通常极具领地意识和侵略性。\n\n所有伤员都很容易遭到这些野兽的毒手。我不想让它们有机会在愈疗者养伤期间发起袭击。\n\n你去除掉它们，我来照顾薇莉迪亚。\n\n她很……很勇敢。', '', '', '', '', '', '', 47936),
(65073, 'zhCN', '毒素问题', '收集$1oa个毒腺。', '你恢复得很快，$n。很好。\n\n逃出育幼所的人都在接受治疗，但还有一些依然困在里面。如果没头没脑地冲进去救人，我可能又要把你拖出来了。\n\n喷口附近散落着不少甲虫巢穴，它们的剧毒腺体也许能帮我们中和毒素的效果。\n\n我现在无力亲自前去收集，只能依靠你的本领了，唤魔师。', '', '', '', '', '', '', 47936),
(65071, 'zhCN', '请帮帮我！', '营救小科。', '帮帮我吧！\n\n我是托诺，我刚才正在探险呢，因为我就会这个。但我没想到的是，我的姐妹小科跟我跑了出来。我需要你帮我找到她，她肯定有麻烦了。能不能求你帮帮忙？\n\n她钻进了这个洞穴，但她的躲藏功夫没我那么好，而我父母现在离得太远，没法帮忙。\n\n你能赶在怪物之前找到她么？', '', '', '', '', '', '将孩子交还给父母。', 47936),
(65063, 'zhCN', '深入龙穴', '跟随欣戴赛什，寻找薇莉迪亚。', '在育幼所中滋长的毒素十分强大，甚至拖垮了我们最好的医师。\n\n这对我们来说并不是个好兆头，$n。\n\n但无所谓了。只要有龙希尔被困在里面，那不管要冒多大的险，我们都得闯进去。\n\n深呼吸，随我来！', '', '', '', '', '', '与薇莉迪亚交谈。', 47936),
(65060, 'zhCN', '疗愈者喷口', '在疗愈者喷口与欣戴赛什见面。', '你从奥术道标中看到的幻象表明，还有龙希尔被困在育幼所里。我们不能再失去更多同胞了。\n\n<安波莎停顿了一下，皱起了眉头。>\n\n疗翼营是部队中最出色的医疗兵。他们的育幼所就设在疗愈者喷口。欣戴赛什知道该怎么去。\n\n谁都不能落下，唤魔师。', '', '', '', '', '', '与疗愈者喷口的欣戴赛什交谈。', 47936),
(65057, 'zhCN', '与安波莎会合', '向安波莎报告。', '战斗结束了，你现在要我去向安波莎报告。阿苏拉泰真以为我会对她言听计从？\n\n这可不行。\n\n乌鳞营只会响应大地守护者的号令。到目前为止，我还没有接到奈萨里奥的命令。\n\n<萨卡雷斯怒目圆睁。>\n\n不过，我也不会对拜荒者带来的威胁视而不见。我以前肯定和他们交过手，然而……\n\n等我的人整顿好了，我们会去阅兵场集合的。解散，唤魔师。', '', '', '', '', '', '', 47936),
(65052, 'zhCN', '乌鳞营', '抵达鳞长萨卡雷斯身边。', '我们击退了进犯的拜荒者，现在必须赶到育幼所。\n\n鳞长萨卡雷斯素来坚韧，他的乌鳞营守住了阵地，但在一头巨龙的钳制之下，他们寸步难行。\n\n该轮到我们加入战斗了！\n\n你要占据要点，等龙进入我们的射程了就发出信号，我们会用尽一切力量来攻击它。\n\n注意伏击，我有种不好的预感。', '', '一头令乌鳞营陷入窘境的远古巨兽。', '艾克拉扎泰', '', '', '与鳞长萨卡雷斯交谈。', 47936),
(65050, 'zhCN', '咒法大军', '消灭$1oa个咒法元素。', '这些拜荒者正在召唤一支元素大军。我们只能先做好假设，他们可能会用元素来袭击我们。\n\n哼，有我在就休想。\n\n向他们降下烈火吧，唤魔师！烧尽离岛上的元素，再除掉那些召唤师，别让他们召唤更多元素。', '', '', '', '', '', '在雷裂冲击坑与阿苏拉泰见面。', 47936),
(65049, 'zhCN', '塔拉赛纠葛', '消灭$1oa个塔拉赛。', '塔拉赛是天性无常的野蛮生物，真要说的话，就和原始的龙人差不多。\n\n在奈萨里奥眼里，他们不过是一群炮灰，是训练的靶子。但他们也是诡诈的猎手，成群出没时极其致命。\n\n如果让他们从拜荒者那里获得元素之力，他们就会变得更危险。\n\n决不能纵容此事发生。$n，快去削减他们的数量。', '', '', '', '', '', '在雷裂冲击坑与阿苏拉泰见面。', 47936),
(65046, 'zhCN', '拜荒者', '寻找与拜荒者的起源和意图相关的线索。', '静滞令我的回忆蒙上了阴云，但我能确定，我们以前遇到过这群拜荒者。\n\n<德薇希安紧咬牙关。>\n\n回忆往昔就和追逐残缺的梦境一样，都是无用功。\n\n也许你的情况会好一点。去寻找线索，看看这些入侵者的目标是什么……或者是谁。', '', '', '', '', '', '在雷裂冲击坑与德薇希安见面。', 47936),
(65045, 'zhCN', '雷裂冲击坑', '在雷裂冲击坑与阿苏拉泰见面。', '德薇希安的报告令人不安。一伙自称拜荒者的敌军部队侵入了雷裂冲击坑，在攻城育幼所压制了乌鳞营。\n\n这些入侵者正在召唤凶暴的元素，还与恶毒的塔拉赛同流合污。\n\n阿苏拉泰需要你增援冲击坑。无论是利用飞翼还是龙爪，你都要救出我们的人。\n\n乌鳞营转危为安之后，请他们的指挥官与我会合。一定要小心，萨卡雷斯……是个暴脾气。', '', '', '', '', '', '与雷裂冲击坑的阿苏拉泰交谈。', 47936),
(65036, 'zhCN', '训战如一', '练习翱翔。', '跳过光圈能帮助你摸清门道，但我们的训练应该和战斗一样不留情面。\n\n到这片区域里练练翱翔，直到你掌握这门诀窍为止。当然，你需要留意当地的野生动物，提防潜在的威胁。毕竟这就是练习的目的。\n\n等你做好准备，就去向安波莎报告吧。祝你好运！', '', '', '', '', '', '当你准备好继续了，与鳞长安波莎交谈。', 47936),
(64873, 'zhCN', '展翼腾龙', '练习施放翱翔。', '有这么多人逃离了战争育幼所，这确实令人振奋，但我自己的营……就没那么走运了。\n\n<安波莎站在那里，片刻无言。>\n\n离岛各处还有其他的育幼所，里面的龙希尔正身处险境。要抵达他们身旁，就需要一对强健的飞翼。\n\n专心致志，牢记训练，再次体会风的抚触。你必须恢复力量，飞往其他的育幼所。\n\n休息时间到此为止。', '', '', '', '', '', '', 47936),
(64872, 'zhCN', '内心之火', '学习火焰吐息，并练习蓄力攻击。', '你是唤魔师，$n。你是精锐中的精锐，你是掌握了各营绝技的精英士兵。\n\n我对你期许甚高。\n\n你的记忆虽然支离破碎，但巨龙的力量仍在你的血脉中奔涌，一定要驾驭好它。\n\n你最强大的武器之一就是吐息，你吸气的时间越长，喷吐的火焰就越凶猛。\n\n训练场上蜂拥的虫子正是理想的目标。', '', '', '', '', '', '', 47936),
(64871, 'zhCN', '看门龙', '击败拉比萨苟斯，逃离战争育幼所。', '那条蓝龙想要摧垮育幼所，将我们全部困在里面！\n\n他宣称自己为玛里苟斯效力。那个名字很耳熟，但是……为什么会有巨龙想要令我们身陷囹圄？\n\n听着，$p。我们接受训练是为了能与巨龙并肩作战，而不是针锋相对。但现在我们别无选择。\n\n该完成分内之事了，唤魔师。', '', '他不愿见你逃出生天。', '拉比萨苟斯', '', '', '', 47936),
(64866, 'zhCN', '刀山火海', '准备撤离育幼所。', '我们需要你的本事，唤魔师。\n\n育幼所正在崩塌，而我们的物资寥寥无几。我们要找到出去的路，但必须先通过这道奥术屏障。\n\n前方的大厅里有许多龙希尔急需救援。去医治他们的伤情，消灭所有胆敢挡路的敌人。\n\n这或许是我们最后一次并肩走过这些大厅了，$n。珍惜每一刻吧。', '', '', '', '', '', '', 47936);
INSERT INTO `quest_template_locale` (`ID`, `locale`, `LogTitle`, `LogDescription`, `QuestDescription`, `AreaDescription`, `PortraitGiverText`, `PortraitGiverName`, `PortraitTurnInText`, `PortraitTurnInName`, `QuestCompletionLog`, `VerifiedBuild`) VALUES
(64865, 'zhCN', '作战武装', '获取武器、护甲和物资。', '敌人正在进犯，我们的人被困在了魔法静滞中，育幼所似乎即将崩塌。\n\n这就是我们受训的原因，$n。如果疑云重重，就该依靠你所知的情报。\n\n首先是武器、护甲和物资。收集你能找到的一切，立即武装起来，我会去集结军队。\n\n然后我们要找到大地守护者，奈萨里奥肯定有我们要找的答案。', '', '', '', '', '', '', 47936),
(64864, 'zhCN', '苏醒吧，龙希尔', '唤醒其他龙希尔。', '<你试图摆脱永无尽头的睡梦，却只能唤起一闪而过的破碎回忆。\n\n面前的龙希尔不省人事，似乎是被某种未知的魔法所封存。你察觉到自己体内的力量足以让盟友重获自由。\n\n也许在育幼所中，还有其他龙希尔正处于静滞状态。\n\n唤醒他们正是你的职责。>', '', '', '', '', '', '与鳞长阿苏拉泰交谈。', 47936),
(64863, 'zhCN', '奥术护卫', '击败$1oa个卫士或构造体。', '这些在育幼所中巡逻的构造体并不是由大地守护者的魔法所驱动的。\n\n<德薇希安眯起了眼。>\n\n不能让敌人在我们之中肆意横行。\n\n摧毁它们，疏通前路。', '', '', '', '', '', '', 47936),
(62265, 'zhCN', '新的冒险等待着你', '返回奥格瑞玛，开始新的冒险。当你达到60级时，克罗米的魔法将会消失，送你回到奥格瑞玛。', '$n！现世需要你。情况有点……哎，你最好回来看看。\n\n我会完成你的工作然后再回去。我不能再让你留在过去了！', '', '', '', '', '', '返回奥格瑞玛，开始新的冒险。', 47936),
(62250, 'zhCN', '新的冒险等待着你', '返回暴风城，开始新的冒险。当你达到60级时，克罗米的魔法将会消失，送你回到暴风城。', '$n！现世需要你。情况有点……哎，你最好回来看看。\n\n我会完成你的工作然后再回去。我不能再让你留在过去了！', '', '', '', '', '', '返回暴风城，开始新的冒险。', 47936),
(54389, 'zhCN', '黑海岸捐赠：雾鳞', '为伯拉勒斯港的梅伊·摆杖收集$1oa份附魔武器 - 坚韧远航。', '', '', '', '', '', '', '', 47936),
(54374, 'zhCN', '黑海岸捐赠：死亡崛起药水', '为伯拉勒斯港的拉罗尔德·凯恩收集$1oa枚全能蓝晶石。', '', '', '', '', '', '', '', 47936),
(53360, 'zhCN', '阿拉希捐赠：钢肤药水', '为伯拉勒斯港的切尔西·斯特兰德收集$1oa份钢肤药水。', '', '', '', '', '', '', '', 47936),
(53233, 'zhCN', '阿拉希捐赠：霜纹弹药', '为伯拉勒斯港的诺波尔·拴链收集$1oa份霜纹弹药。', '嘿！\n\n上层的信息已经传递过来了——我们需要更多的弹药！要火力猛一点的。要让敌人出乎意料！\n\n我听说有种特殊的冰霜弹药，只有经验最丰富的工程师才能制造。如果你能给我送来一些这种弹药，我敢肯定我们的弹药军官会非常高兴！\n\n他们甚至可能会给我留一份来做检查！', '', '', '', '', '', '', 47936),
(49053, 'zhCN', '凝视者', '', '', '', '', '', '', '', '', 47936),
(43347, 'zhCN', '危险：拉布萨克', '', '', '', '', '', '', '', '', 47936),
(26972, 'zhCN', '圣光的黑暗面', '杀死审讯员韦沙斯和血法师萨尔诺斯。', '当我还是一名渴望净化一切邪恶的年轻圣骑士的时候，就加入了血色十字军。当时我对这些狂热之徒的黑暗真相一无所知。$B$B审讯员韦沙斯和血法师萨尔诺斯是这座墓地的主管。他们乐此不疲、永不停歇地折磨新兵，以确保他们是“纯净”的。这是对圣光的侮辱，$c！$B$B我不能继续待在这个堕落的组织里了。你必须把他们两个都干掉，这样其他人就不会再承受我所承受的痛苦折磨了。', '', '', '', '', '', '', 47936),
(14086, 'zhCN', '驰骋在奥格瑞玛', '将这本小册子交给奥格瑞玛荣耀谷的基尔达。', '这本关于骑乘训练和坐骑购买的广告小册子是由基尔达派发出来的。$B$B你可以在奥格瑞玛的荣誉谷找到基尔达。', '', '', '', '', '', '', 47936),
(13248, 'zhCN', '死亡证明：伊米隆国王', '达拉然的大法师兰达洛克要你将已故女王的饰物交给他。$B$B该任务必须在英雄难度下完成。', '乌特加德之巅的伊米隆国王是巫妖王的支持者。单凭这一点，我们就该杀了这个维库人。$B$B如果让他吹响号角，将伊米亚、尤尔丁等部落的领袖都召集起来，维库人就会成为天灾军团中最强的一支部队！$B$B现在就看你的了，$n，你一定要阻止他。将他脖子上的坠饰带回来给我，以此证明伊米隆的威胁已经彻底解除了。', '', '', '', '', '', '', 47936),
(13244, 'zhCN', '提迈尔的预言：泰坦神铁先锋！', '根据达拉然的大法师提迈尔的预言，你必须去杀死7个泰坦神铁先锋。', '整个艾泽拉斯都处在危险之中。疯狂的神灵洛肯已经具备了毁灭世界的能力！$B$B在闪电大厅的大地瞭望塔里，那些泰坦神铁先锋正在有条不紊地执行着洛肯的疯狂计划，无数生灵即将成为他们的牺牲品。$B$B我已经预见到了，$n。你就是阻止这个疯狂计划的人！', '', '', '', '', '', '', 47936);
